(1, 1, 1, 1, '<p>Keluarga Bambi sedang mempersiapkan acara Festival Makanan, dan mereka ingin memanggang kue kering; Kati akan membuat kue. Dia sangat memperhatikan urutan membuat kue dengan memasukkan bahan kue dengan urutan yang benar.</p><p>Ketika dia berjalan ke taman, dia melihat ada secarik kertas pada setiap bahan kue yang akan digunakan. Gambar pada kertas menjelaskan bahan kue yang harus ditambahkan pada urutan berikutnya. Hanya ada satu bahan kue yang tidak memiliki kertas. Ilustrasi taman seperti di bawah ini:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:129921,&quot;height&quot;:258,&quot;href&quot;:&quot;http://comfypace.com/uploads/iWpzpaww49kNEX0qgo6uUFg0dISJzOsB44c2oirz.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/iWpzpaww49kNEX0qgo6uUFg0dISJzOsB44c2oirz.png&quot;,&quot;width&quot;:498}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/iWpzpaww49kNEX0qgo6uUFg0dISJzOsB44c2oirz.png\"><img src=\"http://comfypace.com/uploads/iWpzpaww49kNEX0qgo6uUFg0dISJzOsB44c2oirz.png\" width=\"498\" height=\"258\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">126.88 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Bahan kue manakah yang harus dimasukkan pertama kali?</p><p>------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>Bambi\'s family is preparing for a Food Festival, and they want to bake cookies; Kati will be making the cookies. She is paying close attention to the order of making the cookies by adding the cookie ingredients in the correct sequence.</p><p>As she walks into the garden, she notices that there\'s a piece of paper on each cookie ingredient that will be used. The pictures on the paper indicate the cookie ingredient that should be added in the next step. There\'s only one cookie ingredient that doesn\'t have a piece of paper. The garden illustration is as follows:&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:129921,&quot;height&quot;:258,&quot;href&quot;:&quot;http://comfypace.com/uploads/iWpzpaww49kNEX0qgo6uUFg0dISJzOsB44c2oirz.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/iWpzpaww49kNEX0qgo6uUFg0dISJzOsB44c2oirz.png&quot;,&quot;width&quot;:498}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/iWpzpaww49kNEX0qgo6uUFg0dISJzOsB44c2oirz.png\"><img src=\"http://comfypace.com/uploads/iWpzpaww49kNEX0qgo6uUFg0dISJzOsB44c2oirz.png\" width=\"498\" height=\"258\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">126.88 KB</span></figcaption></a></figure> <strong>Question:</strong></p><p>Which cookie ingredient should be added first?</p>', 5, '2023-10-10 08:01:56', '2023-10-14 10:44:32', '<p>Jika Kati memulai dari B maka dia akan menambahkan kelima bahan kue dengan<br>urutan yang benar. Bahan kue pertama yang harus ditambahkan adalah yang tidak<br>dirujuk oleh bahan lain.</p><p><br>Jika dia memulai dari stroberi, maka dia tidak dapat melanjutkan ke tahap berikutnya<br>karena tidak ada petunjuk bahan kue selanjutnya pada kertas. Jika dia memulai dari<br>apel maka salah, karena bahan kue bunga merah akan terlewatkan. Jika dia memulai<br>dari buah pohon cemara juga salah, karena bahan kue bunga merah dan apel akan<br>terlewatkan.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>If Kati starts from B, she will add the five cake ingredients in the correct order. The first cake ingredient to be added is the one not referred to by any other ingredients.</p><p>If she starts from strawberry, she cannot proceed to the next stage because there are no further cake ingredient cues on the paper. If she starts from apple, it is incorrect because the red flower cake ingredient would be skipped. If she starts from the fir tree, it is also incorrect because both the red flower and apple cake ingredients would be skipped.&nbsp;</p>'),
(2, 2, 1, 1, '<p>Donna harus melakukan 4 tugas berikut ini selama jam istirahat (Pukul 12:00  13:00), yaitu:</p><ul><li>membeli sebuah buku di toko buku;</li><li>membeli sebotol susu dan roti di toko makanan;</li><li>mengirim sebuah buku ke kantor pos;</li><li>minum secangkir kopi di kafetaria.&nbsp;</li></ul><p>Ia memperkirakan waktu untuk menyelesaikan setiap tugas tersebut. Perkiraan waktu ini hanya berlaku di luar jam sibuk. Maka, ia sedapat mungkin menghindari jam sibuk.</p><p>Bantulah Donna untuk mengurutkan tugas agar ia dapat menghindari waktu sibuk semua toko/tempat. Seret dan jatuhkan ikon (buku, keranjang belanja, surat dan cangkir kopi) ke kotak yang disediakan, dengan urutan dari kiri ke kanan&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:23471,&quot;height&quot;:154,&quot;href&quot;:&quot;http://comfypace.com/uploads/8dswiS7uA1JROutfozHiaiX5dxS3pQqphgYiqWag.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/8dswiS7uA1JROutfozHiaiX5dxS3pQqphgYiqWag.png&quot;,&quot;width&quot;:458}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/8dswiS7uA1JROutfozHiaiX5dxS3pQqphgYiqWag.png\"><img src=\"http://comfypace.com/uploads/8dswiS7uA1JROutfozHiaiX5dxS3pQqphgYiqWag.png\" width=\"458\" height=\"154\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">22.92 KB</span></figcaption></a></figure>&nbsp;</p><p>------------------------</p><p>&nbsp;&nbsp;</p><p><strong>ENGLISH VERSION</strong></p><p>Donna must do the following 4 tasks during break times (12:00  13:00), namely:</p><ul><li>buy a book in a bookstore;</li><li>buy a bottle of milk and bread at the grocery store;</li><li>send a book to the post office;</li><li>drink a cup of coffee in the cafeteria.</li></ul><p>She estimates the time to complete each task. These time estimates only apply outside peak hours. So, she avoids rush hour whenever possible.<br><br>Help Donna to sequence tasks so she can avoid busy times at all stores/places. Drag and drop the icons (book, shopping basket, letter and coffee cup) into the boxes provided, in order from left to right<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:51921,&quot;height&quot;:316,&quot;href&quot;:&quot;http://comfypace.com/uploads/oYTndKumkuUfMT5jRqOWGlSWl2AE4O1TzOLAZof4.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/oYTndKumkuUfMT5jRqOWGlSWl2AE4O1TzOLAZof4.png&quot;,&quot;width&quot;:955}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/oYTndKumkuUfMT5jRqOWGlSWl2AE4O1TzOLAZof4.png\"><img src=\"http://comfypace.com/uploads/oYTndKumkuUfMT5jRqOWGlSWl2AE4O1TzOLAZof4.png\" width=\"955\" height=\"316\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">50.7 KB</span></figcaption></a></figure></p>', 5, '2023-10-10 08:02:29', '2023-10-14 10:52:33', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screenshot 2023-10-12 at 14.11.50.png&quot;,&quot;filesize&quot;:445858,&quot;height&quot;:476,&quot;href&quot;:&quot;http://comfypace.com/uploads/aXdDQd0epZeqOkhCRlkzlLwGTSGcHjX8OnuCFJ5l.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/aXdDQd0epZeqOkhCRlkzlLwGTSGcHjX8OnuCFJ5l.png&quot;,&quot;width&quot;:1924}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/aXdDQd0epZeqOkhCRlkzlLwGTSGcHjX8OnuCFJ5l.png\"><img src=\"http://comfypace.com/uploads/aXdDQd0epZeqOkhCRlkzlLwGTSGcHjX8OnuCFJ5l.png\" width=\"1924\" height=\"476\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screenshot 2023-10-12 at 14.11.50.png</span> <span class=\"attachment__size\">435.41 KB</span></figcaption></a></figure>Persoalan ini berkaitan dengan sejumlah batasan yang dapat divisualiasi seperti pada tabel di atas.</p><p>Donna harus mengunjungi Toko Buku sebelum pukul 12:40; Toko Makanan setelah 12:40; ia harus ke Kantor Pos setelah Toko Buku. Ia harus ke Kantor Pos setelah 12:30. Ia dapat ke Kafetaria sebelum pukul 12:30, sebab jika ia ke Kafetaria setelah Pukul 12:50, istirahatnya sudah berakhir (ia perlu 20 menit di Kafetaria). Urutan kunjungan dapat dilihat sesuai dengan nomor pada tabel di atas.</p><p>-------------------------------------------</p><p>This problem is related to a number of limitations which can be visualized as in the table above.<br><br>Donna must visit the Bookstore before 12:40; Food Store after 12:40; she had to go to the Post Office after the Bookstore. She had to go to the Post Office after 12:30. She can go to the cafeteria before 12:30, because if she goes to the cafeteria after 12:50, her break is over (he needs 20 minutes in the cafeteria). The order of visits can be seen according to the numbers in the table above.</p>'),
(3, 3, 2, 1, '<p>Ada beberapa ekor kepik dalam <em>grid </em>yang terdiri dari 16 sel. Sebuah sel dikatakan bertetangga dengan sel lainnya jika sisi atau sudut/pojok keduanya bersebelahan. Ini berarti setiap sel dapat mempunyai sampai dengan 8 tetangga.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screenshot 2023-10-10 at 15.03.02.png&quot;,&quot;filesize&quot;:209826,&quot;height&quot;:576,&quot;href&quot;:&quot;http://comfypace.com/uploads/BnZcECtv9ZJCzPNSOif7sk4fMcCcZ1SgvOIzQgpF.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/BnZcECtv9ZJCzPNSOif7sk4fMcCcZ1SgvOIzQgpF.png&quot;,&quot;width&quot;:752}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/BnZcECtv9ZJCzPNSOif7sk4fMcCcZ1SgvOIzQgpF.png\"><img src=\"http://comfypace.com/uploads/BnZcECtv9ZJCzPNSOif7sk4fMcCcZ1SgvOIzQgpF.png\" width=\"752\" height=\"576\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screenshot 2023-10-10 at 15.03.02.png</span> <span class=\"attachment__size\">204.91 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Pada gambar di atas, sel manakah yang dikelilingi oleh paling banyak kepik? Pilih salah satu:</p><p>-------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong></p><p>On the grid consisting of 16 cells, there are several ladybugs. A cell is considered adjacent to another cell if their sides or corners touch. This means that each cell can have up to 8 neighbors.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screenshot 2023-10-10 at 15.03.02.png&quot;,&quot;filesize&quot;:209826,&quot;height&quot;:576,&quot;href&quot;:&quot;http://comfypace.com/uploads/BnZcECtv9ZJCzPNSOif7sk4fMcCcZ1SgvOIzQgpF.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/BnZcECtv9ZJCzPNSOif7sk4fMcCcZ1SgvOIzQgpF.png&quot;,&quot;width&quot;:752}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/BnZcECtv9ZJCzPNSOif7sk4fMcCcZ1SgvOIzQgpF.png\"><img src=\"http://comfypace.com/uploads/BnZcECtv9ZJCzPNSOif7sk4fMcCcZ1SgvOIzQgpF.png\" width=\"752\" height=\"576\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screenshot 2023-10-10 at 15.03.02.png</span> <span class=\"attachment__size\">204.91 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>In the picture above, which cell is surrounded by the most ladybugs? Please select one.&nbsp;</p>', 5, '2023-10-10 08:03:32', '2023-10-14 11:00:17', '<p>Kita dapat menemukan dengan menghitung (mencacah) jumlah kepik yang mengelilingi setiap huruf.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>We can find it by counting the number of ladybugs surrounding each letter.</p>'),
(4, 4, 2, 1, '<p>Agen-agen rahasia Boris dan Berta saling berkomunikasi dengan menggunakan pesan rahasia. Boris ingin mengirim pesan rahasia kepada Berta yang isinya :&nbsp;</p><p><strong>MEETBILLYBEAVERAT6</strong>&nbsp;</p><p>Boris menuliskan setiap karakter pesannya pada grid dengan 4 kolom dimulai dari kiri ke kanan dan dilakukan baris demi baris dimulai dari atas. Boris akan menuliskan karakter X pada tempat di grid yang tidak terpakai. Hasil penulisan pesan Boris dapat dilihat pada gambar di bawah ini.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:70573,&quot;height&quot;:210,&quot;href&quot;:&quot;http://comfypace.com/uploads/lOgMQffniGLB2N6BuV2uIYQ1A3URKuU1MwXtdIKy.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/lOgMQffniGLB2N6BuV2uIYQ1A3URKuU1MwXtdIKy.png&quot;,&quot;width&quot;:240}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/lOgMQffniGLB2N6BuV2uIYQ1A3URKuU1MwXtdIKy.png\"><img src=\"http://comfypace.com/uploads/lOgMQffniGLB2N6BuV2uIYQ1A3URKuU1MwXtdIKy.png\" width=\"240\" height=\"210\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">68.92 KB</span></figcaption></a></figure>Selanjutnya, Boris akan membuat pesan rahasia dengan cara menuliskan karakter yang ada di grid mulai dari atas ke bawah dan dilakukan secara kolom demi kolom dimulai dari kolom yang paling kiri, sehingga pesan rahasianya adalah :&nbsp;</p><p><strong>MBYVTEIBE6ELERXTLAAX</strong>&nbsp;</p><p>Berta membalas pesan Boris dengan cara yang sama. Pesan rahasia yang dikirim Berta kepada Boris adalah :&nbsp;</p><p><strong>OIERKLTEILH!WBEX&nbsp;</strong></p><p><strong>Pertanyaan</strong>&nbsp;</p><p>Apakah isi pesan yang ingin dikirimkan Berta kepada Boris ?&nbsp;</p><p><br></p><p>---------------------------------------------------------------------------------------<br><strong>ENGLISH VERSION</strong></p><p>Boris and Berta are secret agents who communicate using secret messages. Boris wants to send a secret message to Berta with the content:</p><p><strong>MEETBILLYBEAVERAT6</strong></p><p>Boris writes each character of his message in a grid with 4 columns, starting from left to right and filling in row by row, starting from the top. Boris will write the character \'X\' in unused grid spaces. The result of Boris\'s message writing can be seen in the image below.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:70573,&quot;height&quot;:210,&quot;href&quot;:&quot;http://comfypace.com/uploads/lOgMQffniGLB2N6BuV2uIYQ1A3URKuU1MwXtdIKy.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/lOgMQffniGLB2N6BuV2uIYQ1A3URKuU1MwXtdIKy.png&quot;,&quot;width&quot;:240}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/lOgMQffniGLB2N6BuV2uIYQ1A3URKuU1MwXtdIKy.png\"><img src=\"http://comfypace.com/uploads/lOgMQffniGLB2N6BuV2uIYQ1A3URKuU1MwXtdIKy.png\" width=\"240\" height=\"210\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">68.92 KB</span></figcaption></a></figure></p><p>Next, Boris will create the secret message by writing the characters in the grid from top to bottom and done column by column, starting from the leftmost column, so the secret message is:</p><p><strong>MBYVTEIBE6ELERXTLAAX</strong></p><p>Berta replies to Boris\'s message in the same way. The secret message Berta sends to Boris is:</p><p><strong>OIERKLTEILH!WBEX</strong></p><p><strong>Question:</strong></p><p>What is the content of the message Berta wants to send to Boris?&nbsp;</p>', 5, '2023-10-10 08:05:06', '2023-10-14 11:01:58', '<p>Kita dapat menentukan pesan asal dengan memasukkan pesan ke dalam grid mulai<br>dari grid paling kiri atas, yang menghasilkan:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:5473,&quot;height&quot;:130,&quot;href&quot;:&quot;http://comfypace.com/uploads/wv2alluVX1KbieaoMVKY5bD26hxjLyMWQchU7Xoq.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/wv2alluVX1KbieaoMVKY5bD26hxjLyMWQchU7Xoq.png&quot;,&quot;width&quot;:270}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/wv2alluVX1KbieaoMVKY5bD26hxjLyMWQchU7Xoq.png\"><img src=\"http://comfypace.com/uploads/wv2alluVX1KbieaoMVKY5bD26hxjLyMWQchU7Xoq.png\" width=\"270\" height=\"130\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">5.34 KB</span></figcaption></a></figure>Kemudian, membacanya dari kiri ke kanan, baris per baris: <strong>OKIWILLBETHERE!</strong></p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>We can determine the original message by inputting the message into a grid starting from the top-left grid, resulting in:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:5473,&quot;height&quot;:130,&quot;href&quot;:&quot;http://comfypace.com/uploads/wv2alluVX1KbieaoMVKY5bD26hxjLyMWQchU7Xoq.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/wv2alluVX1KbieaoMVKY5bD26hxjLyMWQchU7Xoq.png&quot;,&quot;width&quot;:270}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/wv2alluVX1KbieaoMVKY5bD26hxjLyMWQchU7Xoq.png\"><img src=\"http://comfypace.com/uploads/wv2alluVX1KbieaoMVKY5bD26hxjLyMWQchU7Xoq.png\" width=\"270\" height=\"130\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">5.34 KB</span></figcaption></a></figure> Then, read it from left to right, row by row: \"OKIWILLBETHERE!\"</p>'),
(5, 5, 3, 1, '<p>Dengklek dapat mengubah cat tembok menggunakan sebuah <em>roller </em>(kuas gulung) ajaib yang cara kerjanya sebagai berikut: kuas mengganti gambar yang ada dengan gambar berikutnya yang ditunjukkan sesuai arah panah, seperti dijelaskan pada gambar berikut :</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screenshot 2023-10-10 at 15.04.19.png&quot;,&quot;filesize&quot;:135420,&quot;height&quot;:410,&quot;href&quot;:&quot;http://comfypace.com/uploads/yJOwBq89HGhdUfad903Yn8ABkRSv3quk4gJHkz63.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/yJOwBq89HGhdUfad903Yn8ABkRSv3quk4gJHkz63.png&quot;,&quot;width&quot;:1226}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/yJOwBq89HGhdUfad903Yn8ABkRSv3quk4gJHkz63.png\"><img src=\"http://comfypace.com/uploads/yJOwBq89HGhdUfad903Yn8ABkRSv3quk4gJHkz63.png\" width=\"1226\" height=\"410\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screenshot 2023-10-10 at 15.04.19.png</span> <span class=\"attachment__size\">132.25 KB</span></figcaption></a></figure></p><p>Saat Dengklek menggunakan kuas ajaib tersebut dengan gambar yang ada di sebelah kiri, ia akan mendapatkan gambar sebelah kanan:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screenshot 2023-10-10 at 15.04.32.png&quot;,&quot;filesize&quot;:55061,&quot;height&quot;:154,&quot;href&quot;:&quot;http://comfypace.com/uploads/7w00mNT6GHwJLGF6HquJ7vsTpLclJXnyDICntc1v.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/7w00mNT6GHwJLGF6HquJ7vsTpLclJXnyDICntc1v.png&quot;,&quot;width&quot;:546}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/7w00mNT6GHwJLGF6HquJ7vsTpLclJXnyDICntc1v.png\"><img src=\"http://comfypace.com/uploads/7w00mNT6GHwJLGF6HquJ7vsTpLclJXnyDICntc1v.png\" width=\"546\" height=\"154\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screenshot 2023-10-10 at 15.04.32.png</span> <span class=\"attachment__size\">53.77 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Gambar apa yang dihasilkan setelah memakai kuas ajaib terhadap gambar berikut ?</p><p>-------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>Dengklek can change wall paint using a magical roller brush, which works as follows: the brush replaces the current image with the next image shown according to the arrow direction, as explained in the image below:</p><p>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screenshot 2023-10-10 at 15.04.19.png&quot;,&quot;filesize&quot;:135420,&quot;height&quot;:410,&quot;href&quot;:&quot;http://comfypace.com/uploads/yJOwBq89HGhdUfad903Yn8ABkRSv3quk4gJHkz63.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/yJOwBq89HGhdUfad903Yn8ABkRSv3quk4gJHkz63.png&quot;,&quot;width&quot;:1226}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/yJOwBq89HGhdUfad903Yn8ABkRSv3quk4gJHkz63.png\"><img src=\"http://comfypace.com/uploads/yJOwBq89HGhdUfad903Yn8ABkRSv3quk4gJHkz63.png\" width=\"1226\" height=\"410\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screenshot 2023-10-10 at 15.04.19.png</span> <span class=\"attachment__size\">132.25 KB</span></figcaption></a></figure> When Dengklek uses this magical brush with the image on the left, he will get the image on the right:&nbsp; <strong><br></strong>&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screenshot 2023-10-10 at 15.04.32.png&quot;,&quot;filesize&quot;:55061,&quot;height&quot;:154,&quot;href&quot;:&quot;http://comfypace.com/uploads/7w00mNT6GHwJLGF6HquJ7vsTpLclJXnyDICntc1v.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/7w00mNT6GHwJLGF6HquJ7vsTpLclJXnyDICntc1v.png&quot;,&quot;width&quot;:546}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/7w00mNT6GHwJLGF6HquJ7vsTpLclJXnyDICntc1v.png\"><img src=\"http://comfypace.com/uploads/7w00mNT6GHwJLGF6HquJ7vsTpLclJXnyDICntc1v.png\" width=\"546\" height=\"154\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screenshot 2023-10-10 at 15.04.32.png</span> <span class=\"attachment__size\">53.77 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>What image is produced after using the magical brush on the following image?&nbsp;</p>', 5, '2023-10-10 08:05:22', '2023-10-14 11:02:38', '<p>Hasil ini diperoleh setelah menerapkan langkah/algoritma di atas. Jawaban lainnya salah. (A) dan (C) salah pada simbol kedua, yang tak seharusnya sebuah lingkaran. (D) juga salah sebab hanya dua simbol awal yang benar.<br>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;<br> This result is obtained after applying the steps/algorithm above. The other answers are incorrect. (A) and (C) are wrong in the second symbol, which should not be a circle. (D) is also wrong because only the first two symbols are correct.</p>'),
(6, 6, 3, 1, '<p>Sebuah lebah robot memiliki 4 tombol panah di punggungnya. Lebah robot itu bergerak seperti pada gambar berikut.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screenshot 2023-10-10 at 15.05.58.png&quot;,&quot;filesize&quot;:204415,&quot;height&quot;:586,&quot;href&quot;:&quot;http://comfypace.com/uploads/vGKxPum9ZZefVyHRCQPR5ZJr1sDL7S620MktBRxj.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/vGKxPum9ZZefVyHRCQPR5ZJr1sDL7S620MktBRxj.png&quot;,&quot;width&quot;:738}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/vGKxPum9ZZefVyHRCQPR5ZJr1sDL7S620MktBRxj.png\"><img src=\"http://comfypace.com/uploads/vGKxPum9ZZefVyHRCQPR5ZJr1sDL7S620MktBRxj.png\" width=\"738\" height=\"586\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screenshot 2023-10-10 at 15.05.58.png</span> <span class=\"attachment__size\">199.62 KB</span></figcaption></a></figure>Sederetan penekanan tombol yang diberikan akan diingat sebagai program yang akan dijalankan robot. Tedapat juga tombol GO untuk memulai gerakan yang akan dilakukan sesuai dengan program.</p><p>Contoh: mula-mula lebah bergerak maju, kemudian berputar kekiri, lalu bergerak maju. Penekanan GO berikutnya akan menyebabkan gerakan yang sama.</p><p>Empat anak bermain dengan robot-robot lebahnya. Masing-masing membuat programnya sendiri-sendiri untuk lebah robot miliknya. Mereka menekan tombol GO dan kemudian lebah robot bergerak. Mereka menekan tombol GO kembali sekali lagi namun hanya satu saja yang kembali ke posisi semula.</p><p><strong>Pertanyaan</strong></p><p>Manakah deretan penekanan tombol yang mengembalikan robot lebah ke posisi dan arah semula?</p><p>-------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>A robotic bee has 4 arrow buttons on its back, and it moves as shown in the image below:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screenshot 2023-10-10 at 15.05.58.png&quot;,&quot;filesize&quot;:204415,&quot;height&quot;:586,&quot;href&quot;:&quot;http://comfypace.com/uploads/vGKxPum9ZZefVyHRCQPR5ZJr1sDL7S620MktBRxj.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/vGKxPum9ZZefVyHRCQPR5ZJr1sDL7S620MktBRxj.png&quot;,&quot;width&quot;:738}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/vGKxPum9ZZefVyHRCQPR5ZJr1sDL7S620MktBRxj.png\"><img src=\"http://comfypace.com/uploads/vGKxPum9ZZefVyHRCQPR5ZJr1sDL7S620MktBRxj.png\" width=\"738\" height=\"586\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screenshot 2023-10-10 at 15.05.58.png</span> <span class=\"attachment__size\">199.62 KB</span></figcaption></a></figure>A sequence of button presses will be remembered as a program that the robot will execute. There is also a GO button to start the movement according to the program.</p><p>Example: initially, the bee moves forward, then turns left, and then moves forward. The next GO button press will cause the same movement.</p><p>Four children are playing with their robotic bees. Each of them creates their own program for their robotic bee. They press the GO button, and the robotic bee starts moving. They press the GO button again, but only one of them returns to its original position and direction.</p><p><strong>Question:</strong></p><p>Which sequence of button presses returns the robotic bee to its original position and direction?&nbsp;</p>', 5, '2023-10-10 08:06:59', '2023-10-14 11:04:04', '<p>Lebah robot dapat kembali ke posisi semula setelah program dieksekusi kedua<br>kalinya, jika eksekusi pertama daeri program memenuhi paling tidak satu dari dua<br>kondisi berikut ini:</p><ol><li>Lebah robot kembali ke posisi semula setelah menyelesaikan eksekusi pertama</li><li>Lebah robot berubah ke arah yang berlawanan</li></ol><p>Pada gambar dapat dilihat bahwa tidak ada satupun program yang memenuhi kondisi yang pertama. Jawaban yang benar adalah C, karena program ini mengandung instruksi untuk berubah arah ke kiri sebanyak dua kali, sehingga arahnya akan berubah 180 derajat atau berubah ke arah yang berlawanan. Menjalankan program dengan GO sekali lagi akan berakibat lebah robot akan kembali ke posisi dan arah semula.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The robot bee can return to its original position after the program is executed for the second time if the first execution of the program satisfies at least one of the two conditions:</p><ol><li>The robot bee returns to its original position after completing the first execution.</li><li>The robot bee changes its direction to the opposite direction.</li></ol><p>In the picture, it can be seen that none of the programs satisfy the first condition. The correct answer is C because this program contains instructions to turn left twice, which means it will change its direction by 180 degrees or to the opposite direction. Running the program with GO once again will result in the robot bee returning to its original position and direction.&nbsp;</p>'),
(7, 7, 4, 1, '<p>Bantulah si Robot hijau keluar dari lorong.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:29138,&quot;height&quot;:123,&quot;href&quot;:&quot;http://comfypace.com/uploads/2I23Bj4TrahMMDOC2pF1U0CiWmLF9b0C3y6swBpX.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/2I23Bj4TrahMMDOC2pF1U0CiWmLF9b0C3y6swBpX.png&quot;,&quot;width&quot;:424}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/2I23Bj4TrahMMDOC2pF1U0CiWmLF9b0C3y6swBpX.png\"><img src=\"http://comfypace.com/uploads/2I23Bj4TrahMMDOC2pF1U0CiWmLF9b0C3y6swBpX.png\" width=\"424\" height=\"123\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">28.46 KB</span></figcaption></a></figure> Robot dapat bergerak ke empat arah: Kanan (<strong>R</strong>), Bawah (<strong>B</strong>), Kiri (<strong>L</strong>) atau Atas (<strong>A</strong>) <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:3977,&quot;height&quot;:75,&quot;href&quot;:&quot;http://comfypace.com/uploads/mf6d4EJ6VqyIw2mntYbOz352AFcz8Vcd8yPCyRB2.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/mf6d4EJ6VqyIw2mntYbOz352AFcz8Vcd8yPCyRB2.png&quot;,&quot;width&quot;:185}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/mf6d4EJ6VqyIw2mntYbOz352AFcz8Vcd8yPCyRB2.png\"><img src=\"http://comfypace.com/uploads/mf6d4EJ6VqyIw2mntYbOz352AFcz8Vcd8yPCyRB2.png\" width=\"185\" height=\"75\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">3.88 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Seret dan jatuhkan tanda arah/panah ke dalam kotak-kotak pada gambar di bawah untuk membentuk suatu urutan instruksi. Urutan instruksi yang terbentuk harus diulang 4 kali agar Robot keluar dari lorong.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15382,&quot;height&quot;:112,&quot;href&quot;:&quot;http://comfypace.com/uploads/3wcfspKKCXIHKK2qEgyopi6fVbhBtq3wFSQy0RDw.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/3wcfspKKCXIHKK2qEgyopi6fVbhBtq3wFSQy0RDw.png&quot;,&quot;width&quot;:381}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/3wcfspKKCXIHKK2qEgyopi6fVbhBtq3wFSQy0RDw.png\"><img src=\"http://comfypace.com/uploads/3wcfspKKCXIHKK2qEgyopi6fVbhBtq3wFSQy0RDw.png\" width=\"381\" height=\"112\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">15.02 KB</span></figcaption></a></figure>Setiap instruksi diwakili huruf R atau B atau L atau A sesuai dengan gerakan robot. Tuliskan jawaban dengan 8 huruf berurutan tanpa spasi yang harus diisikan pada 8 kotak tsb. <strong>Anda hanya mengetikkan 8 huruf saja untuk menjawab</strong>. Contoh format jawaban : <strong>LBRARALR</strong>&nbsp;<br><br>&nbsp;</p><p>-------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;<br>Help the green robot to exit the corridor.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:29138,&quot;height&quot;:123,&quot;href&quot;:&quot;http://comfypace.com/uploads/2I23Bj4TrahMMDOC2pF1U0CiWmLF9b0C3y6swBpX.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/2I23Bj4TrahMMDOC2pF1U0CiWmLF9b0C3y6swBpX.png&quot;,&quot;width&quot;:424}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/2I23Bj4TrahMMDOC2pF1U0CiWmLF9b0C3y6swBpX.png\"><img src=\"http://comfypace.com/uploads/2I23Bj4TrahMMDOC2pF1U0CiWmLF9b0C3y6swBpX.png\" width=\"424\" height=\"123\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">28.46 KB</span></figcaption></a></figure>The Robot can move in four directions: Right (R), Down (B), Left (L), or Up (A).<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:3977,&quot;height&quot;:75,&quot;href&quot;:&quot;http://comfypace.com/uploads/mf6d4EJ6VqyIw2mntYbOz352AFcz8Vcd8yPCyRB2.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/mf6d4EJ6VqyIw2mntYbOz352AFcz8Vcd8yPCyRB2.png&quot;,&quot;width&quot;:185}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/mf6d4EJ6VqyIw2mntYbOz352AFcz8Vcd8yPCyRB2.png\"><img src=\"http://comfypace.com/uploads/mf6d4EJ6VqyIw2mntYbOz352AFcz8Vcd8yPCyRB2.png\" width=\"185\" height=\"75\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">3.88 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>Drag and drop the arrow signs into the boxes in the image above to create a sequence of instructions. The instruction sequence should be repeated 4 times for the Robot to exit the corridor.&nbsp;</p><p>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15382,&quot;height&quot;:112,&quot;href&quot;:&quot;http://comfypace.com/uploads/3wcfspKKCXIHKK2qEgyopi6fVbhBtq3wFSQy0RDw.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/3wcfspKKCXIHKK2qEgyopi6fVbhBtq3wFSQy0RDw.png&quot;,&quot;width&quot;:381}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/3wcfspKKCXIHKK2qEgyopi6fVbhBtq3wFSQy0RDw.png\"><img src=\"http://comfypace.com/uploads/3wcfspKKCXIHKK2qEgyopi6fVbhBtq3wFSQy0RDw.png\" width=\"381\" height=\"112\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">15.02 KB</span></figcaption></a></figure> Each instruction is represented by the letters R or B or L or A, according to the robot\'s movement. Write the answer with 8 consecutive letters without spaces to be filled in the 8 boxes. You only need to type 8 letters to answer. For example, the answer format: LBRARALR.&nbsp;<br>&nbsp;</p>', 5, '2023-10-10 08:08:19', '2023-10-14 11:05:57', '<p>Robot yang mampu bergerak sendiri (karena sudah diprogram menggunakan algoritma tertentu) sering dipakai memecahkan masalah labirin (maze). Labirin dapat beragam bentuknya, mengandung jalan melingkar (loop), tanpa loop, sistem grid (kotak-kotak) ataupun sistem tanpa grid. Pada algoritma permasalahan labirin ini, yang mengandung pengulangan sederhana, robot diinstruksikan untuk mengikuti arah yang dikehendaki. Misalnya, kita mungkin menandai arah seperti di atas: (R) untuk ke kanan, (A) untuk bergerak ke atas, (L) untuk bergerak ke kiri dan (B) untuk turun ke bawah.</p><p><br>Saat menemui suatu persimpangan jalan, robot selalu memilih jalur berdasarkan urutan instruksi yang diprioritaskan. Misalnya, ada dua jalan keluar, satu ke kiri dan satu ke kanan. Robot yang lewat mula-mula akan ke kiri dan posisi dan arah akan diingat. Jika setelah mengikuti suatu jalur robot tak dapat bergerak, dia akan kembali ke posisi sebelumnya. Setelah mencapai posisi itu, posisi dan arah yang diingat akan digali kembali, dan arah lain yang dipilih diingat sebelum ditempuh. Demikian seterusnya sampai robot mencapai tujuan.</p><p><br>Maka, robot akan mencatat/merekan posisi yang ditempuh dan sekumpulan arah yang sudah diambil. Dengan bergerak ke posisi dan arah yang sudah direkam, robot dapat mencapai tujuan.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The robot that can move autonomously (because it has been programmed using a specific algorithm) is often used to solve maze problems. Mazes can have various shapes, including circular paths (loops), non-loops, grid systems (squares), or non-grid systems. In the algorithm for maze problems, which involve simple repetitions, the robot is instructed to follow the desired direction. For example, we might mark directions as follows: (R) for right, (A) for up, (L) for left, and (B) for down.</p><p>When encountering an intersection, the robot always chooses a path based on the prioritized order of instructions. For example, if there are two exits, one to the left and one to the right, the robot that arrives first will go to the left, and its position and direction will be remembered. If, after following a path, the robot cannot move, it will return to the previous position. After reaching that position, the remembered position and direction will be revisited, and another direction will be chosen before proceeding. This continues until the robot reaches its goal.</p><p>Therefore, the robot will record the positions it has traversed and a set of directions it has taken. By moving to the recorded positions and directions, the robot can reach its destination.&nbsp;</p>'),
(8, 8, 4, 1, '<p>Pada suatu pagi yang cerah tiga sekawan, seekor kelinci, seekor kodok, dan seekor kangguru, bertanding dalam suatu lomba melompat (hopping race). Lintasannya merupakan keliling suatu lingkaran dengan 15 posisi langkah. Posisi langkah itu dinomori dari 0 sampai dengan 14. Setiap kali siapapun yang mencapai atau melalui posisi 14, posisi berikutnya adalah posisi 0.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:103811,&quot;height&quot;:296,&quot;href&quot;:&quot;http://comfypace.com/uploads/yaY3JJ5SmY78QEmR5aE07Ujkz9b7MbPQUgEOnrwe.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/yaY3JJ5SmY78QEmR5aE07Ujkz9b7MbPQUgEOnrwe.png&quot;,&quot;width&quot;:369}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/yaY3JJ5SmY78QEmR5aE07Ujkz9b7MbPQUgEOnrwe.png\"><img src=\"http://comfypace.com/uploads/yaY3JJ5SmY78QEmR5aE07Ujkz9b7MbPQUgEOnrwe.png\" width=\"369\" height=\"296\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">101.38 KB</span></figcaption></a></figure>Berang-berang yang kini menjadi wasitnya, akan meniupkan peluit setiap detik selama perlombaan. Pada setiap peniupan peluit, kelinci dapat melompat tepat 3 posisi berikutnya; kodok melompat tepat 2 posisi berikutnya, dan kangguru melompat tepat 5 posisi berikutnya.&nbsp;</p><p>Di awal lomba semua pemain memulai pada posisi 0.&nbsp;</p><p><strong>Pertanyaan</strong></p><p>Setelah empat kali peniupan peluit, berapa banyak posisi yang telah dilompatinya masing-masing? Tuliskan nomor posisi terakhir, berturut-turut posisi kelinci, posisi kodok dan posisi kangguru (pisahkan dengan hanya sebuah tanda koma, misalnya 3,2,5 ).&nbsp;</p><p>&nbsp;</p><p>-------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>On a bright morning, three friends  a rabbit, a frog, and a kangaroo  compete in a hopping race. Their race course forms a circle with 15 stepping positions, numbered from 0 to 14. Each time anyone reaches or passes position 14, the next position is position 0.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:103811,&quot;height&quot;:296,&quot;href&quot;:&quot;http://comfypace.com/uploads/yaY3JJ5SmY78QEmR5aE07Ujkz9b7MbPQUgEOnrwe.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/yaY3JJ5SmY78QEmR5aE07Ujkz9b7MbPQUgEOnrwe.png&quot;,&quot;width&quot;:369}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/yaY3JJ5SmY78QEmR5aE07Ujkz9b7MbPQUgEOnrwe.png\"><img src=\"http://comfypace.com/uploads/yaY3JJ5SmY78QEmR5aE07Ujkz9b7MbPQUgEOnrwe.png\" width=\"369\" height=\"296\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">101.38 KB</span></figcaption></a></figure>A beaver, who is now the referee, will blow the whistle every second during the race. On each whistle blow, the rabbit can hop precisely 3 positions ahead, the frog can hop 2 positions ahead, and the kangaroo can hop 5 positions ahead.</p><p>At the beginning of the race, all players start at position 0.</p><p><strong>Question:</strong></p><p>After four whistle blows, how many positions have each one of them hopped? Write down the last position numbers for the rabbit, frog, and kangaroo, separated by a single comma, for example, 3,2,5.&nbsp;</p>', 5, '2023-10-10 08:09:44', '2023-10-14 11:07:09', '<p>Setelah terdengar empat kali bunyi peluit, berikut ini adalah jumlah langkah yang telah dilakukan oleh masing-masing pemain, diikuti posisi terakhirnya:</p><ul><li>Kelinci 12 lompatan, posisi 12</li><li>Kodok 8 lompatan, posisi 8</li><li>Kangguru 20 lompatan, posisi 5</li></ul><p>Setiap kali mendengar peluit, kelinci, kodok, kangguru melompat sesuai nilai langkahnya yang sudah terdefinisi. Kodok melompat 2 langkah per lompatan, dan dengan melakukan 4 kali, si kodok melompat 8 langkah. Kelinci melompat 3 langkah per lompatan, sehingga saat 4 kali melakukannya dia akan melangkah 12 langkah. Kanguru melompat 5 langkah per lompatan, sehingga ia melangkah sejauh 20 lompatan.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>After hearing the whistle four times, here is the number of steps taken by each player, followed by their final positions:</p><ul><li>Rabbit: 12 jumps, position 12</li><li>Frog: 8 jumps, position 8</li><li>Kangaroo: 20 jumps, position 5</li></ul><p>Each time they hear the whistle, the rabbit, frog, and kangaroo jump according to their predefined step values. The frog jumps 2 steps per jump, and by doing it 4 times, the frog jumps 8 steps. The rabbit jumps 3 steps per jump, so after doing it 4 times, it jumps 12 steps. The kangaroo jumps 5 steps per jump, so it jumps a total of 20 jumps.&nbsp;</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(9, 9, 5, 1, '<p>Keluarga Bambi merencanakan pergi untuk berpiknik. Sebelum berangkat, ayah meminta mereka merapikan kamarnya. Sesaat kemudian, ayah sangat puas karena ruangannya sangat rapi. Ayah melihat kotak berisi mainan dan berkata: \"Kalian sudah mengerjakan dengan sangat baik. Semua boneka, rangkaian manikmanik dan lidi-lidi sudah berada dalam kotak. Sekarang saya punya permainan tebaktebakan. Sekarang, kalau saya berikan tiga buah lingkaran berlabel AABBCC, ABCABC, ABCCBA; di mana kalian akan menaruh mainan-mainan tadi? Saya yakin kalian bisa menebak dengan baik, dan sebagai hadiah kalian akan saya belikan es krim\".&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:242081,&quot;height&quot;:284,&quot;href&quot;:&quot;http://comfypace.com/uploads/2yVpBwBzF4zuysoe8ug5EEIOYVzhdFJEIdwekdh3.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/2yVpBwBzF4zuysoe8ug5EEIOYVzhdFJEIdwekdh3.png&quot;,&quot;width&quot;:861}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/2yVpBwBzF4zuysoe8ug5EEIOYVzhdFJEIdwekdh3.png\"><img src=\"http://comfypace.com/uploads/2yVpBwBzF4zuysoe8ug5EEIOYVzhdFJEIdwekdh3.png\" width=\"861\" height=\"284\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">236.41 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Masukkan setiap mainan ke dalam lingkaran-lingkaran yang sesuai dengan label yang tertulis pada masing-masing lingkaran. Tempatkan semua mainan pada lingkaran-lingkaran berlabel AABBCC, ABCABC, ABCCBA, sesuai dengan pola susunan mainan dalam rangkaian.&nbsp;</p><p>Manakan susunan isi lingkaran yang benar ?<br>&nbsp;</p><p>-------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>The Bambi family plans to go on a picnic. Before leaving, the father asks them to tidy up his room. After a while, the father is very pleased because the room is very neat. He looks at a box of toys and says, \"You have done very well. All the dolls, bead strings, and sticks are now in the box. Now I have a guessing game for you. Now, if I give you three circles labeled AABBCC, ABCABC, ABCCBA, where will you place the toys I mentioned? I am sure you can guess correctly, and as a reward, I will buy you ice cream.\"</p><p>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:212950,&quot;height&quot;:203,&quot;href&quot;:&quot;http://comfypace.com/uploads/hEvdKxLZrGo43SMG3h5yXy13MHZxrm6ygZZC3gru.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/hEvdKxLZrGo43SMG3h5yXy13MHZxrm6ygZZC3gru.png&quot;,&quot;width&quot;:808}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;caption&quot;:&quot;Example of dolls (left), Example of bead strings (middle) , Example of sticks (right)&quot;,&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/hEvdKxLZrGo43SMG3h5yXy13MHZxrm6ygZZC3gru.png\"><img src=\"http://comfypace.com/uploads/hEvdKxLZrGo43SMG3h5yXy13MHZxrm6ygZZC3gru.png\" width=\"808\" height=\"203\"><figcaption class=\"attachment__caption attachment__caption--edited\">Example of dolls (left), Example of bead strings (middle) , Example of sticks (right)</figcaption></a></figure><strong>Question:</strong></p><p>Place each toy in the circles corresponding to the labels written on each circle. Put all the toys in the circles labeled AABBCC, ABCABC, ABCCBA, according to the pattern of the arrangement of the toys in the string.</p><p>Which arrangement of toys is correct?&nbsp;</p>', 5, '2023-10-10 08:16:34', '2023-10-14 11:08:07', '<p>Masing-masing mainan tersebut dapat dikelompokkan kembali berdasarkan polanya. Boneka menurut pola urutan pada lingkaran dalam satu arah tertentu; untaian manik-manik menurut urutannya dalam rangkaian tali; dan mainan lidi-lidi menurut pola kemiringan setiap lidi dalam urutannya dari kiri ke kanan.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Each of these toys can be grouped based on its \"pattern.\" Dolls are categorized by the pattern of their sequence in a particular direction; bead strings are categorized by their order in a string; and stick toys are categorized by the pattern of the slant of each stick in their sequence from left to right.</p>'),
(10, 10, 5, 1, '<p>Bambi ingin meletakkan 5 botol di atas rak. Ia ingin agar botol-botol itu dibariskan dari yang paling kecil bagian tengahnya hingga yang terbesar dari kiri ke kanan. Susunlah urutan itu dengan menggeret botol-botol ke atas rak.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:77116,&quot;height&quot;:345,&quot;href&quot;:&quot;http://comfypace.com/uploads/gjnNSmANb3x6TDr7qSTkj94Ymo6qfbxe8sh9HlPt.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/gjnNSmANb3x6TDr7qSTkj94Ymo6qfbxe8sh9HlPt.png&quot;,&quot;width&quot;:498}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/gjnNSmANb3x6TDr7qSTkj94Ymo6qfbxe8sh9HlPt.png\"><img src=\"http://comfypace.com/uploads/gjnNSmANb3x6TDr7qSTkj94Ymo6qfbxe8sh9HlPt.png\" width=\"498\" height=\"345\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">75.31 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Susunlah botol-botol berikut ini di atas rak, terurut menurut bagian tengah (atau leher) dari botol, mulai dari yang paling kecil ke paling besar.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:44757,&quot;height&quot;:117,&quot;href&quot;:&quot;http://comfypace.com/uploads/MwjmFxxyh4b642kVi9rwtgoA8VPaogdTVomDclOy.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/MwjmFxxyh4b642kVi9rwtgoA8VPaogdTVomDclOy.png&quot;,&quot;width&quot;:761}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/MwjmFxxyh4b642kVi9rwtgoA8VPaogdTVomDclOy.png\"><img src=\"http://comfypace.com/uploads/MwjmFxxyh4b642kVi9rwtgoA8VPaogdTVomDclOy.png\" width=\"761\" height=\"117\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">43.71 KB</span></figcaption></a></figure>&nbsp;</p><p>-------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>Bambi wants to place 5 bottles on a shelf. She wants the bottles to be arranged from the smallest in the middle to the largest from left to right. Arrange the bottles in the order of the middle (or neck) of the bottle, starting from the smallest to the largest.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:77116,&quot;height&quot;:345,&quot;href&quot;:&quot;http://comfypace.com/uploads/gjnNSmANb3x6TDr7qSTkj94Ymo6qfbxe8sh9HlPt.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/gjnNSmANb3x6TDr7qSTkj94Ymo6qfbxe8sh9HlPt.png&quot;,&quot;width&quot;:498}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/gjnNSmANb3x6TDr7qSTkj94Ymo6qfbxe8sh9HlPt.png\"><img src=\"http://comfypace.com/uploads/gjnNSmANb3x6TDr7qSTkj94Ymo6qfbxe8sh9HlPt.png\" width=\"498\" height=\"345\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">75.31 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>Arrange the following bottles on the shelf in order of the middle (or neck) of the bottle, from the smallest to the largest.&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:44757,&quot;height&quot;:117,&quot;href&quot;:&quot;http://comfypace.com/uploads/MwjmFxxyh4b642kVi9rwtgoA8VPaogdTVomDclOy.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/MwjmFxxyh4b642kVi9rwtgoA8VPaogdTVomDclOy.png&quot;,&quot;width&quot;:761}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/MwjmFxxyh4b642kVi9rwtgoA8VPaogdTVomDclOy.png\"><img src=\"http://comfypace.com/uploads/MwjmFxxyh4b642kVi9rwtgoA8VPaogdTVomDclOy.png\" width=\"761\" height=\"117\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">43.71 KB</span></figcaption></a></figure></p>', 5, '2023-10-10 08:18:19', '2023-10-14 11:09:31', '<p>Kita dapat mencoba dengan berbagai cara, namun ada satu indikator apakah meletakkan dua buah botol sudah dalam urutan yang benar. Jika sebuah botol hilang atau tidak terlihat karena tertutup saat meletakkan botol lain sesudahnya, maka kita tahu botol tersebut seharusnya diletakkan di depan. Kita dapat mencoba meletakkan botol-botol tersebut satu per satu hingga soal ini terselesaikan. Botol yang paling kecil harus diletakkan paling depan.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:101824,&quot;height&quot;:329,&quot;href&quot;:&quot;http://comfypace.com/uploads/Cksznjoo4OBQoAeQitEI8WodRkuFadqFs0H9dtbf.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Cksznjoo4OBQoAeQitEI8WodRkuFadqFs0H9dtbf.png&quot;,&quot;width&quot;:442}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Cksznjoo4OBQoAeQitEI8WodRkuFadqFs0H9dtbf.png\"><img src=\"http://comfypace.com/uploads/Cksznjoo4OBQoAeQitEI8WodRkuFadqFs0H9dtbf.png\" width=\"442\" height=\"329\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">99.44 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>We can try in various ways, but there is one indicator to determine if placing two bottles is in the correct order. If one bottle \"disappears\" or is not visible because it\'s covered when placing another bottle after it, then we know that the bottle should have been placed in front. We can try placing the bottles one by one until this problem is solved. The smallest bottle should be placed at the front.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:101824,&quot;height&quot;:329,&quot;href&quot;:&quot;http://comfypace.com/uploads/Cksznjoo4OBQoAeQitEI8WodRkuFadqFs0H9dtbf.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Cksznjoo4OBQoAeQitEI8WodRkuFadqFs0H9dtbf.png&quot;,&quot;width&quot;:442}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Cksznjoo4OBQoAeQitEI8WodRkuFadqFs0H9dtbf.png\"><img src=\"http://comfypace.com/uploads/Cksznjoo4OBQoAeQitEI8WodRkuFadqFs0H9dtbf.png\" width=\"442\" height=\"329\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">99.44 KB</span></figcaption></a></figure>&nbsp;</p>'),
(11, 11, 6, 1, '<p>Joni ingin melakukan perjalanan untuk mengunjungi 5 kota di negaranya: Kotasatu, Kotadua, Kotatiga, Kotaempat, Kotalima, Kotaenam. Kota-kota tersebut dihubungkan dengan jalur bus. Rute bus yang tersedia (dalam dua arah) adalah sebagai berikut:</p><ul><li>Kotatiga - Kotasatu&nbsp;</li><li>Kotasatu - Kotadua&nbsp;</li><li>Kotaenam - Kotatiga&nbsp;</li><li>Kotalima  Kotaempat&nbsp;</li></ul><p><strong>Tantangan</strong>:&nbsp;</p><p>Jika Joni memulai perjalanannya dari Kotatiga dengan bus, kota mana yang tidak dapat dikunjungi?&nbsp;<br>&nbsp;-------------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong></p><p>Joni wants to travel to visit 5 cities in his country: City One, City Two, City Three, City Four, City Five, City Six. These cities are connected by bus routes. The available bus routes (in both directions) are as follows:</p><ul><li>City Three - City One</li><li>City One - City Two</li><li>City Six - City Three</li><li>City Five - City Four</li></ul><p><strong>Challenge:</strong></p><p>If Joni starts his journey from City Three by bus, which city cannot be visited?&nbsp;</p>', 5, '2023-10-10 08:23:54', '2023-10-14 11:25:23', '<p>Kamu dapat menggambar suatu diagram dengan kota digambarkan sebagai titik dan jalur bus sebagai garis yang tidak berpotongan, seperti ditunjukkan dalam gambar berikut ini. Dalam gambar terlihat jelas bahwa tidakmungkin mencapai Kotalima dari Kotatiga. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:31221,&quot;height&quot;:199,&quot;href&quot;:&quot;http://comfypace.com/uploads/0ZSqmHAOdr3xGPhYhPQyV6hp8FTZB4dxZv2DFSaW.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/0ZSqmHAOdr3xGPhYhPQyV6hp8FTZB4dxZv2DFSaW.png&quot;,&quot;width&quot;:477}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/0ZSqmHAOdr3xGPhYhPQyV6hp8FTZB4dxZv2DFSaW.png\"><img src=\"http://comfypace.com/uploads/0ZSqmHAOdr3xGPhYhPQyV6hp8FTZB4dxZv2DFSaW.png\" width=\"477\" height=\"199\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">30.49 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>You can draw a diagram with cities represented as points and bus routes as non-intersecting lines, as shown in the following image. In the image, it is clear that it is impossible to reach City Five from City Three.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:37056,&quot;height&quot;:486,&quot;href&quot;:&quot;http://comfypace.com/uploads/uXfy6hkwmHl9vugaC8WusLvDVBPQLNt1R4QqZD4r.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/uXfy6hkwmHl9vugaC8WusLvDVBPQLNt1R4QqZD4r.png&quot;,&quot;width&quot;:965}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/uXfy6hkwmHl9vugaC8WusLvDVBPQLNt1R4QqZD4r.png\"><img src=\"http://comfypace.com/uploads/uXfy6hkwmHl9vugaC8WusLvDVBPQLNt1R4QqZD4r.png\" width=\"965\" height=\"486\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">36.19 KB</span></figcaption></a></figure></p>'),
(12, 12, 6, 1, '<p>Violeta ingin mengirim pesan kepada Leo. Pesan dipecah menjadi potongan maksimal 3 huruf yang ditulis dalam kartu dan diberi nomor urut. Untuk mengerti pesan aslinya, Leo harus mengurutkan kartu sesuai nomor kartu. Misalnya, untuk mengirim pesan DANCETIME, Violeta membuat 3 kartu sebagai berikut:&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:3962,&quot;height&quot;:65,&quot;href&quot;:&quot;http://comfypace.com/uploads/0UdMv2FENKds0pHfoKKi8qXtMuLE8y9POOmz7mSH.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/0UdMv2FENKds0pHfoKKi8qXtMuLE8y9POOmz7mSH.png&quot;,&quot;width&quot;:349}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/0UdMv2FENKds0pHfoKKi8qXtMuLE8y9POOmz7mSH.png\"><img src=\"http://comfypace.com/uploads/0UdMv2FENKds0pHfoKKi8qXtMuLE8y9POOmz7mSH.png\" width=\"349\" height=\"65\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">3.87 KB</span></figcaption></a></figure> <strong>Tantangan</strong>:&nbsp;</p><p>Saat Leo menerima urutan kartu berikut:&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:6349,&quot;height&quot;:68,&quot;href&quot;:&quot;http://comfypace.com/uploads/tRuDkKjTXw1N16cpvBGwrLnXf8CFalGRmJ4AZUih.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/tRuDkKjTXw1N16cpvBGwrLnXf8CFalGRmJ4AZUih.png&quot;,&quot;width&quot;:566}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/tRuDkKjTXw1N16cpvBGwrLnXf8CFalGRmJ4AZUih.png\"><img src=\"http://comfypace.com/uploads/tRuDkKjTXw1N16cpvBGwrLnXf8CFalGRmJ4AZUih.png\" width=\"566\" height=\"68\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.2 KB</span></figcaption></a></figure>Apa pesan aslinya?&nbsp;</p><p>-------------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>Violeta wants to send a message to Leo. The message is divided into pieces of up to 3 letters, which are written on cards and numbered in sequence. To understand the original message, Leo has to arrange the cards according to their card numbers. For example, to send the message DANCETIME, Violeta creates 3 cards as follows:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:3962,&quot;height&quot;:65,&quot;href&quot;:&quot;http://comfypace.com/uploads/0UdMv2FENKds0pHfoKKi8qXtMuLE8y9POOmz7mSH.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/0UdMv2FENKds0pHfoKKi8qXtMuLE8y9POOmz7mSH.png&quot;,&quot;width&quot;:349}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/0UdMv2FENKds0pHfoKKi8qXtMuLE8y9POOmz7mSH.png\"><img src=\"http://comfypace.com/uploads/0UdMv2FENKds0pHfoKKi8qXtMuLE8y9POOmz7mSH.png\" width=\"349\" height=\"65\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">3.87 KB</span></figcaption></a></figure><strong>Challenge:</strong></p><p>When Leo receives the following card sequence:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:6349,&quot;height&quot;:68,&quot;href&quot;:&quot;http://comfypace.com/uploads/tRuDkKjTXw1N16cpvBGwrLnXf8CFalGRmJ4AZUih.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/tRuDkKjTXw1N16cpvBGwrLnXf8CFalGRmJ4AZUih.png&quot;,&quot;width&quot;:566}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/tRuDkKjTXw1N16cpvBGwrLnXf8CFalGRmJ4AZUih.png\"><img src=\"http://comfypace.com/uploads/tRuDkKjTXw1N16cpvBGwrLnXf8CFalGRmJ4AZUih.png\" width=\"566\" height=\"68\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.2 KB</span></figcaption></a></figure>What is the original message?</p>', 5, '2023-10-10 08:25:30', '2023-10-14 10:36:44', '<p>Pesan asli adalah \"GETHOCKEYSTICKS\" setelah kartu-kartu ditempatkan dalam urutan numerik dan kata-kata dibentuk.&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:3438,&quot;height&quot;:51,&quot;href&quot;:&quot;http://comfypace.com/uploads/90UI1zmyVFsrsCilJ2tWRjzAwr1KbAJWx6gpfffy.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/90UI1zmyVFsrsCilJ2tWRjzAwr1KbAJWx6gpfffy.png&quot;,&quot;width&quot;:245}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/90UI1zmyVFsrsCilJ2tWRjzAwr1KbAJWx6gpfffy.png\"><img src=\"http://comfypace.com/uploads/90UI1zmyVFsrsCilJ2tWRjzAwr1KbAJWx6gpfffy.png\" width=\"245\" height=\"51\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">3.36 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The original message was GETHOCKEYSTICKS after the cards are put in numerical order and words are constructed.&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:3438,&quot;height&quot;:51,&quot;href&quot;:&quot;http://comfypace.com/uploads/Ukq4Tm84oxrezm1vLhOpr9kRjTOIIfD99fPjOnD8.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Ukq4Tm84oxrezm1vLhOpr9kRjTOIIfD99fPjOnD8.png&quot;,&quot;width&quot;:245}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Ukq4Tm84oxrezm1vLhOpr9kRjTOIIfD99fPjOnD8.png\"><img src=\"http://comfypace.com/uploads/Ukq4Tm84oxrezm1vLhOpr9kRjTOIIfD99fPjOnD8.png\" width=\"245\" height=\"51\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">3.36 KB</span></figcaption></a></figure></p>'),
(13, 13, 7, 1, '<p>Zac dan Pan ingin melakukan perjalanan sepanjang lintasan seperti pada gambar di bawah ini. Zac ingin berjalan dari titik 1 ke titik 2 dan Pan ingin berjalan dari titik 2 ke titik 1.&nbsp;</p><p>Sepanjang lintasan, terdapat huruf-huruf (B, E,R,A, dan S) yang harus Zac dan Pan catat. Zac dan Pan hanya dapat mencatat huruf yang terletak pada sisi kiri mereka. Ketika Zac dan Pan mencapai akhir dari lintasan, mereka akan menghasilkan sebarisan huruf yang sudah mereka kumpulkan sebagai catatan.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:142748,&quot;height&quot;:338,&quot;href&quot;:&quot;http://comfypace.com/uploads/NkIhyKz0KvUN9UIf0tdDcyMzHdVbKyVP5wVxEiP8.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/NkIhyKz0KvUN9UIf0tdDcyMzHdVbKyVP5wVxEiP8.png&quot;,&quot;width&quot;:405}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/NkIhyKz0KvUN9UIf0tdDcyMzHdVbKyVP5wVxEiP8.png\"><img src=\"http://comfypace.com/uploads/NkIhyKz0KvUN9UIf0tdDcyMzHdVbKyVP5wVxEiP8.png\" width=\"405\" height=\"338\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">139.4 KB</span></figcaption></a></figure><strong>Pertanyaan</strong>:&nbsp;</p><p>Apakah barisan huruf yang berhasil dicatat oleh masing-masing berang-berang tersebut di akhir perjalanan mereka?&nbsp;</p><p>&nbsp;-------------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>&nbsp;Zac and Pan want to travel along the track as shown in the image below. Zac wants to walk from point 1 to point 2, and Pan wants to walk from point 2 to point 1.</p><p>Along the track, there are letters (\'B\', \'E\', \'R\', \'A\', and \'S\') that Zac and Pan need to record. Zac and Pan can only record the letters that are on their respective sides. When Zac and Pan reach the end of the track, they will produce a sequence of letters that they have collected as notes.</p><p>&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:142748,&quot;height&quot;:338,&quot;href&quot;:&quot;http://comfypace.com/uploads/NkIhyKz0KvUN9UIf0tdDcyMzHdVbKyVP5wVxEiP8.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/NkIhyKz0KvUN9UIf0tdDcyMzHdVbKyVP5wVxEiP8.png&quot;,&quot;width&quot;:405}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/NkIhyKz0KvUN9UIf0tdDcyMzHdVbKyVP5wVxEiP8.png\"><img src=\"http://comfypace.com/uploads/NkIhyKz0KvUN9UIf0tdDcyMzHdVbKyVP5wVxEiP8.png\" width=\"405\" height=\"338\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">139.4 KB</span></figcaption></a></figure> <strong>Question:</strong></p><p>What is the sequence of letters successfully recorded by each badger at the end of their journey?&nbsp;</p>', 5, '2023-10-10 08:27:37', '2023-10-13 14:41:25', NULL),
(14, 14, 7, 1, '<p>Budi ingin menjadi ninja dan menentukan namanya. Nama Ninja dibuat dengan mengganti setiap huruf yang berasal dari nama sesungguhnya dengan suku-suku kata sesuai dengan tabel berikut:&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:45419,&quot;height&quot;:199,&quot;href&quot;:&quot;http://comfypace.com/uploads/00vTykitw1SVTuIIKUIzzO7mlDVk4UnCKrGA1yPf.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/00vTykitw1SVTuIIKUIzzO7mlDVk4UnCKrGA1yPf.png&quot;,&quot;width&quot;:489}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/00vTykitw1SVTuIIKUIzzO7mlDVk4UnCKrGA1yPf.png\"><img src=\"http://comfypace.com/uploads/00vTykitw1SVTuIIKUIzzO7mlDVk4UnCKrGA1yPf.png\" width=\"489\" height=\"199\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">44.35 KB</span></figcaption></a></figure>Misalnya \"BUDI\" memiliki nama ninja \"pidoteki.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Jika nama ninjanya adalah \"zukame moru\", siapa namanya yang sesungguhnya?&nbsp;</p>', 5, '2023-10-10 08:28:45', '2023-10-13 14:44:37', NULL),
(15, 15, 8, 1, '<p>Beni harus mengisi 9 kotak pada bidang dengan 3 macam stiker. Setiap stiker berisi satu gambar. Syaratnya, pada setiap baris maupun kolom, tidak boleh ada stiker yang sama.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Susunan stiker mana yang benar?&nbsp;</p><p>-------------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>Beni needs to fill 9 boxes on the grid with 3 different stickers. Each sticker contains one image. The condition is that in each row and column, there must be no identical stickers.</p><p><strong>Challenge:</strong></p><p>Which arrangement of stickers is correct?&nbsp;</p>', 5, '2023-10-10 08:31:08', '2023-10-14 11:15:02', '<ul><li>A salah sebab ada paling tidak 1 kolom dengan dua stiker yang sama.&nbsp;</li><li>B salah sebab ada paling tidak 1 baris dengan dua stiker yang sama.&nbsp;</li><li>D salah sebab ada paling tidak 1 baris dengan dua stiker yang sama&nbsp;</li></ul><p>Untuk memecahkan latihan sudoku seperti ini, kita harus mencermati semua baris dan semua kolom. Salah satu cara adalah mencermati semua baris terlebih dulu, kemudian semua kolom. Cara lain adalah sebaliknya: mencermati semua kolom dulu, baru semua baris. Jika kamu sudah menemukan satu baris atau kolom yang salah, anda dapat berhenti mengamati baris atau kolom lainnya, yang disebut melakukan eliminasi. Dalam kehidupan sehari-hari, eliminasi membantumu untuk menyelesaikan persoalan. Misalnya saat menjawab pertanyaan pilihan ganda, kamu dapat mengabaikan jawaban tak benar untuk membuat kemungkinan pilihan lebih sedikit&nbsp;</p><p>----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><ul><li>A is incorrect because there is at least 1 column with two identical stickers.</li><li>B is incorrect because there is at least 1 row with two identical stickers.</li><li>D is incorrect because there is at least 1 row with two identical stickers.&nbsp;</li></ul><p>To solve a \"sudoku\" puzzle like this, we must carefully examine all rows and columns. One way is to examine all rows first and then all columns. Another way is to do it the other way around: examine all columns first, then all rows.<br>If you have found one incorrect row or column, you can stop observing other rows or columns, which is called \"elimination.\"<br>In everyday life, elimination helps you solve problems. For example, when answering multiple-choice questions, you can eliminate the incorrect answers to narrow down the possibilities.&nbsp;</p>'),
(16, 16, 8, 1, '<p>Sara ingin membeli sepatu, dan ayahnya memberi batasan bahwa harganya tak boleh lebih dari Rp. 100.000,- rupiah. Sarah menyukai sepatu bot berwarna hitam.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Merek apakah sepatu yang dipilih Sarah?&nbsp;</p><p>&nbsp;-------------------------------------------------------------------------------------</p><p><strong>ENGLISH VERSION</strong>&nbsp;</p><p>Sara wants to buy shoes, and her father has set a limit that the price should not exceed Rp. 100,000. Sara likes black lace-up Boots.</p><p>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:58246,&quot;height&quot;:187,&quot;href&quot;:&quot;http://comfypace.com/uploads/VpkzROi8MkPXaQvOIiORBXPdYncKvW6MZSOhTW1p.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/VpkzROi8MkPXaQvOIiORBXPdYncKvW6MZSOhTW1p.png&quot;,&quot;width&quot;:794}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/VpkzROi8MkPXaQvOIiORBXPdYncKvW6MZSOhTW1p.png\"><img src=\"http://comfypace.com/uploads/VpkzROi8MkPXaQvOIiORBXPdYncKvW6MZSOhTW1p.png\" width=\"794\" height=\"187\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">56.88 KB</span></figcaption></a></figure><strong>Challenge:</strong></p><p>What is the brand of the shoes chosen by Sara?</p>', 5, '2023-10-10 08:32:22', '2023-10-13 14:47:06', NULL),
(17, 17, 9, 1, '<p>Bambi menemukan sebuah lorong yang terdiri dari sederet kotak, setiap kotak berisi permen loli atau sikat gigi. Ia harus berjalan sepanjang lorong menuju ujung kanan dan tidak boleh mundur atau balik arah ke ujung kiri. Bebras dapat menggosok gigi kalau menemukan sikat gigi. Setelah makan dua permen loli, ia harus menggosok gigi sebelum boleh makan lagi. Pada setiap kotak, ia hanya dapat makan loli, atau menggosok gigi, atau hanya berjalan. Dia tak boleh membawa loli ataupun sikat gigi ke langkah berikutnya.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:35012,&quot;height&quot;:84,&quot;href&quot;:&quot;http://comfypace.com/uploads/7RdFzeQ4WD9U3xNape1HqEnRzWqJetRAHASGDFnW.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/7RdFzeQ4WD9U3xNape1HqEnRzWqJetRAHASGDFnW.png&quot;,&quot;width&quot;:890}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/7RdFzeQ4WD9U3xNape1HqEnRzWqJetRAHASGDFnW.png\"><img src=\"http://comfypace.com/uploads/7RdFzeQ4WD9U3xNape1HqEnRzWqJetRAHASGDFnW.png\" width=\"890\" height=\"84\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">34.19 KB</span></figcaption></a></figure></p><p><strong>Tantangan</strong>:&nbsp;</p><p>Berapa sebanyak-banyaknya permen loli yang dapat dimakannya dan giginya tetap sehat?&nbsp;</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>Bambi finds a corridor consisting of a series of boxes, with each box containing either a lollipop or a toothbrush. She has to walk along the corridor towards the right end and cannot go back or turn to the left. Bambi can brush her teeth if she finds a toothbrush. After eating two lollipops, she must brush her teeth before she can eat again. In each box, she can only either eat a lollipop, brush her teeth, or just walk. She cannot carry lollipops or a toothbrush to the next step.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:35012,&quot;height&quot;:84,&quot;href&quot;:&quot;http://comfypace.com/uploads/7RdFzeQ4WD9U3xNape1HqEnRzWqJetRAHASGDFnW.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/7RdFzeQ4WD9U3xNape1HqEnRzWqJetRAHASGDFnW.png&quot;,&quot;width&quot;:890}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/7RdFzeQ4WD9U3xNape1HqEnRzWqJetRAHASGDFnW.png\"><img src=\"http://comfypace.com/uploads/7RdFzeQ4WD9U3xNape1HqEnRzWqJetRAHASGDFnW.png\" width=\"890\" height=\"84\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">34.19 KB</span></figcaption></a></figure></p><p><strong>Challenge:</strong></p><p>How many lollipops can he eat at most while keeping his teeth healthy?</p>', 5, '2023-10-10 08:34:28', '2023-10-14 11:20:19', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:24931,&quot;height&quot;:103,&quot;href&quot;:&quot;http://comfypace.com/uploads/pZfYojA0lcSEf5UJ6YLVWYqLd23iMFC57SZTNpdr.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/pZfYojA0lcSEf5UJ6YLVWYqLd23iMFC57SZTNpdr.png&quot;,&quot;width&quot;:640}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/pZfYojA0lcSEf5UJ6YLVWYqLd23iMFC57SZTNpdr.png\"><img src=\"http://comfypace.com/uploads/pZfYojA0lcSEf5UJ6YLVWYqLd23iMFC57SZTNpdr.png\" width=\"640\" height=\"103\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.35 KB</span></figcaption></a></figure></p><p><strong>Ini Informatika!</strong></p><p>Pada soal ini, Bambi<strong> </strong>harus makan sebanyak mungkin loli, tapi ada konstrain. Konstrain adalah aturan yang mengharuskan anda untuk mengerjakan sesuatu, atau menghalangi. Misalnya dalam suatu permainan, anda harus menaati aturan permainan. Setiap permainan ada aturannya masing-masing. Kadang, aturan itu mudah, walaupun terkadang sulit. Dalam bidang informatika. Konstrain merupakan bagian penting dari persoalan, tetapi dapat membuat soal menjadi sulit dipecahkan. Oleh sebab itu, memahami aturan adalah hal penting dalam memecahkan persoalan.</p><p><strong>----------------</strong></p><p><strong>English Version</strong><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:24931,&quot;height&quot;:103,&quot;href&quot;:&quot;http://comfypace.com/uploads/00k5JDMftJTkk8EHtfcUF9zbihZwdpSOpLfjFZGl.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/00k5JDMftJTkk8EHtfcUF9zbihZwdpSOpLfjFZGl.png&quot;,&quot;width&quot;:640}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/00k5JDMftJTkk8EHtfcUF9zbihZwdpSOpLfjFZGl.png\"><img src=\"http://comfypace.com/uploads/00k5JDMftJTkk8EHtfcUF9zbihZwdpSOpLfjFZGl.png\" width=\"640\" height=\"103\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.35 KB</span></figcaption></a></figure><strong>This is Informatics!&nbsp;</strong></p><p>In this question, Bambi must eat as many lollipops as possible, but there are constraints. Constraints are rules that require you to do something or hinder you. For example, in a game, you must follow the rules of the game. Each game has its own rules. Sometimes, the rules are easy, although sometimes they are difficult. In the field of informatics, constraints are an essential part of the problem, but they can make it challenging to solve. Therefore, understanding the rules is crucial in problem-solving.</p>'),
(18, 18, 9, 1, '<p>Si Bambi dapat memutar roda ke kanan atau ke kiri. Pada setiap sekali putaran, roda berputar satu langkah dan panah menunjuk ke warna berikutnya. Gambar berikut menunjukkan kondisi awal roda, dan kondisi setelah roda diputar satu kali ke kiri:&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:42348,&quot;height&quot;:261,&quot;href&quot;:&quot;http://comfypace.com/uploads/AsAARWrQddoguczmi3BNynJHxjebW0TDYmhgXQ5M.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AsAARWrQddoguczmi3BNynJHxjebW0TDYmhgXQ5M.png&quot;,&quot;width&quot;:616}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AsAARWrQddoguczmi3BNynJHxjebW0TDYmhgXQ5M.png\"><img src=\"http://comfypace.com/uploads/AsAARWrQddoguczmi3BNynJHxjebW0TDYmhgXQ5M.png\" width=\"616\" height=\"261\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">41.36 KB</span></figcaption></a></figure><strong>Tantangan</strong>:&nbsp;</p><p>Jika si Bambi ingin memenangkan koin seperti pada kondisi awal (panah menunjuk warna merah dengan gambar koin seperti pada kondisi awal), berapa kali putaran roda paling sedikit yang perlu dilakukan dari kondisi awal?&nbsp;</p><p><strong>------------------</strong></p><p><strong>English Version</strong></p><p>Bambi can turn the wheel to the right or to the left. With each turn, the wheel moves one step, and the arrow points to the next color. The picture below shows the initial condition of the wheel and the condition after the wheel has been turned once to the left.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:42348,&quot;height&quot;:261,&quot;href&quot;:&quot;http://comfypace.com/uploads/AsAARWrQddoguczmi3BNynJHxjebW0TDYmhgXQ5M.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AsAARWrQddoguczmi3BNynJHxjebW0TDYmhgXQ5M.png&quot;,&quot;width&quot;:616}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AsAARWrQddoguczmi3BNynJHxjebW0TDYmhgXQ5M.png\"><img src=\"http://comfypace.com/uploads/AsAARWrQddoguczmi3BNynJHxjebW0TDYmhgXQ5M.png\" width=\"616\" height=\"261\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">41.36 KB</span></figcaption></a></figure><strong>Challenge:</strong></p><p>If Bambi wants to win a coin as in the initial condition (arrow pointing to the red color with a coin picture as in the initial condition), what is the minimum number of wheel rotations needed from the initial condition?</p><p><br></p>', 5, '2023-10-10 08:35:27', '2023-10-14 09:40:15', '<p>Jalan paling pendek untuk menempatkan tanda panah ke koin adalah memutarnya searah jarum jam<br>sebanyak 4 kali. Cara lain adalah memutar berlawanan arah dengan jarum jam sebanyak 8 kali, tetapi<br>bukan yang paling sedikit.</p><p><strong>Ini Informatika!</strong><br>Jika kita ingin menyelesaikan persoalan ini dengan komputer, kita perlu menyatakan ciri dari roda<br>chiper: ada berapa sektor dan warnanya, dan di mana uang berada. Kita perlu membuat sebuah data<br>yang sirkular (memutar), yang pada struktur data disebut doubly linked list, di mana satu elemen lis<br>dapat menunjuk ke elemen sebelum dan sesudahnya.<br>Salah satu operasi dasar pada struktur data adalah menelusuri lis dari awal sampai ke titik tertentu.<br>Menelusuri sebuah doubly linked list dapat dilakukan dua arah.</p><p><strong>------------------</strong></p><p><strong>English Version</strong></p><p>The shortest path to place the arrow on the coin is by rotating it clockwise 4 times. Another way is to rotate it counterclockwise 8 times, but that is not the shortest way.</p><p><strong>This is Informatics!&nbsp;</strong></p><p>If we want to solve this problem with a computer, we need to specify the characteristics of the wheel cipher: how many sectors it has, their colors, and where the money is located. We need to create circular data, which in data structures is called a \"doubly linked list,\" where each list element can point to the elements before and after it. One of the fundamental operations in data structures is traversing the list from the beginning to a specific point. Traversing a \"doubly linked list\" can be done in two directions.</p>'),
(19, 19, 10, 1, '<p>Sebuah kelompok berjumlah 4 anak memainkan \"kursi-musik\" yaitu berpindah kursi saat musik dimainkan.&nbsp;</p><p>Saat musik dimulai, setiap anak harus berpindah ke kursi searah dengan putaran jarum jam. Satu kursi dapat ditempati oleh lebih dari satu anak.&nbsp;</p><p>Pada setiap putaran, Anak (A) akan berpindah tiga (3) kursi. Anak (C) akan berpindah dua (2) kursi, sedangkan Anak (B, D) hanya akan berpindah satu (1) kursi. Semua brang-berang berpindah searah jarum jam.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:19453,&quot;height&quot;:231,&quot;href&quot;:&quot;http://comfypace.com/uploads/eepuQ8TKvYk52KVOxeUTLmUyTKm1fREDkoC6RZdZ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/eepuQ8TKvYk52KVOxeUTLmUyTKm1fREDkoC6RZdZ.png&quot;,&quot;width&quot;:305}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/eepuQ8TKvYk52KVOxeUTLmUyTKm1fREDkoC6RZdZ.png\"><img src=\"http://comfypace.com/uploads/eepuQ8TKvYk52KVOxeUTLmUyTKm1fREDkoC6RZdZ.png\" width=\"305\" height=\"231\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">19 KB</span></figcaption></a></figure></p><p><strong>Tantangan</strong>:&nbsp;</p><p>Jika pada awalnya posisi masing-masing sebagaimana terlihat pada gambar di atas, kursi mana yang kosong pada putaran ke-3 ?&nbsp;</p><p><strong>-------------------</strong></p><p><strong>English Version</strong></p><p>A group of 4 children is playing \"musical chairs,\" where they move from chair to chair when the music is played.</p><p>When the music starts, each child must move to the next chair clockwise. One chair can be occupied by more than one child.</p><p>In each round, Child (A) will move three (3) chairs, Child (C) will move two (2) chairs, while Children (B, D) will only move one (1) chair. All children move clockwise.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:19453,&quot;height&quot;:231,&quot;href&quot;:&quot;http://comfypace.com/uploads/WOPbfWA2dItE6YGEL1tCccWvJAJdOIbv67jT1csT.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/WOPbfWA2dItE6YGEL1tCccWvJAJdOIbv67jT1csT.png&quot;,&quot;width&quot;:305}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/WOPbfWA2dItE6YGEL1tCccWvJAJdOIbv67jT1csT.png\"><img src=\"http://comfypace.com/uploads/WOPbfWA2dItE6YGEL1tCccWvJAJdOIbv67jT1csT.png\" width=\"305\" height=\"231\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">19 KB</span></figcaption></a></figure></p><p><strong>Challenge:</strong></p><p>If initially, their positions are as shown in the picture above, which chair will be empty in the 3rd round?</p>', 5, '2023-10-10 08:36:52', '2023-10-14 08:58:27', '<p><strong>Ini Informatika!</strong><br>Untuk memecahkan persoalan ini, harus diingat bahwa semua berang-berang bergerak ke arah yang<br>sama selama permainan ini. Informasi ini penting supaya kita tetap fokus terhadap permasalahan<br>utamanya daripada pengulangan dalam permainan ini. Dengan demikian kita bisa menyederhanakan<br>algoritmanya dan mengidentifikasi pola yang ada.</p><p><strong>-------------------</strong></p><p><strong>English Version<br>This is Informatics!&nbsp;</strong></p><p>To solve this problem, it\'s important to remember that all the badgers move in the same direction during this game. This information is crucial to help us stay focused on the main issue rather than getting caught up in the repetitions of the game. As a result, we can simplify the algorithm and identify existing patterns.</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(20, 20, 10, 1, '<p>Sebuah robot pengecat mula-mula mempunyai 4 kaleng masing-masing berisi cat merah (M), hijau (H), kuning (K) dan biru (B). Ia akan mengecat pagar si Bebras yang dibuat dari deretan papan dan akan mewarnai setiap papan dengan satu warna. Kemudian ia akan mewarnai papan berikutnya dengan warna yang berikutnya sesuai urutan merah, hijau, kuning, biru (M-H-K-B). Jika robot sudah mewarnai dengan warna terakhir, ia akan kembali memakai warna pertama. Jika salah satu kaleng catnya habis, robot akan melemparkan kaleng cat itu, dan terus mewarnai dengan kaleng-kaleng cat tersisa. Dan seterusnya, sehingga semua kaleng cat kosong, atau tersisa cat di satu kaleng karena dua papan berurutan tak boleh berwarna sama.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:272072,&quot;height&quot;:286,&quot;href&quot;:&quot;http://comfypace.com/uploads/GwqIjkf1uLCRLrJqBKWC0z1LLpIJfB2JSlVmF1u8.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/GwqIjkf1uLCRLrJqBKWC0z1LLpIJfB2JSlVmF1u8.png&quot;,&quot;width&quot;:646}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/GwqIjkf1uLCRLrJqBKWC0z1LLpIJfB2JSlVmF1u8.png\"><img src=\"http://comfypace.com/uploads/GwqIjkf1uLCRLrJqBKWC0z1LLpIJfB2JSlVmF1u8.png\" width=\"646\" height=\"286\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">265.7 KB</span></figcaption></a></figure>Pada awalnya, robot dilengkapi dengan 4 kaleng dengan warna dan isinya:&nbsp;</p><ul><li>Merah, cukup untuk mencat 5 papan&nbsp;</li><li>Hijau, cukup untuk 3 papan</li><li>Kuning, cukup untuk 7 papan</li><li>Biru, cukup untuk 2 papan&nbsp;</li></ul><p><strong>Tantangan</strong>:&nbsp;</p><p>Berapa papan yang dapat dicat oleh Robot hingga berhenti?&nbsp;</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>A painting robot initially has 4 cans of paint, each containing red (R), green (G), yellow (Y), and blue (B) paint. It will paint Beaver\'s fence, which is made up of a row of boards, and it will color each board with one color. Then it will paint the next board with the next color in the sequence: red, green, yellow, blue (R-G-Y-B). If the robot has already used the last color, it will start again with the first color. If one of its paint cans is empty, the robot will throw that can away and continue painting with the remaining paint cans. This continues until all the paint cans are empty, or there is one can of paint left because two consecutive boards cannot be the same color.</p><p>Initially, the robot is equipped with 4 cans with colors and contents as follows:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:272072,&quot;height&quot;:286,&quot;href&quot;:&quot;http://comfypace.com/uploads/GwqIjkf1uLCRLrJqBKWC0z1LLpIJfB2JSlVmF1u8.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/GwqIjkf1uLCRLrJqBKWC0z1LLpIJfB2JSlVmF1u8.png&quot;,&quot;width&quot;:646}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/GwqIjkf1uLCRLrJqBKWC0z1LLpIJfB2JSlVmF1u8.png\"><img src=\"http://comfypace.com/uploads/GwqIjkf1uLCRLrJqBKWC0z1LLpIJfB2JSlVmF1u8.png\" width=\"646\" height=\"286\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">265.7 KB</span></figcaption></a></figure>Red, enough to paint 5 boards<br>Green, enough to paint 3 boards<br>Yellow, enough to paint 7 boards<br>Blue, enough to paint 2 boards<br><strong>Challenge:</strong></p><p>How many boards can the robot paint before it stops?</p>', 5, '2023-10-10 08:38:36', '2023-10-14 09:45:07', '<p>Setelah robot mencat M-H-K-B-M-H-K-B, cat Biru habis, sehingga berikutnya ia akan mencat M-H dan<br>kemudian cat hijau habis. Berikutnya ia K-M-K-M dan cat merah habis. Berikutnya lagi, ia mencat K dan<br>berhenti. Jadi, dengan empat kaleng cat tersebut ia dapat mencat 15 papan:<br>M-H-K-B-M-H-K-B-M-H-K-M-K-M-K</p><p><strong>Ini Informatika!</strong><br>Sebuah algoritma adalah sebuah deretan instruksi atau rumus yang rinci, untuk menyelesaikan sebuah<br>persoalan atau memenuhi suatu tugas. Anda harus mampu membaca instruksi demi instruksi dan<br>menjalankannya, serta mengamati apa yang terjadi. Ini adalah salah satu kemampuan sangat penting<br>dalam pemrograman, khususnya dalam kegiatan yang dinamakan debugging (mencari kesalahan).</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>After the robot paints M-H-K-B-M-H-K-B, the blue paint runs out, so next, it will paint M-H, and then the green paint runs out. Next, it will paint K-M-K-M, and the red paint runs out. After that, it paints K and stops. So, with the four cans of paint, it can paint 15 boards:</p><p>M-H-K-B-M-H-K-B-M-H-K-M-K-M-K</p><p><strong><br>This is Informatics!&nbsp;</strong></p><p>An algorithm is a series of detailed instructions or formulas designed to solve a problem or complete a task. You must be able to read and execute each instruction while observing what happens. This is one of the essential skills in programming, especially in an activity known as \"debugging\" (finding errors).</p>'),
(21, 21, 11, 1, '<p>Jordan menebang pohon dan memotongnya sehingga setiap pohon menghasilkan batang pohon yang panjangnya 10 meter&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17865,&quot;height&quot;:127,&quot;href&quot;:&quot;http://comfypace.com/uploads/1qEwyJqKjK5Haq8g4exg1V64uJoJPBGNFw0oQLck.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/1qEwyJqKjK5Haq8g4exg1V64uJoJPBGNFw0oQLck.png&quot;,&quot;width&quot;:258}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/1qEwyJqKjK5Haq8g4exg1V64uJoJPBGNFw0oQLck.png\"><img src=\"http://comfypace.com/uploads/1qEwyJqKjK5Haq8g4exg1V64uJoJPBGNFw0oQLck.png\" width=\"258\" height=\"127\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">17.45 KB</span></figcaption></a></figure>Ali ingin membangun bendungan dan membutuhkan kayu sepanjang 4 meter sebanyak 7 batang, dan kayu sepanjang 3 meter sebanyak 7 batang. Ali dapat memotong batang pohon yang sudah dipotong Jordan sesuai dengan keperluannya. Jordan ingin memberikan batang pohon kepada Ali dengan jumlah sesedikit mungkin.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Berapa banyaknya batang pohon minimal yang dapat dipakai Ali untuk membangun bendungan?&nbsp;</p><p><strong>-------------</strong></p><p><strong>English Version</strong></p><p>Jordan is cutting down trees and cutting them into logs, each of which is 10 meters long.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17865,&quot;height&quot;:127,&quot;href&quot;:&quot;http://comfypace.com/uploads/1qEwyJqKjK5Haq8g4exg1V64uJoJPBGNFw0oQLck.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/1qEwyJqKjK5Haq8g4exg1V64uJoJPBGNFw0oQLck.png&quot;,&quot;width&quot;:258}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/1qEwyJqKjK5Haq8g4exg1V64uJoJPBGNFw0oQLck.png\"><img src=\"http://comfypace.com/uploads/1qEwyJqKjK5Haq8g4exg1V64uJoJPBGNFw0oQLck.png\" width=\"258\" height=\"127\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">17.45 KB</span></figcaption></a></figure>Ali wants to build a dam and needs 7 logs that are 4 meters long and 7 logs that are 3 meters long. Ali can cut the logs already cut by Jordan according to his needs. Jordan wants to give Ali the minimum number of logs.</p><p><strong>Challenge:</strong></p><p>How many logs is the minimum number that Ali can use to build the dam?</p>', 5, '2023-10-10 08:40:13', '2025-03-14 07:31:14', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:97298,&quot;height&quot;:234,&quot;href&quot;:&quot;http://comfypace.com/uploads/L6RBwj92BxS4TH0AZeoTxTLKlO8jd1mOfOxoy9bJ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/L6RBwj92BxS4TH0AZeoTxTLKlO8jd1mOfOxoy9bJ.png&quot;,&quot;width&quot;:421}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/L6RBwj92BxS4TH0AZeoTxTLKlO8jd1mOfOxoy9bJ.png\"><img src=\"http://comfypace.com/uploads/L6RBwj92BxS4TH0AZeoTxTLKlO8jd1mOfOxoy9bJ.png\" width=\"421\" height=\"234\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">95.02 KB</span></figcaption></a></figure></p><p><br></p><p><strong>English Version</strong></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:97298,&quot;height&quot;:234,&quot;href&quot;:&quot;http://comfypace.com/uploads/cwviDsoBIpHsAofmyD9D8cERLrq4xfapqyC75MYY.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/cwviDsoBIpHsAofmyD9D8cERLrq4xfapqyC75MYY.png&quot;,&quot;width&quot;:421}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/cwviDsoBIpHsAofmyD9D8cERLrq4xfapqyC75MYY.png\"><img src=\"http://comfypace.com/uploads/cwviDsoBIpHsAofmyD9D8cERLrq4xfapqyC75MYY.png\" width=\"421\" height=\"234\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">95.02 KB</span></figcaption></a></figure></p>'),
(22, 22, 11, 1, '<p>Bryan menemukan sebuah roda cipher untuk membuat pesan rahasia. Hanya roda dalam yang dapat berputar berlawanan arah jarum jam, seperti dapat dilihat pada Gambar 1. Saat kunci adalah 0, A dikode sebagai a\'. Seperti ditunjukkan pada gambar 2, <strong>saat kunci adalah A (sebab roda dalam digeser 1 posisi berlawanan arah jarum jam), \'A\' dikode sebagai \'b\'.&nbsp;</strong></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:445295,&quot;height&quot;:398,&quot;href&quot;:&quot;http://comfypace.com/uploads/vclbZP2t9Rsy0IFpzonWg5ra0ZrzKo5sFEV10iul.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/vclbZP2t9Rsy0IFpzonWg5ra0ZrzKo5sFEV10iul.png&quot;,&quot;width&quot;:826}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/vclbZP2t9Rsy0IFpzonWg5ra0ZrzKo5sFEV10iul.png\"><img src=\"http://comfypace.com/uploads/vclbZP2t9Rsy0IFpzonWg5ra0ZrzKo5sFEV10iul.png\" width=\"826\" height=\"398\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">434.86 KB</span></figcaption></a></figure>Dengan kunci=1, kita akan meng-kode pesan <strong>SCHOOL</strong> menjadi <strong>TDIPPK</strong>.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Jika pesan terkode adalah \"<strong>DPNQVUBUJPOBM UIOLJLJOH</strong>\" apa pesan aslinya jika roda dalam diputar dengan kunci= 1?&nbsp;</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>Bryan found an inner wheel cipher to create a secret message. Only the inner wheel can rotate counterclockwise, as seen in Figure 1. When the key is 0, \'A\' is encoded as \'a\'. As shown in Figure 2, <strong>when the key is A (because the inner wheel is shifted 1 position counterclockwise), \'A\' is encoded as \'b\'.</strong></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:445295,&quot;height&quot;:398,&quot;href&quot;:&quot;http://comfypace.com/uploads/vclbZP2t9Rsy0IFpzonWg5ra0ZrzKo5sFEV10iul.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/vclbZP2t9Rsy0IFpzonWg5ra0ZrzKo5sFEV10iul.png&quot;,&quot;width&quot;:826}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/vclbZP2t9Rsy0IFpzonWg5ra0ZrzKo5sFEV10iul.png\"><img src=\"http://comfypace.com/uploads/vclbZP2t9Rsy0IFpzonWg5ra0ZrzKo5sFEV10iul.png\" width=\"826\" height=\"398\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">434.86 KB</span></figcaption></a></figure></p><p>With a key of 1, we will encode the message <strong>\"SCHOOL\"</strong> into <strong>\"TDIPPK\"</strong>.</p><p><strong>Challenge:</strong></p><p>If the encoded message is <strong>\"DPNQVUBUJPOBM UIOLJLJOH\"</strong>, what is the original message when the inner wheel is rotated with a key of 1?</p>', 5, '2023-10-10 08:41:58', '2023-10-14 09:46:02', '<p>Anda harus teliti mengamati perubahan setiap huruf. Kunci adalah berapa posisi anda harus bergeser<br>dari satu huruf ke huruf lainnya untuk mendapatkan kodenya. Kunci juga menunjukkan bagaimana<br>memperoleh sebuah pesan yang sudah terkode menjadi pesan asal.</p><p><strong>Ini Informatika!</strong><br>Roda chiper sama dengan cakram cipher yaitu sebuah alat yang dipakai untuk mengkode pesan dan<br>mengembalikan pesan terkode ke pesan asli, yang diciptakan oleh seorang arsitek italia bernama Leon<br>Battista Alberti. Ia membuat alat tersebut, yang dinamakan cakram cipher Alberti. Cakram ini terdiri<br>dari dua cakram yang porosnya sama dan diletakkan bertumpuk. Cakram besar tersebut tidak dapat<br>digerakkan, sedangkan yang lain dapat digerakkan berputar di atas cakram yang diam.<br>Sekarang, cakram tidak lagi dibuat karena dapat dibuat secara digital menggunakan komputer, dan<br>aturannya lebih kompleks. Mengkodekan pesan dan mendapatkan kembali pesan asli dapat juga<br>dilakukan secara mekanis.<br><strong>----------------</strong></p><p><strong>English Version</strong></p><p>You must carefully observe the change in each letter. The key is how many positions you need to shift from one letter to another to get the code. The key also indicates how to decode a message that has already been encoded into the original message.</p><p><strong>This is Informatics!&nbsp;</strong></p><p>The wheel cipher is the same as the disc cipher, which is a tool used to encode messages and decode the encoded messages back into their original form. It was created by an Italian architect named Leon Battista Alberti. He invented this device, known as Alberti\'s disc cipher. The cipher consists of two disks with the same axis, stacked on top of each other. The larger disk cannot be moved, while the other can be rotated on top of the stationary disk.</p><p>Nowadays, these discs are no longer manufactured because the process can be done digitally using computers, and the rules are more complex. Encoding messages and recovering the original message can also be achieved mechanically.</p>'),
(23, 23, 12, 1, '<p>Jaka duduk di pinggir jalan menghitung mobil warna-warni yang lewat. Di akhir hari ia mencatat:</p><ul><li>Mobil biru ada 10&nbsp;</li><li>Mobil merah ada 44</li><li>Mobil putih ada 3&nbsp;</li><li>Mobil hijau ada 8&nbsp;</li><li>Mobil hitam ada 15</li></ul><p>Jaka mengetikkan angka itu memakai program komputer dan hasilnya sebuah diagram batang sebagai berikut: &nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:11440,&quot;height&quot;:226,&quot;href&quot;:&quot;http://comfypace.com/uploads/I0H90bRY16M92LXo4Efc8rFxccKXngI0JRzGMf1M.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/I0H90bRY16M92LXo4Efc8rFxccKXngI0JRzGMf1M.png&quot;,&quot;width&quot;:412}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/I0H90bRY16M92LXo4Efc8rFxccKXngI0JRzGMf1M.png\"><img src=\"http://comfypace.com/uploads/I0H90bRY16M92LXo4Efc8rFxccKXngI0JRzGMf1M.png\" width=\"412\" height=\"226\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">11.17 KB</span></figcaption></a></figure>Tetapi sayangnya, diagram tersebut tidak menunjukkan warna mobil.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Mobil warna apa yang digambarkan pada diagram batang paling tengah ?&nbsp;</p><p><strong>---------------</strong></p><p><strong>English Version</strong></p><p>Jaka sat by the roadside and counted colorful cars passing by. At the end of the day, he recorded:</p><p>Blue cars: 10<br>Red cars: 44<br>White cars: 3<br>Green cars: 8<br>Black cars: 15<br>Jaka entered these numbers into a computer program, and the result is a bar chart as follows:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:11440,&quot;height&quot;:226,&quot;href&quot;:&quot;http://comfypace.com/uploads/I0H90bRY16M92LXo4Efc8rFxccKXngI0JRzGMf1M.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/I0H90bRY16M92LXo4Efc8rFxccKXngI0JRzGMf1M.png&quot;,&quot;width&quot;:412}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/I0H90bRY16M92LXo4Efc8rFxccKXngI0JRzGMf1M.png\"><img src=\"http://comfypace.com/uploads/I0H90bRY16M92LXo4Efc8rFxccKXngI0JRzGMf1M.png\" width=\"412\" height=\"226\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">11.17 KB</span></figcaption></a></figure></p><p>Unfortunately, the chart doesn\'t indicate the colors of the cars.</p><p><strong>Challenge:</strong></p><p>What color of cars is represented in the middle of the bar chart?</p>', 5, '2023-10-10 09:21:31', '2023-10-14 09:47:15', '<p>Jika kita mengurutkan data mobil lewat yang diberikan, nilai yang ketiga (di tengah) adalah 10, data dari<br>mobil berwarna biru.</p><p><strong>Ini Informatika!</strong><br>Ini Informatika sebab kita harus menemukan hubungan antara dua hal: warna dan mobil. Selain itu, kita<br>harus mengurutkan nilai agar menaik.</p><p><strong>---------------</strong></p><p><strong>English Version</strong></p><p>If we sort the car data provided, the third value (in the middle) is 10, which corresponds to the blue-colored car data.</p><p><strong>This is Informatics!&nbsp;</strong></p><p>It\'s Informatics because we need to find the relationship between two things: colors and cars. Additionally, we must arrange the values in ascending order.</p>'),
(24, 24, 12, 1, '<p>Jeni pergi ke sekolah dengan berjalan kaki. Peta jalan yang dapat dilalui dari rumah ke sekolah seperti berikut:&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:31107,&quot;height&quot;:137,&quot;href&quot;:&quot;http://comfypace.com/uploads/xuIHKkf5sGW8TxUV0g3b8FbhzPWvCClCwWcdByrP.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/xuIHKkf5sGW8TxUV0g3b8FbhzPWvCClCwWcdByrP.png&quot;,&quot;width&quot;:354}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/xuIHKkf5sGW8TxUV0g3b8FbhzPWvCClCwWcdByrP.png\"><img src=\"http://comfypace.com/uploads/xuIHKkf5sGW8TxUV0g3b8FbhzPWvCClCwWcdByrP.png\" width=\"354\" height=\"137\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">30.38 KB</span></figcaption></a></figure>Jeni senang menempuh jalur yang berbeda-beda setiap hari. Dia hanya berjalan sepanjang jalan yang tersedia seperti pada gambar. Jalan yang Jeni gunakan pasti selalu mengarah ke sekolah. Artinya Jeni tidak akan menggunakan jalan yang menjauhi sekolah.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Ada berapa banyak jalur yang berbeda yang dapat ditempuh Jeni untuk pergi ke sekolah?&nbsp;</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>Jeni walks to school every day. The map of the possible routes from her house to school is as follows:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:31107,&quot;height&quot;:137,&quot;href&quot;:&quot;http://comfypace.com/uploads/xuIHKkf5sGW8TxUV0g3b8FbhzPWvCClCwWcdByrP.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/xuIHKkf5sGW8TxUV0g3b8FbhzPWvCClCwWcdByrP.png&quot;,&quot;width&quot;:354}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/xuIHKkf5sGW8TxUV0g3b8FbhzPWvCClCwWcdByrP.png\"><img src=\"http://comfypace.com/uploads/xuIHKkf5sGW8TxUV0g3b8FbhzPWvCClCwWcdByrP.png\" width=\"354\" height=\"137\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">30.38 KB</span></figcaption></a></figure></p><p>Jeni enjoys taking different routes every day. She only walks along the available paths as shown on the map. The paths Jeni takes always lead towards the school, meaning she won\'t take paths that lead away from school.</p><p><strong>Challenge:</strong></p><p>How many different routes can Jeni take to go to school?</p>', 5, '2023-10-10 09:22:58', '2023-10-14 09:47:37', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:22402,&quot;height&quot;:135,&quot;href&quot;:&quot;http://comfypace.com/uploads/meSzPGuxp9E4CYSawDxgECb7ERi4avh4RJZFRcmS.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/meSzPGuxp9E4CYSawDxgECb7ERi4avh4RJZFRcmS.png&quot;,&quot;width&quot;:251}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/meSzPGuxp9E4CYSawDxgECb7ERi4avh4RJZFRcmS.png\"><img src=\"http://comfypace.com/uploads/meSzPGuxp9E4CYSawDxgECb7ERi4avh4RJZFRcmS.png\" width=\"251\" height=\"135\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">21.88 KB</span></figcaption></a></figure></p><p><strong>Ini Informatika!</strong><br>Menemukan jalur pada sebuah jaringan adalah persoalan yang sering dihadapi dalam bidang<br>informatika. Walaupun soal ini sangat mudah, jika jalan lebih rumit, akan makin sulit untuk dipecahkan.<br>Persoalan yang sejenis adalah menemukan jalur terpendek dan jalur tercepat.<br><strong>----------------</strong></p><p><strong>English Version</strong></p><p><strong><br></strong><br><strong>This is Informatics!&nbsp;</strong></p><p>Finding a path in a network is a common problem in the field of informatics. While this problem is straightforward, as the routes become more complex, it becomes increasingly challenging to solve. Similar problems include finding the shortest path and the fastest route.</p>'),
(25, 25, 13, 1, '<p>Keluarga Bobi mempunyai kebun apel. Setelah panen, mereka ingin mengemas sebaik-baiknya untuk dijual.&nbsp;</p><p>Mereka mengemas sesuai aturan sebagai berikut:&nbsp;</p><ol><li>Apel ditaruh di kantong. Setiap kantong diisi dengan 8 apel. Jika tersisa kurang dari 8 apel, apel dibiarkan tidak dikemas.&nbsp;</li><li>Kantong akan dimasukkan ke kardus, Setiap kardus berisi 8 kantong. Jika tersisa kurang dari 8 kantong, kantong yang tersisa tidak dimasukkan ke kardus.&nbsp;</li></ol><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:41408,&quot;height&quot;:162,&quot;href&quot;:&quot;http://comfypace.com/uploads/s76LvT8m4oZGenfwfc5EqCNejOutuLvVIMwigWsS.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/s76LvT8m4oZGenfwfc5EqCNejOutuLvVIMwigWsS.png&quot;,&quot;width&quot;:459}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/s76LvT8m4oZGenfwfc5EqCNejOutuLvVIMwigWsS.png\"><img src=\"http://comfypace.com/uploads/s76LvT8m4oZGenfwfc5EqCNejOutuLvVIMwigWsS.png\" width=\"459\" height=\"162\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">40.44 KB</span></figcaption></a></figure><strong>Tantangan</strong>:&nbsp;</p><p>Hari ini, mereka panen 275 apel. Ada berapa banyak apel yang tidak dimasukkan ke kantong?</p><p><strong>-------------</strong></p><p><strong>English Version</strong></p><p>Bobi\'s family has an apple orchard, and after the harvest, they want to package the apples for sale.</p><p>They package them according to the following rules:</p><ol><li>Apples are placed in bags, with each bag containing 8 apples. If there are fewer than 8 apples left, they are not bagged.</li><li>Bags are placed in boxes, with each box containing 8 bags. If there are fewer than 8 bags left, the remaining bags are not placed in a box.</li></ol><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:41408,&quot;height&quot;:162,&quot;href&quot;:&quot;http://comfypace.com/uploads/s76LvT8m4oZGenfwfc5EqCNejOutuLvVIMwigWsS.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/s76LvT8m4oZGenfwfc5EqCNejOutuLvVIMwigWsS.png&quot;,&quot;width&quot;:459}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/s76LvT8m4oZGenfwfc5EqCNejOutuLvVIMwigWsS.png\"><img src=\"http://comfypace.com/uploads/s76LvT8m4oZGenfwfc5EqCNejOutuLvVIMwigWsS.png\" width=\"459\" height=\"162\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">40.44 KB</span></figcaption></a></figure></p><p><strong>Challenge:</strong></p><p>Today, they harvested 275 apples. How many apples are not placed in bags?</p>', 5, '2023-10-10 09:25:54', '2023-10-14 09:49:18', '<p>Ada 64 apel di setiap kardus (8 kantong, 8 apel di setiap kantong). Berang-berang memetik 275 apel<br>yang memerlukan 4 kardus (275/64=4.296875). 4 kardus tersebut diisi oleh total 64*4=256 apel.<br>Karena setiap kantong bisa diisi oleh 8 apel, sisa 275-256=19 apel bisa dimasukkan ke 2 kantong<br>(19/8=2.375). 2 kantong ini berisi 16 apel, jadi sisanya adalah 3 apel.<br>Untuk menganalisis pilihan jawaban yang lain:<br>o Jawaban a) jumlah total apel adalah 4*64 + 1*8 +6 = 270 apel.<br>o Jawaban b) jumlah total apel adalah 3*64 +5*8 +1 = 233 apel.<br>o Jawaban c) jumlah total apel adalah 3*64 +7*8 +7 = 255 apel.</p><p><strong>Ini Informatika!</strong><br>Sistem angka biner adalah sistem kode komputer atau informasi yang paling sederhana. Sistem ini<br>dilambangkan seluruhnya oleh dua simbol angka, yaitu urutan angka nol dan satu.<br>Sedangkan sistem Oktal menggunakan 8 simbol angka, dari 0 sampai 7. Jika ada nilai yang<br>membutuhkan lebih dari 7, kita bisa menambahkan kolom di sebelah kiri. Nilai di kolom ini adalah 8 kali<br>lebih besar dari nilai yang berada di kolom yang persis disebelah kanannya. Sistem Oktal bisa<br>menunjukkan informasi yang sama dengan hanya menggunakan 1/3 digit karena setiap digit oktal<br>mewakili 3 digit biner. Ini sangat ideal untuk sistem komputer kuno karena mereka bisa<br>mempertunjukkan kode mesin dengan lebih akurat.<br>Di tantangan Mengemas Apel ini, kardus apel melambangkan angka 8^2 apel, kantong menggambarkan<br>8^1 apel dan sisa apel melambangkan 8^1 (unit). Oleh karena itu, angka desimal 275 bisa ditulis sebagai<br>423 di dalam sistem bilangan Oktal.<br><strong>-------------</strong></p><p><strong>English Version</strong></p><p>There are 64 apples in each box (8 bags, 8 apples in each bag). The badger picked 275 apples, which required 4 boxes (275/64=4.296875). Those 4 boxes contain a total of 64*4=256 apples. Since each bag can hold 8 apples, the remaining 275-256=19 apples can be placed in 2 bags (19/8=2.375). These 2 bags contain 16 apples, so there are 3 apples left.</p><p>To analyze the other answer choices:</p><ul><li>Answer a) The total number of apples is 4<em>64 + 1</em>8 + 6 = 270 apples.</li><li>Answer b) The total number of apples is 3<em>64 + 5</em>8 + 1 = 233 apples.</li><li>Answer c) The total number of apples is 3<em>64 + 7</em>8 + 7 = 255 apples.</li></ul><p><strong><br>This is Informatics!</strong></p><p>The binary number system is the simplest computer or information encoding system. It is entirely represented by two numerical symbols, the sequence of the numbers zero and one.</p><p>On the other hand, the Octal system uses eight numerical symbols, from 0 to 7. If there is a value that requires more than 7, you can add a column to the left. The value in this column is eight times larger than the value in the column immediately to its right. The Octal system can represent the same information using only 1/3 of the digits because each Octal digit represents 3 binary digits. This was very ideal for early computer systems as it could represent machine code more accurately.</p><p>In the Apple Packing Challenge, the apple boxes represent 8^2 apples, the bags represent 8^1 apples, and the remaining apples represent 8^0 (units). Therefore, the decimal number 275 can be written as 423 in the Octal number system.</p>'),
(26, 26, 13, 1, '<p>Sepasang kekasih bernama Justin dan Selena, mempunyai gerakan tarian yang menyesuaikan jenis sorakan penonton. Mereka melakukan gerakan secara bersamaan pada satu kotak, pada setiap saat sesuai arah anak panah di bawah ini. Gambar berikut ini menunjukkan bagaimana kedua berang-berang akan bergerak:&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:215299,&quot;height&quot;:262,&quot;href&quot;:&quot;http://comfypace.com/uploads/O2LvSDuTAci2pVKkwEYeDUKyyCkncZv5019XHnKJ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/O2LvSDuTAci2pVKkwEYeDUKyyCkncZv5019XHnKJ.png&quot;,&quot;width&quot;:600}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/O2LvSDuTAci2pVKkwEYeDUKyyCkncZv5019XHnKJ.png\"><img src=\"http://comfypace.com/uploads/O2LvSDuTAci2pVKkwEYeDUKyyCkncZv5019XHnKJ.png\" width=\"600\" height=\"262\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">210.25 KB</span></figcaption></a></figure>Sebagai contoh, jika penonton bersorak \"Roar!\" Justin akan bergerak satu kotak ke kanan kemudian satu kotak mundur ke belakang. Pada saat yang sama, Selena akan maju satu kotak ke depan dan satu kotak ke kiri. Mereka mulai dengan posisi di lantai dansa sebagai berikut: <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:41708,&quot;height&quot;:267,&quot;href&quot;:&quot;http://comfypace.com/uploads/yjO9pXhBTXLLF4VaJbW9YOqXLT1UxQpOmH2i1OSA.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/yjO9pXhBTXLLF4VaJbW9YOqXLT1UxQpOmH2i1OSA.png&quot;,&quot;width&quot;:505}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/yjO9pXhBTXLLF4VaJbW9YOqXLT1UxQpOmH2i1OSA.png\"><img src=\"http://comfypace.com/uploads/yjO9pXhBTXLLF4VaJbW9YOqXLT1UxQpOmH2i1OSA.png\" width=\"505\" height=\"267\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">40.73 KB</span></figcaption></a></figure><strong>Tantangan:&nbsp;</strong></p><p>Manakah dari urutan sorakan berikut yang menyebabkan keduanya berhenti pada kotak yang sama?&nbsp;</p><p><strong>-----------------</strong></p><p><strong>English Version</strong></p><p>A couple named Justin and Selena has a dance routine that adjusts to the type of audience cheers. They perform movements together in one square, at each moment according to the arrow directions below. The image shows how both beavers will move:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:215299,&quot;height&quot;:262,&quot;href&quot;:&quot;http://comfypace.com/uploads/O2LvSDuTAci2pVKkwEYeDUKyyCkncZv5019XHnKJ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/O2LvSDuTAci2pVKkwEYeDUKyyCkncZv5019XHnKJ.png&quot;,&quot;width&quot;:600}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/O2LvSDuTAci2pVKkwEYeDUKyyCkncZv5019XHnKJ.png\"><img src=\"http://comfypace.com/uploads/O2LvSDuTAci2pVKkwEYeDUKyyCkncZv5019XHnKJ.png\" width=\"600\" height=\"262\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">210.25 KB</span></figcaption></a></figure></p><p>As an example, if the audience cheers \"Roar!\" Justin will move one square to the right and then one square backward. At the same time, Selena will move one square forward and one square to the left. They start with the dance floor positions as follows:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:41708,&quot;height&quot;:267,&quot;href&quot;:&quot;http://comfypace.com/uploads/yjO9pXhBTXLLF4VaJbW9YOqXLT1UxQpOmH2i1OSA.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/yjO9pXhBTXLLF4VaJbW9YOqXLT1UxQpOmH2i1OSA.png&quot;,&quot;width&quot;:505}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/yjO9pXhBTXLLF4VaJbW9YOqXLT1UxQpOmH2i1OSA.png\"><img src=\"http://comfypace.com/uploads/yjO9pXhBTXLLF4VaJbW9YOqXLT1UxQpOmH2i1OSA.png\" width=\"505\" height=\"267\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">40.73 KB</span></figcaption></a></figure></p><p>Challenge:</p><p>Which of the following sequences of cheers causes them to stop in the same square?</p><p>The sequences of cheers are not provided in your message. Please provide the sequences, and I can help you determine which one causes them to stop in the same square.</p>', 5, '2023-10-10 09:31:44', '2023-10-14 09:49:40', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:72391,&quot;height&quot;:304,&quot;href&quot;:&quot;http://comfypace.com/uploads/ZXcaxmjtigAgqEXZglkmPQIq3t2fnpXuohpN1ZuM.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/ZXcaxmjtigAgqEXZglkmPQIq3t2fnpXuohpN1ZuM.png&quot;,&quot;width&quot;:571}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/ZXcaxmjtigAgqEXZglkmPQIq3t2fnpXuohpN1ZuM.png\"><img src=\"http://comfypace.com/uploads/ZXcaxmjtigAgqEXZglkmPQIq3t2fnpXuohpN1ZuM.png\" width=\"571\" height=\"304\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">70.69 KB</span></figcaption></a></figure></p><p><strong>Ini Informatika!</strong><br>Persoalan ini memberikan suatu contoh tentang parallel processing atau parallel computing.<br>Dalam hal ini, setiap penari beraksi masing-masing secara independen. Ketika dua prosesor bertabrakan<br>(yang dimaksud: mereka mencoba mengakses lokasi yang sama dalam kode atau memori), maka<br>diperlukan kesepakatan prosesor mana yang mempunyai akses pertama terhadap bagian kode<br>tersebut. Hal ini dapat dilakukan memakai misalnya semaphore. Dengan cara ini satu prosesor<br>mempunyai kunci (lock) pada kode atau variabel yang sedang dipakai dan prosesor lainnya harus<br>menunggu sampai prosesor pertama selesai menggunakan kode tersebut.<br>Ketika melakukan gerakan tari pada kertas, anda sebenarnya melakukan simulasi dari kedua penari.<br>Simulasi penting dalam banyak situasi di dunia nyata. Misalnya, pada saat membuat suatu video game<br>online, seringkali sulit untuk memperoleh akses ke sejuta pemain untuk menguji kode anda. Pemrogram<br>biasanya akan mensimulasikan permainan dengan satu juta instan untuk melihat apakah permainan itu<br>stabil atau akan menemui tabrakan.<br><strong>-----------------</strong></p><p><strong>English Version</strong></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:72391,&quot;height&quot;:304,&quot;href&quot;:&quot;http://comfypace.com/uploads/yeDAIGfyopxsm5T0NwvusLjygk9DmScS2QUNRxpS.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/yeDAIGfyopxsm5T0NwvusLjygk9DmScS2QUNRxpS.png&quot;,&quot;width&quot;:571}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/yeDAIGfyopxsm5T0NwvusLjygk9DmScS2QUNRxpS.png\"><img src=\"http://comfypace.com/uploads/yeDAIGfyopxsm5T0NwvusLjygk9DmScS2QUNRxpS.png\" width=\"571\" height=\"304\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">70.69 KB</span></figcaption></a></figure></p><p><strong>This is Informatics!&nbsp;</strong></p><p>This problem provides an example of parallel processing or parallel computing. In this case, each dancer acts independently. When two processors collide (meaning they try to access the same location in the code or memory), an agreement is needed on which processor had the first access to that part of the code. This can be done using mechanisms like semaphores. In this way, one processor holds a lock on the code or variable it\'s using, and other processors must wait until the first processor finishes using that code.</p><p>When performing dance moves on paper, you\'re actually simulating the actions of both dancers. Simulation is essential in many real-world situations. For example, when creating an online video game, it\'s often difficult to access a million players to test your code. Programmers will usually simulate the game with a million instances to see if the game is stable or will encounter collisions.</p>'),
(27, 27, 14, 1, '<p>Terdapat dua jenis anjing yang berbaris seperti tampak dalam gambar berikut ini:&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:39254,&quot;height&quot;:97,&quot;href&quot;:&quot;http://comfypace.com/uploads/CIxHzey5CHUHdfxBssk2Lgp8Mwmz3NMLQpLFt154.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/CIxHzey5CHUHdfxBssk2Lgp8Mwmz3NMLQpLFt154.png&quot;,&quot;width&quot;:674}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/CIxHzey5CHUHdfxBssk2Lgp8Mwmz3NMLQpLFt154.png\"><img src=\"http://comfypace.com/uploads/CIxHzey5CHUHdfxBssk2Lgp8Mwmz3NMLQpLFt154.png\" width=\"674\" height=\"97\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">38.33 KB</span></figcaption></a></figure>Suatu pertukaran tempat dapat terjadi antara dua anjing yang berdiri bersebelahan. Akan dilakukan beberapa kali pertukaran tempat, sehingga tiga anjing besar akan berdiri dalam tiga posisi yang bersebelahan.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Berapakah banyaknya pertukaran sesedikit mungkin yang diperlukan? <br><strong>----------------</strong></p><p><strong>English Version</strong></p><p>There are two types of dogs lined up as seen in the following picture:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:39254,&quot;height&quot;:97,&quot;href&quot;:&quot;http://comfypace.com/uploads/CIxHzey5CHUHdfxBssk2Lgp8Mwmz3NMLQpLFt154.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/CIxHzey5CHUHdfxBssk2Lgp8Mwmz3NMLQpLFt154.png&quot;,&quot;width&quot;:674}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/CIxHzey5CHUHdfxBssk2Lgp8Mwmz3NMLQpLFt154.png\"><img src=\"http://comfypace.com/uploads/CIxHzey5CHUHdfxBssk2Lgp8Mwmz3NMLQpLFt154.png\" width=\"674\" height=\"97\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">38.33 KB</span></figcaption></a></figure></p><p>A swap of places can occur between two adjacent dogs. Several swaps will be made so that three big dogs will stand in three adjacent positions.</p><p><strong>Challenge:</strong></p><p>What is the minimum number of swaps needed to achieve this?</p>', 5, '2023-10-10 09:33:51', '2023-10-14 09:53:01', '<p>Ketiga anjing besar akan berdiri dalam tiga posisi yang bersebelahan dengan cara:</p><ul><li>Pertukaran pertama antara anjing besar pertama ke sebelah kanan sebanyak dua kali, kemudian</li><li>Pertukaran anjing besar terakhir ke sebelah kiri sebanyak empat kali.</li></ul><p>Setiap anjing kecil harus dilibatkan dalam pertukaran karena setiap anjing kecil diletakkan di antara dua<br>anjing besar. Pertukaran dua anjing kecil tidak akan ada dampaknya sehingga pertukaran harus<br>dilakukan antara satu anjing kecil dengan satu anjing besar. Karena terdapat enam anjing kecil, berarti<br>harus ada paling sedikit enam pertukaran. Perhatikan bahwa percobaan untuk memindahkan ketiga<br>anjing besar ke sebelah kiri atau ke sebelah kanan akan membutuhkan pertukaran lebih dari enam kali.</p><p><strong>Ini Informatika!</strong><br>Data tersimpan dalam memori kompute. Hal ini mencakup memori internal yang disebut RAM dan<br>memori eksternal yang misalnya bisa berbentuk hard drive atau USB. Komputer dapat mengakses data<br>dalam memori internal dengan sangat cepat tetapi memori eksternal lebih murah dibandingkan memori<br>interna. Hal ini berarti computer modern biasanya mempunyai lebih banyak memori eksternal, tetapi<br>ilmuwan computer mencoba untuk menemukan cara untuk menggunakan memori internal sedapat<br>mungkin.<br>Untuk masalah ini, operasi yang dipertimbangkan adalah hanya pertukaran (swap). Jika kita<br>memandang anjing-anjing tersebut sebagai data yang tersimpan di memori computer, maka suatu<br>pertukaran melibatkan perubahan lokasi dari dua buah data. Jika data ini ada di memori eksternal,<br>maka tujuan sesedikit mungkin pertukaran adalah yang kita perlukan untuk melaksanakan seluruh tugas<br>secepat mungkin. Pertukaran juga digunakan dalam beberapa algoritma pengurutan (sorting), yaitu<br>mengurutkan data secara membesar (ascending) atau mengecil (descending). Sebagai contoh dalam<br>bubble sort: dalam setiap pass kita menukar dua data yang bersebelahan yang tidak berurutan.</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>The three big dogs will stand in three adjacent positions as follows:</p><ul><li>The first exchange involves moving the first big dog to the right twice.</li><li>Then, the last big dog is moved to the left four times.</li></ul><p>Each small dog must be involved in the exchange because each small dog is placed between two big dogs. Exchanging two small dogs will have no effect, so the exchange must be done between one small dog and one big dog. Since there are six small dogs, there must be at least six exchanges. Note that attempts to move the three big dogs to the left or to the right will require more than six exchanges.</p><p><strong><br>This is Informatics!&nbsp;</strong></p><p>Data is stored in a computer\'s memory, including internal memory called RAM and external memory, such as hard drives or USB drives. Computers can access data in internal memory very quickly, but external memory is more cost-effective compared to internal memory. This means that modern computers usually have more external memory, but computer scientists are trying to find ways to use internal memory as efficiently as possible.</p><p>For this problem, the operation under consideration is swapping. If we view the dogs as data stored in computer memory, a swap involves changing the location of two pieces of data. If this data is in external memory, the goal is to minimize the number of swaps needed to perform the entire task as quickly as possible. Swapping is also used in some sorting algorithms, such as sorting data in ascending or descending order. For example, in bubble sort, during each pass, we swap two adjacent pieces of data that are out of order.</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(28, 28, 14, 1, '<p>Robin ingin menempel kertas di dinding kamarnya yang berukuran 5x5, menggunakan kertas-kertas persegi dalam berbagai ukuran dan warna. Kertas selalu ditempel tanpa melampaui batas dindingnya dan tanpa mengguntingnya. Ia menumpukkan kertas suatu kertas di atas kertas lain. Hasilnya adalah sebagai berikut:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:250899,&quot;height&quot;:366,&quot;href&quot;:&quot;http://comfypace.com/uploads/VLldnPcaLl3vBcokcZp6ny3JXQrHq8cc80bIFvh0.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/VLldnPcaLl3vBcokcZp6ny3JXQrHq8cc80bIFvh0.png&quot;,&quot;width&quot;:373}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/VLldnPcaLl3vBcokcZp6ny3JXQrHq8cc80bIFvh0.png\"><img src=\"http://comfypace.com/uploads/VLldnPcaLl3vBcokcZp6ny3JXQrHq8cc80bIFvh0.png\" width=\"373\" height=\"366\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">245.02 KB</span></figcaption></a></figure><strong>Tantangan</strong>:</p><p>Jika hasilnya seperti gambar tersebut, bagaimana urutan Robin menempelkan kertasnya?&nbsp;</p><p><strong>--------------</strong></p><p><strong>English Version</strong></p><p>Robin wants to paste papers on the wall of his 5x5 room using square papers of various sizes and colors. The papers are always pasted without extending beyond the wall\'s boundaries and without cutting them. He stacks one paper on top of another. The result is as follows:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:250899,&quot;height&quot;:366,&quot;href&quot;:&quot;http://comfypace.com/uploads/VLldnPcaLl3vBcokcZp6ny3JXQrHq8cc80bIFvh0.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/VLldnPcaLl3vBcokcZp6ny3JXQrHq8cc80bIFvh0.png&quot;,&quot;width&quot;:373}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/VLldnPcaLl3vBcokcZp6ny3JXQrHq8cc80bIFvh0.png\"><img src=\"http://comfypace.com/uploads/VLldnPcaLl3vBcokcZp6ny3JXQrHq8cc80bIFvh0.png\" width=\"373\" height=\"366\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">245.02 KB</span></figcaption></a></figure></p><p><strong>Challenge:</strong></p><p>If the result looks like the picture, what is the sequence in which Robin pasted his papers?</p>', 5, '2023-10-10 09:35:45', '2023-10-14 09:53:50', '<p>Kertas kuning dengan gambar tas adalah satu-satunya kertas yang tidak terpotong oleh kertas lain, jadi<br>itu pasti yang terakhir ditempel.<br>Kita bisa melihat bahwa gambar tas itu memotong gambar bola basket, kertas bola basket ditumpuk di<br>atas kertas daun, kertas daun memotong gambar bunga, kertas bunga menindih kertas cermin dan<br>kertas cermin memotong kertas bergambar hati.</p><p><strong>Ini Informatika!</strong><br>Dengan menggunakan kertas persegi panjang dalam urutan tertentu kita bisa mendapatkan gambar<br>yang berbeda, urutan adalah hal yang paling penting dalam informatika. Urutan dalam melakukan<br>sesuatu mempengaruhi urutan perintah untuk proses komputer, ini akan menghasilkan hasil yang<br>spesifik.<br>Tantangan ini adalah juga merupakan contoh lapisan, pengeditan gambar digital menggunakan teknik<br>lapisan untuk mengubah bagian gambar.<br><strong>--------------</strong></p><p><strong>English Version</strong></p><p>The yellow paper with the bag picture is the only paper that is not cut by other papers, so it must be the last one pasted.<br>We can see that the bag picture cuts the basketball picture, the basketball paper is stacked on the leaf paper, the leaf paper cuts the flower picture, the flower paper overlaps the mirror paper, and the mirror paper cuts the paper with the heart picture.</p><p><strong>This is Informatics!&nbsp;</strong></p><p>By using rectangular sheets of paper in a specific order, we can obtain different pictures. Sequence is the most crucial element in informatics. The sequence of doing something affects the order of computer instructions, which will yield specific results.</p><p>This challenge is also an example of layers, editing digital images using layer techniques to modify parts of the image.</p>'),
(29, 29, 15, 1, '<p>Toko donat di desa Suka Menang dapat membuat 1 donat setiap 2 menit. Ada antrian di depan toko, pelanggan dilayani satu persatu. Setiap pelanggan ingin membeli sejumlah donat. Saking larisnya, setiap orang hanya boleh membeli 3 donat pada satu saat. Jika ingin membeli lebih, harus antri lagi ke belakang. Toko donat buka dan mulai membuat donat pada pukul 7 pagi, dan sudah ada 3 pelanggan yang antri: yang pertama adalah Ali ingin membeli 7 donat, kedua adalah Bilgin ingin membeli 3 donat, dan yang ketiga Yasemin ingin membeli 5 donat.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:93237,&quot;height&quot;:479,&quot;href&quot;:&quot;http://comfypace.com/uploads/gfQpohpcMRrmvybnXVabXp3rxcuop5NLhG0DnzZo.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/gfQpohpcMRrmvybnXVabXp3rxcuop5NLhG0DnzZo.png&quot;,&quot;width&quot;:659}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/gfQpohpcMRrmvybnXVabXp3rxcuop5NLhG0DnzZo.png\"><img src=\"http://comfypace.com/uploads/gfQpohpcMRrmvybnXVabXp3rxcuop5NLhG0DnzZo.png\" width=\"659\" height=\"479\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">91.05 KB</span></figcaption></a></figure><strong>Tantangan</strong>:&nbsp;</p><p>Berapa menit setelah toko buka, Yasemin akan dilayani dan mendapat semua donat yang ingin dibelinya?&nbsp;</p><p><strong>-------------------</strong></p><p><strong>English Version</strong></p><p>The donut shop in the village of Suka Menang can make 1 donut every 2 minutes. There is a queue in front of the shop, and customers are served one by one. Each customer wants to buy a certain number of donuts. Due to high demand, each person is allowed to buy only 3 donuts at a time. If they want to buy more, they have to get back in line. The donut shop opens and starts making donuts at 7 AM, and there are already 3 customers in line: the first is Ali, who wants to buy 7 donuts, the second is Bilgin, who wants to buy 3 donuts, and the third is Yasemin, who wants to buy 5 donuts.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:93237,&quot;height&quot;:479,&quot;href&quot;:&quot;http://comfypace.com/uploads/gfQpohpcMRrmvybnXVabXp3rxcuop5NLhG0DnzZo.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/gfQpohpcMRrmvybnXVabXp3rxcuop5NLhG0DnzZo.png&quot;,&quot;width&quot;:659}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/gfQpohpcMRrmvybnXVabXp3rxcuop5NLhG0DnzZo.png\"><img src=\"http://comfypace.com/uploads/gfQpohpcMRrmvybnXVabXp3rxcuop5NLhG0DnzZo.png\" width=\"659\" height=\"479\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">91.05 KB</span></figcaption></a></figure></p><p><strong>Challenge:</strong></p><p>How many minutes after the shop opens will Yasemin be served and get all the donuts she wants to buy?</p>', 5, '2023-10-10 09:37:58', '2023-10-14 09:12:52', '<div class=\"attachment-gallery attachment-gallery--2\"><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:20225,&quot;height&quot;:160,&quot;href&quot;:&quot;http://comfypace.com/uploads/rHH4JPeGpxHxdg8H4wZfgIQgvXHT4UDFraFCqSgq.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/rHH4JPeGpxHxdg8H4wZfgIQgvXHT4UDFraFCqSgq.png&quot;,&quot;width&quot;:654}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/rHH4JPeGpxHxdg8H4wZfgIQgvXHT4UDFraFCqSgq.png\"><img src=\"http://comfypace.com/uploads/rHH4JPeGpxHxdg8H4wZfgIQgvXHT4UDFraFCqSgq.png\" width=\"654\" height=\"160\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">19.75 KB</span></figcaption></a></figure><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:48805,&quot;height&quot;:476,&quot;href&quot;:&quot;http://comfypace.com/uploads/0b7RQGF38SwbZ6lNxQQIzyxp5accPUZMp99iWIia.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/0b7RQGF38SwbZ6lNxQQIzyxp5accPUZMp99iWIia.png&quot;,&quot;width&quot;:655}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/0b7RQGF38SwbZ6lNxQQIzyxp5accPUZMp99iWIia.png\"><img src=\"http://comfypace.com/uploads/0b7RQGF38SwbZ6lNxQQIzyxp5accPUZMp99iWIia.png\" width=\"655\" height=\"476\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">47.66 KB</span></figcaption></a></figure></div><p><strong>Ini Informatika!</strong><br>Dalam tantangan ini, toko donat adalah komputer processor. Berang-berang adalah prosesnya. Donat<br>yang mereka pesan adalah waktu yang diperlukan untuk setiap proses.<br>Tantangan ini menggunakan metode penjadwalan algoritma Round Robin.<br><strong>-------------------</strong></p><p><strong>English Version</strong></p><p><strong>This is Informatics!&nbsp;</strong></p><p>In this challenge, the donut shop represents a computer processor, and people represent processes. The donuts they order are the time required for each process. This challenge uses the Round Robin scheduling algorithm.</p><p><br><br><br><br></p><p><br><br></p>'),
(30, 30, 15, 1, '<p>Kepulauan Honomakato terdiri dari lima pulau yang indah yaitu Ho, No, Ma, Ka, dan To. Pulau terbesar yaitu Ho terhubung ke daratan (pulau utama) oleh sebuah jembatan besar terbuat dari besi yang kokoh. Selain itu, terdapat jembatan-jembatan kayu yang menghubungkan Ho dengan No, Ho dengan Ka, Ka dengan Ma, dan Ka dengan To.&nbsp;</p><p>Penduduk kepulauan Honomakato berharap dibangun dua jembatan kayu lagi agar jika salah satu jembatan kayu putus, setiap pulau tetap masih bisa mencapai daratan lewat pulau Ho, karena jembatan dari Ho ke daratan tak mungkin rusak.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:46795,&quot;height&quot;:317,&quot;href&quot;:&quot;http://comfypace.com/uploads/Tnd8uXPhENJV966JXKK806cIFgTSPKiSVMyNhXpo.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Tnd8uXPhENJV966JXKK806cIFgTSPKiSVMyNhXpo.png&quot;,&quot;width&quot;:340}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Tnd8uXPhENJV966JXKK806cIFgTSPKiSVMyNhXpo.png\"><img src=\"http://comfypace.com/uploads/Tnd8uXPhENJV966JXKK806cIFgTSPKiSVMyNhXpo.png\" width=\"340\" height=\"317\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">45.7 KB</span></figcaption></a></figure> <strong>Tantangan</strong>:&nbsp;</p><p>Jembatan yang mana?&nbsp;</p><p><strong>---------------------</strong></p><p><strong>English Version</strong></p><p><br>The Honomakato Islands consist of five beautiful islands: Ho, No, Ma, Ka, and To. The largest island, Ho, is connected to the mainland (main island) by a sturdy iron bridge. Additionally, there are wooden bridges connecting Ho to No, Ho to Ka, Ka to Ma, and Ka to To.</p><p>The inhabitants of the Honomakato islands hope to build two more wooden bridges so that if one of the wooden bridges breaks, each island can still reach the mainland through Ho, as the bridge from Ho to the mainland is unlikely to break.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:46795,&quot;height&quot;:317,&quot;href&quot;:&quot;http://comfypace.com/uploads/Tnd8uXPhENJV966JXKK806cIFgTSPKiSVMyNhXpo.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Tnd8uXPhENJV966JXKK806cIFgTSPKiSVMyNhXpo.png&quot;,&quot;width&quot;:340}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Tnd8uXPhENJV966JXKK806cIFgTSPKiSVMyNhXpo.png\"><img src=\"http://comfypace.com/uploads/Tnd8uXPhENJV966JXKK806cIFgTSPKiSVMyNhXpo.png\" width=\"340\" height=\"317\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">45.7 KB</span></figcaption></a></figure></p><p><strong>Challenge:</strong></p><p>Which two bridges should be built?</p>', 5, '2023-10-10 09:39:42', '2023-10-14 09:14:24', '<p>Kalau ada jembatan Ho-To, jika Ho-Ka atau Ka-To terputus, To masih terhubung. Selain itu, Ka masih<br>terhubung juga melalui To kalau jembatan Ho-Ka putus.<br>Kalau ada jembatan No dan Ma:</p><ul><li>Ma masih terhubung melalui No, jika jembatan Ho-Ka atau Ka-Ma terputus.</li><li>No terhubung dengan Ka dan Ma, jika jembatan Ho-No terputus.</li><li>Ka masih terhubung melalui No dan Ma, jika jembatan Ho-Ka putus.</li></ul><p>Jembatan Ma-To tidak dapat menghubungkan No kalau jembatan Ho-No terputus.<br>Jembatan Ka-No tidak dapat menghubungkan To jika jembatan Ho-Ka atau Ka-To putus.<br>Jaringan kabel yang dibuat untuk kepulauan Honomakato menggambarkan hanya sebagian kecil dari<br>seluruh internet. Strukturnya menunjukkan contoh dari semua jaringan internat secara global:<br>komputer, HP, televisi, CCTV, dan apapun yang terkoneksi ke Internet saat ini, dapat digambarkan<br>sebagai jejaring dari simpul, seperti pulau-pulau pada jaringan Honomakato.<br>Pada tahun 1960, motivasi utama dari penemuan internet adalah untuk membangun sebuah jejaring<br>yang dengan cepat pulih jika ada masalah (resilien). Khususnya, tidak berfungsinya sebuah simpul<br>tidak menyebabkah seluruh jaringan menjadi lumpuh (tak berfungsi). Jenis jejaring selain internet,<br>misalnya jejaring lalulintas antar kota, pengiriman logistik, juga sama pentingnya agar tidak mempunyai<br>satu simpul yang jika lumpuh dapat menyebabkan semua jaringan lumpuh.<br>Ilmuwan/Ahli informatika menggunakan teori graf untuk menalarkan sebuah jaringan. Sebuah graf<br>adalah sebuah jaringan terdiri dari simpul dan penghubung (jalur) antar simpul. Sebuah graf disebut<br>terhubung, jika setiap pasangan A dan B terhubung, yaitu dapat mencapai A dari B melalui satu atau<br>lebih simpul. Jika ada sebuah simpul yang harus ada untuk membuat graf tersebut terhubung, maka<br>simpul tersebut disebut jembatan. Dalam sebuah jaringan yang cepat pulih terhubung kembali saat<br>sebuah simpul gagal berfungsi, harus dihindari adanya simpul jembatan. Untungnya, ada algoritma<br>untuk mengenali simpul jembatan. Robert Tarjan menemukan sebuah algoritma mendeteksi simpul<br>jembatan yang efisien  dan juga banyak algoritma lainnya.<br><br><strong>---------------------</strong></p><p><strong>English Version<br></strong>If there is a bridge from Ho to To, if Ho to Ka or Ka to To is disconnected, To remains connected. In addition, Ka is still connected through To if the bridge from Ho to Ka is disconnected.</p><p>If there are bridges No and Ma:</p><ul><li>Ma is still connected through No if the bridge from Ho to Ka or Ka to Ma is disconnected.</li><li>No is connected to Ka and Ma if the bridge from Ho to No is disconnected.</li><li>Ka is still connected through No and Ma if the bridge from Ho to Ka is disconnected.</li></ul><p>The Ma-To bridge cannot connect to No if the bridge from Ho to No is disconnected.</p><p>The Ka-No bridge cannot connect to To if the bridge from Ho to Ka or Ka to To is disconnected.</p><p>The cable network created for the Honomakato islands represents only a small part of the entire internet. Its structure illustrates examples of all global internet networks: computers, mobile phones, televisions, CCTV, and anything currently connected to the internet can be depicted as a network of nodes, like islands on the Honomakato network.</p><p>In the 1960s, the primary motivation for the invention of the internet was to build a network that could quickly recover from problems (\"resilient\"). In particular, the failure of a node should not cause the entire network to become non-functional. Other types of networks, such as intercity traffic networks and logistics systems, are equally important in that they should not have a single node that, if it fails, can cause the entire network to fail.</p><p>Computer scientists use graph theory to study a network. A graph is a network consisting of nodes and connections (edges) between nodes. A graph is called \"connected\" if every pair of nodes A and B are connected, meaning A can be reached from B through one or more nodes. If there is a node that must be present to make the graph connected, that node is called a \"bridge.\" In a network that quickly recovers its connections when a node fails, it\'s essential to avoid having bridge nodes. Fortunately, there are algorithms to identify bridge nodes. Robert Tarjan discovered an efficient algorithm to detect bridge nodes, among many other algorithms.</p>'),
(31, 31, 16, 1, '<p>Terdapat 12 tempat untuk parkir mobil di area parkir. Setiap tempat diberi nomor. Gambar di bawah ini menunjukkan kondisi area parkir pada hari Senin dan kondisi pada hari Selasa.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:300093,&quot;height&quot;:379,&quot;href&quot;:&quot;http://comfypace.com/uploads/mPlVvhZEsrW6RfHR4r5PlXwIsBDVlmf0Cx0BRj7b.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/mPlVvhZEsrW6RfHR4r5PlXwIsBDVlmf0Cx0BRj7b.png&quot;,&quot;width&quot;:654}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/mPlVvhZEsrW6RfHR4r5PlXwIsBDVlmf0Cx0BRj7b.png\"><img src=\"http://comfypace.com/uploads/mPlVvhZEsrW6RfHR4r5PlXwIsBDVlmf0Cx0BRj7b.png\" width=\"654\" height=\"379\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">293.06 KB</span></figcaption></a></figure>Mobil yang parkir pada hari Senin maupun pada hari Selasa pasti akan parkir di tempat seperti pada gambar.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Berapa banyak tempat parkir yang tidak pernah terisi mobil pada hari Senin maupun hari Selasa?</p><p><strong>---------------</strong></p><p><strong>English Version</strong></p><p>There are 12 parking spaces in the parking area, each with a number. The image below shows the parking area\'s condition on Monday and the condition on Tuesday.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:300093,&quot;height&quot;:379,&quot;href&quot;:&quot;http://comfypace.com/uploads/mPlVvhZEsrW6RfHR4r5PlXwIsBDVlmf0Cx0BRj7b.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/mPlVvhZEsrW6RfHR4r5PlXwIsBDVlmf0Cx0BRj7b.png&quot;,&quot;width&quot;:654}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/mPlVvhZEsrW6RfHR4r5PlXwIsBDVlmf0Cx0BRj7b.png\"><img src=\"http://comfypace.com/uploads/mPlVvhZEsrW6RfHR4r5PlXwIsBDVlmf0Cx0BRj7b.png\" width=\"654\" height=\"379\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">293.06 KB</span></figcaption></a></figure></p><p>Cars parked on Monday or Tuesday will always park in spaces as shown in the picture.</p><p><strong>Challenge:</strong></p><p>How many parking spaces are never occupied by cars on both Monday and Tuesday?</p>', 5, '2023-10-10 09:41:58', '2023-10-14 09:17:19', '<p>Kita dapat melihat tempat mana yang dipakai dengan menempatkan mobil-mobil dari kedua hari di<br>arena parkir secara bersamaan.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:73244,&quot;height&quot;:248,&quot;href&quot;:&quot;http://comfypace.com/uploads/SeI5lddK1XFozcx4EID1qO0iQqYjjN7ZApqLionb.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/SeI5lddK1XFozcx4EID1qO0iQqYjjN7ZApqLionb.png&quot;,&quot;width&quot;:335}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/SeI5lddK1XFozcx4EID1qO0iQqYjjN7ZApqLionb.png\"><img src=\"http://comfypace.com/uploads/SeI5lddK1XFozcx4EID1qO0iQqYjjN7ZApqLionb.png\" width=\"335\" height=\"248\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">71.53 KB</span></figcaption></a></figure><br>Kemudian kita dapat menghitung banyaknya tempat kosong untuk menentukan 4 tempat kosong pada<br>hari Senin maupun hari Selasa.<br><br><strong>Ini Informatika!</strong><br>Semua data dapat dipandang sebagai rangkaian nol dan satu. Setiap nol atau satu disebut sebagai bit<br>dan rangkaian bit disebut kode biner, representasi biner atau bilangan biner.<br>Pada kasus sini, kita dapat memodelkan tempat bersisi mobil sebagai satu (1) dan tempat kosong<br>sebagai nol (0); sehingga satu tempat parkir direpresentasikan dengan satu bit. Kita mendapatkan<br>rangkaian bit jika kita memandang bahwa tempat parkir berurutan. Misalnya kita mulai dari baris atas<br>kemudian baru baris bawah untuk memperoleh 101001001010 untuk arena parkir pada hari Senin dan<br>100100000111 untuk arena parkir pada hari Selasa.<br>Soal ini meminta anda untuk menentukan pasangan bit mana dari kedua belas posisi pada kedua<br>representasi biner yang keduanya bernilai nol (0).<br><br><strong>---------------</strong></p><p><strong>English Version<br></strong>We can determine which parking spots are occupied by placing the cars from both days in the parking area simultaneously. Then, we can count the number of empty spots to determine the 4 empty spots on both Monday and Tuesday.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:73244,&quot;height&quot;:248,&quot;href&quot;:&quot;http://comfypace.com/uploads/wRIl33Bk24o8SSnrFXUdhfIc2zfgy7MaKiuTWufK.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/wRIl33Bk24o8SSnrFXUdhfIc2zfgy7MaKiuTWufK.png&quot;,&quot;width&quot;:335}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/wRIl33Bk24o8SSnrFXUdhfIc2zfgy7MaKiuTWufK.png\"><img src=\"http://comfypace.com/uploads/wRIl33Bk24o8SSnrFXUdhfIc2zfgy7MaKiuTWufK.png\" width=\"335\" height=\"248\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">71.53 KB</span></figcaption></a></figure></p><p>This is Informatics! All data can be viewed as a sequence of zeros and ones. Each zero or one is called a bit, and a sequence of bits is called binary code, binary representation, or binary number.</p><p>In this case, we can model parking spaces with cars as one (1) and empty spaces as zero (0); thus, one parking spot is represented by one bit. We obtain a bit sequence if we consider parking spaces in order. For example, we start from the top row and then the bottom row to get 101001001010 for the parking area on Monday and 100100000111 for the parking area on Tuesday.</p><p>This problem asks you to determine which pairs of bits from the two representations, in all twelve positions, both have a value of zero (0).</p><p><br><br><br><br></p><p><br><br></p>'),
(32, 32, 16, 1, '<p>Yaya punya 3 gambar berang-berang bermain pedang dan perisai sebagai berikut.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:51821,&quot;height&quot;:165,&quot;href&quot;:&quot;http://comfypace.com/uploads/Yg9BM73cd8Nv35naHyNgj73qbhjmr903S6a8K3jU.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Yg9BM73cd8Nv35naHyNgj73qbhjmr903S6a8K3jU.png&quot;,&quot;width&quot;:606}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Yg9BM73cd8Nv35naHyNgj73qbhjmr903S6a8K3jU.png\"><img src=\"http://comfypace.com/uploads/Yg9BM73cd8Nv35naHyNgj73qbhjmr903S6a8K3jU.png\" width=\"606\" height=\"165\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">50.61 KB</span></figcaption></a></figure>Yaya ingin membuat sebuah gambar, di mana setiap pedang harus menunjuk pada berang-berang yang lain, dan setiap perisai harus menghalangi pedang yang ditunjukkan kepadanya.&nbsp;</p><p><strong>Tantangan</strong>:&nbsp;</p><p>Padankanlah 3 buah gambar (bilangan 1 sampai dengan 3) dengan ruangruang yang masih kosong (huruf A, B, C) agar didapat gambar yang diharapkan.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25120,&quot;height&quot;:278,&quot;href&quot;:&quot;http://comfypace.com/uploads/8SWvXQCJ5MYUdURE3KO6uE0WPP6IzyDW4EkXTm2j.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/8SWvXQCJ5MYUdURE3KO6uE0WPP6IzyDW4EkXTm2j.png&quot;,&quot;width&quot;:262}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/8SWvXQCJ5MYUdURE3KO6uE0WPP6IzyDW4EkXTm2j.png\"><img src=\"http://comfypace.com/uploads/8SWvXQCJ5MYUdURE3KO6uE0WPP6IzyDW4EkXTm2j.png\" width=\"262\" height=\"278\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.53 KB</span></figcaption></a></figure><strong>-----------------</strong></p><p><strong>English Version</strong></p><p>Yaya has 3 images of beavers playing with swords and shields as follows:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:51821,&quot;height&quot;:165,&quot;href&quot;:&quot;http://comfypace.com/uploads/Yg9BM73cd8Nv35naHyNgj73qbhjmr903S6a8K3jU.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Yg9BM73cd8Nv35naHyNgj73qbhjmr903S6a8K3jU.png&quot;,&quot;width&quot;:606}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Yg9BM73cd8Nv35naHyNgj73qbhjmr903S6a8K3jU.png\"><img src=\"http://comfypace.com/uploads/Yg9BM73cd8Nv35naHyNgj73qbhjmr903S6a8K3jU.png\" width=\"606\" height=\"165\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">50.61 KB</span></figcaption></a></figure></p><p>Yaya wants to create an image where each sword must point to another beaver, and each shield must block the sword that is pointing at it.</p><p><strong>Challenge:</strong></p><p>Match the 3 images (numbered 1 to 3) with the empty spaces (letters A, B, C) to obtain the expected image.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25120,&quot;height&quot;:278,&quot;href&quot;:&quot;http://comfypace.com/uploads/8SWvXQCJ5MYUdURE3KO6uE0WPP6IzyDW4EkXTm2j.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/8SWvXQCJ5MYUdURE3KO6uE0WPP6IzyDW4EkXTm2j.png&quot;,&quot;width&quot;:262}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/8SWvXQCJ5MYUdURE3KO6uE0WPP6IzyDW4EkXTm2j.png\"><img src=\"http://comfypace.com/uploads/8SWvXQCJ5MYUdURE3KO6uE0WPP6IzyDW4EkXTm2j.png\" width=\"262\" height=\"278\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.53 KB</span></figcaption></a></figure></p>', 5, '2023-10-10 09:43:42', '2023-10-14 09:56:17', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:20162,&quot;height&quot;:185,&quot;href&quot;:&quot;http://comfypace.com/uploads/TzskQkmsiE1BZ3Zl524LZvqHJeZ9h6XmexcokZR1.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/TzskQkmsiE1BZ3Zl524LZvqHJeZ9h6XmexcokZR1.png&quot;,&quot;width&quot;:224}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/TzskQkmsiE1BZ3Zl524LZvqHJeZ9h6XmexcokZR1.png\"><img src=\"http://comfypace.com/uploads/TzskQkmsiE1BZ3Zl524LZvqHJeZ9h6XmexcokZR1.png\" width=\"224\" height=\"185\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">19.69 KB</span></figcaption></a></figure><strong>Ini Informatika!</strong><br>Tantangan ini bisa menjadi sebuah teka-teki yang sangat rumit. Hanya dengan beberapa gambar,<br>menghasilkan banyak kombinasi yang bukan merupakan solusi yang benar.<br>Namun, dengan memakai pemikiran logika, kita bisa memangkas ruang pencarian dengan banyak.<br>Contohnya, hanya ada 1 berang-berang dalam tantangan ini yang memegang 2 perisai ke kanan dan ke<br>atas. Jadi berang-berang ini harus diletakkan di barisan bawah dan di sebelah pojok kiri untuk<br>menghalangi pedang dari sebelah kanan dan atas.<br>JIka ditambahkan dua gambar, sehingga ada 6 berang-berang, mencoba semua kombinasi tempatnya<br>akan membutuhkan banya waktu. Tetapi dengan memakai logika, maka dapat memangkas solusi yang<br>tidak mungkin.<br>Jika kita ingin mencari dengan teliti, kita bisa menggunakan algoritma Backtracking. Saat menggunakan<br>algoritma jenis ini, ruang pencarian bisa sangat luas. Inilah sebabnya proses pemangkasan sangat<br>penting.</p><p><strong>-----------------</strong></p><p><strong>English Version</strong></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:20162,&quot;height&quot;:185,&quot;href&quot;:&quot;http://comfypace.com/uploads/TzskQkmsiE1BZ3Zl524LZvqHJeZ9h6XmexcokZR1.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/TzskQkmsiE1BZ3Zl524LZvqHJeZ9h6XmexcokZR1.png&quot;,&quot;width&quot;:224}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/TzskQkmsiE1BZ3Zl524LZvqHJeZ9h6XmexcokZR1.png\"><img src=\"http://comfypace.com/uploads/TzskQkmsiE1BZ3Zl524LZvqHJeZ9h6XmexcokZR1.png\" width=\"224\" height=\"185\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">19.69 KB</span></figcaption></a></figure><strong>This is Informatics!</strong>&nbsp;</p><p>This challenge can be a very complex puzzle. With just a few pictures, it generates many combinations that are not the correct solution. However, with logical thinking, we can narrow down the search space significantly.</p><p>For example, there is only one badger in this challenge holding 2 shields to the right and above. So this badger must be placed in the bottom row and in the bottom-left corner to block the swords from the right and above.</p><p>If you add two more images, so there are 6 badgers, trying all the placement combinations would take a lot of time. But with logical thinking, you can eliminate solutions that are not possible.</p><p>If you want to search diligently, you can use the Backtracking algorithm. When using this type of algorithm, the search space can be very large. That\'s why the pruning process is crucial.</p>'),
(33, 33, 17, 1, '<p>Seekor cacing sedang duduk di ujung cabang sebuah pohon apel. Ia ingin makan semua apel yang ada lewat dahan pohon. Setiap bagian dahan, panjangnya 1 meter.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25874,&quot;height&quot;:288,&quot;href&quot;:&quot;http://comfypace.com/uploads/lklHUiXnInpOVOyT7JV8B6wzRXZHqp36Y6zW7Fru.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/lklHUiXnInpOVOyT7JV8B6wzRXZHqp36Y6zW7Fru.png&quot;,&quot;width&quot;:336}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/lklHUiXnInpOVOyT7JV8B6wzRXZHqp36Y6zW7Fru.png\"><img src=\"http://comfypace.com/uploads/lklHUiXnInpOVOyT7JV8B6wzRXZHqp36Y6zW7Fru.png\" width=\"336\" height=\"288\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">25.27 KB</span></figcaption></a></figure> <strong>Tantangan</strong>:&nbsp;</p><p>Berapa meter lintasan terpendek yang harus ditempuh untuk makan semua apel yang ada?&nbsp;</p><p><strong>---------------</strong></p><p><strong>English Version</strong></p><p>A worm is sitting at the end of a branch of an apple tree and wants to eat all the apples on the tree, which are on branches that are each 1 meter long.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25874,&quot;height&quot;:288,&quot;href&quot;:&quot;http://comfypace.com/uploads/lklHUiXnInpOVOyT7JV8B6wzRXZHqp36Y6zW7Fru.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/lklHUiXnInpOVOyT7JV8B6wzRXZHqp36Y6zW7Fru.png&quot;,&quot;width&quot;:336}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/lklHUiXnInpOVOyT7JV8B6wzRXZHqp36Y6zW7Fru.png\"><img src=\"http://comfypace.com/uploads/lklHUiXnInpOVOyT7JV8B6wzRXZHqp36Y6zW7Fru.png\" width=\"336\" height=\"288\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">25.27 KB</span></figcaption></a></figure></p><p><strong>Challenge:</strong></p><p>What is the shortest path the worm has to travel to eat all the apples?</p>', 5, '2023-10-10 09:45:45', '2023-10-14 09:57:45', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:38437,&quot;height&quot;:215,&quot;href&quot;:&quot;http://comfypace.com/uploads/7Is0Roplg2hphE6mLc5bfQsNnTx9rBx52NGZa56A.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/7Is0Roplg2hphE6mLc5bfQsNnTx9rBx52NGZa56A.png&quot;,&quot;width&quot;:231}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/7Is0Roplg2hphE6mLc5bfQsNnTx9rBx52NGZa56A.png\"><img src=\"http://comfypace.com/uploads/7Is0Roplg2hphE6mLc5bfQsNnTx9rBx52NGZa56A.png\" width=\"231\" height=\"215\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">37.54 KB</span></figcaption></a></figure><strong>Ini Informatika!</strong><br>Pada informatika, anda tidak hanya dituntut untuk merencanakan instruksi untuk menyelesaikan<br>persoalan, tetapi harus mencari solusi yang membutuhkan usaha minimal. Para ahli informatika<br>menyebutkan hal ini dengan membuat solusi yang optimal.<br>Cacing harus berjalan menelusuri 3 cabang pohon. Pohon dalam kasus ini adalah sebuah diagram di<br>mana beberapa titik penting dihubungkan oleh sepotong cabang. Diagram semacam itu juga disebut<br>graf. Pohon adalah sebuah graf khusus. Persoalan ini adalah menemukan suatu jalur tertentu dalam<br>graf yang paling pendek, mulai dari di mana cacing sedang duduk dan semua buah apel harus berada<br>dalam jalur tersebut.</p><p><strong>---------------</strong></p><p><strong>English Version</strong></p><p><strong>This is Informatics!</strong>&nbsp;</p><p>In informatics, you are not only required to plan instructions to solve a problem but also to find a solution that requires minimal effort. Computer experts refer to this as creating an optimal solution.</p><p>The worm needs to travel through 3 branches of a tree. In this case, the tree is a diagram where several key points are connected by a branch. Such a diagram is also called a graph. A tree is a special type of graph. The problem is to find a specific path in the graph that is the shortest, starting from where the worm is sitting, and all the apples must be on that path.</p>'),
(34, 34, 17, 1, '<p>Jack menggulirkan dadu sepanjang jalan tanpa pengeseran, tiga kali ke arah belakang dan dua kali berikutnya ke kanan (berhenti di jalan bertanda lingkaran putih.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:31993,&quot;height&quot;:195,&quot;href&quot;:&quot;http://comfypace.com/uploads/AM5wV1NQ0Z8gXWritAZll1im232ZVgekQwd4Of3k.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AM5wV1NQ0Z8gXWritAZll1im232ZVgekQwd4Of3k.png&quot;,&quot;width&quot;:379}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AM5wV1NQ0Z8gXWritAZll1im232ZVgekQwd4Of3k.png\"><img src=\"http://comfypace.com/uploads/AM5wV1NQ0Z8gXWritAZll1im232ZVgekQwd4Of3k.png\" width=\"379\" height=\"195\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">31.24 KB</span></figcaption></a></figure><strong>Tantangan</strong></p><p>&nbsp;Permukaan dengan angka berapakah yang menghadap ke atas?&nbsp;</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p><br>Jack rolls the die along the path without shifting, three times to the left and then two times to the right (stopping on the road with a white circle).</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:31993,&quot;height&quot;:195,&quot;href&quot;:&quot;http://comfypace.com/uploads/AM5wV1NQ0Z8gXWritAZll1im232ZVgekQwd4Of3k.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AM5wV1NQ0Z8gXWritAZll1im232ZVgekQwd4Of3k.png&quot;,&quot;width&quot;:379}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AM5wV1NQ0Z8gXWritAZll1im232ZVgekQwd4Of3k.png\"><img src=\"http://comfypace.com/uploads/AM5wV1NQ0Z8gXWritAZll1im232ZVgekQwd4Of3k.png\" width=\"379\" height=\"195\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">31.24 KB</span></figcaption></a></figure></p><p><strong>Challenge:</strong></p><p>What number is facing up on the die?</p>', 5, '2023-10-10 09:47:05', '2023-10-14 09:58:27', '<p>Jika pergerakan dadu ditelusuri, urutan dari permukaan yang di atas adalah: 6, 5, 1, 2, 4, 5.<br><strong>Ini Informatika!</strong><br>Ini adalah contoh pemecahan masalah dengan mengamati hanya sebagian informasi di setiap tahap.<br>Metode ini dapat mengurangi kerumitan dan penggunaan memori. Komputer sering diprogram seperti<br>ini.<br>Salah satu alternatif dari metode ini adalah melacak jumlah titik di bagian atas setelah setiap langkah,<br>dan memperhatikan bahwa pada dadu, sisi 6 berlawanan dengan 1; 5 dengan 2; 4 dengan 3;.</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>If the movements of the die are traced, the sequence of the upper face is: 6, 5, 1, 2, 4, 5.</p><p><strong>This is Informatics!</strong>&nbsp;</p><p>This is an example of problem-solving by observing only partial information at each stage. This method can reduce complexity and memory usage. Computers are often programmed in this way.</p><p>One alternative to this method is to track the number of dots on the top after each move and notice that on a die, side 6 is opposite side 1; 5 is opposite 2; and 4 is opposite 3.</p>'),
(36, 35, 19, 1, '<p>Jane rutin berjalan kaki ke sekolah. Jane suka mengubah rutenya setiap hari, namun dia hanya mengambil jalur menuju sekolah yang paling langsung. Berapa banyak rute berbeda yang dapat diambil Jane ke sekolah?</p><p>&nbsp;</p><p>----------</p><p>&nbsp;</p><p>Jane regularly walks to school. Jane likes to change her route each day, but she only takes paths to the school that are most direct. How many different routes can Jane take to school?</p><p><br></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:43532,&quot;height&quot;:334,&quot;href&quot;:&quot;http://comfypace.com/uploads/gLueLascKuMdUQKwITnvDq2TwyP9GMd5T2XUKn30.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/gLueLascKuMdUQKwITnvDq2TwyP9GMd5T2XUKn30.png&quot;,&quot;width&quot;:838}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/gLueLascKuMdUQKwITnvDq2TwyP9GMd5T2XUKn30.png\"><img src=\"http://comfypace.com/uploads/gLueLascKuMdUQKwITnvDq2TwyP9GMd5T2XUKn30.png\" width=\"838\" height=\"334\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">42.51 KB</span></figcaption></a></figure></p>', 5, '2023-10-12 13:55:25', '2023-10-13 02:54:25', '<p>Jane dapat berjalan kaki ke sekolah menggunakan tiga rute berbeda. Setiap rute menggunakan kombinasi jalan yang berbeda tetapi ketiga jalur tersebut membawanya ke sekolah.</p><p>---</p><p>Jane can walk to school using three different routes. Each route uses a different combination of roads but all three pathways lead her to the school.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:37811,&quot;height&quot;:238,&quot;href&quot;:&quot;http://comfypace.com/uploads/8q9c1DJSyrJ3xV5ttJDvDwb1xK1b8uvIq519iN3Y.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/8q9c1DJSyrJ3xV5ttJDvDwb1xK1b8uvIq519iN3Y.png&quot;,&quot;width&quot;:508}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/8q9c1DJSyrJ3xV5ttJDvDwb1xK1b8uvIq519iN3Y.png\"><img src=\"http://comfypace.com/uploads/8q9c1DJSyrJ3xV5ttJDvDwb1xK1b8uvIq519iN3Y.png\" width=\"508\" height=\"238\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">36.92 KB</span></figcaption></a></figure></p>'),
(37, 36, 19, 1, '<p>Anda sedang membangun sangkar burung untuk seorang teman yang telah memberi Anda petunjuk berikut:<br>Saya ingin sangkar burung dengan 2 jendela dan hati.</p><p>Sangkar burung mana yang sesuai dengan aturan tersebut?</p><p>&nbsp;&nbsp;</p><p>-------</p><p>&nbsp;</p><p>You are building a birdhouse for a friend who has given you these instructions:</p><p>I would like a birdhouse with 2 windows and a heart.</p><p>Which birdhouse fits those rules?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:45083,&quot;height&quot;:286,&quot;href&quot;:&quot;http://comfypace.com/uploads/AhAUG6MKJBIj9bLKniNNKwFfLTolCjQRJ440KmnE.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AhAUG6MKJBIj9bLKniNNKwFfLTolCjQRJ440KmnE.png&quot;,&quot;width&quot;:718}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AhAUG6MKJBIj9bLKniNNKwFfLTolCjQRJ440KmnE.png\"><img src=\"http://comfypace.com/uploads/AhAUG6MKJBIj9bLKniNNKwFfLTolCjQRJ440KmnE.png\" width=\"718\" height=\"286\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">44.03 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 02:52:22', '2023-10-13 02:54:30', '<p>Rumah 1 salah karena hanya mempunyai satu jendela dan dua hati.<br>Rumah 2 salah karena punya dua jendela, tapi tidak ada hati.<br>Rumah 4 salah karena hanya mempunyai satu jendela.</p><p>&nbsp;</p><p>------</p><p>&nbsp;</p><p>House 1 is not correct because it has only one window and two hearts.</p><p>House 2 is not correct because it has two windows, but no heart.</p><p>House 4 is not correct because it has only one window.</p>'),
(38, 37, 21, 1, '<p>Benjamin diminta mengisi sebuah kotak dengan berbagai bentuk. Kotak itu memiliki 9 bagian.<br>Aturan: Hanya boleh ada satu bentuk yang sama di setiap baris. Hanya boleh ada satu bentuk yang sama di setiap kolom.<br>Benjamin punya empat kesempatan!</p><p>Manakah dari kotak berikut yang benar?</p><p><br></p><p>------------</p><p><br></p><p>Benjamin is asked to fill a box with different shapes. The box has 9 sections.</p><p>Rules: There must be only one of the same shape in each row. There must be only one of the same shape in each column.</p><p>Benjamin has four goes!</p><p>Which of the following boxes is correct?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screen Shot 2023-10-13 at 12.46.41.png&quot;,&quot;filesize&quot;:22502,&quot;height&quot;:96,&quot;href&quot;:&quot;http://comfypace.com/uploads/1ChnHVB6VKPZEJzwMJArzz9GAKlDsO01ICuKduLk.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/1ChnHVB6VKPZEJzwMJArzz9GAKlDsO01ICuKduLk.png&quot;,&quot;width&quot;:302}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/1ChnHVB6VKPZEJzwMJArzz9GAKlDsO01ICuKduLk.png\"><img src=\"http://comfypace.com/uploads/1ChnHVB6VKPZEJzwMJArzz9GAKlDsO01ICuKduLk.png\" width=\"302\" height=\"96\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screen Shot 2023-10-13 at 12.46.41.png</span> <span class=\"attachment__size\">21.97 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 05:48:07', '2023-10-13 05:48:58', '<p>A is wrong because there is at least<br>1 column with two of the same shapes.</p><p>B is wrong because there is at least 1 row with two of the same shapes.</p><p>D is wrong because there is at least 1 row with two of the same shapes.</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(39, 38, 21, 1, '<p>Seekor cacing sedang duduk di ujung dahan pohon di sebelah kanan.<br>Ia ingin memakan semua apel dengan bergerak melalui dahan pohon.<br>Setiap bagian cabang dibuat bagian-bagian sepanjang 1 m.</p><p>Berapa jarak terpendek, dalam meter,<br>bahwa cacing harus merangkak untuk memakan semua apel?</p><p><br></p><p>-------------</p><p><br></p><p>A worm is sitting at the end of the branch of the tree shown to the right. It wants to eat all the apples by moving through the trees branches. Each branch section is made of 1m long sections.</p><p>What is the shortest distance, in metres, that the worm has to crawl to eat all the apples?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screen Shot 2023-10-13 at 12.52.08.png&quot;,&quot;filesize&quot;:15950,&quot;height&quot;:143,&quot;href&quot;:&quot;http://comfypace.com/uploads/jTblnLYeOjoAoZbJUlZqQcR0ycILlouQFbyuohIS.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/jTblnLYeOjoAoZbJUlZqQcR0ycILlouQFbyuohIS.png&quot;,&quot;width&quot;:205}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/jTblnLYeOjoAoZbJUlZqQcR0ycILlouQFbyuohIS.png\"><img src=\"http://comfypace.com/uploads/jTblnLYeOjoAoZbJUlZqQcR0ycILlouQFbyuohIS.png\" width=\"205\" height=\"143\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screen Shot 2023-10-13 at 12.52.08.png</span> <span class=\"attachment__size\">15.58 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 05:52:46', '2023-10-13 05:56:22', '<p>Cacing itu harus menjangkau semua apel.<br>4m dan 9m bukanlah jawaban yang benar, karena tidak mungkin menjangkau seluruh apel melalui 4 atau 9 bagian cabang saja. Sebuah jalan setapak sepanjang 13m memungkinkan cacing menjangkau semua apel. Pertama ia harus mencapai apel terdekat dan kemudian tiga apel sisanya. Perhatikan, tidak masalah bagaimana urutan cacing mencapai apel yang tersisa. Jalur sepanjang 15m terlalu panjang.</p><p><br></p><p>-------------</p><p><br></p><p>The worm has to reach all the apples.<br>4m and 9m are not the correct answers, because it is not possible to reach all apples passing 4 or 9 branch parts only. A path with a length of 13m allows the worm to reach all the apples. First it has to reach the closest apple and then the remaining three apples. Notice, it does not matter in which order the worm will reach the remaining apples. The 15m long path is too long.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:21186,&quot;height&quot;:194,&quot;href&quot;:&quot;http://comfypace.com/uploads/Qdp6swznjdf3qo4jr1cJlosl72UIUgHkiY2IvYQr.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Qdp6swznjdf3qo4jr1cJlosl72UIUgHkiY2IvYQr.png&quot;,&quot;width&quot;:203}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Qdp6swznjdf3qo4jr1cJlosl72UIUgHkiY2IvYQr.png\"><img src=\"http://comfypace.com/uploads/Qdp6swznjdf3qo4jr1cJlosl72UIUgHkiY2IvYQr.png\" width=\"203\" height=\"194\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">20.69 KB</span></figcaption></a></figure></p>'),
(40, 39, 20, 1, '<p>Terdapat 12 ruang untuk mobil di tempat parkir. Setiap ruang diberi label dengan nomor. Gambar di bawah menunjukkan ruang mana yang digunakan pada hari Senin dan ruang mana yang digunakan pada hari Selasa.</p><p>Berapa banyak tempat parkir yang kosong pada hari Senin dan Selasa?</p><p><br></p><p>-------------</p><p><br></p><p>There are 12 spaces for cars in a parking lot. Each space is labelled with a number. The pictures below show which spaces were used on Monday and which spaces were used on Tuesday.</p><p>How many parking spaces were empty both on Monday and Tuesday?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17437,&quot;height&quot;:115,&quot;href&quot;:&quot;http://comfypace.com/uploads/uxZLzqJ2FT9ZylXjEHJVGbZml0Dq6BBmB0cJc10k.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/uxZLzqJ2FT9ZylXjEHJVGbZml0Dq6BBmB0cJc10k.png&quot;,&quot;width&quot;:372}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/uxZLzqJ2FT9ZylXjEHJVGbZml0Dq6BBmB0cJc10k.png\"><img src=\"http://comfypace.com/uploads/uxZLzqJ2FT9ZylXjEHJVGbZml0Dq6BBmB0cJc10k.png\" width=\"372\" height=\"115\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">17.03 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 06:01:03', '2023-10-13 06:01:03', '<p>Hanya titik 13, 16, 18 dan 19 yang tidak ada mobil yang diparkir di dalamnya.</p><p><br></p><p>----------------</p><p><br></p><p>Only spots 13, 16, 18 and 19 did not have a car parked in them.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:14215,&quot;height&quot;:98,&quot;href&quot;:&quot;http://comfypace.com/uploads/3mKASbaoKC6EbQ6BG8IjDWXkxbpdzrxHi3HFWBVh.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/3mKASbaoKC6EbQ6BG8IjDWXkxbpdzrxHi3HFWBVh.png&quot;,&quot;width&quot;:204}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/3mKASbaoKC6EbQ6BG8IjDWXkxbpdzrxHi3HFWBVh.png\"><img src=\"http://comfypace.com/uploads/3mKASbaoKC6EbQ6BG8IjDWXkxbpdzrxHi3HFWBVh.png\" width=\"204\" height=\"98\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">13.88 KB</span></figcaption></a></figure></p>'),
(41, 40, 20, 1, '<p>Empat jejak kaki ditemukan di lumpur. Polisi sedang mencari perampok yang memakai sepatu dengan ciri-ciri sebagai berikut:</p><p> Sol memiliki pola garis-garis<br><br> Tumitnya tipis<br><br>Cetakan sepatu mana yang cocok dengan perampok?</p><p><br></p><p>--------------</p><p><br></p><p>Four footprints have been found in the mud. The police are looking for a robber who wore shoes with these properties:</p><p> The soles have a stripey pattern&nbsp;</p><p> The heel is thin</p><p>Which shoe print would match the robber?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:19864,&quot;height&quot;:127,&quot;href&quot;:&quot;http://comfypace.com/uploads/Lu06BtUPtnStXlqDuO7zUZ5BE5eOTXBvfQ0P7flX.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Lu06BtUPtnStXlqDuO7zUZ5BE5eOTXBvfQ0P7flX.png&quot;,&quot;width&quot;:365}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Lu06BtUPtnStXlqDuO7zUZ5BE5eOTXBvfQ0P7flX.png\"><img src=\"http://comfypace.com/uploads/Lu06BtUPtnStXlqDuO7zUZ5BE5eOTXBvfQ0P7flX.png\" width=\"365\" height=\"127\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">19.4 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 06:36:47', '2023-10-13 06:38:49', '<p>Jika Anda melihat semua cetakan sepatu di pertanyaan, hanya cetakan sepatu yang ditampilkan yang memiliki hak tipis dan sol bergaris.</p><p><br></p><p>---------------</p><p><br></p><p>If you look at all the shoe prints in the question, only the shoe print shown has both thin heels and a stripey sole.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:10321,&quot;height&quot;:126,&quot;href&quot;:&quot;http://comfypace.com/uploads/3vvjOvGWUIm9TZxLvouPkyOb84ybDWILS0GQpySW.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/3vvjOvGWUIm9TZxLvouPkyOb84ybDWILS0GQpySW.png&quot;,&quot;width&quot;:96}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/3vvjOvGWUIm9TZxLvouPkyOb84ybDWILS0GQpySW.png\"><img src=\"http://comfypace.com/uploads/3vvjOvGWUIm9TZxLvouPkyOb84ybDWILS0GQpySW.png\" width=\"96\" height=\"126\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">10.08 KB</span></figcaption></a></figure></p>'),
(42, 41, 22, 1, '<p>Edna si echidna ingin pergi ke sarang semut.<br>Untuk sampai ke sana dia harus mengumpulkan semua bir, semut merah.<br><br><strong>A</strong> Kanan, atas, kanan, bawah, kanan, atas, kanan<br><br><strong>B</strong> Kanan, atas, kanan, atas, kanan atas, kanan, bawah, kanan, bawah, kanan</p><p><strong>C</strong> Kanan, atas, kanan, atas, kiri, bawah, kanan</p><p><strong>D</strong> Kanan, atas, kanan, bawah, kanan, bawah, kanan</p><p>Serangkaian perintah apa yang akan membuat Edna mendapatkan semua semut merah?</p><p>----------</p><p><br></p><p>Edna the echidna wants to go to the anthill.<br>To get there she must collect all the lager, red ants.</p><p><strong>A&nbsp; </strong>Right, up, right, down, right, up, right</p><p><strong>B&nbsp; </strong>Right, up, right, up, right up, right, down, right, down, right</p><p><strong>C&nbsp; </strong>Right, up, right, up, left, down, right</p><p><strong>D&nbsp; </strong>Right, up, right, down, right, down, right</p><p>What set of commands would get Edna all the red ants?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:20080,&quot;height&quot;:105,&quot;href&quot;:&quot;http://comfypace.com/uploads/w4WIhMmWJTzbkQj8xFuDx8M9hlqfgSau7ALVEImv.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/w4WIhMmWJTzbkQj8xFuDx8M9hlqfgSau7ALVEImv.png&quot;,&quot;width&quot;:264}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/w4WIhMmWJTzbkQj8xFuDx8M9hlqfgSau7ALVEImv.png\"><img src=\"http://comfypace.com/uploads/w4WIhMmWJTzbkQj8xFuDx8M9hlqfgSau7ALVEImv.png\" width=\"264\" height=\"105\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">19.61 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 07:17:20', '2023-10-13 07:23:01', '<p>Semua jawaban dimulai dengan Edna berjalan langsung dari titik awal, namun hanya A yang mengumpulkan semua semut merah dan berakhir di bukit semut.<br>B tidak mungkin benar karena jalur yang dijelaskan tidak mengumpulkan semua semut merah.<br>C dan D tidak mungkin benar karena tidak mengikuti garis semut.</p><p><br></p><p>----------------</p><p><br></p><p>All answers begin with Edna walking right from the starting point, but only A collects all red ants and ends up at the ant hill.</p><p>B cant be right as the path described does not collect all red ants.</p><p>C and D cant be right as the paths as they do not follow the line of ants.</p>'),
(43, 42, 22, 1, '<p>Sally si ular akan menari.</p><p>Gambar manakah yang muncul selanjutnya dalam tarian tersebut?</p><p><br></p><p>-------------</p><p><br></p><p>Sally the snake is coming up with a dance.</p><p>Which image comes next in the dance?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:12974,&quot;height&quot;:74,&quot;href&quot;:&quot;http://comfypace.com/uploads/tYODBLILPUuvSRIU9PUKIXJvJlvih5SL98kRRZea.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/tYODBLILPUuvSRIU9PUKIXJvJlvih5SL98kRRZea.png&quot;,&quot;width&quot;:218}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/tYODBLILPUuvSRIU9PUKIXJvJlvih5SL98kRRZea.png\"><img src=\"http://comfypace.com/uploads/tYODBLILPUuvSRIU9PUKIXJvJlvih5SL98kRRZea.png\" width=\"218\" height=\"74\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">12.67 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 07:22:24', '2023-10-13 07:22:30', '<p>A, B &amp; D tidak mungkin benar karena tidak mengikuti pola perubahan posisi ekor ular pada setiap langkah tarian:<br>itu bisa lurus atau bengkok satu demi satu. Garis hitam kecil bertukar menjadi di atas atau di bawah garis hitam lebar pada setiap gerakan bergantian dan pada setiap langkah tarian kedua ular berputar (90 derajat) searah jarum jam.<br>Untuk memenuhi semua aturan tersebut langkah tarian selanjutnya kepala ular menunjuk ke arah yang baru (bawah), dengan ekor tetap tidak bergerak (lurus), dan garis hitam kecil bergerak melewati garis hitam lebar.</p><p><br></p><p>----------------</p><p><br></p><p>A, B &amp; D cant be right as it does not follow the pattern as the tail of the snake changes position in each dance step:<br>it is either a straight or bent after the other. The small black stripe swaps to be over or under the wide black stripe in each alternate move and in each second dance step the snake rotates (90 degrees) in a clockwise direction.</p><p>To meet all of these rules the next dance step the head of the snake points in new direction (down), with the tail remaining unmoved (straight), and the black small stripe moves over the wide black stripe.</p>'),
(44, 43, 23, 1, '<p>Lucilla sedang belajar cara makan pizza. Berikut aturan ibunya: Potongan yang berkulit harus dimakan dengan tangan.<br>Potongan tanpa kerak sebaiknya dimakan dengan garpu.<br><br>Berapa potong pizza yang harus dimakan dengan garpu?</p><p><br></p><p>--------------</p><p><br></p><p>Lucilla is learning how to eat pizza. Here are her Mums rules: Pieces with crust should be eaten with hands.<br>Pieces without crust should be eaten with a fork.</p><p>How many pieces of pizza should be eaten with a fork?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:27605,&quot;height&quot;:133,&quot;href&quot;:&quot;http://comfypace.com/uploads/ihkk3qfV9lQjXSNOWnkVRoZU6bSJ76pXXWBo1hKt.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/ihkk3qfV9lQjXSNOWnkVRoZU6bSJ76pXXWBo1hKt.png&quot;,&quot;width&quot;:164}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/ihkk3qfV9lQjXSNOWnkVRoZU6bSJ76pXXWBo1hKt.png\"><img src=\"http://comfypace.com/uploads/ihkk3qfV9lQjXSNOWnkVRoZU6bSJ76pXXWBo1hKt.png\" width=\"164\" height=\"133\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">26.96 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 07:33:04', '2023-10-13 07:33:39', '<p>Gambar menunjukkan hanya tiga potong yang tidak memiliki kerak yang dapat dimakan dengan garpu.</p><p><br></p><p>-----------------</p><p><br></p><p>The image shows the only three pieces that have no crust which would be eaten with a fork.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:23469,&quot;height&quot;:132,&quot;href&quot;:&quot;http://comfypace.com/uploads/uYnYXDhL8UPibhw8D70lmqvQasPAcBy88h9eZo5B.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/uYnYXDhL8UPibhw8D70lmqvQasPAcBy88h9eZo5B.png&quot;,&quot;width&quot;:147}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/uYnYXDhL8UPibhw8D70lmqvQasPAcBy88h9eZo5B.png\"><img src=\"http://comfypace.com/uploads/uYnYXDhL8UPibhw8D70lmqvQasPAcBy88h9eZo5B.png\" width=\"147\" height=\"132\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">22.92 KB</span></figcaption></a></figure></p>'),
(45, 44, 23, 1, '<p>Lingkaran hijau di sebelah kanan menunjukkan posisi enam pohon. Joni telah mengikatkan tali di sekelilingnya yang ditunjukkan dengan garis kuning.<br><br>Hanya lima pohon yang tersentuh tali.<br><br>Jika pohon-pohon di sebelah kanan dililitkan dengan tali dengan cara yang sama, berapa banyak pohon yang akan disentuh oleh tali tersebut?</p><p><br></p><p>-----------</p><p><br></p><p>The green circles on the right show the position of six trees. Joni has tied a rope around them shown by the yellow line.</p><p>Only five trees are touched by the rope.</p><p>If the trees shown on the right are wrapped with a rope in the same way, how many trees will be touched by the rope?</p><div class=\"attachment-gallery attachment-gallery--2\"><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:12309,&quot;height&quot;:92,&quot;href&quot;:&quot;http://comfypace.com/uploads/syyEoemBQq9jNsFjyet9gFOlOvwfderhtFFxj6p4.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/syyEoemBQq9jNsFjyet9gFOlOvwfderhtFFxj6p4.png&quot;,&quot;width&quot;:107}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/syyEoemBQq9jNsFjyet9gFOlOvwfderhtFFxj6p4.png\"><img src=\"http://comfypace.com/uploads/syyEoemBQq9jNsFjyet9gFOlOvwfderhtFFxj6p4.png\" width=\"107\" height=\"92\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">12.02 KB</span></figcaption></a></figure><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17170,&quot;height&quot;:137,&quot;href&quot;:&quot;http://comfypace.com/uploads/RfsVhxP5NnmPOWPijgFEvWYehxZQYasZ5VxBdBnk.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/RfsVhxP5NnmPOWPijgFEvWYehxZQYasZ5VxBdBnk.png&quot;,&quot;width&quot;:160}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/RfsVhxP5NnmPOWPijgFEvWYehxZQYasZ5VxBdBnk.png\"><img src=\"http://comfypace.com/uploads/RfsVhxP5NnmPOWPijgFEvWYehxZQYasZ5VxBdBnk.png\" width=\"160\" height=\"137\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">16.77 KB</span></figcaption></a></figure></div>', 5, '2023-10-13 07:48:53', '2023-10-13 07:49:36', '<p>Gambar menunjukkan bahwa enam pohon akan dilingkarkan jika seutas tali direntangkan mengelilingi pohon-pohon tersebut di luar kelompok.</p><p><br></p><p>--------------</p><p><br></p><p>The image shows that six trees would be looped if a rope was extended around the trees around the outside of the group.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:20149,&quot;height&quot;:132,&quot;href&quot;:&quot;http://comfypace.com/uploads/Hetyt6OTsqeI0OAX6DjbALil0Dsa7Yl0LU8hDv08.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Hetyt6OTsqeI0OAX6DjbALil0Dsa7Yl0LU8hDv08.png&quot;,&quot;width&quot;:175}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Hetyt6OTsqeI0OAX6DjbALil0Dsa7Yl0LU8hDv08.png\"><img src=\"http://comfypace.com/uploads/Hetyt6OTsqeI0OAX6DjbALil0Dsa7Yl0LU8hDv08.png\" width=\"175\" height=\"132\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">19.68 KB</span></figcaption></a></figure></p>'),
(46, 45, 24, 1, '<p>Sebuah taman dibagi menjadi beberapa persegi panjang. Angka pada setiap persegi panjang mewakili jumlah sampah yang ditinggalkan pengunjung.<br><br>Penjaga taman memiliki dua robot, Anton dan Boris, yang mengumpulkan semua sampah yang mereka temukan di setiap persegi panjang yang mereka masuki.<br><br>Robot diberi instruksi berikut:<br><br>Pertama, robot Anton dikirim:</p><p>Selanjutnya, robot Boris dikirim:</p><p>Berapa banyak sampah yang akan dikumpulkan Boris?</p><p>---------------</p><p><br></p><p>A park is divided into rectangles. The number in each rectangle represents the number of pieces of rubbish left there by visitors.</p><p>The park rangers have two robots, Anton and Boris, who collect all the rubbish they find in every rectangle they enter.</p><p>The robots were given the following instructions:</p><p>First, robot Anton was sent:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9176,&quot;height&quot;:28,&quot;href&quot;:&quot;http://comfypace.com/uploads/pBKJVnNXnPouuz7J7TUmnX5Sj3mFKPdmBPklxvdU.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/pBKJVnNXnPouuz7J7TUmnX5Sj3mFKPdmBPklxvdU.png&quot;,&quot;width&quot;:215}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/pBKJVnNXnPouuz7J7TUmnX5Sj3mFKPdmBPklxvdU.png\"><img src=\"http://comfypace.com/uploads/pBKJVnNXnPouuz7J7TUmnX5Sj3mFKPdmBPklxvdU.png\" width=\"215\" height=\"28\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.96 KB</span></figcaption></a></figure>Next, robot Boris was sent:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9169,&quot;height&quot;:33,&quot;href&quot;:&quot;http://comfypace.com/uploads/bOnbZNJvVXQs98nBve4UV7TqqIwDbAutWQAiEeuz.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/bOnbZNJvVXQs98nBve4UV7TqqIwDbAutWQAiEeuz.png&quot;,&quot;width&quot;:209}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/bOnbZNJvVXQs98nBve4UV7TqqIwDbAutWQAiEeuz.png\"><img src=\"http://comfypace.com/uploads/bOnbZNJvVXQs98nBve4UV7TqqIwDbAutWQAiEeuz.png\" width=\"209\" height=\"33\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.95 KB</span></figcaption></a></figure></p><p>How many pieces of rubbish will Boris collect?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:11489,&quot;height&quot;:136,&quot;href&quot;:&quot;http://comfypace.com/uploads/cQMc6Ql5qAJdlbuiDcY2NQnBAJ8uxmIwoprfQtNB.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/cQMc6Ql5qAJdlbuiDcY2NQnBAJ8uxmIwoprfQtNB.png&quot;,&quot;width&quot;:103}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/cQMc6Ql5qAJdlbuiDcY2NQnBAJ8uxmIwoprfQtNB.png\"><img src=\"http://comfypace.com/uploads/cQMc6Ql5qAJdlbuiDcY2NQnBAJ8uxmIwoprfQtNB.png\" width=\"103\" height=\"136\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">11.22 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 08:18:36', '2023-10-13 08:18:36', '<p>Boris akan mengumpulkan 3, lalu 6, lalu 0, sehingga totalnya 9.<br><br>Kotak terakhir tempat Boris mendarat akan berisi 0 buah karena Anton, yang pergi lebih dulu, pasti sudah mengumpulkannya.</p><p><br></p><p>-------------</p><p><br></p><p>Boris will collect 3, then 6, then 0, for a total of 9.</p><p>The last square that Boris lands in will have 0 pieces in it as Anton, who goes first, would have already collected them.</p>'),
(47, 46, 24, 1, '<p>Robot bergerak melalui labirin vertikal. Labirin terdiri dari berbagai platform. Robot dimulai dari pojok kiri atas lalu bergerak ke kanan.<br><br>Ketika mencapai ujung platform, ia jatuh ke platform di bawahnya.<br><br>Begitu robot mendarat, arahnya berubah. Akhirnya robot mencapai salah satu ember di dasar labirin.<br><br>Ember manakah yang akan dijangkau robot di labirin?</p><p>Gambar di sebelah kanan memberikan contoh bagaimana robot akan bergerak ke bawah.</p><p><br></p><p>---------------</p><p><br></p><p>A robot moves through a vertical maze. The maze consists of various platforms. The robot begins in the upper left corner and then moves to the right.</p><p>When it reaches the end of a platform, it falls down onto the platform below.</p><p>As soon as the robot lands it changes direction. Eventually the robot reaches one of the buckets at the bottom of the maze.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9560,&quot;height&quot;:106,&quot;href&quot;:&quot;http://comfypace.com/uploads/6EDhP8OZ2EoOWswXynW7pV5TBrdH3jYgBx97gdWU.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/6EDhP8OZ2EoOWswXynW7pV5TBrdH3jYgBx97gdWU.png&quot;,&quot;width&quot;:106}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/6EDhP8OZ2EoOWswXynW7pV5TBrdH3jYgBx97gdWU.png\"><img src=\"http://comfypace.com/uploads/6EDhP8OZ2EoOWswXynW7pV5TBrdH3jYgBx97gdWU.png\" width=\"106\" height=\"106\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9.34 KB</span></figcaption></a></figure></p><p>Which bucket will the robot reach in the maze?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9215,&quot;height&quot;:74,&quot;href&quot;:&quot;http://comfypace.com/uploads/ZW1snSuQSvXcW4MP7NmSjUs05pUw8loLP6vOcqk6.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/ZW1snSuQSvXcW4MP7NmSjUs05pUw8loLP6vOcqk6.png&quot;,&quot;width&quot;:75}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/ZW1snSuQSvXcW4MP7NmSjUs05pUw8loLP6vOcqk6.png\"><img src=\"http://comfypace.com/uploads/ZW1snSuQSvXcW4MP7NmSjUs05pUw8loLP6vOcqk6.png\" width=\"75\" height=\"74\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9 KB</span></figcaption></a></figure>The image on the right gives an example of how the robot will move down.</p>', 5, '2023-10-13 08:21:42', '2023-10-13 08:21:42', '<p>Robot mengikuti aturan dasar atau algoritma yang sama saat bergerak menyusuri labirin. Hal ini membuat robot terjatuh dengan pola yang berubah arah di setiap level labirin.</p><p><br></p><p>----------------</p><p><br></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:11119,&quot;height&quot;:123,&quot;href&quot;:&quot;http://comfypace.com/uploads/AE6TsNA8EAQDe07b9tuLQu8h2SqcPWoFCJh0hVnJ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AE6TsNA8EAQDe07b9tuLQu8h2SqcPWoFCJh0hVnJ.png&quot;,&quot;width&quot;:117}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AE6TsNA8EAQDe07b9tuLQu8h2SqcPWoFCJh0hVnJ.png\"><img src=\"http://comfypace.com/uploads/AE6TsNA8EAQDe07b9tuLQu8h2SqcPWoFCJh0hVnJ.png\" width=\"117\" height=\"123\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">10.86 KB</span></figcaption></a></figure></p><p>The robot follows the same basic rule, or algorithm when moving down the maze. This makes the robot fall in a pattern changing directions at each level of the maze.</p>'),
(48, 47, 25, 1, '<p>Ada mesin es krim khusus yang membuat kerucut dengan 4 sendok es krim.<br><br>Ia melakukannya dengan cara yang teratur. Di sini Anda melihat, dari kiri ke kanan, 3 es krim terakhir yang dibuat mesin tersebut.<br>Es krim manakah yang akan diproduksi mesin selanjutnya?</p><p><br></p><p>---------------</p><p><br></p><p>There is a special ice cream machine that creates cones with 4 scoops of ice cream.</p><p>It does so in an ordered way. Here you see, from left to right, the last 3 ice creams that the machine has made.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:11616,&quot;height&quot;:80,&quot;href&quot;:&quot;http://comfypace.com/uploads/9ou040mL0gr1B8xcV17IJppgLM9SLnG1HeuCesxX.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/9ou040mL0gr1B8xcV17IJppgLM9SLnG1HeuCesxX.png&quot;,&quot;width&quot;:81}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/9ou040mL0gr1B8xcV17IJppgLM9SLnG1HeuCesxX.png\"><img src=\"http://comfypace.com/uploads/9ou040mL0gr1B8xcV17IJppgLM9SLnG1HeuCesxX.png\" width=\"81\" height=\"80\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">11.34 KB</span></figcaption></a></figure></p><p>Which ice cream will the machine produce next?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:14860,&quot;height&quot;:91,&quot;href&quot;:&quot;http://comfypace.com/uploads/0tGk64cCDAa47TMMgpeRwhsqi5MVC5nrRmRVieik.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/0tGk64cCDAa47TMMgpeRwhsqi5MVC5nrRmRVieik.png&quot;,&quot;width&quot;:229}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/0tGk64cCDAa47TMMgpeRwhsqi5MVC5nrRmRVieik.png\"><img src=\"http://comfypace.com/uploads/0tGk64cCDAa47TMMgpeRwhsqi5MVC5nrRmRVieik.png\" width=\"229\" height=\"91\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.51 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 08:27:41', '2023-10-13 08:27:41', '<p>Urutan es krim selalu mengikuti pola:<br>kuning  biru  ungu  merah  kuning  biru  ungu  merah.<br>Dengan menerapkan pola ini, Anda dapat melihat bahwa A adalah es krim berikutnya dalam pola tersebut.</p><p><br></p><p>-------------------</p><p><br></p><p>The order of ice creams always follow a pattern:<br>yellow  blue  purple  red  yellow  blue  purple  red.</p><p>Applying this pattern you can see that A is the next ice cream in the pattern.</p>'),
(49, 48, 25, 1, '<p>Enam anak sedang bermain di halaman.<br>Salah satu dari mereka melempar bola dan memecahkan jendela Pak Berang-berang. Pak Berang-berang hanya melihat punggung anak itu yang melarikan diri. Anak itu berkemeja merah dan rambut hitam pendek.</p><p>Siapa yang memecahkan jendela?</p><p><br></p><p>---------------</p><p><br></p><p>Six children were playing in the yard.<br>One of them threw a ball and broke Mr. Beavers window. Mr. Beaver only saw the back of the child running away. The child had a red shirt and short dark hair.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:24298,&quot;height&quot;:128,&quot;href&quot;:&quot;http://comfypace.com/uploads/h9u0FTzTgjR6oLro9qKAjnECKjIvRz5dLkZpvpeM.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/h9u0FTzTgjR6oLro9qKAjnECKjIvRz5dLkZpvpeM.png&quot;,&quot;width&quot;:289}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/h9u0FTzTgjR6oLro9qKAjnECKjIvRz5dLkZpvpeM.png\"><img src=\"http://comfypace.com/uploads/h9u0FTzTgjR6oLro9qKAjnECKjIvRz5dLkZpvpeM.png\" width=\"289\" height=\"128\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">23.73 KB</span></figcaption></a></figure>Who broke the window?</p>', 5, '2023-10-13 08:29:45', '2023-10-13 08:29:45', '<p>Hanya tiga anak yang memakai baju merah: Jane, John dan Dan. Tapi Jane memiliki rambut pirang panjang dan rambut Dan berwarna ungu.<br>Jadi, itu pasti John.</p><p><br></p><p>-------------</p><p><br></p><p>Only three of the children wear a red shirt: Jane, John and Dan. But Jane has long blonde hair and Dans hair is violet.</p><p>So, it had to be John.</p>'),
(50, 49, 26, 1, '<p>Beatrix sedang mencoba mengatur ulang raknya. Dia memiliki dua aturan: 1. Benda berbentuk persegi panjang tidak boleh bersebelahan.<br>2. Benda berbentuk lingkaran tidak boleh berada di sebelah benda persegi panjang.Rak mana yang mengikuti peraturannya dengan benar?</p><p>Rak mana yang mengikuti peraturannya dengan benar?</p><p><br></p><p>-------------</p><p><br></p><p>Beatrix is trying to rearrange her shelf. She has two rules: 1. Rectangular items must not be next to each other.<br>2. Circular items must not be next to rectangular items.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17641,&quot;height&quot;:112,&quot;href&quot;:&quot;http://comfypace.com/uploads/CmAZO6fgC7ZJ9jp6k24rLd84TNlioeWUAVZ6kJRR.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/CmAZO6fgC7ZJ9jp6k24rLd84TNlioeWUAVZ6kJRR.png&quot;,&quot;width&quot;:262}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/CmAZO6fgC7ZJ9jp6k24rLd84TNlioeWUAVZ6kJRR.png\"><img src=\"http://comfypace.com/uploads/CmAZO6fgC7ZJ9jp6k24rLd84TNlioeWUAVZ6kJRR.png\" width=\"262\" height=\"112\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">17.23 KB</span></figcaption></a></figure>Which one of these shelves has followed her rules correctly?</p>', 5, '2023-10-13 08:38:56', '2023-10-13 08:38:56', '<p>A tidak mungkin benar karena ada benda-benda berbentuk persegi panjang yang menyatu.<br>B tidak mungkin benar karena ada benda berbentuk lingkaran di sebelah benda persegi panjang.<br>C tidak mungkin benar karena ada benda berbentuk lingkaran di sebelah benda persegi panjang.<br>Satu-satunya jawaban yang benar adalah D karena mengikuti aturan yang dinyatakan.</p><p><br></p><p>-----------------</p><p><br></p><p>A cant be right as there are rectangular objects together.</p><p>B cant be right as there is a circular object next to a rectangular object.</p><p>C cant be right as there is a circular object next to a rectangular object.</p><p>The only correct answer can be D as it follows the rules stated.</p>'),
(51, 50, 26, 1, '<p>Seekor berang-berang meletakkan lima botol di atas meja.<br><br>Dia menempatkannya sehingga setiap botol terlihat sedikit.<br><br>Dia meletakkan botol pertama di belakang meja dan meletakkan setiap botol baru di depan botol yang sudah ditempatkan.<br><br>Bagaimana urutan penempatan botol-botol tersebut jika tampak seperti pada gambar?</p><p><br></p><p>---------------------</p><p><br></p><p>A beaver puts five bottles on a table.</p><p>He places them so that every bottle has a bit showing.</p><p>He places the first bottle at the back of the table and puts each new bottle in front of those already placed.</p><p>In what order are the bottles placed when they appear as shown in the picture?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:19144,&quot;height&quot;:140,&quot;href&quot;:&quot;http://comfypace.com/uploads/7vlGkhDK9L5rPdOKS52piOPfzb5LhC0FQRpwYN8t.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/7vlGkhDK9L5rPdOKS52piOPfzb5LhC0FQRpwYN8t.png&quot;,&quot;width&quot;:204}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/7vlGkhDK9L5rPdOKS52piOPfzb5LhC0FQRpwYN8t.png\"><img src=\"http://comfypace.com/uploads/7vlGkhDK9L5rPdOKS52piOPfzb5LhC0FQRpwYN8t.png\" width=\"204\" height=\"140\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">18.7 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 08:41:15', '2023-10-13 08:41:15', '<p>Botol-botol tersebut perlu disortir berdasarkan bentuk dan ukurannya. Semakin lebar bagian atas atau tengah botol, maka semakin jauh letaknya di belakang meja.</p><p><br></p><p>---------------</p><p><br></p><p>The bottles need to be sorted based on their shape and size. The wider the top or the middle of the bottle, the further back it is placed on the table.</p>'),
(52, 51, 27, 1, '<p>Seekor tikus ingin meraih keju di ujung tabung 5. Tikus selalu mengikuti perintah berikut:<br><br>Turun ke bawah sampai ada persimpangan.<br>Di persimpangan, lanjutkan ke tabung vertikal berikutnya.<br>Pergi ke perintah 1.<br>Di tabung manakah tikus harus memulai agar dapat mencapai keju?</p><p><br></p><p>--------------</p><p><br></p><p>A mouse wants to reach the cheese at the end of tube 5. The mouse always follows these commands:</p><ol><li>Go downwards until a crossing.</li><li>At the crossing, move through to the next vertical tube.</li><li>Go to command 1.</li></ol><p>In which tube should the mouse start so that it reaches the cheese?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:12493,&quot;height&quot;:112,&quot;href&quot;:&quot;http://comfypace.com/uploads/QtaH9nNzlnkPAnS7Z5okzffzY6BQkShoSGyoG98k.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/QtaH9nNzlnkPAnS7Z5okzffzY6BQkShoSGyoG98k.png&quot;,&quot;width&quot;:167}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/QtaH9nNzlnkPAnS7Z5okzffzY6BQkShoSGyoG98k.png\"><img src=\"http://comfypace.com/uploads/QtaH9nNzlnkPAnS7Z5okzffzY6BQkShoSGyoG98k.png\" width=\"167\" height=\"112\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">12.2 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 08:45:16', '2023-10-13 08:45:16', '<p>Tikus harus selalu mengikuti aturan dan bergerak dengan pola yang sama.<br>Dari tabung 1 tikus selalu mencapai tabung 3.<br>Dari tabung 2 sampai ke tabung 1.<br>Dari tabung 4 sampai ke tabung 2.<br>Dari tabung 5 tikus sampai ke tabung 4.</p><p><br></p><p>-----------------</p><p><br></p><p>The mouse must always follow the rules and move in the same pattern.</p><p>From tube 1 the mouse always reaches tube 3.</p><p>From tube 2 it reaches tube 1.<br>From tube 4 it reaches tube 2.<br>From tube 5 the mouse gets to tube 4.</p>'),
(53, 52, 27, 1, '<p>Jane sedang bermain tebak-tebakan di komputer.<br><br>Jane mencoba menebak warna lima bunga berbeda<br>tersembunyi di dalam kuncup. Ketika Jane menebak warnanya dengan benar, kuncupnya terbuka dan memperlihatkan warna bunga yang benar.<br><br>Warna apa yang dipilih komputer untuk kelima bunga tersebut?</p><p><br></p><p>--------------------</p><p><br></p><p>Jane is playing a guessing game on the computer.</p><p>Jane tries to guess the colour of five different flowers<br>hidden within a bud. When Jane guesses the colour correctly the bud opens up and reveals the correct colour of the flower.</p><p>What colours did the computer choose for the five flowers?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:24779,&quot;height&quot;:90,&quot;href&quot;:&quot;http://comfypace.com/uploads/3cV368o2r2txLHqqohblWGvJqwDZ61i0SKFPguTw.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/3cV368o2r2txLHqqohblWGvJqwDZ61i0SKFPguTw.png&quot;,&quot;width&quot;:386}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/3cV368o2r2txLHqqohblWGvJqwDZ61i0SKFPguTw.png\"><img src=\"http://comfypace.com/uploads/3cV368o2r2txLHqqohblWGvJqwDZ61i0SKFPguTw.png\" width=\"386\" height=\"90\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.2 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 08:47:16', '2023-10-13 08:47:16', '<p>Bunga pertama berwarna merah muda jadi jawaban A tidak mungkin benar.<br>Bunga kedua harus berwarna biru karena bunganya tidak muncul ketika ditebak warna merah jambu dan jingga. Jadi jawaban D tidak mungkin benar.<br>Bunga keempat harus berwarna merah muda karena bunganya tidak muncul ketika ditebak warna oranye dan biru. Jadi jawaban B tidak mungkin benar.</p><p><br></p><p>-------------------</p><p><br></p><p>The first flower was pink so answer A cannot be correct.</p><p>The second flower must be blue because the flower did not appear when pink and orange were guessed. So answer D cannot be correct.</p><p>The fourth flower must be pink because the flower did not appear when orange and blue were guessed. So answer B cannot be correct.</p>'),
(54, 53, 28, 1, '<p>Ibu Berang-berang membeli sepuluh balon tiga warna dengan nomor seperti pada gambar:<br><br>0 Hijau<br><br>1 Kuning<br><br>2 Merah<br>3 Hijau<br><br>4 Kuning<br><br>5 Merah<br><br>... dll.<br><br>Jika Induk Berang-berang lahir pada tahun 1983, bisakah kamu memilih balon dengan urutan yang benar untuk menunjukkan tahun lahir Induk Berang-berang?</p><p><br></p><p>-------------</p><p><br></p><p>Mother Beaver bought ten balloons of three colours with the numbers as shown:</p><p>0 Green&nbsp;</p><p>1 Yellow&nbsp;</p><p>2 Red<br>3 Green&nbsp;</p><p>4 Yellow&nbsp;</p><p>5 Red</p><p>... etc.</p><p>If Mother Beaver was born in the year 1983, can you pick the balloons in the correct order to show Mother Beavers year of birth?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15226,&quot;height&quot;:117,&quot;href&quot;:&quot;http://comfypace.com/uploads/mMhlm3GCDeVQLLean56w9bnm5bfpfnx702dSAtHm.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/mMhlm3GCDeVQLLean56w9bnm5bfpfnx702dSAtHm.png&quot;,&quot;width&quot;:132}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/mMhlm3GCDeVQLLean56w9bnm5bfpfnx702dSAtHm.png\"><img src=\"http://comfypace.com/uploads/mMhlm3GCDeVQLLean56w9bnm5bfpfnx702dSAtHm.png\" width=\"132\" height=\"117\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.87 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 08:54:11', '2023-10-13 08:54:11', '<p>Pertanyaannya adalah balon yang bernomor 1 akan berwarna kuning dan yang bernomor 3 akan berwarna hijau. Jadi kita tahu jawabannya harus dimulai dengan warna kuning dan diakhiri dengan warna hijau. Kalau kita lanjutkan polanya, 6 berwarna hijau, 7 berwarna kuning, 8 berwarna merah, dan 9 berwarna hijau. Maka jawabannya harus kuning, hijau, merah, hijau.</p><p><br></p><p>-------------</p><p><br></p><p>The question states that the balloon with the number 1 on it will be yellow, and the 3 green. So we know the answer must start with yellow and end in green. If we continue the pattern, 6 is green, 7 is yellow, 8 is red and 9 is green. The answer therefore must be yellow, green, red, green.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:12699,&quot;height&quot;:144,&quot;href&quot;:&quot;http://comfypace.com/uploads/mS8joxkngfg3mpEFg14THPt3EcH1faHz3mWXuAQm.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/mS8joxkngfg3mpEFg14THPt3EcH1faHz3mWXuAQm.png&quot;,&quot;width&quot;:109}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/mS8joxkngfg3mpEFg14THPt3EcH1faHz3mWXuAQm.png\"><img src=\"http://comfypace.com/uploads/mS8joxkngfg3mpEFg14THPt3EcH1faHz3mWXuAQm.png\" width=\"109\" height=\"144\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">12.4 KB</span></figcaption></a></figure></p>'),
(55, 54, 28, 1, '<p>Beaver Bob telah menata meja sarapan seperti terlihat pada gambar, termasuk taplak meja, serbet, cangkir dan tatakan, pisau dan piring.<br><br>Dalam urutan manakah dia meletakkan benda-benda di atas meja?</p><p><br></p><p>-----------------</p><p><br></p><p>Beaver Bob has set the breakfast table as shown in the picture, including a tablecloth, napkin, cup and saucer, a knife and a plate.</p><p>In which order has he placed the objects on the table?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:22516,&quot;height&quot;:121,&quot;href&quot;:&quot;http://comfypace.com/uploads/m5aWu36QHxp0si3zbSAvJ8pQFG7khBuNjtWmt77H.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/m5aWu36QHxp0si3zbSAvJ8pQFG7khBuNjtWmt77H.png&quot;,&quot;width&quot;:153}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/m5aWu36QHxp0si3zbSAvJ8pQFG7khBuNjtWmt77H.png\"><img src=\"http://comfypace.com/uploads/m5aWu36QHxp0si3zbSAvJ8pQFG7khBuNjtWmt77H.png\" width=\"153\" height=\"121\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">21.99 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 08:59:31', '2023-10-13 08:59:39', '<p>Untuk mencari benda yang diletakkan di atas meja terlebih dahulu Anda dapat melihat setiap benda dan mengajukan pertanyaan, apakah benda ini berada di atas benda lain? Jika jawabannya ya, maka benda tersebut bukanlah benda pertama yang diletakkan di atas meja.</p><p><br></p><p>----------------</p><p><br></p><p>To find the object that was placed on the table first you can look at each object and ask the question, is this object on top of something else? If the answer is yes, the object was not the first item to be placed on the table.</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(56, 55, 29, 1, '<p>Makhluk lucu hidup di planet yang baru ditemukan.</p><p>Cocokkan makhluk itu dengan planet yang benar.</p><p><br></p><p>----------------</p><p><br></p><p>Cute creatures live in newly discovered planets.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:158930,&quot;height&quot;:464,&quot;href&quot;:&quot;http://comfypace.com/uploads/HANS39xWS19NtBSJuhZB8XsMxxkQsQAem2CbUJOv.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/HANS39xWS19NtBSJuhZB8XsMxxkQsQAem2CbUJOv.png&quot;,&quot;width&quot;:711}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/HANS39xWS19NtBSJuhZB8XsMxxkQsQAem2CbUJOv.png\"><img src=\"http://comfypace.com/uploads/HANS39xWS19NtBSJuhZB8XsMxxkQsQAem2CbUJOv.png\" width=\"711\" height=\"464\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">155.21 KB</span></figcaption></a></figure>Match the creature to the correct planet.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:108761,&quot;height&quot;:259,&quot;href&quot;:&quot;http://comfypace.com/uploads/M9dEyJ31tu6nIiTYge9hDGEUqy4iGxIpcxkBdfYZ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/M9dEyJ31tu6nIiTYge9hDGEUqy4iGxIpcxkBdfYZ.png&quot;,&quot;width&quot;:719}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/M9dEyJ31tu6nIiTYge9hDGEUqy4iGxIpcxkBdfYZ.png\"><img src=\"http://comfypace.com/uploads/M9dEyJ31tu6nIiTYge9hDGEUqy4iGxIpcxkBdfYZ.png\" width=\"719\" height=\"259\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">106.21 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 17:15:23', '2023-10-13 17:15:23', '<p>Cocokkan planet dengan makhluk penghuninya berdasarkan bentuk planet dan bentuk kepala. Jangan mencocokkan berdasarkan warna.</p><p><br></p><p>------------------</p><p><br></p><p>Match the planets with their resident creatures based on the shape of the planet and the shape of the head. Don\'t match based on color.</p>'),
(57, 56, 29, 1, '<p>Cocokkan tali sepatu dengan sepatu yang benar.</p><p><br></p><p>----------------</p><p><br></p><p>Match the shoestring to the correct shoe.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:177723,&quot;height&quot;:544,&quot;href&quot;:&quot;http://comfypace.com/uploads/dj0jtEPolyqBVhS9N7I0p71CzRYpuHTEoP7eycQ3.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/dj0jtEPolyqBVhS9N7I0p71CzRYpuHTEoP7eycQ3.png&quot;,&quot;width&quot;:752}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/dj0jtEPolyqBVhS9N7I0p71CzRYpuHTEoP7eycQ3.png\"><img src=\"http://comfypace.com/uploads/dj0jtEPolyqBVhS9N7I0p71CzRYpuHTEoP7eycQ3.png\" width=\"752\" height=\"544\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">173.56 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 17:17:49', '2023-10-13 17:17:49', '<p>Cocokkan sepatu dengan tali sepatu berdasarkan warnanya.</p><p><br></p><p>---------------</p><p><br></p><p><br>Match shoes with shoelaces based on their color.</p>'),
(58, 57, 30, 1, '<p>Berang-berang kecil mempunyai lima perangko.</p><p>Dengan menggunakan perangko ini, dia menciptakan sebuah lukisan:</p><p>Dalam urutan apa berang-berang kecil menggunakan prangko tersebut?</p><p>-------------</p><p><br></p><p>Little beaver has five stamps.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:106863,&quot;height&quot;:273,&quot;href&quot;:&quot;http://comfypace.com/uploads/pstu7hpDtgOlkFwGFRAOaHmokPk7pBD5ECNhUifq.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/pstu7hpDtgOlkFwGFRAOaHmokPk7pBD5ECNhUifq.png&quot;,&quot;width&quot;:655}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/pstu7hpDtgOlkFwGFRAOaHmokPk7pBD5ECNhUifq.png\"><img src=\"http://comfypace.com/uploads/pstu7hpDtgOlkFwGFRAOaHmokPk7pBD5ECNhUifq.png\" width=\"655\" height=\"273\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">104.36 KB</span></figcaption></a></figure>Using these stamps, he created a painting:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:65092,&quot;height&quot;:382,&quot;href&quot;:&quot;http://comfypace.com/uploads/U2bhQ81mNvQij9cSAGSVAlfeL15NHT8CwDns6AjU.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/U2bhQ81mNvQij9cSAGSVAlfeL15NHT8CwDns6AjU.png&quot;,&quot;width&quot;:359}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/U2bhQ81mNvQij9cSAGSVAlfeL15NHT8CwDns6AjU.png\"><img src=\"http://comfypace.com/uploads/U2bhQ81mNvQij9cSAGSVAlfeL15NHT8CwDns6AjU.png\" width=\"359\" height=\"382\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">63.57 KB</span></figcaption></a></figure>In what order did little beaver use the stamps?</p>', 5, '2023-10-13 17:25:37', '2023-10-13 17:26:17', '<p>Stempel yang digunakan pertama kali pasti terletak di paling belakang. Dan stempel berikutnya akan berada di atasnya. Karena itu, perhatikan stempel yang terletak paling belakang lalu stempel apa yang menumpuk di atasnya.&nbsp;</p><p><br></p><p>------------------</p><p><br></p><p>The stamp used for the first time must be located at the very back. And the next stamp will be above it. Therefore, pay attention to the stamp that is at the very back and then what stamps are stacked on top of it.</p>'),
(59, 58, 30, 1, '<p>Berang-berang kecil mempunyai enam perangko.</p><p>Dengan menggunakan perangko ini, ia menciptakan sebuah lukisan:</p><p>Dalam urutan apa berang-berang kecil menggunakan prangko tersebut?</p><p><br></p><p>-----------</p><p><br></p><p>Little beaver has six stamps.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:144847,&quot;height&quot;:364,&quot;href&quot;:&quot;http://comfypace.com/uploads/L6pTefmPq1OTgkyjXKa3AedPpX2FBrjuTsWXa88c.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/L6pTefmPq1OTgkyjXKa3AedPpX2FBrjuTsWXa88c.png&quot;,&quot;width&quot;:727}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/L6pTefmPq1OTgkyjXKa3AedPpX2FBrjuTsWXa88c.png\"><img src=\"http://comfypace.com/uploads/L6pTefmPq1OTgkyjXKa3AedPpX2FBrjuTsWXa88c.png\" width=\"727\" height=\"364\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">141.45 KB</span></figcaption></a></figure>By using these stamps, he created a painting:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:84563,&quot;height&quot;:276,&quot;href&quot;:&quot;http://comfypace.com/uploads/503Oxe3yu3qqNp3qgsKSiwG15w3RjpzRINP7GdWH.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/503Oxe3yu3qqNp3qgsKSiwG15w3RjpzRINP7GdWH.png&quot;,&quot;width&quot;:533}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/503Oxe3yu3qqNp3qgsKSiwG15w3RjpzRINP7GdWH.png\"><img src=\"http://comfypace.com/uploads/503Oxe3yu3qqNp3qgsKSiwG15w3RjpzRINP7GdWH.png\" width=\"533\" height=\"276\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">82.58 KB</span></figcaption></a></figure>In what order did little beaver use the stamps?</p>', 5, '2023-10-13 17:29:56', '2023-10-13 17:30:05', '<p>Stempel yang digunakan pertama kali pasti terletak di paling belakang. Dan stempel berikutnya akan berada di atasnya. Karena itu, perhatikan stempel yang terletak paling belakang lalu stempel apa yang menumpuk di atasnya.&nbsp;</p><p><br></p><p>-------------------</p><p><br></p><p>The stamp used for the first time must be located at the very back. And the next stamp will be above it. Therefore, pay attention to the stamp that is at the very back and then what stamps are stacked on top of it.</p>'),
(60, 59, 31, 1, '<p>Saat perayaan ulang tahun, ruangan didekorasi<br>dengan bendera.</p><p>Bendera mana yang akan ditambahkan selanjutnya?</p><p>-----------------</p><p><br></p><p>During a birthday celebration the room is decorated<br>with flags.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:63473,&quot;height&quot;:299,&quot;href&quot;:&quot;http://comfypace.com/uploads/2LjineAMth7qfp3mzyFEOF6lP0umYN0GAl9F3aqp.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/2LjineAMth7qfp3mzyFEOF6lP0umYN0GAl9F3aqp.png&quot;,&quot;width&quot;:749}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/2LjineAMth7qfp3mzyFEOF6lP0umYN0GAl9F3aqp.png\"><img src=\"http://comfypace.com/uploads/2LjineAMth7qfp3mzyFEOF6lP0umYN0GAl9F3aqp.png\" width=\"749\" height=\"299\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">61.99 KB</span></figcaption></a></figure></p><p>Which flag is going to be added next?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:42764,&quot;height&quot;:253,&quot;href&quot;:&quot;http://comfypace.com/uploads/FPqupk5D9WNDusTpunlYygfrTtu5l5xP124rauGS.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/FPqupk5D9WNDusTpunlYygfrTtu5l5xP124rauGS.png&quot;,&quot;width&quot;:717}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/FPqupk5D9WNDusTpunlYygfrTtu5l5xP124rauGS.png\"><img src=\"http://comfypace.com/uploads/FPqupk5D9WNDusTpunlYygfrTtu5l5xP124rauGS.png\" width=\"717\" height=\"253\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">41.76 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 17:33:14', '2023-10-13 17:33:14', '<p>Perhatikan pola bendera yang sudah terpasang. Bisa dilihat bahwa pola urutan bendera adalah seperti berikut: 3-1-1-2-2. Bendera terakhir di sebelah kanan adalah bendera nomor 3, jadi bendera selanjutnya adalah nomor 1.</p><p><br></p><p>----------------</p><p><br></p><p>Pay attention to the flag pattern that has been installed. It can be seen that the flag sequence pattern is as follows: 3-1-1-2-2. The last flag on the right is flag number 3, so the next flag is number 1.</p>'),
(61, 60, 31, 1, '<p>Robot mengendalikan mobil menggunakan perintah berikut.<br>Maju 1:  menarik garis satu persegi ke depan. Ada bisa<br>menjadi nomor berapa pun.<br>Kiri:  belok kiri sembilan puluh derajat.<br>Kanan:  belok kanan sembilan puluh derajat.<br><br>Yang mana dari program di bawah ini yang menggerakkan mobil<br>Negeri Berang-berang?</p><p><br></p><p>---------------</p><p><br></p><p>A robot controls a car using the following commands.<br>Forward 1:  draw a line one square forward. There can<br>be any number.<br>Left:  turn left ninety degrees.<br>Right:  turn right ninety degrees.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:77115,&quot;height&quot;:316,&quot;href&quot;:&quot;http://comfypace.com/uploads/tMErElTIa6nNCikJX9OIaIzKNJiWEhOXkwujkvsG.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/tMErElTIa6nNCikJX9OIaIzKNJiWEhOXkwujkvsG.png&quot;,&quot;width&quot;:716}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/tMErElTIa6nNCikJX9OIaIzKNJiWEhOXkwujkvsG.png\"><img src=\"http://comfypace.com/uploads/tMErElTIa6nNCikJX9OIaIzKNJiWEhOXkwujkvsG.png\" width=\"716\" height=\"316\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">75.31 KB</span></figcaption></a></figure></p><p>Which one of the programs below drives the car to<br>Beaverland?</p>', 5, '2023-10-13 17:37:52', '2023-10-13 17:37:52', '<p>Perhatikan bagian depan mobil. Mobil perlu bergerak maju atau belok sesuai dengan ke arah mana mobil sedang menghadap. Dari gambar dapat terlihat bahwa awalnya mobil perlu melakukan hal berikut:</p><ul><li>maju 1 kotak</li><li>Lalu berputar ke arah kanan mobil</li><li>maju lagi 1 langkah</li><li>berputar ke arah kiri</li><li>Maju 3 kotak</li></ul><p><br></p><p>-------------------</p><p><br></p><p>Pay attention to the front of the car. The car needs to move forward or turn according to which direction the car is facing. From the figure it can be seen that initially the car needs to do the following:<br><br></p><p>Go forward 1 box</p><p>Then turn to the right of the car.</p><p>Take another step forward</p><p>Totate to the left</p><p>Go forward 3 squares</p>'),
(62, 61, 32, 1, '<p>Robot mengenali beberapa cookie berbentuk geometris:<br>persegi, lingkaran dan segitiga. Kami akan menandainya<br>dengan S, C dan T.<br>Robot mengetahui perintah PUT  memasang cookie<br>yang lainnya. Saat robot menyelesaikan perintah<br>PUT S PUT C PUT C PUT T, tumpukan kuenya terlihat seperti ini:</p><p>Akan terlihat seperti apa tumpukan kue tersebut saat robot<br>menyelesaikan perintah: PUT S PUT S PUT C PUT T PUT C?</p><p><br></p><p>-------------</p><p><br></p><p>A robot recognises several geometric shaped cookies:<br>square, circle and triangle. We are going to mark them<br>with S, C and T.<br>The robot knows a command PUT  puts a cookie on<br>another one. When the robot finishes the commands<br>PUT S PUT C PUT C PUT T, a pile of cookies looks like this:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:64227,&quot;height&quot;:301,&quot;href&quot;:&quot;http://comfypace.com/uploads/NYzbXCnl5MDL3Ys1kb1k7GVAmn7GvSTBqshG69Sc.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/NYzbXCnl5MDL3Ys1kb1k7GVAmn7GvSTBqshG69Sc.png&quot;,&quot;width&quot;:570}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/NYzbXCnl5MDL3Ys1kb1k7GVAmn7GvSTBqshG69Sc.png\"><img src=\"http://comfypace.com/uploads/NYzbXCnl5MDL3Ys1kb1k7GVAmn7GvSTBqshG69Sc.png\" width=\"570\" height=\"301\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">62.72 KB</span></figcaption></a></figure>What will the pile of cookies look like when the robot<br>finishes the commands: PUT S PUT S PUT C PUT T PUT C?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:85322,&quot;height&quot;:186,&quot;href&quot;:&quot;http://comfypace.com/uploads/lsh8Jj6k9PmvUT80GQyXWdzmIZgyAJyfQoMIJHl9.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/lsh8Jj6k9PmvUT80GQyXWdzmIZgyAJyfQoMIJHl9.png&quot;,&quot;width&quot;:655}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/lsh8Jj6k9PmvUT80GQyXWdzmIZgyAJyfQoMIJHl9.png\"><img src=\"http://comfypace.com/uploads/lsh8Jj6k9PmvUT80GQyXWdzmIZgyAJyfQoMIJHl9.png\" width=\"655\" height=\"186\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">83.32 KB</span></figcaption></a></figure></p>', 5, '2023-10-13 17:42:09', '2023-10-23 12:35:16', '<p>Perlu diketahui dulu bahwa arti S=Square (kotak), C=Circle (lingkaran) dan T=Triangle (segitiga). Maka perintah PUT S PUT S PUT C PUT T PUT C akan menghasilkan urutan dari paling bawah sebagai berikut: kotak-kotak-lingkaran-segitiga-lingkaran</p><p><br></p><p>--------------------</p><p><br></p><p>Please note first that the meaning of S=Square (square), C=Circle (circle) and T=Triangle (triangle). Then the command PUT S PUT S PUT C PUT T PUT C will produce the following sequence from the bottom: square-square-circle-triangle-circle</p>'),
(63, 62, 32, 1, '<p>Ayah berang-berang sedang memilih gambar, dimana:<br>1) Dukun, tidak mempunyai tokoh dalam gambar<br>tongkat dan<br>2) Semua kancing jas sudah terpasang.</p><p>Gambar manakah yang benar?</p><p>--------------</p><p><br></p><p>Father beaver is choosing a picture, where:<br>1) Shaman, the character in the picture does not have<br>a stick and<br>2) All coat buttons are fastened.</p><p>Which is the right picture?</p>', 5, '2023-10-13 17:46:56', '2023-10-13 17:46:56', '<p>Ada 2 syarat yang perlu diperhatikan. Yang pertama adalah Shaman tidak memiliki tongkat, maka jawaban B pasti salah. Syarat kedua adalah semua kancing jaket dikancingkan. Maka jawaban A dan D adalah salah. Jadi jawaban yang benar adalah C.</p><p><br></p><p>----------------</p><p><br></p><p>There are 2 conditions that need to be considered. The first is that the Shaman does not have a wand, so answer B must be wrong. The second requirement is that all jacket buttons are buttoned. So answers A and D are wrong. So the correct answer is C.</p>'),
(64, 63, 33, 1, '<p>Terdapat 3 kotak berisi kancing. Hitunglah kancing-kancing di luar kotak yang bentuknya mirip dengan kancing-kancing di setiap kotak.</p><p>Berapa banyak kancing jahit yang ada di dalam setiap kotak?<br>putranya sudah selesai?</p><p><br></p><p>------------------</p><p><br></p><p>Mother beaver started to sort sewing buttons and asked<br>her son to finish the job.</p><p><br></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:227565,&quot;height&quot;:557,&quot;href&quot;:&quot;http://comfypace.com/uploads/U5gge4rInD4cNWE2TpmoTOYbBTmv7SOtQpBv8ie9.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/U5gge4rInD4cNWE2TpmoTOYbBTmv7SOtQpBv8ie9.png&quot;,&quot;width&quot;:729}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/U5gge4rInD4cNWE2TpmoTOYbBTmv7SOtQpBv8ie9.png\"><img src=\"http://comfypace.com/uploads/U5gge4rInD4cNWE2TpmoTOYbBTmv7SOtQpBv8ie9.png\" width=\"729\" height=\"557\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">222.23 KB</span></figcaption></a></figure>How many sewing buttons are inside each box when<br>her son has finished?</p>', 5, '2023-10-13 17:52:39', '2023-10-13 18:13:39', '<p>Ada 3 box yang sudah terisi kancing. Hitung kancing di luar box yang memiliki bentuk serupa dengan kancing yang ada di masing-masing box.</p><p><br></p><p>---------------</p><p><br></p><p>There are 3 boxes filled with buttons. Count the buttons outside the boxes that have a similar shape to the buttons in each box.</p><p><br></p>'),
(65, 64, 33, 1, '<p>Sabuk bulu bermotif berang-berang telah kehilangan tiga bulu.</p><p>Bulu apa yang harus ada di ikat pinggang?</p><p><br></p><p>-----------------</p><p><br></p><p>Beavers patterned feather belt has lost three feathers.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:179636,&quot;height&quot;:578,&quot;href&quot;:&quot;http://comfypace.com/uploads/mbDGyYKw3JMHWkCkY42kkburQnsRGeB80rgUjfF9.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/mbDGyYKw3JMHWkCkY42kkburQnsRGeB80rgUjfF9.png&quot;,&quot;width&quot;:755}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/mbDGyYKw3JMHWkCkY42kkburQnsRGeB80rgUjfF9.png\"><img src=\"http://comfypace.com/uploads/mbDGyYKw3JMHWkCkY42kkburQnsRGeB80rgUjfF9.png\" width=\"755\" height=\"578\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">175.43 KB</span></figcaption></a></figure></p><p>Which feathers should be on the belt?</p>', 5, '2023-10-13 17:58:06', '2023-10-13 18:17:02', '<p>Pada bulu yang tersisa di sabuk, dapat kita lihat ada pola yang tersisa yaitu&nbsp;</p><ul><li>2 bulu merah terletak bersebelahan</li><li>2 bulu kuning terletak bersebelahan</li></ul><p>Dari kedua pula di atas bisa disimpulkan bahwa pada posisi no 1 mestinya diisi dengan bulu berwarna merah dan posisi no 2 diisi bulu kuning. Setelah posisi no 1 dan 2 diisi, maka akan menghasilkan pola baru yaitu:</p><ul><li>Setelah 2 bulu merah, diikuti 1 bulu hijau</li></ul><p>Karena itu posisi no 3 akan diisi bulu hijau.&nbsp;</p><p><br></p><p>Hasil akhir pola adalah berikut: merah-merah-hijau-kuning-kuning</p><p><br></p><p>---------------</p><p><br></p><p>On the remaining feathers on the belt, we can see that there is a pattern remaining, namely<br>2 red feathers located next to each other<br>2 yellow feathers located next to each other<br>From the two things above, it can be concluded that position number 1 should be filled with red feathers and position number 2 should be filled with yellow feathers. After positions 1 and 2 are filled, a new pattern will be produced, namely:<br>After 2 red feathers, followed by 1 green feather<br>Therefore, position number 3 will be filled with green feathers.<br><br>The final result of the pattern is as follows: red-red-green-yellow-yellow</p>'),
(66, 65, 34, 1, '<p>Gadis berang-berang kecil mempunyai setumpuk kartu yang panjang. Dia ingin<br>bagilah menjadi potongan-potongan kecil yang sama seperti yang dipegangnya<br>tangan.</p><p>Berapa jumlah maksimum potongan kecil yang bisa dia dapat<br>membuat?</p><p><br></p><p>--------------</p><p><br></p><p>Little beaver girl has a long strip of card. She wants to<br>divide it into the same small strips as she is holding in her<br>hand.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:133177,&quot;height&quot;:493,&quot;href&quot;:&quot;http://comfypace.com/uploads/KjIB3OraLaO6nA5OGw8OTHi03ZIU4E4gFG8dJ8Ul.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/KjIB3OraLaO6nA5OGw8OTHi03ZIU4E4gFG8dJ8Ul.png&quot;,&quot;width&quot;:734}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/KjIB3OraLaO6nA5OGw8OTHi03ZIU4E4gFG8dJ8Ul.png\"><img src=\"http://comfypace.com/uploads/KjIB3OraLaO6nA5OGw8OTHi03ZIU4E4gFG8dJ8Ul.png\" width=\"734\" height=\"493\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">130.06 KB</span></figcaption></a></figure></p><p>What is the maximum number of small strips she can<br>make?</p>', 5, '2023-10-13 18:01:48', '2023-10-13 18:01:48', '<p>Perhatikan pola yang ada pada pita pendek yang dipegang dan pola yang ada pada pita panjang. Selanjutnya cari ada berapa pola pita pendek yang terdapat pada pita panjang. Dari situ bisa kita lihat bahwa ada 4 pola yang bisa kita temukan.</p><p><br></p><p>-------------------</p><p><br></p><p>Pay attention to the pattern on the short ribbon you are holding and the pattern on the long ribbon. Next, look for how many short ribbon patterns there are on the long ribbon. From there we can see that there are 4 patterns that we can find.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:37366,&quot;height&quot;:55,&quot;href&quot;:&quot;http://comfypace.com/uploads/JnksKSXTclLtTBU6bplPPuLSVckic8T0rusdixoi.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/JnksKSXTclLtTBU6bplPPuLSVckic8T0rusdixoi.png&quot;,&quot;width&quot;:598}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/JnksKSXTclLtTBU6bplPPuLSVckic8T0rusdixoi.png\"><img src=\"http://comfypace.com/uploads/JnksKSXTclLtTBU6bplPPuLSVckic8T0rusdixoi.png\" width=\"598\" height=\"55\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">36.49 KB</span></figcaption></a></figure></p>'),
(67, 66, 34, 1, '<p>Hiasan pohon natal sebaiknya ditempatkan di dalam kotak<br>sebagai berikut:<br>Kotak pertama: Besar dan bulat<br>Kotak ke-2: Kecil dan bulat<br>Kotak ke-3: Panjang dan bergaris<br>Kotak ke-4: Bintang dan kepingan salju</p><p>Dekorasi mana yang tidak muat di salah satu dari empat kotak berikut?</p><p><br></p><p>-------------</p><p><br></p><p>Christmas tree decorations should be placed in boxes<br>as follows:<br>1st box: Large and rounded<br>2nd box: Small and rounded<br>3rd box: Long and striped<br>4th box: Stars and snowflakes</p><div class=\"attachment-gallery attachment-gallery--2\"><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:84072,&quot;height&quot;:357,&quot;href&quot;:&quot;http://comfypace.com/uploads/hC8ohhZXmQKgwQNUP2k5L3K2nvCfsndY4NnyXl4g.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/hC8ohhZXmQKgwQNUP2k5L3K2nvCfsndY4NnyXl4g.png&quot;,&quot;width&quot;:334}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/hC8ohhZXmQKgwQNUP2k5L3K2nvCfsndY4NnyXl4g.png\"><img src=\"http://comfypace.com/uploads/hC8ohhZXmQKgwQNUP2k5L3K2nvCfsndY4NnyXl4g.png\" width=\"334\" height=\"357\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">82.1 KB</span></figcaption></a></figure><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:102490,&quot;height&quot;:256,&quot;href&quot;:&quot;http://comfypace.com/uploads/btT7arjiTa3o3hVaf1u5vBKSDooUtE5NJaoBOMin.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/btT7arjiTa3o3hVaf1u5vBKSDooUtE5NJaoBOMin.png&quot;,&quot;width&quot;:711}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/btT7arjiTa3o3hVaf1u5vBKSDooUtE5NJaoBOMin.png\"><img src=\"http://comfypace.com/uploads/btT7arjiTa3o3hVaf1u5vBKSDooUtE5NJaoBOMin.png\" width=\"711\" height=\"256\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">100.09 KB</span></figcaption></a></figure></div><p>Which decorations do not fit in any of these four boxes?</p>', 5, '2023-10-13 18:07:00', '2023-10-13 18:07:00', '<p>Perhatikan syarat yang ditetapkan untuk masing-masing kotak. Kemudian perhatikan setiap hiasan yang ada di pohon natal. Cari bentuk hiasan yang tidak termasuk dalam syarat masing-masing kotak. Kita bisa lihat bahwa hiasan yang tidak termasuk dalam semua kotak adalah yang berbentuk segitiga, kotak dan rumah.</p><p><br></p><p>-------------</p><p><br></p><p>Pay attention to the conditions set for each box. Then pay attention to every decoration on the Christmas tree. Look for decorative shapes that are not included in the requirements of each box. We can see that the decorations that are not included in all the boxes are those in the form of triangles, squares and houses.</p>'),
(68, 67, 35, 1, '<p>Manakah dari pernyataan tersebut yang benar?<br>A. Berang-berang lebih berat dari pada printer dan sepeda motor<br>lebih berat dari berang-berang.<br>B. Berang-berang lebih berat dari pada printer dan sepeda motor<br>lebih ringan dari berang-berang.<br>C. Berang-berang lebih ringan dibandingkan printer dan sepeda motor<br>lebih berat dari berang-berang.</p><p><br></p><p>-----------------</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:154758,&quot;height&quot;:489,&quot;href&quot;:&quot;http://comfypace.com/uploads/Lvpmgzpqmya6jK4iMzGB2dq5ykP31gH2h8W6VUl4.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Lvpmgzpqmya6jK4iMzGB2dq5ykP31gH2h8W6VUl4.png&quot;,&quot;width&quot;:730}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Lvpmgzpqmya6jK4iMzGB2dq5ykP31gH2h8W6VUl4.png\"><img src=\"http://comfypace.com/uploads/Lvpmgzpqmya6jK4iMzGB2dq5ykP31gH2h8W6VUl4.png\" width=\"730\" height=\"489\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">151.13 KB</span></figcaption></a></figure>Which one of those statements is correct?<br>A. Beaver is heavier than the printer and motorcycle is<br>heavier than beaver.<br>B. Beaver is heavier than the printer and motorcycle is<br>lighter than beaver.<br>C. Beaver is lighter than the printer and motorcycle is<br>heavier than beaver.</p>', 5, '2023-10-13 18:21:03', '2023-10-13 18:21:03', '<p>Mari kita cek dulu gambar yang ada. Dapat kita simpulkan bahwa:</p><ul><li>Berang-berang lebih berat dari printer</li><li>Berat 2 berang-berang sama dengan sepeda motor, yang artinya berang-berang lebih ringan dari sepeda motor.</li></ul><p>Selanjutnya kita cek setiap pernyataan yang ada. Bisa kita lihat bahwa pernyataan 2 dan 3 salah.</p><p><br></p><p>---------</p><p><br></p><p>Let\'s first check the existing images. We can conclude that:<br>Beavers are heavier than printers<br>The weight of 2 beavers is the same as a motorbike, which means the beaver is lighter than a motorbike.<br>Next, we check each existing statement. We can see that statements 2 and 3 are wrong.</p>'),
(69, 68, 35, 1, '<p>Hanya ada dua angka di Beaverland: 0 dan 1.</p><p>Saat perayaan ulang tahun membakar lilin artinya 1<br>dan tidak menyala berarti 0.<br>Berapa umur berang-berang?</p><p><br></p><p>----------------</p><p><br></p><p>There are only two numbers in Beaverland: 0 and 1.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:156867,&quot;height&quot;:601,&quot;href&quot;:&quot;http://comfypace.com/uploads/E3OpSsTq0YwE4XcfONQXHVAbOfhVnOpXwBK330zy.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/E3OpSsTq0YwE4XcfONQXHVAbOfhVnOpXwBK330zy.png&quot;,&quot;width&quot;:653}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/E3OpSsTq0YwE4XcfONQXHVAbOfhVnOpXwBK330zy.png\"><img src=\"http://comfypace.com/uploads/E3OpSsTq0YwE4XcfONQXHVAbOfhVnOpXwBK330zy.png\" width=\"653\" height=\"601\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">153.19 KB</span></figcaption></a></figure></p><p>There are only two numbers in Beaverland: 0 and 1.</p>', 5, '2023-10-13 18:24:41', '2023-10-13 18:24:41', '<p>Dijelaskan bahwa lilin yang menyala artinya 1 dan lilin yang mati artinya 0. Kita lihat pada kue tart ada 2 lilin nyala dan 2 lilin mati, jadi kode yang dihasilkan adalah 1100. Pada tabel di sebelah kiri dapat kita lihat bahwa kode 1100 adalah untuk angka 12.&nbsp;</p><p><br></p><p>-------------</p><p><br></p><p>It is explained that a lit candle means 1 and a dead candle means 0. We see that in the tart cake there are 2 candles on and 2 candles off, so the resulting code is 1100. In the table on the left we can see that the code 1100 is for the number 12 .</p>'),
(70, 69, 36, 1, '<p>Tindakan pagi hari harus dilakukan dalam urutan yang benar. Sayangnya, di sana<br>adalah sebuah kesalahan.<br><br>Manakah dua tindakan yang urutannya salah?</p><p><br></p><p>-----------------</p><p><br></p><p>Morning actions should be performed in the correct sequence. Unfortunately, there<br>is a mistake.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:267138,&quot;height&quot;:778,&quot;href&quot;:&quot;http://comfypace.com/uploads/RpecHj9wZom32Y82QiMkpx52tcdOERiP5Nr4fd3j.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/RpecHj9wZom32Y82QiMkpx52tcdOERiP5Nr4fd3j.png&quot;,&quot;width&quot;:455}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/RpecHj9wZom32Y82QiMkpx52tcdOERiP5Nr4fd3j.png\"><img src=\"http://comfypace.com/uploads/RpecHj9wZom32Y82QiMkpx52tcdOERiP5Nr4fd3j.png\" width=\"455\" height=\"778\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">260.88 KB</span></figcaption></a></figure>Which two actions are in the wrong order?</p>', 5, '2023-10-13 18:28:14', '2023-10-13 18:28:14', '<p>Perhatikan kegiatan yang dilakukan di setiap gambar dan coba pahami. Bisa dilihat pada gambar ke-3 berang-berang menyisir rambut, dan pada gambar ke-4 dia mandi. Kita tahu bahwa biasanya menyisir rambut dilakukan setelah mandi. Karena itu 2 kegiatan yang salah adalah pada gambar 3 dan 4.&nbsp;</p><p><br>----------------</p><p><br></p><p>Pay attention to the activities carried out in each picture and try to understand them. You can see in the 3rd picture the otter combing his hair, and in the 4th picture he is taking a shower. We know that usually combing hair is done after bathing. Therefore the 2 wrong activities are in pictures 3 and 4.</p>'),
(71, 70, 36, 1, '<p>Sepulang sekolah, Gabrielle punya banyak pekerjaan. Urutan tindakannya ditunjukkan dalam gambar. Sayangnya, satu gambar hilang.<br><br>Manakah dari gambar berikut yang paling cocok?</p><p><br></p><p>-----------</p><p><br></p><p>After school Gabrielle has a lot to do. Her sequence of actions is shown in the pictures. Unfortunately, one picture is missing.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:253157,&quot;height&quot;:788,&quot;href&quot;:&quot;http://comfypace.com/uploads/ABLhkSR65R9UVOj4iVDmAhuE0b5SX2wf2JoNAjA2.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/ABLhkSR65R9UVOj4iVDmAhuE0b5SX2wf2JoNAjA2.png&quot;,&quot;width&quot;:459}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/ABLhkSR65R9UVOj4iVDmAhuE0b5SX2wf2JoNAjA2.png\"><img src=\"http://comfypace.com/uploads/ABLhkSR65R9UVOj4iVDmAhuE0b5SX2wf2JoNAjA2.png\" width=\"459\" height=\"788\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">247.22 KB</span></figcaption></a></figure></p><p>Which one of these pictures would fit best?</p>', 5, '2023-10-13 18:32:17', '2023-10-13 18:32:17', '<p>Perhatikan kegiatan yang dilakukan di setiap gambar dan coba pahami. Gambar yang kosong adalah kegiatan setelah kegiatan bermain di luar ruangan. Karena itu kegiatan yang paling sesuai setelah itu adalah gambar B yaitu belajar. Gambar A dan C masih menunjukkan kegiatan bermain di luar ruangan.</p><p><br></p><p>--------------</p><p><br></p><p>Pay attention to the activities carried out in each picture and try to understand them. The blank image is the activity after the outdoor play activity. Therefore, the most appropriate activity after that is picture B, namely studying. Pictures A and C still show outdoor play activities.</p>'),
(72, 71, 37, 1, '<p>Uang Beaverland  koin beuro. Berang-berang membeli ikan menggunakan koin euro. Ikannya berharga 10 beuro.Dia punya<br>koin-koin ini:<br><br>Dengan berapa cara dia dapat membayarnya?</p><p><br></p><p>------------</p><p><br></p><p>Beaverland money  beuro coins. Beaver is buying a fish using beuro coins. The fish costs 10 beuros.He has<br>these coins:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:239518,&quot;height&quot;:508,&quot;href&quot;:&quot;http://comfypace.com/uploads/IOrh8NovZ55HTelswWZKTbUy3eXozNR0xfN5Y7Fc.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/IOrh8NovZ55HTelswWZKTbUy3eXozNR0xfN5Y7Fc.png&quot;,&quot;width&quot;:707}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/IOrh8NovZ55HTelswWZKTbUy3eXozNR0xfN5Y7Fc.png\"><img src=\"http://comfypace.com/uploads/IOrh8NovZ55HTelswWZKTbUy3eXozNR0xfN5Y7Fc.png\" width=\"707\" height=\"508\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">233.9 KB</span></figcaption></a></figure>In how many different ways can he pay for it?</p>', 5, '2023-10-13 18:35:22', '2023-10-13 18:35:22', '<p>Langkah awal kita hitung dulu jumlah koin yang ada, yaitu:</p><ul><li>3 koin 5 beuros</li><li>6 koin 2 beuros</li><li>2 koin 1 beuro</li></ul><p><br></p><p>Untuk membayar 10 beuros, kita bisa membayar dengan 4 variasi seperti berikut:</p><ul><li>5 beuros (2)</li><li>5 beuros (1), 2 beuros (2), 1 beuro (1)</li><li>2 beuros (5)</li><li>2 beuros (4), 1 beuro (2)</li></ul><p><br></p><p>------------</p><p><br></p><p>The first step is to calculate the number of coins available, namely:<br>3 coins 5 beuros<br>6 coins 2 beuros<br>2 coins 1 beuro<br><br>To pay 10 beuros, we can pay with 4 variations as follows:<br>5 euros (2)<br>5 beuros (1), 2 beuros (2), 1 beuro (1)<br>2 euros (5)<br>2 beuros (4), 1 beuro (2)</p>'),
(73, 72, 38, 1, '<p>Hazel menonton sebuah turnamen balapan dan mencatat pemenang dari setiap tahap di papan di bawah ini. Para pelari mengenakan nomor yang sama, mulai dari 1 hingga 8, sepanjang turnamen. Hazel menggunakan kartu bernomor untuk mewakili setiap pelari. Ketika turnamen berakhir, adik laki-lakinya, Tomo, mencampurkan semua kartu, kecuali yang berasal dari tahap pertama turnamen tersebut.</p><p>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:43549,&quot;height&quot;:579,&quot;href&quot;:&quot;http://comfypace.com/uploads/asx7pq65aARaGYsdOQSY8xdlNYoQCCmLL72ke1b7.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/asx7pq65aARaGYsdOQSY8xdlNYoQCCmLL72ke1b7.png&quot;,&quot;width&quot;:984}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/asx7pq65aARaGYsdOQSY8xdlNYoQCCmLL72ke1b7.png\"><img src=\"http://comfypace.com/uploads/asx7pq65aARaGYsdOQSY8xdlNYoQCCmLL72ke1b7.png\" width=\"984\" height=\"579\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">42.53 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong></p><p>Pelari mana yang memenangkan balapan? Siapa lawan terakhir mereka?&nbsp;</p><p><br></p><p>-----------------------------------------------------------------------------------------------<br><strong>English Version</strong><br>Hazel watched a tournament of races and recorded the winners of each stage on the board below. The runners wore the same numbers, from 1 to 8, throughout the tournament. Hazel used numbered cards to represent each runner. When the tournament was over his younger brother Tomo mixed up all the cards, except those from the first stage of the tournament.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:43549,&quot;height&quot;:579,&quot;href&quot;:&quot;http://comfypace.com/uploads/asx7pq65aARaGYsdOQSY8xdlNYoQCCmLL72ke1b7.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/asx7pq65aARaGYsdOQSY8xdlNYoQCCmLL72ke1b7.png&quot;,&quot;width&quot;:984}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/asx7pq65aARaGYsdOQSY8xdlNYoQCCmLL72ke1b7.png\"><img src=\"http://comfypace.com/uploads/asx7pq65aARaGYsdOQSY8xdlNYoQCCmLL72ke1b7.png\" width=\"984\" height=\"579\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">42.53 KB</span></figcaption></a></figure><strong>Question</strong></p><p>Which runner won the race? Who was their final competitor?&nbsp;</p>', 5, '2023-10-14 08:22:57', '2023-10-14 11:10:28', '<p>Semakin banyak balapan yang dimenangkan seorang pelari, semakin sering kartu mereka akan muncul dalam tumpukan kartu. Pelari dari babak pertama tidak akan memiliki kartu mereka di dalam tumpukan. Untuk mengisi hasil, kita perlu melihat nomor dari dua pesaing dalam setiap balapan yang termasuk dalam kartu-kartu yang tersisa.&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:13792,&quot;height&quot;:261,&quot;href&quot;:&quot;http://comfypace.com/uploads/QJbUp59U7Hav4TWvihwQ2EC6kRsWrQEL1I6j51rL.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/QJbUp59U7Hav4TWvihwQ2EC6kRsWrQEL1I6j51rL.png&quot;,&quot;width&quot;:363}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/QJbUp59U7Hav4TWvihwQ2EC6kRsWrQEL1I6j51rL.png\"><img src=\"http://comfypace.com/uploads/QJbUp59U7Hav4TWvihwQ2EC6kRsWrQEL1I6j51rL.png\" width=\"363\" height=\"261\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">13.47 KB</span></figcaption></a></figure> -----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The more races a runner won, the more frequently their card will appear in the pile. Runners from round one would not have their card in the pile. To fill the results, we need to look at which of the two competitors of each race numbers are among the remaining cards.&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:13792,&quot;height&quot;:261,&quot;href&quot;:&quot;http://comfypace.com/uploads/QJbUp59U7Hav4TWvihwQ2EC6kRsWrQEL1I6j51rL.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/QJbUp59U7Hav4TWvihwQ2EC6kRsWrQEL1I6j51rL.png&quot;,&quot;width&quot;:363}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/QJbUp59U7Hav4TWvihwQ2EC6kRsWrQEL1I6j51rL.png\"><img src=\"http://comfypace.com/uploads/QJbUp59U7Hav4TWvihwQ2EC6kRsWrQEL1I6j51rL.png\" width=\"363\" height=\"261\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">13.47 KB</span></figcaption></a></figure></p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(74, 73, 38, 1, '<p>Adam memiliki lima batang. Ia meletakkannya di atas meja dan membuat bentuk seperti ini:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:805,&quot;height&quot;:81,&quot;href&quot;:&quot;http://comfypace.com/uploads/2lx2YWFD4IUwGy5Ky6NEVRGdosYcLoJfnBzeaIz5.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/2lx2YWFD4IUwGy5Ky6NEVRGdosYcLoJfnBzeaIz5.png&quot;,&quot;width&quot;:99}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/2lx2YWFD4IUwGy5Ky6NEVRGdosYcLoJfnBzeaIz5.png\"><img src=\"http://comfypace.com/uploads/2lx2YWFD4IUwGy5Ky6NEVRGdosYcLoJfnBzeaIz5.png\" width=\"99\" height=\"81\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">805 Bytes</span></figcaption></a></figure>Nola datang ke meja. Ia mengambil satu batang dan meletakkannya di tempat yang berbeda:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:756,&quot;height&quot;:91,&quot;href&quot;:&quot;http://comfypace.com/uploads/GlhNv4UYp5rXi47ITqzAXNOVUFAC7FiPftTna8kK.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/GlhNv4UYp5rXi47ITqzAXNOVUFAC7FiPftTna8kK.png&quot;,&quot;width&quot;:86}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/GlhNv4UYp5rXi47ITqzAXNOVUFAC7FiPftTna8kK.png\"><img src=\"http://comfypace.com/uploads/GlhNv4UYp5rXi47ITqzAXNOVUFAC7FiPftTna8kK.png\" width=\"86\" height=\"91\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">756 Bytes</span></figcaption></a></figure>Kemudian Bob datang ke meja, ia juga mengambil satu batang dan meletakkannya di tempat yang berbeda.</p><p><strong>Pertanyaan:</strong></p><p>Bentuk apa yang tidak dibuat oleh Bob?&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong></p><p>&nbsp;Adam has five sticks. He puts them on the table and creates this shape:&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:805,&quot;height&quot;:81,&quot;href&quot;:&quot;http://comfypace.com/uploads/2lx2YWFD4IUwGy5Ky6NEVRGdosYcLoJfnBzeaIz5.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/2lx2YWFD4IUwGy5Ky6NEVRGdosYcLoJfnBzeaIz5.png&quot;,&quot;width&quot;:99}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/2lx2YWFD4IUwGy5Ky6NEVRGdosYcLoJfnBzeaIz5.png\"><img src=\"http://comfypace.com/uploads/2lx2YWFD4IUwGy5Ky6NEVRGdosYcLoJfnBzeaIz5.png\" width=\"99\" height=\"81\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">805 Bytes</span></figcaption></a></figure>Nola comes to the table. She takes one stick and puts it in a different place: <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:756,&quot;height&quot;:91,&quot;href&quot;:&quot;http://comfypace.com/uploads/GlhNv4UYp5rXi47ITqzAXNOVUFAC7FiPftTna8kK.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/GlhNv4UYp5rXi47ITqzAXNOVUFAC7FiPftTna8kK.png&quot;,&quot;width&quot;:86}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/GlhNv4UYp5rXi47ITqzAXNOVUFAC7FiPftTna8kK.png\"><img src=\"http://comfypace.com/uploads/GlhNv4UYp5rXi47ITqzAXNOVUFAC7FiPftTna8kK.png\" width=\"86\" height=\"91\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">756 Bytes</span></figcaption></a></figure>Then Bob comes to the table, he also takes one stick and puts it in a different place. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:5111,&quot;height&quot;:134,&quot;href&quot;:&quot;http://comfypace.com/uploads/nZeHRd4UzxJlPZIQjj92MBEEqc5RRIJmz00Pf1SX.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/nZeHRd4UzxJlPZIQjj92MBEEqc5RRIJmz00Pf1SX.png&quot;,&quot;width&quot;:525}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/nZeHRd4UzxJlPZIQjj92MBEEqc5RRIJmz00Pf1SX.png\"><img src=\"http://comfypace.com/uploads/nZeHRd4UzxJlPZIQjj92MBEEqc5RRIJmz00Pf1SX.png\" width=\"525\" height=\"134\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">4.99 KB</span></figcaption></a></figure><strong>Question&nbsp;</strong></p><p>Which shape did Bob not make?&nbsp;</p>', 5, '2023-10-14 08:33:01', '2023-10-14 11:10:38', '<p>Seperti yang ditunjukkan oleh gambar, D akan memerlukan pergerakan lebih dari satu batang untuk membentuk bentuk huruf D. &nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:6209,&quot;height&quot;:247,&quot;href&quot;:&quot;http://comfypace.com/uploads/XOgUG83hLCDROYEq0tWqx8zhmSOqwLECZR1dOdE3.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/XOgUG83hLCDROYEq0tWqx8zhmSOqwLECZR1dOdE3.png&quot;,&quot;width&quot;:216}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/XOgUG83hLCDROYEq0tWqx8zhmSOqwLECZR1dOdE3.png\"><img src=\"http://comfypace.com/uploads/XOgUG83hLCDROYEq0tWqx8zhmSOqwLECZR1dOdE3.png\" width=\"216\" height=\"247\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.06 KB</span></figcaption></a></figure> -----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong> &nbsp;</p><p>As the image shows, D would require the movement of more than one stick to produce the D shape&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:6209,&quot;height&quot;:247,&quot;href&quot;:&quot;http://comfypace.com/uploads/XOgUG83hLCDROYEq0tWqx8zhmSOqwLECZR1dOdE3.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/XOgUG83hLCDROYEq0tWqx8zhmSOqwLECZR1dOdE3.png&quot;,&quot;width&quot;:216}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/XOgUG83hLCDROYEq0tWqx8zhmSOqwLECZR1dOdE3.png\"><img src=\"http://comfypace.com/uploads/XOgUG83hLCDROYEq0tWqx8zhmSOqwLECZR1dOdE3.png\" width=\"216\" height=\"247\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.06 KB</span></figcaption></a></figure></p>'),
(75, 74, 39, 1, '<p>Esther telah meminta Ivan untuk memasak kue spesial yang terbuat dari lima bahan. Dia telah meletakkan label di sebelah bahan-bahan itu di kebun. Salah satu bahan tidak memiliki label. Label-label tersebut memberitahu Ivan bahan mana yang harus ditambahkan berikutnya dalam urutan.<br>Kebunnya terlihat seperti ini:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25200,&quot;height&quot;:267,&quot;href&quot;:&quot;http://comfypace.com/uploads/3ZSxk0ARQxH92yAbNSg6g1la5uiqYGorHSBxGJVs.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/3ZSxk0ARQxH92yAbNSg6g1la5uiqYGorHSBxGJVs.png&quot;,&quot;width&quot;:393}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/3ZSxk0ARQxH92yAbNSg6g1la5uiqYGorHSBxGJVs.png\"><img src=\"http://comfypace.com/uploads/3ZSxk0ARQxH92yAbNSg6g1la5uiqYGorHSBxGJVs.png\" width=\"393\" height=\"267\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.61 KB</span></figcaption></a></figure><br><strong>Pertanyaan</strong><br>Bahan apa yang harus ditambahkan pertama?</p><p><strong>--------------</strong></p><p><strong>English Version</strong></p><p>Esther has asked Ivan to cook a special cake made of five ingredients. She has put labels next to the ingredients in the garden. One ingredient has no label. The labels tell Ivan which ingredient must be added next in the sequence.<br>The garden looks like this:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25200,&quot;height&quot;:267,&quot;href&quot;:&quot;http://comfypace.com/uploads/3ZSxk0ARQxH92yAbNSg6g1la5uiqYGorHSBxGJVs.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/3ZSxk0ARQxH92yAbNSg6g1la5uiqYGorHSBxGJVs.png&quot;,&quot;width&quot;:393}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/3ZSxk0ARQxH92yAbNSg6g1la5uiqYGorHSBxGJVs.png\"><img src=\"http://comfypace.com/uploads/3ZSxk0ARQxH92yAbNSg6g1la5uiqYGorHSBxGJVs.png\" width=\"393\" height=\"267\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.61 KB</span></figcaption></a></figure><br><strong>Question</strong><br>Which ingredient should be added first?</p>', 5, '2023-10-14 08:37:57', '2023-10-14 11:37:49', '<p>Jika Esther memulai dengan bunga merah, dia dapat menambahkan semualima bahan dalam urutan yang benar. Memilih stroberi, dia tidak bisa melanjutkan ke berikutnya karena tidak ada label untuk itu. Apel tidak benar karena jika dia memulai dengan apel, dia akan melewatkan bunga merah. Begitu juga dengan cone (biji pinus) tidak benar karena jika dia memulai dengan cone, dia akan melewatkan bunga merah dan apel.</p><p><strong>--------------</strong></p><p><strong>English Version</strong></p><p>If Esther starts with the red flower, she can add all five ingredients in the right order. Choosing the strawberry, she could not have continued to the next as there is no paper with it. The apple is not correct because if she had started with the apple, she would have skipped the red flower. The pine cone is not correct because if she had started with the cone, she would have skipped the red flower and the apple.</p>'),
(76, 75, 40, 1, '<p>Ada 10 siswa yang bekerja pada surat kabar sekolah. Setiap Jumat, mereka menulis atau mengedit artikel mereka sendiri.</p><p>Pada rencana tersebut, sel yang berwarna oranye menunjukkan kapan siswa memerlukan komputer. Selama satu jam, hanya satu siswa pada satu waktu yang bisa bekerja di komputer.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:49170,&quot;height&quot;:445,&quot;href&quot;:&quot;http://comfypace.com/uploads/SHLeJdCITyT0Wvh3IOmIYOLRwKkQgk6xhgq9rFl5.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/SHLeJdCITyT0Wvh3IOmIYOLRwKkQgk6xhgq9rFl5.png&quot;,&quot;width&quot;:851}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/SHLeJdCITyT0Wvh3IOmIYOLRwKkQgk6xhgq9rFl5.png\"><img src=\"http://comfypace.com/uploads/SHLeJdCITyT0Wvh3IOmIYOLRwKkQgk6xhgq9rFl5.png\" width=\"851\" height=\"445\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">48.02 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong></p><p>Berapa jumlah minimum komputer yang diperlukan agar semua siswa dapat bekerja sesuai dengan rencana di atas?&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>There are 10 students working on the schools newspaper. Every Friday they write or edit their own articles.&nbsp;</p><p>On the plan, the orange cells show when the students need a computer. During any one hour, only one student at a time can work on a computer.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:28305,&quot;height&quot;:388,&quot;href&quot;:&quot;http://comfypace.com/uploads/9OsmoEunuFP0BXZkWk3vwDTvtiwNmgzywP4aNP5A.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/9OsmoEunuFP0BXZkWk3vwDTvtiwNmgzywP4aNP5A.png&quot;,&quot;width&quot;:715}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/9OsmoEunuFP0BXZkWk3vwDTvtiwNmgzywP4aNP5A.png\"><img src=\"http://comfypace.com/uploads/9OsmoEunuFP0BXZkWk3vwDTvtiwNmgzywP4aNP5A.png\" width=\"715\" height=\"388\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">27.64 KB</span></figcaption></a></figure><strong>Question:&nbsp;</strong></p><p>What is the minimum number of computers needed for all of the students to work according to the plan shown above?&nbsp;</p>', 5, '2023-10-14 08:50:18', '2023-10-14 08:56:56', '<p>Tabel tersebut menunjukkan susunan yang berfungsi dengan jumlah minimum komputer.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:91882,&quot;height&quot;:441,&quot;href&quot;:&quot;http://comfypace.com/uploads/C0gZnUH5mNQX1YoilYCdLCQDCPg1haWJsezWPE1X.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/C0gZnUH5mNQX1YoilYCdLCQDCPg1haWJsezWPE1X.png&quot;,&quot;width&quot;:831}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/C0gZnUH5mNQX1YoilYCdLCQDCPg1haWJsezWPE1X.png\"><img src=\"http://comfypace.com/uploads/C0gZnUH5mNQX1YoilYCdLCQDCPg1haWJsezWPE1X.png\" width=\"831\" height=\"441\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">89.73 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The table shows the arrangement that works with the minimum number of computers <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:54328,&quot;height&quot;:415,&quot;href&quot;:&quot;http://comfypace.com/uploads/CA7n2oC4QBFNSyi6VbDKNywjz5iazndnx0OTpwki.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/CA7n2oC4QBFNSyi6VbDKNywjz5iazndnx0OTpwki.png&quot;,&quot;width&quot;:764}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/CA7n2oC4QBFNSyi6VbDKNywjz5iazndnx0OTpwki.png\"><img src=\"http://comfypace.com/uploads/CA7n2oC4QBFNSyi6VbDKNywjz5iazndnx0OTpwki.png\" width=\"764\" height=\"415\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">53.05 KB</span></figcaption></a></figure></p>'),
(77, 76, 40, 1, '<p>Di Kota Roundabout, perangkat lunak navigasi tidak memberikan instruksi seperti:</p><ul><li>Pada bundaran berikutnya, ambil keluaran ke-4.</li><li>Pada bundaran berikutnya, ambil keluaran ke-1.</li><li>Pada bundaran berikutnya, ambil keluaran ke-2.</li></ul><p>Sebagai gantinya, perangkat lunak tersebut memberikan urutan angka, seperti \"4 1 2,\" yang akan membuat Anda pergi sebagaimana yang terlihat di sebelah kanan.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:26427,&quot;height&quot;:197,&quot;href&quot;:&quot;http://comfypace.com/uploads/jRHOU8XKskyOI69yEuDwWvlNdJxXK9DJEWFcPuN4.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/jRHOU8XKskyOI69yEuDwWvlNdJxXK9DJEWFcPuN4.png&quot;,&quot;width&quot;:324}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/jRHOU8XKskyOI69yEuDwWvlNdJxXK9DJEWFcPuN4.png\"><img src=\"http://comfypace.com/uploads/jRHOU8XKskyOI69yEuDwWvlNdJxXK9DJEWFcPuN4.png\" width=\"324\" height=\"197\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">25.81 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong></p><p>Jika Anda diberikan instruksi berikut: 3 1 3 2 3, Anda akan berakhir di keluaran mana (ditandai dengan huruf)? Ingatlah bahwa di Kota Roundabout, lalu lintas berada di sisi kanan, dan pergerakan di sekitar bundaran dilakukan berlawanan arah jarum jam.&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>In Roundabout City, the navigation software does not give instructions like:&nbsp;</p><p> At the next roundabout, take the 4th exit&nbsp;</p><p> At the next roundabout, take the 1st exit&nbsp;</p><p> At the next roundabout, take the 2nd exit</p><p>Instead, it gives you a sequence of numbers, like 4 1 2 which would make you go the way seen to the right.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:26427,&quot;height&quot;:197,&quot;href&quot;:&quot;http://comfypace.com/uploads/jRHOU8XKskyOI69yEuDwWvlNdJxXK9DJEWFcPuN4.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/jRHOU8XKskyOI69yEuDwWvlNdJxXK9DJEWFcPuN4.png&quot;,&quot;width&quot;:324}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/jRHOU8XKskyOI69yEuDwWvlNdJxXK9DJEWFcPuN4.png\"><img src=\"http://comfypace.com/uploads/jRHOU8XKskyOI69yEuDwWvlNdJxXK9DJEWFcPuN4.png\" width=\"324\" height=\"197\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">25.81 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>If you were given these instructions 3 1 3 2 3 which of the lettered exits would you end up at? Remember that Roundabout City drives on the right, and move around the roundabout in an anticlockwise direction.&nbsp;</p>', 5, '2023-10-14 09:05:48', '2023-10-14 11:10:55', '<p>As shown in the image that follows the stated rules, exiting at the 3rd exit then the 1st exit and following <br>the pattern <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17795,&quot;height&quot;:162,&quot;href&quot;:&quot;http://comfypace.com/uploads/JPBKOmKiMfOHa825V5jzY9aGfc4SFH1pnmVfpioA.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/JPBKOmKiMfOHa825V5jzY9aGfc4SFH1pnmVfpioA.png&quot;,&quot;width&quot;:240}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/JPBKOmKiMfOHa825V5jzY9aGfc4SFH1pnmVfpioA.png\"><img src=\"http://comfypace.com/uploads/JPBKOmKiMfOHa825V5jzY9aGfc4SFH1pnmVfpioA.png\" width=\"240\" height=\"162\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">17.38 KB</span></figcaption></a></figure> -----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong> <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17795,&quot;height&quot;:162,&quot;href&quot;:&quot;http://comfypace.com/uploads/JPBKOmKiMfOHa825V5jzY9aGfc4SFH1pnmVfpioA.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/JPBKOmKiMfOHa825V5jzY9aGfc4SFH1pnmVfpioA.png&quot;,&quot;width&quot;:240}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/JPBKOmKiMfOHa825V5jzY9aGfc4SFH1pnmVfpioA.png\"><img src=\"http://comfypace.com/uploads/JPBKOmKiMfOHa825V5jzY9aGfc4SFH1pnmVfpioA.png\" width=\"240\" height=\"162\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">17.38 KB</span></figcaption></a></figure>Seperti yang ditunjukkan dalam gambar yang mengikuti aturan yang dinyatakan, keluar pada pintu keluar ke-3, kemudian pintu keluar ke-1, dan mengikuti pola tersebut.&nbsp;</p>'),
(78, 77, 41, 1, '<p>Seluruh keluarga buaya memiliki urutan sisik yang sama yang berjalan di sepanjang punggung mereka. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15333,&quot;height&quot;:192,&quot;href&quot;:&quot;http://comfypace.com/uploads/kyuErSNQsKhnp1NEovWuyXNQtIK2xRl8DDRmbjeD.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/kyuErSNQsKhnp1NEovWuyXNQtIK2xRl8DDRmbjeD.png&quot;,&quot;width&quot;:486}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/kyuErSNQsKhnp1NEovWuyXNQtIK2xRl8DDRmbjeD.png\"><img src=\"http://comfypace.com/uploads/kyuErSNQsKhnp1NEovWuyXNQtIK2xRl8DDRmbjeD.png\" width=\"486\" height=\"192\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.97 KB</span></figcaption></a></figure>Cheryl dan Charlie Crocodile termasuk dalam keluarga yang sama, dan jika mereka kehilangan sebuah sisik, sisik tersebut dapat tumbuh kembali. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:28324,&quot;height&quot;:157,&quot;href&quot;:&quot;http://comfypace.com/uploads/D4pgu4kv2N4RhluXLEeZyQ8zoF1asaEVq0jHQ52S.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/D4pgu4kv2N4RhluXLEeZyQ8zoF1asaEVq0jHQ52S.png&quot;,&quot;width&quot;:927}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/D4pgu4kv2N4RhluXLEeZyQ8zoF1asaEVq0jHQ52S.png\"><img src=\"http://comfypace.com/uploads/D4pgu4kv2N4RhluXLEeZyQ8zoF1asaEVq0jHQ52S.png\" width=\"927\" height=\"157\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">27.66 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong></p><p>Dari buaya-buaya yang digambarkan, yang mana yang mungkin menjadi bagian dari keluarga yang sama dengan Cheryl dan Charlie?&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>&nbsp;Crocodile families all have the same sequence of scales running down their spines.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15333,&quot;height&quot;:192,&quot;href&quot;:&quot;http://comfypace.com/uploads/kyuErSNQsKhnp1NEovWuyXNQtIK2xRl8DDRmbjeD.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/kyuErSNQsKhnp1NEovWuyXNQtIK2xRl8DDRmbjeD.png&quot;,&quot;width&quot;:486}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/kyuErSNQsKhnp1NEovWuyXNQtIK2xRl8DDRmbjeD.png\"><img src=\"http://comfypace.com/uploads/kyuErSNQsKhnp1NEovWuyXNQtIK2xRl8DDRmbjeD.png\" width=\"486\" height=\"192\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.97 KB</span></figcaption></a></figure>Cheryl and Charlie Crocodile belong to the same family and if they lose a scale, it can regrow.&nbsp; <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:28324,&quot;height&quot;:157,&quot;href&quot;:&quot;http://comfypace.com/uploads/D4pgu4kv2N4RhluXLEeZyQ8zoF1asaEVq0jHQ52S.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/D4pgu4kv2N4RhluXLEeZyQ8zoF1asaEVq0jHQ52S.png&quot;,&quot;width&quot;:927}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/D4pgu4kv2N4RhluXLEeZyQ8zoF1asaEVq0jHQ52S.png\"><img src=\"http://comfypace.com/uploads/D4pgu4kv2N4RhluXLEeZyQ8zoF1asaEVq0jHQ52S.png\" width=\"927\" height=\"157\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">27.66 KB</span></figcaption></a></figure><strong>Question:&nbsp;</strong></p><p>Of the pictured crocodiles, which ones could be in the same family as Cheryl and Charlie?&nbsp;</p>', 5, '2023-10-14 09:50:31', '2023-10-14 09:51:23', '<p>B salah karena pola sisiknya terbalik. C tidak bisa benar karena polanya tidak cocok. D tidak bisa benar karena ada satu sisik yang hilang di tempat di mana seharusnya ada sisik setengah silang.</p><p>Oleh karena itu, A, E, dan F adalah jawaban yang tepat<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:21809,&quot;height&quot;:305,&quot;href&quot;:&quot;http://comfypace.com/uploads/hWb3gUcxxSggr7BIIrL4ObokjkrqoA301Bcdpkb4.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/hWb3gUcxxSggr7BIIrL4ObokjkrqoA301Bcdpkb4.png&quot;,&quot;width&quot;:251}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/hWb3gUcxxSggr7BIIrL4ObokjkrqoA301Bcdpkb4.png\"><img src=\"http://comfypace.com/uploads/hWb3gUcxxSggr7BIIrL4ObokjkrqoA301Bcdpkb4.png\" width=\"251\" height=\"305\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">21.3 KB</span></figcaption></a></figure> -----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>B is incorrect because the scale pattern is backwards. C cant be right because the pattern does not match. D cant be right as there is one a scale missing in the spot there should be a half cross scale.&nbsp;</p><p>Therefore A ,E and F<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:21809,&quot;height&quot;:305,&quot;href&quot;:&quot;http://comfypace.com/uploads/hWb3gUcxxSggr7BIIrL4ObokjkrqoA301Bcdpkb4.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/hWb3gUcxxSggr7BIIrL4ObokjkrqoA301Bcdpkb4.png&quot;,&quot;width&quot;:251}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/hWb3gUcxxSggr7BIIrL4ObokjkrqoA301Bcdpkb4.png\"><img src=\"http://comfypace.com/uploads/hWb3gUcxxSggr7BIIrL4ObokjkrqoA301Bcdpkb4.png\" width=\"251\" height=\"305\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">21.3 KB</span></figcaption></a></figure></p>'),
(79, 78, 41, 1, '<p>Sistem kereta api terdiri dari empat jalur kereta yang dimulai dari stasiun-stasiun: Acton, Bams, Chat, dan Dinmore. John pergi ke Kebun Binatang. Dia berganti jalur kereta tepat satu kali di Moor, Museum, Mart, atau Market. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17028,&quot;height&quot;:217,&quot;href&quot;:&quot;http://comfypace.com/uploads/trfKohKCsDhjFrN6qaXHKV0xSYXKb5KVoWkq7rmK.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/trfKohKCsDhjFrN6qaXHKV0xSYXKb5KVoWkq7rmK.png&quot;,&quot;width&quot;:314}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/trfKohKCsDhjFrN6qaXHKV0xSYXKb5KVoWkq7rmK.png\"><img src=\"http://comfypace.com/uploads/trfKohKCsDhjFrN6qaXHKV0xSYXKb5KVoWkq7rmK.png\" width=\"314\" height=\"217\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">16.63 KB</span></figcaption></a></figure> <strong>Pertanyaan:</strong></p><p>Dari stasiun mana John memulai perjalanannya?</p><p>----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>A train system consists of four train lines that start at the stations: Acton, Bams, Chat, and Dinmore. John went to the Zoo. He changed train lines exactly once at Moor, Museum, Mart or Market.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17028,&quot;height&quot;:217,&quot;href&quot;:&quot;http://comfypace.com/uploads/trfKohKCsDhjFrN6qaXHKV0xSYXKb5KVoWkq7rmK.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/trfKohKCsDhjFrN6qaXHKV0xSYXKb5KVoWkq7rmK.png&quot;,&quot;width&quot;:314}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/trfKohKCsDhjFrN6qaXHKV0xSYXKb5KVoWkq7rmK.png\"><img src=\"http://comfypace.com/uploads/trfKohKCsDhjFrN6qaXHKV0xSYXKb5KVoWkq7rmK.png\" width=\"314\" height=\"217\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">16.63 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>Which station did he start his journey from?&nbsp;</p>', 5, '2023-10-14 09:54:18', '2023-10-14 10:03:20', '<p>Jika John memulai perjalanan dari Acton, dia tidak perlu melakukan perpindahan. Dua kali perpindahan diperlukan jika John memulai perjalanan dari Bams atau Chat.&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>If John starts at Acton, he will not transfer. Two transfers are needed if John starts at Bams or Chat.&nbsp;</p>'),
(80, 79, 42, 1, '<p>Robyn sedang memasang kertas dinding.<br>Dia menggunakan potongan kertas dinding<br>berbentuk persegi panjang dengan berbagai ukuran.<br>Setiap potongan kertas dinding memiliki hanya<br>satu warna dengan satu pola di atasnya.<br>Terkadang, Robyn menutupi sebagian dari<br>satu potongan kertas dinding dengan potongan<br>persegi panjang baru.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:23524,&quot;height&quot;:333,&quot;href&quot;:&quot;http://comfypace.com/uploads/gaPjy6Kb8U4fyzfzxf1cFspfIfXc2io72rwOfIRz.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/gaPjy6Kb8U4fyzfzxf1cFspfIfXc2io72rwOfIRz.png&quot;,&quot;width&quot;:327}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/gaPjy6Kb8U4fyzfzxf1cFspfIfXc2io72rwOfIRz.png\"><img src=\"http://comfypace.com/uploads/gaPjy6Kb8U4fyzfzxf1cFspfIfXc2io72rwOfIRz.png\" width=\"327\" height=\"333\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">22.97 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Dalam urutan apa Robyn meletakkan kertas dinding?</p><p><strong>-----------------<br>English Version</strong></p><p>Robyn is wallpapering. She uses rectangular wallpaper pieces of different sizes. Each wallpaper piece has only one colour with one pattern on it. Sometimes, Robyn covers part of one piece of wallpaper with a new rectangular piece.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:23524,&quot;height&quot;:333,&quot;href&quot;:&quot;http://comfypace.com/uploads/qFpgqIrd9FLSSgWTz022z706YOMtrM7l3KqWG4dZ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/qFpgqIrd9FLSSgWTz022z706YOMtrM7l3KqWG4dZ.png&quot;,&quot;width&quot;:327}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/qFpgqIrd9FLSSgWTz022z706YOMtrM7l3KqWG4dZ.png\"><img src=\"http://comfypace.com/uploads/qFpgqIrd9FLSSgWTz022z706YOMtrM7l3KqWG4dZ.png\" width=\"327\" height=\"333\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">22.97 KB</span></figcaption></a></figure></p><p><strong>&nbsp;Question&nbsp;</strong></p><p>In which order has Robyn placed the wallpaper?&nbsp;</p>', 5, '2023-10-14 10:07:52', '2023-10-14 10:10:08', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:6151,&quot;height&quot;:77,&quot;href&quot;:&quot;http://comfypace.com/uploads/sm9MTsXam1yaf544jH3k615eIFB4inrauqFlmn9q.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/sm9MTsXam1yaf544jH3k615eIFB4inrauqFlmn9q.png&quot;,&quot;width&quot;:327}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/sm9MTsXam1yaf544jH3k615eIFB4inrauqFlmn9q.png\"><img src=\"http://comfypace.com/uploads/sm9MTsXam1yaf544jH3k615eIFB4inrauqFlmn9q.png\" width=\"327\" height=\"77\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.01 KB</span></figcaption></a></figure><br>Kertas dinding kuning dengan gambar tas adalah satu-satunya kertas dinding yang tidak dipotong oleh yang lain, sehingga seharusnya menjadi yang terakhir. Gambar tas memotong hanya kertas dinding bola basket, yang berarti itu ditempatkan kedua terakhir. Dari sana, kertas dinding bola basket memotong kertas dinding daun, kertas dinding daun memotong kertas dinding bunga, kertas dinding bunga memotong kertas dinding cermin, dan kertas dinding cermin memotong kertas dinding hati.<br><strong>-----------------<br>English Version<br></strong><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:6151,&quot;height&quot;:77,&quot;href&quot;:&quot;http://comfypace.com/uploads/nWFzo1HAkHJHn52kOSThEBrEN8xEPD1w0ZeOqxLn.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/nWFzo1HAkHJHn52kOSThEBrEN8xEPD1w0ZeOqxLn.png&quot;,&quot;width&quot;:327}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/nWFzo1HAkHJHn52kOSThEBrEN8xEPD1w0ZeOqxLn.png\"><img src=\"http://comfypace.com/uploads/nWFzo1HAkHJHn52kOSThEBrEN8xEPD1w0ZeOqxLn.png\" width=\"327\" height=\"77\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.01 KB</span></figcaption></a></figure><strong><br></strong>The yellow wallpaper with the briefcases is the only wallpaper that isnt cut off by another one, so that should be the last one. The suitcase cuts off the basketball wallpaper only, meaning it was placed second last. From there the basketball wallpaper cuts off the leaf wallpaper, the leaf wallpaper cuts off the flower wallpaper, the flower wallpaper cuts off the mirrors and the mirrors cut off the hearts.&nbsp;</p>'),
(81, 80, 43, 1, '<p>Tiga teman ingin bertemu. Peta di sebelah kanan menunjukkan dari mana mereka akan memulai. Bob bersepeda, Alice berskateboard, dan Jenny menggunakan skuter. Mereka ingin bertemu di salah satu dari empat titik: persegi, segitiga, lingkaran, atau berlian, dan mereka hanya dapat bergerak sepanjang garis-garis kisi secara horizontal atau vertikal. Jarak dari Alice (yang berskateboard) ke segitiga biru adalah 6.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:10988,&quot;height&quot;:281,&quot;href&quot;:&quot;http://comfypace.com/uploads/2VzIC2Pd6nNkYnuLzydtcn5IAe5uemXGTlnAZQQL.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/2VzIC2Pd6nNkYnuLzydtcn5IAe5uemXGTlnAZQQL.png&quot;,&quot;width&quot;:287}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/2VzIC2Pd6nNkYnuLzydtcn5IAe5uemXGTlnAZQQL.png\"><img src=\"http://comfypace.com/uploads/2VzIC2Pd6nNkYnuLzydtcn5IAe5uemXGTlnAZQQL.png\" width=\"287\" height=\"281\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">10.73 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong></p><p>Tempat pertemuan mana yang seharusnya mereka pilih sehingga jarak total yang harus ditempuh oleh ketiga teman itu sependek mungkin?&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;<br>Three friends want to meet. The map on the right shows where they will start from. Bob is on his bike, Alice is on her skateboard and Jenny is on her scooter. They want to meet at either the square, triangle, circle or diamond and they can only travel along any of the gridlines horizontally or vertically. The distance from Alice (on her skateboard) to the blue triangle is 6&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:10988,&quot;height&quot;:281,&quot;href&quot;:&quot;http://comfypace.com/uploads/2VzIC2Pd6nNkYnuLzydtcn5IAe5uemXGTlnAZQQL.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/2VzIC2Pd6nNkYnuLzydtcn5IAe5uemXGTlnAZQQL.png&quot;,&quot;width&quot;:287}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/2VzIC2Pd6nNkYnuLzydtcn5IAe5uemXGTlnAZQQL.png\"><img src=\"http://comfypace.com/uploads/2VzIC2Pd6nNkYnuLzydtcn5IAe5uemXGTlnAZQQL.png\" width=\"287\" height=\"281\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">10.73 KB</span></figcaption></a></figure> <strong>Question:</strong></p><p>Which meeting place should they choose so that the total distance the three friends must travel is the shortest possible?&nbsp;</p>', 5, '2023-10-14 10:12:16', '2023-10-14 10:22:41', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:7962,&quot;height&quot;:201,&quot;href&quot;:&quot;http://comfypace.com/uploads/Is2G60AuIHPedyPZ3oiSHF5pqL5KBnb8QWK0ypZS.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Is2G60AuIHPedyPZ3oiSHF5pqL5KBnb8QWK0ypZS.png&quot;,&quot;width&quot;:195}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Is2G60AuIHPedyPZ3oiSHF5pqL5KBnb8QWK0ypZS.png\"><img src=\"http://comfypace.com/uploads/Is2G60AuIHPedyPZ3oiSHF5pqL5KBnb8QWK0ypZS.png\" width=\"195\" height=\"201\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">7.78 KB</span></figcaption></a></figure>Dengan menghitung jarak total ke setiap lokasi, kita dapat menghitung jarak terpendeknya.</p><ul><li>Persegi merah adalah: 4 + 3 + 8 = 15</li><li>Segitiga biru adalah: 4 + 3 + 6 = 13</li><li>Lingkaran hijau adalah: 3 + 4 + 5 = 12</li><li>Berlian kuning adalah: 4 + 5 + 4 = 13</li></ul><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:7962,&quot;height&quot;:201,&quot;href&quot;:&quot;http://comfypace.com/uploads/sMxckH5O5HprUQDSE8AdGOk20C2UwpkstvFy8QXG.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/sMxckH5O5HprUQDSE8AdGOk20C2UwpkstvFy8QXG.png&quot;,&quot;width&quot;:195}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/sMxckH5O5HprUQDSE8AdGOk20C2UwpkstvFy8QXG.png\"><img src=\"http://comfypace.com/uploads/sMxckH5O5HprUQDSE8AdGOk20C2UwpkstvFy8QXG.png\" width=\"195\" height=\"201\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">7.78 KB</span></figcaption></a></figure>By calculating the total distance to each location, we can calculate the shortest distance.&nbsp;</p><p>- Red square is: 4 + 3 + 8 = 15&nbsp;</p><p>- Blue triangle is: 4 + 3 + 6 = 13&nbsp;</p><p>- Green circle is: 3 + 4 + 5 = 12&nbsp;</p><p>- Yellow diamond is: 4 + 5 + 4 = 13&nbsp;</p><p>&nbsp;</p>'),
(82, 81, 43, 1, '<p>Sarah sedang bermain permainan Ring Toss. Untuk setiap putaran, dia memiliki 5 cincin untuk mencoba melemparkannya mengelilingi penjepit. Setiap cincin yang berhasil mendarat mengelilingi penjepit menghasilkan poin, tetapi tidak setiap lemparan bernilai jumlah poin yang sama, dan lemparan yang gagal tidak menghasilkan poin. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:39458,&quot;height&quot;:277,&quot;href&quot;:&quot;http://comfypace.com/uploads/m5xfGj6qidufOTOroQYswuzBFofO8ktwBspM1vul.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/m5xfGj6qidufOTOroQYswuzBFofO8ktwBspM1vul.png&quot;,&quot;width&quot;:688}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/m5xfGj6qidufOTOroQYswuzBFofO8ktwBspM1vul.png\"><img src=\"http://comfypace.com/uploads/m5xfGj6qidufOTOroQYswuzBFofO8ktwBspM1vul.png\" width=\"688\" height=\"277\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">38.53 KB</span></figcaption></a></figure><strong>Pertanyaan:<br></strong>Sarah melemparkan lima cincinnya seperti yang ditunjukkan. Berapa banyak poin yang dia dapatkan?&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Sarah is playing the game Ring Toss. For each round she has 5 rings to try to throw around a peg. Every ring that successfully lands around the peg scores points, but not every throw is worth the same number of points and a missed throw scores no points: <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:21414,&quot;height&quot;:166,&quot;href&quot;:&quot;http://comfypace.com/uploads/ZdSBG6jd0ODgOJAH8NG24iYdbndTeo55OTmL6AZe.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/ZdSBG6jd0ODgOJAH8NG24iYdbndTeo55OTmL6AZe.png&quot;,&quot;width&quot;:520}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/ZdSBG6jd0ODgOJAH8NG24iYdbndTeo55OTmL6AZe.png\"><img src=\"http://comfypace.com/uploads/ZdSBG6jd0ODgOJAH8NG24iYdbndTeo55OTmL6AZe.png\" width=\"520\" height=\"166\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">20.91 KB</span></figcaption></a></figure> <strong>Question:</strong></p><p>Sarah threw her five rings as shown. How many points did she score?&nbsp;</p>', 5, '2023-10-14 10:21:38', '2023-10-14 10:21:38', '<p>Karena cincin biru ada di atas cincin kuning dan di bawah cincin-cincin lainnya, cincin biru mendapatkan 4 poin. Karena cincin hijau ada di atas semua cincin kecuali cincin hitam, ini adalah lemparan ke-4, dan mendapatkan 2 poin.&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>As blue is on top of the yellow ring, and under the others, it scored 4 points. As green is on top of all but the black ring, it was the 4th throw, and scores 2 points&nbsp;</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(83, 82, 44, 1, '<p>Toko bunga menjual jenis bunga berikut:<br>Bunga-bunga ini tersedia dalam warna putih, kuning, atau biru.</p><p>Clara ingin sebuah rangkaian bunga yang terdiri dari enam bunga. Dia memberitahu tukang bunga:</p><ul><li>Harus ada dua dari masing-masing warna kuning, putih, dan biru.</li><li>Bunga-bunga dari jenis yang sama tidak boleh memiliki warna yang sama.</li><li>Tidak boleh ada lebih dari dua dari setiap jenis bunga.&nbsp;</li></ul><p>&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:28404,&quot;height&quot;:137,&quot;href&quot;:&quot;http://comfypace.com/uploads/8eZIKPC0B2jL3vxufNBDB4QQcTMtgCKX1F5T802n.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/8eZIKPC0B2jL3vxufNBDB4QQcTMtgCKX1F5T802n.png&quot;,&quot;width&quot;:367}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/8eZIKPC0B2jL3vxufNBDB4QQcTMtgCKX1F5T802n.png\"><img src=\"http://comfypace.com/uploads/8eZIKPC0B2jL3vxufNBDB4QQcTMtgCKX1F5T802n.png\" width=\"367\" height=\"137\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">27.74 KB</span></figcaption></a></figure> &nbsp;</p><p><strong>Pertanyaan:<br></strong>Buket mana yang akan membuat Clara senang?<br>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>A flower shop sells the following types of flowers: The flowers come in white, yellow or blue. Clara wants a bunch of six flowers.&nbsp; She tells the florist:&nbsp;</p><p> There must be two of each of the colours yellow, white and blue</p><p> Flowers of the same type must not have the same colour&nbsp;</p><p> There should be no more than two of each type of flower&nbsp;</p><p>&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:28404,&quot;height&quot;:137,&quot;href&quot;:&quot;http://comfypace.com/uploads/ob6rrKdLqOFesMuPcci3YQKSGhs9oHjuDnbyld84.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/ob6rrKdLqOFesMuPcci3YQKSGhs9oHjuDnbyld84.png&quot;,&quot;width&quot;:367}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/ob6rrKdLqOFesMuPcci3YQKSGhs9oHjuDnbyld84.png\"><img src=\"http://comfypace.com/uploads/ob6rrKdLqOFesMuPcci3YQKSGhs9oHjuDnbyld84.png\" width=\"367\" height=\"137\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">27.74 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>Which of the following bunches will Clara be happy with?</p>', 5, '2023-10-14 10:25:42', '2023-10-14 10:27:49', '<p>D adalah satu-satunya rangkaian yang memenuhi semua aturan yang disebutkan.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:12427,&quot;height&quot;:160,&quot;href&quot;:&quot;http://comfypace.com/uploads/rcmvcj0yGUi1OPb8MnrV9PiAr3WzY7rujru4nxYL.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/rcmvcj0yGUi1OPb8MnrV9PiAr3WzY7rujru4nxYL.png&quot;,&quot;width&quot;:165}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/rcmvcj0yGUi1OPb8MnrV9PiAr3WzY7rujru4nxYL.png\"><img src=\"http://comfypace.com/uploads/rcmvcj0yGUi1OPb8MnrV9PiAr3WzY7rujru4nxYL.png\" width=\"165\" height=\"160\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">12.14 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>&nbsp;D is the only bunch that meets all the stated rules.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:12427,&quot;height&quot;:160,&quot;href&quot;:&quot;http://comfypace.com/uploads/rcmvcj0yGUi1OPb8MnrV9PiAr3WzY7rujru4nxYL.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/rcmvcj0yGUi1OPb8MnrV9PiAr3WzY7rujru4nxYL.png&quot;,&quot;width&quot;:165}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/rcmvcj0yGUi1OPb8MnrV9PiAr3WzY7rujru4nxYL.png\"><img src=\"http://comfypace.com/uploads/rcmvcj0yGUi1OPb8MnrV9PiAr3WzY7rujru4nxYL.png\" width=\"165\" height=\"160\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">12.14 KB</span></figcaption></a></figure></p>'),
(84, 83, 44, 1, '<p>Dua nelayan memiliki dua perahu, yang diberi nama \"Lisa 1\" dan \"Lisa 2\". Setiap perahu dapat membawa maksimum muatan sebanyak 300kg. Para nelayan diberikan tong-tong yang diisi dengan ikan untuk diangkut. Di setiap tong terdapat angka yang menunjukkan berat tong tersebut dalam kilogram. Anda harus memastikan bahwa tidak ada perahu yang kelebihan muatan.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15115,&quot;height&quot;:179,&quot;href&quot;:&quot;http://comfypace.com/uploads/Lc1j2PTpGp5ugdv3C03rsGRFfHWQomIf0WoXiVNR.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Lc1j2PTpGp5ugdv3C03rsGRFfHWQomIf0WoXiVNR.png&quot;,&quot;width&quot;:509}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Lc1j2PTpGp5ugdv3C03rsGRFfHWQomIf0WoXiVNR.png\"><img src=\"http://comfypace.com/uploads/Lc1j2PTpGp5ugdv3C03rsGRFfHWQomIf0WoXiVNR.png\" width=\"509\" height=\"179\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.76 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong></p><p>Berapakah maksimum muatan ikan yang dapat diangkut?&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Two fishermen own two boats, named Lisa 1 and Lisa 2. Each boat can hold a maximum cargo of 300kg. The fishermen are given barrels filled with fish to transport. On each barrel is a number that shows how heavy the barrel is in kilograms. You must make sure that neither boat is overloaded <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15115,&quot;height&quot;:179,&quot;href&quot;:&quot;http://comfypace.com/uploads/Lc1j2PTpGp5ugdv3C03rsGRFfHWQomIf0WoXiVNR.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Lc1j2PTpGp5ugdv3C03rsGRFfHWQomIf0WoXiVNR.png&quot;,&quot;width&quot;:509}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Lc1j2PTpGp5ugdv3C03rsGRFfHWQomIf0WoXiVNR.png\"><img src=\"http://comfypace.com/uploads/Lc1j2PTpGp5ugdv3C03rsGRFfHWQomIf0WoXiVNR.png\" width=\"509\" height=\"179\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.76 KB</span></figcaption></a></figure><strong>Question:&nbsp;</strong></p><p>What is the maximum possible load of fish that can be carried?&nbsp;</p>', 5, '2023-10-14 10:26:20', '2023-10-14 10:58:22', '<p>Jika Anda mencoba memuat tong-tong berat terlebih dahulu, Anda akan berakhir pada 220 + 60 = 280 kilogram dan 130 + 120 = 250 kilogram, yang hanya total 530 kilogram. Hanya ada satu cara untuk mencapai 300 kilogram: 120 + 90 + 90, sehingga berat lebih dari 590 kilogram tidak mungkin.&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>If you try to load heavy barrels first, you will end up at 220+60=280 kilos and 130+120=250 kilos which is only 530 kilos total. There is only one way to make 300: 120+90+90, so a weight higher than 590kg is not possible&nbsp;</p>'),
(85, 84, 42, 1, '<p>Untuk mengatur pesta makan malam, Sara si berang-berang perlu berbicara dengan lima teman: Alicia, Beat, Caroline, David, dan Emil. Sara dapat berbicara dengan Emil langsung. Namun, untuk berbicara dengan teman-temannya yang lain, ada beberapa hal yang perlu dipertimbangkan:</p><ol><li>Sebelum berbicara dengan David, ia harus berbicara terlebih dahulu dengan Alicia.</li><li>Sebelum berbicara dengan Beat, ia harus berbicara terlebih dahulu dengan Emil.</li><li>Sebelum berbicara dengan Caroline, ia harus berbicara terlebih dahulu dengan Beat dan David.</li><li>Sebelum berbicara dengan Alicia, ia harus berbicara terlebih dahulu dengan Beat dan Emil.</li></ol><p><strong>Pertanyaan</strong><br>Jika Sara ingin berbicara dengan semua teman-temannya, dengan siapa dia akan berbicara pertama kali dan terakhir?</p><p><br><strong>--------------</strong><br><strong>English Version</strong><br>To arrange a dinner party Sara the beaver needs to talk to five friends: Alicia, Beat, Caroline, David and Emil. Sara can talk to Emil right away. However, to talk to her other friends, there are a few points to consider: 1. Before she talks to David, she must first talk to Alicia 2. Before she talks to Beat, she must first talk to Emil 3. Before she talks to Caroline, she must first talk to Beat and David 4. Before she talks to Alicia, she must first talk to Beat and Emil. <br><strong>Question</strong>&nbsp;<br>If Sarah wants to talk to all of her friends, who would she speak to first and last?&nbsp;</p>', 5, '2023-10-14 10:26:51', '2023-10-14 10:26:51', '<p>Emil adalah satu-satunya teman yang tidak perlu diajak bicara setelah yang lain, jadi dia harus menjadi yang pertama. Caroline diajak bicara terakhir.</p><p>Karena Caroline bergantung pada Beat dan David, Beat bergantung pada Emil, David bergantung pada Alicia, dan Caroline harus menjadi yang terakhir.<br><strong>--------------<br>English Version<br></strong>Emil is the only friend that doesnt need to be spoken to after another, so he must go first. Caroline is spoken to last.<br>As Caroline depends on both Beat and David, Beat depends on Emil, David depends on Alicia, and Caroline must be last.</p>'),
(86, 85, 45, 1, '<p>Barbara diberikan dua stempel. Dengan satu stempel, dia dapat membuat bunga kecil, dan dengan yang lainnya, matahari kecil. Dengan menjadi gadis cerdas, dia mencari cara untuk menuliskan namanya sendiri menggunakan kode di bawah ini:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:6860,&quot;height&quot;:48,&quot;href&quot;:&quot;http://comfypace.com/uploads/1PU2uPvfYIhhrffAj7lUQyoLvSSefiCbTC1PnoHz.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/1PU2uPvfYIhhrffAj7lUQyoLvSSefiCbTC1PnoHz.png&quot;,&quot;width&quot;:483}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/1PU2uPvfYIhhrffAj7lUQyoLvSSefiCbTC1PnoHz.png\"><img src=\"http://comfypace.com/uploads/1PU2uPvfYIhhrffAj7lUQyoLvSSefiCbTC1PnoHz.png\" width=\"483\" height=\"48\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.7 KB</span></figcaption></a></figure></p><p>Jadi, Barbara menjadi seperti ini:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:1985,&quot;height&quot;:27,&quot;href&quot;:&quot;http://comfypace.com/uploads/tMFu8pHpMbjBRiaclTLHONdPEbrOJXAYuDSmtUHF.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/tMFu8pHpMbjBRiaclTLHONdPEbrOJXAYuDSmtUHF.png&quot;,&quot;width&quot;:173}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/tMFu8pHpMbjBRiaclTLHONdPEbrOJXAYuDSmtUHF.png\"><img src=\"http://comfypace.com/uploads/tMFu8pHpMbjBRiaclTLHONdPEbrOJXAYuDSmtUHF.png\" width=\"173\" height=\"2