ot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/M0qdkBGLOlUTjDDYdOnHCHL6ZAs8qvryVMG3mzJc.png\"><img src=\"http://comfypace.com/uploads/M0qdkBGLOlUTjDDYdOnHCHL6ZAs8qvryVMG3mzJc.png\" width=\"483\" height=\"48\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.7 KB</span></figcaption></a></figure><br>So Barbara becomes:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:1985,&quot;height&quot;:27,&quot;href&quot;:&quot;http://comfypace.com/uploads/qJ1Ccale7QXyyvbUSEnLMIaAzekZQCffZHgpqbje.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/qJ1Ccale7QXyyvbUSEnLMIaAzekZQCffZHgpqbje.png&quot;,&quot;width&quot;:173}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/qJ1Ccale7QXyyvbUSEnLMIaAzekZQCffZHgpqbje.png\"><img src=\"http://comfypace.com/uploads/qJ1Ccale7QXyyvbUSEnLMIaAzekZQCffZHgpqbje.png\" width=\"173\" height=\"27\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">1.94 KB</span></figcaption></a></figure><br>She then writes the names of her friends. Unfortunately, they all got mixed up.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:11865,&quot;height&quot;:43,&quot;href&quot;:&quot;http://comfypace.com/uploads/CfnDxlCqAORvNjThdvVyJWd4mZxfHcPC7wuRbmi7.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/CfnDxlCqAORvNjThdvVyJWd4mZxfHcPC7wuRbmi7.png&quot;,&quot;width&quot;:355}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/CfnDxlCqAORvNjThdvVyJWd4mZxfHcPC7wuRbmi7.png\"><img src=\"http://comfypace.com/uploads/CfnDxlCqAORvNjThdvVyJWd4mZxfHcPC7wuRbmi7.png\" width=\"355\" height=\"43\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">11.59 KB</span></figcaption></a></figure><br><strong>Question</strong><br>Which code above reads Abby?</p>', 5, '2023-10-14 10:48:36', '2023-10-14 10:55:18', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:19284,&quot;height&quot;:153,&quot;href&quot;:&quot;http://comfypace.com/uploads/UtTcwSJfscqNee8HDDd1HhjQy6mzixLlZukoKQX2.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/UtTcwSJfscqNee8HDDd1HhjQy6mzixLlZukoKQX2.png&quot;,&quot;width&quot;:209}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/UtTcwSJfscqNee8HDDd1HhjQy6mzixLlZukoKQX2.png\"><img src=\"http://comfypace.com/uploads/UtTcwSJfscqNee8HDDd1HhjQy6mzixLlZukoKQX2.png\" width=\"209\" height=\"153\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">18.83 KB</span></figcaption></a></figure>Hanya \"Abby\" yang dimulai dengan huruf A dan B, jadi kita mencari kode yang memiliki dua matahari dan satu bunga di awal.</p><p><strong>---------------</strong></p><p><strong>English Version</strong><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:19284,&quot;height&quot;:153,&quot;href&quot;:&quot;http://comfypace.com/uploads/BERIEVVnWUaWnpSj5rJdVN0KlfjSwBdipjri8lOe.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/BERIEVVnWUaWnpSj5rJdVN0KlfjSwBdipjri8lOe.png&quot;,&quot;width&quot;:209}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/BERIEVVnWUaWnpSj5rJdVN0KlfjSwBdipjri8lOe.png\"><img src=\"http://comfypace.com/uploads/BERIEVVnWUaWnpSj5rJdVN0KlfjSwBdipjri8lOe.png\" width=\"209\" height=\"153\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">18.83 KB</span></figcaption></a></figure> Only Abby starts with an A and a B and so we look for a code with two suns and a flower at the start.&nbsp;</p>'),
(87, 86, 45, 1, '<p>Sebuah mobil robot menggunakan aturan sederhana untuk menjalani labirin:<br>Belok kanan jika memungkinkan.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8766,&quot;height&quot;:126,&quot;href&quot;:&quot;http://comfypace.com/uploads/bGi7dJuXFV6gTFIoPOyvNTJmIglhu8wrIqOvachl.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/bGi7dJuXFV6gTFIoPOyvNTJmIglhu8wrIqOvachl.png&quot;,&quot;width&quot;:361}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/bGi7dJuXFV6gTFIoPOyvNTJmIglhu8wrIqOvachl.png\"><img src=\"http://comfypace.com/uploads/bGi7dJuXFV6gTFIoPOyvNTJmIglhu8wrIqOvachl.png\" width=\"361\" height=\"126\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.56 KB</span></figcaption></a></figure><br><strong>Pertanyaan</strong><br>Di berapa banyak labirin berikut mobil akan mencapai titik merah jika menggunakan sistem ini?</p><p><strong>--------------<br>English Version</strong></p><p>&nbsp;A robotic car uses a simple rule to drive through a maze: Turn right whenever possible.&nbsp;</p><p></p><p><strong>Question&nbsp;</strong></p><p>In how many of the following mazes will the car reach the red dot if it uses this system?&nbsp;</p>', 5, '2023-10-14 11:24:37', '2023-10-14 11:24:37', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9064,&quot;height&quot;:119,&quot;href&quot;:&quot;http://comfypace.com/uploads/HnVBPLZSbkGkQxWeBJcesVXgh70KrDrl0bMaKsTr.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/HnVBPLZSbkGkQxWeBJcesVXgh70KrDrl0bMaKsTr.png&quot;,&quot;width&quot;:238}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/HnVBPLZSbkGkQxWeBJcesVXgh70KrDrl0bMaKsTr.png\"><img src=\"http://comfypace.com/uploads/HnVBPLZSbkGkQxWeBJcesVXgh70KrDrl0bMaKsTr.png\" width=\"238\" height=\"119\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.85 KB</span></figcaption></a></figure></p><p>Hanya Maze C yang tidak akan mencapai titik merah jika mengikuti aturan tersebut.</p><p><strong>-------------<br>English Version</strong></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9064,&quot;height&quot;:119,&quot;href&quot;:&quot;http://comfypace.com/uploads/HnVBPLZSbkGkQxWeBJcesVXgh70KrDrl0bMaKsTr.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/HnVBPLZSbkGkQxWeBJcesVXgh70KrDrl0bMaKsTr.png&quot;,&quot;width&quot;:238}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/HnVBPLZSbkGkQxWeBJcesVXgh70KrDrl0bMaKsTr.png\"><img src=\"http://comfypace.com/uploads/HnVBPLZSbkGkQxWeBJcesVXgh70KrDrl0bMaKsTr.png\" width=\"238\" height=\"119\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.85 KB</span></figcaption></a></figure> Only Maze C results in the red dot never being reached when following the rules.&nbsp;</p>'),
(88, 87, 39, 1, '<p>Lodges dari lima berang-berang ditunjukkan pada peta di bawah ini. Berang-berang ingin menempatkan halte bus di salah satu tempat yang ditandai dengan hexagon biru. Semua hexagon terletak 10 meter dari satu sama lain. Berang-berang memutuskan bahwa jumlah jarak dari sarang mereka ke halte bus harus sesingkat mungkin.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:12311,&quot;height&quot;:149,&quot;href&quot;:&quot;http://comfypace.com/uploads/5umCPo5tor8EipyStlFi4OD3fi1g395jnrfrazfy.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/5umCPo5tor8EipyStlFi4OD3fi1g395jnrfrazfy.png&quot;,&quot;width&quot;:313}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/5umCPo5tor8EipyStlFi4OD3fi1g395jnrfrazfy.png\"><img src=\"http://comfypace.com/uploads/5umCPo5tor8EipyStlFi4OD3fi1g395jnrfrazfy.png\" width=\"313\" height=\"149\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">12.02 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Di mana tempat terbaik untuk meletakkan halte bus?</p><p><strong>----------------<br>English Version</strong></p><p>&nbsp;The lodges of five beavers are shown on the map below. The beavers want to put a bus stop in one of the places marked by blue hexagons. All the hexagons are 10m apart. The beavers decide that the sum of the distances from their lodges to the bus stop must be as small as possible.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:12311,&quot;height&quot;:149,&quot;href&quot;:&quot;http://comfypace.com/uploads/5umCPo5tor8EipyStlFi4OD3fi1g395jnrfrazfy.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/5umCPo5tor8EipyStlFi4OD3fi1g395jnrfrazfy.png&quot;,&quot;width&quot;:313}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/5umCPo5tor8EipyStlFi4OD3fi1g395jnrfrazfy.png\"><img src=\"http://comfypace.com/uploads/5umCPo5tor8EipyStlFi4OD3fi1g395jnrfrazfy.png\" width=\"313\" height=\"149\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">12.02 KB</span></figcaption></a></figure><strong>Question&nbsp;</strong></p><p>What is the best place to put a bus stop?&nbsp;</p>', 5, '2023-10-14 11:36:08', '2023-10-14 11:36:08', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:6296,&quot;height&quot;:123,&quot;href&quot;:&quot;http://comfypace.com/uploads/tcVrqISzwqlipOn8S9MUClvQ6rNzTSHSrIRLjdvu.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/tcVrqISzwqlipOn8S9MUClvQ6rNzTSHSrIRLjdvu.png&quot;,&quot;width&quot;:212}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/tcVrqISzwqlipOn8S9MUClvQ6rNzTSHSrIRLjdvu.png\"><img src=\"http://comfypace.com/uploads/tcVrqISzwqlipOn8S9MUClvQ6rNzTSHSrIRLjdvu.png\" width=\"212\" height=\"123\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.15 KB</span></figcaption></a></figure>Tempat terbaik untuk meletakkan halte bus adalah pada titik merah di gambar. Ini mengurangi jarak untuk sebagian besar jumlah berang-berang. Dengan jarak maksimum 30 meter. Di lokasi lain, jarak maksimum akan lebih dari 30 meter untuk setidaknya satu berang-berang.</p><p><strong>----------------------<br>English Version</strong></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:6296,&quot;height&quot;:123,&quot;href&quot;:&quot;http://comfypace.com/uploads/tcVrqISzwqlipOn8S9MUClvQ6rNzTSHSrIRLjdvu.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/tcVrqISzwqlipOn8S9MUClvQ6rNzTSHSrIRLjdvu.png&quot;,&quot;width&quot;:212}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/tcVrqISzwqlipOn8S9MUClvQ6rNzTSHSrIRLjdvu.png\"><img src=\"http://comfypace.com/uploads/tcVrqISzwqlipOn8S9MUClvQ6rNzTSHSrIRLjdvu.png\" width=\"212\" height=\"123\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">6.15 KB</span></figcaption></a></figure> The best place to put a bus stop is at the red dot in the image. This minimises the distance for the most number of beavers. With the maximum distance being 30m. In any other location, the maximum distance would be larger than 30m for at least one beaver.&nbsp;</p>'),
(89, 88, 47, 1, '<p>Jalur kereta api di Beaver City memiliki nomor masing-masing. Sayangnya, nomor-nomor tersebut hanya ditampilkan pada peta ini. Ketika Anda berada di dalam kereta, Anda tidak dapat melihat nomor jalurnya di mana pun!<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9779,&quot;height&quot;:158,&quot;href&quot;:&quot;http://comfypace.com/uploads/l0DjGCYIGpi2iqCR4LYkcVsOYvYCGNH2tvyiUXGN.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/l0DjGCYIGpi2iqCR4LYkcVsOYvYCGNH2tvyiUXGN.png&quot;,&quot;width&quot;:309}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/l0DjGCYIGpi2iqCR4LYkcVsOYvYCGNH2tvyiUXGN.png\"><img src=\"http://comfypace.com/uploads/l0DjGCYIGpi2iqCR4LYkcVsOYvYCGNH2tvyiUXGN.png\" width=\"309\" height=\"158\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9.55 KB</span></figcaption></a></figure></p><p>Anda naik kereta di stasiun utama di mana semua jalur dimulai. Setelah tiga stasiun, kereta Anda berbelok. Di stasiun berikutnya, kereta berbelok lagi. Empat stasiun kemudian, Anda tiba di tujuan Anda.</p><p><strong>Pertanyaan</strong></p><p>Anda berada di jalur kereta apa?<br><strong>----------------<br>English Version<br></strong>The train lines in Beaver City all have their own number. Unfortunately the numbers are only shown on this map.<br>When you are on a train you cannot see the line number anywhere!&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9779,&quot;height&quot;:158,&quot;href&quot;:&quot;http://comfypace.com/uploads/l0DjGCYIGpi2iqCR4LYkcVsOYvYCGNH2tvyiUXGN.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/l0DjGCYIGpi2iqCR4LYkcVsOYvYCGNH2tvyiUXGN.png&quot;,&quot;width&quot;:309}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/l0DjGCYIGpi2iqCR4LYkcVsOYvYCGNH2tvyiUXGN.png\"><img src=\"http://comfypace.com/uploads/l0DjGCYIGpi2iqCR4LYkcVsOYvYCGNH2tvyiUXGN.png\" width=\"309\" height=\"158\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9.55 KB</span></figcaption></a></figure></p><p>You board a train at the main station where all the lines begin. After three stations your train makes a turn. At the next station it makes another turn. Four stations later you have arrived at your destination.<br><br><strong>Question<br></strong>Which train line are you on?</p>', 5, '2023-10-14 11:42:35', '2023-10-14 11:42:35', '<p>Putaran pertama menghilangkan Jalur 1. Instruksi kedua (berbelok di stasiun berikutnya) menghilangkan Jalur 5. Satu-satunya tujuan di akhir empat stasiun adalah Jalur 6.<br><strong>--------------<br>English Version</strong><br>The first turn eliminates Line 1. The second instruction (a turn at the next stop) eliminates Line 5. The only destination at the end of the four stops is Line 6.&nbsp;</p>'),
(90, 89, 47, 1, '<p>Gerald sedang bermain di hutan. Dia menggunakan kacang dan batang untuk membuat empat hewan lucu. Saudara perempuannya berhasil melenturkan hewan-hewan tersebut tanpa menghilangkan salah satu batang, menghasilkan bentuk-bentuk berikut:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9444,&quot;height&quot;:95,&quot;href&quot;:&quot;http://comfypace.com/uploads/0X3GP3mMA8PvNePOVaxLQsjt2zeYfm8UFR3mX5YN.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/0X3GP3mMA8PvNePOVaxLQsjt2zeYfm8UFR3mX5YN.png&quot;,&quot;width&quot;:249}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/0X3GP3mMA8PvNePOVaxLQsjt2zeYfm8UFR3mX5YN.png\"><img src=\"http://comfypace.com/uploads/0X3GP3mMA8PvNePOVaxLQsjt2zeYfm8UFR3mX5YN.png\" width=\"249\" height=\"95\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9.22 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong><br>Bentuk mana di antara berikut ini dapat dilenturkan kembali menjadi bentuk anjing?<br><strong>---------------<br>English Version</strong></p><p>Gerald was playing in the woods. He used nuts and sticks to create four nice animals. His sister managed to bend the animals around without removing any of the sticks, producing the following shapes:&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9444,&quot;height&quot;:95,&quot;href&quot;:&quot;http://comfypace.com/uploads/J5lTIEfELQTCvfwuscXMKqGazAyyJetGk21Eq90J.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/J5lTIEfELQTCvfwuscXMKqGazAyyJetGk21Eq90J.png&quot;,&quot;width&quot;:249}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/J5lTIEfELQTCvfwuscXMKqGazAyyJetGk21Eq90J.png\"><img src=\"http://comfypace.com/uploads/J5lTIEfELQTCvfwuscXMKqGazAyyJetGk21Eq90J.png\" width=\"249\" height=\"95\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9.22 KB</span></figcaption></a></figure></p><p><strong>Question&nbsp;</strong></p><p>Which of the following figures can be bent back to make the figure of the dog again?&nbsp;</p>', 5, '2023-10-14 11:48:32', '2023-10-14 11:48:32', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15774,&quot;height&quot;:166,&quot;href&quot;:&quot;http://comfypace.com/uploads/acJWzT4YPTClWbxqtqB5ieDzznkvc8cExoGprgbU.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/acJWzT4YPTClWbxqtqB5ieDzznkvc8cExoGprgbU.png&quot;,&quot;width&quot;:188}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/acJWzT4YPTClWbxqtqB5ieDzznkvc8cExoGprgbU.png\"><img src=\"http://comfypace.com/uploads/acJWzT4YPTClWbxqtqB5ieDzznkvc8cExoGprgbU.png\" width=\"188\" height=\"166\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">15.4 KB</span></figcaption></a></figure>Dengan melihat sambungan untuk setiap bagian hewan dan melakukan transformasi seputar sambungan, kita dapat melihat kesamaan dalam sambungan tersebut dan pola-pola yang berkembang. Semua susunan lainnya tidak akan menghasilkan bentuk anjing.</p><p><strong>------------------<br>English Version</strong><br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15774,&quot;height&quot;:166,&quot;href&quot;:&quot;http://comfypace.com/uploads/acJWzT4YPTClWbxqtqB5ieDzznkvc8cExoGprgbU.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/acJWzT4YPTClWbxqtqB5ieDzznkvc8cExoGprgbU.png&quot;,&quot;width&quot;:188}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/acJWzT4YPTClWbxqtqB5ieDzznkvc8cExoGprgbU.png\"><img src=\"http://comfypace.com/uploads/acJWzT4YPTClWbxqtqB5ieDzznkvc8cExoGprgbU.png\" width=\"188\" height=\"166\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">15.4 KB</span></figcaption></a></figure> By looking at the connections for each part of the animal and transforming around the connections we can see a the similarities in the connections and the patterns develop. All of the other arrangements would not lead to the dog shape being produced.&nbsp;<br><br><br></p><p><br><br><br></p>'),
(91, 90, 48, 1, '<p>Dua teman, Anna dan Bob, sedang mencari harta karun. Mereka memiliki aplikasi smartphone yang menunjukkan arah ke harta karun yang mereka cari. Dua kotak pada peta menunjukkan di mana harta karun itu berada. Anna sedang mencari kotak 1. Bob mencari kotak 2. Anna dan Bob berdiri di tempat yang sama. Gambar menunjukkan peta dan tangkapan layar dari smartphone mereka.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:38463,&quot;height&quot;:174,&quot;href&quot;:&quot;http://comfypace.com/uploads/z6HFr9KYpHRvjMFExlbNRS8blqJdTDe18N3uaDsE.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/z6HFr9KYpHRvjMFExlbNRS8blqJdTDe18N3uaDsE.png&quot;,&quot;width&quot;:246}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/z6HFr9KYpHRvjMFExlbNRS8blqJdTDe18N3uaDsE.png\"><img src=\"http://comfypace.com/uploads/z6HFr9KYpHRvjMFExlbNRS8blqJdTDe18N3uaDsE.png\" width=\"246\" height=\"174\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">37.56 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong><br> Di landmark mana mereka berdiri?</p><p><strong>-------------------<br>English Version</strong><br>Two friends, Anna and Bob, are searching for treasure. They have a smartphone app that shows them the direction to the treasure they are looking for. The two boxes on the map show where the treasure is. Anna is searching for box 1. Bob is looking for box 2. Anna and Bob are standing in the same place. The picture shows the map and a screenshot of the smartphones.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:38463,&quot;height&quot;:174,&quot;href&quot;:&quot;http://comfypace.com/uploads/z6HFr9KYpHRvjMFExlbNRS8blqJdTDe18N3uaDsE.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/z6HFr9KYpHRvjMFExlbNRS8blqJdTDe18N3uaDsE.png&quot;,&quot;width&quot;:246}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/z6HFr9KYpHRvjMFExlbNRS8blqJdTDe18N3uaDsE.png\"><img src=\"http://comfypace.com/uploads/z6HFr9KYpHRvjMFExlbNRS8blqJdTDe18N3uaDsE.png\" width=\"246\" height=\"174\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">37.56 KB</span></figcaption></a></figure><br>&nbsp;<br><strong>Question</strong>&nbsp;<br>At what landmark are they standing?&nbsp;</p>', 5, '2023-10-14 11:52:35', '2023-10-25 05:12:46', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:3817,&quot;height&quot;:90,&quot;href&quot;:&quot;http://comfypace.com/uploads/AdFBbcc7UhgDpYP9bSHXMs7vDvk4slym8JrdTbER.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AdFBbcc7UhgDpYP9bSHXMs7vDvk4slym8JrdTbER.png&quot;,&quot;width&quot;:89}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AdFBbcc7UhgDpYP9bSHXMs7vDvk4slym8JrdTbER.png\"><img src=\"http://comfypace.com/uploads/AdFBbcc7UhgDpYP9bSHXMs7vDvk4slym8JrdTbER.png\" width=\"89\" height=\"90\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">3.73 KB</span></figcaption></a></figure>Kedua lokasi di sebelah kanan layar tidak cocok dengan kotak-kotak yang ditempatkan. Dari dua landmark di sebelah kiri, hanya satu yang memungkinkan Anna dan Bob untuk mengumpulkan harta karun.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25240,&quot;height&quot;:168,&quot;href&quot;:&quot;http://comfypace.com/uploads/1Mi34vb4tFRzSnbNzJj7NBeGE3PQBg5RU8xdUP71.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/1Mi34vb4tFRzSnbNzJj7NBeGE3PQBg5RU8xdUP71.png&quot;,&quot;width&quot;:168}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/1Mi34vb4tFRzSnbNzJj7NBeGE3PQBg5RU8xdUP71.png\"><img src=\"http://comfypace.com/uploads/1Mi34vb4tFRzSnbNzJj7NBeGE3PQBg5RU8xdUP71.png\" width=\"168\" height=\"168\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.65 KB</span></figcaption></a></figure></p><p><strong>----------------<br>English Version</strong></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:3817,&quot;height&quot;:90,&quot;href&quot;:&quot;http://comfypace.com/uploads/AdFBbcc7UhgDpYP9bSHXMs7vDvk4slym8JrdTbER.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AdFBbcc7UhgDpYP9bSHXMs7vDvk4slym8JrdTbER.png&quot;,&quot;width&quot;:89}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AdFBbcc7UhgDpYP9bSHXMs7vDvk4slym8JrdTbER.png\"><img src=\"http://comfypace.com/uploads/AdFBbcc7UhgDpYP9bSHXMs7vDvk4slym8JrdTbER.png\" width=\"89\" height=\"90\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">3.73 KB</span></figcaption></a></figure></p><p>&nbsp;Both locations on the right of the screen would not match the placed boxes. Of the two left landmarks, only one allows both Anna and Bob to collect the treasure.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25240,&quot;height&quot;:168,&quot;href&quot;:&quot;http://comfypace.com/uploads/fPDakSMQH80b2NEojvPvO4nrlVps5CAgQroaTdiY.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/fPDakSMQH80b2NEojvPvO4nrlVps5CAgQroaTdiY.png&quot;,&quot;width&quot;:168}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/fPDakSMQH80b2NEojvPvO4nrlVps5CAgQroaTdiY.png\"><img src=\"http://comfypace.com/uploads/fPDakSMQH80b2NEojvPvO4nrlVps5CAgQroaTdiY.png\" width=\"168\" height=\"168\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.65 KB</span></figcaption></a></figure></p>'),
(92, 91, 48, 1, '<p>Sebuah angka direpresentasikan pada sebuah sipoa Tiongkok oleh posisi manik-maniknya. Nilai manik pada bagian atas adalah 5; nilai manik pada bagian bawah adalah 1. Sipoa diatur ulang menjadi nol dengan mendorong manik-manik menjauhi pusat. Untuk merepresentasikan angka 1.746.503, manik-manik yang sesuai dipindahkan menuju pusat sempoa:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9504,&quot;height&quot;:138,&quot;href&quot;:&quot;http://comfypace.com/uploads/Vk3eUgQnaJxIWGi6Z5V6L8xDtJl8flXHNwkifJtF.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Vk3eUgQnaJxIWGi6Z5V6L8xDtJl8flXHNwkifJtF.png&quot;,&quot;width&quot;:121}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Vk3eUgQnaJxIWGi6Z5V6L8xDtJl8flXHNwkifJtF.png\"><img src=\"http://comfypace.com/uploads/Vk3eUgQnaJxIWGi6Z5V6L8xDtJl8flXHNwkifJtF.png\" width=\"121\" height=\"138\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9.28 KB</span></figcaption></a></figure></p><p>Pertanyaan: Angka berapa yang direpresentasikan oleh sempoa berikut ini?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8287,&quot;height&quot;:125,&quot;href&quot;:&quot;http://comfypace.com/uploads/fFXGjcyoo83F9MEQUey3iRscEbXXdVy5yGyxF3Po.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/fFXGjcyoo83F9MEQUey3iRscEbXXdVy5yGyxF3Po.png&quot;,&quot;width&quot;:123}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/fFXGjcyoo83F9MEQUey3iRscEbXXdVy5yGyxF3Po.png\"><img src=\"http://comfypace.com/uploads/fFXGjcyoo83F9MEQUey3iRscEbXXdVy5yGyxF3Po.png\" width=\"123\" height=\"125\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.09 KB</span></figcaption></a></figure><br><strong>-------------</strong><br><strong>English Version<br></strong>A number is represented on a Chinese abacus by the position of its beads. The value of a bead on the top part is 5; the value of a bead on the bottom part is 1. The abacus is reset to zero by pushing the beads away from the centre. To represent the number 1,746,503 the appropriate beads are moved towards the centre of the abacus: <br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9504,&quot;height&quot;:138,&quot;href&quot;:&quot;http://comfypace.com/uploads/Vk3eUgQnaJxIWGi6Z5V6L8xDtJl8flXHNwkifJtF.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Vk3eUgQnaJxIWGi6Z5V6L8xDtJl8flXHNwkifJtF.png&quot;,&quot;width&quot;:121}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Vk3eUgQnaJxIWGi6Z5V6L8xDtJl8flXHNwkifJtF.png\"><img src=\"http://comfypace.com/uploads/Vk3eUgQnaJxIWGi6Z5V6L8xDtJl8flXHNwkifJtF.png\" width=\"121\" height=\"138\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9.28 KB</span></figcaption></a></figure><strong> Question&nbsp;</strong></p><p>What number does the following abacus represent?&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8287,&quot;height&quot;:125,&quot;href&quot;:&quot;http://comfypace.com/uploads/fFXGjcyoo83F9MEQUey3iRscEbXXdVy5yGyxF3Po.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/fFXGjcyoo83F9MEQUey3iRscEbXXdVy5yGyxF3Po.png&quot;,&quot;width&quot;:123}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/fFXGjcyoo83F9MEQUey3iRscEbXXdVy5yGyxF3Po.png\"><img src=\"http://comfypace.com/uploads/fFXGjcyoo83F9MEQUey3iRscEbXXdVy5yGyxF3Po.png\" width=\"123\" height=\"125\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.09 KB</span></figcaption></a></figure></p>', 5, '2023-10-14 11:56:56', '2023-10-14 11:56:56', '<p>&nbsp;7,014,831 <br>Dengan menambahkan nilai-nilai manik yang paling dekat dengan pusat sempoa, jawaban yang ditunjukkan dapat diperoleh.<br><strong>-------------</strong><br><strong>English Version<br></strong>&nbsp;7,014,831<strong><br></strong>By adding the values of the beads that are nearest to the centre of the abacus the answer shown can be obtained.&nbsp;</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(93, 92, 49, 1, '<p>Daniel mengirim pesan teks dari ponsel lamanya. Untuk setiap huruf, dia harus menekan tombol yang sesuai satu, dua, tiga, atau empat kali, diikuti dengan jeda singkat. Untuk mengetik huruf \'C\', dia harus menekan tombol nomor 2 sebanyak tiga kali karena \'C\' adalah huruf ketiga yang tertulis di tombol ini. Untuk mengetik \'HIM\', dia harus menekan tombol nomor 4 dua kali, kemudian tombol nomor 4 tiga kali, dan akhirnya tombol nomor 6 sekali.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:10717,&quot;height&quot;:171,&quot;href&quot;:&quot;http://comfypace.com/uploads/8gapw8xgd88crVbqCYIwmAkUKpjwcBDiSmpDnkgt.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/8gapw8xgd88crVbqCYIwmAkUKpjwcBDiSmpDnkgt.png&quot;,&quot;width&quot;:144}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/8gapw8xgd88crVbqCYIwmAkUKpjwcBDiSmpDnkgt.png\"><img src=\"http://comfypace.com/uploads/8gapw8xgd88crVbqCYIwmAkUKpjwcBDiSmpDnkgt.png\" width=\"144\" height=\"171\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">10.47 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong><br>Daniel menekan tombol tepat enam kali untuk memasukkan nama seorang teman. Siapa nama temannya: Miriam, Iris, Emma, atau Ina?</p><p><strong>-----------------<br>English Version</strong><br>Daniel is sending text messages from his old phone. For every letter he has to press the proper key once, twice, three or four times, followed by a short pause. In order to type C he has to press the number 2 key three times because C is the third letter written on this key. In order to type HIM he has to press the number 4 key twice, followed by the number 4 key three times and finally the number 6 key once.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:10717,&quot;height&quot;:171,&quot;href&quot;:&quot;http://comfypace.com/uploads/rECRoZw3Tg8gPWnZGhJxHJLLcCcGYJLrzpcZegup.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/rECRoZw3Tg8gPWnZGhJxHJLLcCcGYJLrzpcZegup.png&quot;,&quot;width&quot;:144}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/rECRoZw3Tg8gPWnZGhJxHJLLcCcGYJLrzpcZegup.png\"><img src=\"http://comfypace.com/uploads/rECRoZw3Tg8gPWnZGhJxHJLLcCcGYJLrzpcZegup.png\" width=\"144\" height=\"171\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">10.47 KB</span></figcaption></a></figure> <br><strong>Question</strong>&nbsp;<br>Daniel presses exactly six times to enter the name of a friend. What is the name of his friend? Miriam, Iris, Emma, or Ina?&nbsp;</p>', 5, '2023-10-14 12:00:59', '2023-10-14 12:00:59', '<p>MIRIAM memerlukan 12 ketukan: M=1, I=3, R=3, I=3, A=1, M=1.<br>IRIS memerlukan 13 ketukan: I=3, R=3, I=3, S=4.<br>EMMA memerlukan 5 ketukan: E=2, M=1, M=1, A=1.<br>INA memerlukan 6 ketukan: I=3, N=2, A=1.<br>Jadi INA adalah nama yang benar.<br><strong>--------------------<br>English Version</strong><br>MIRIAM requires 12 taps: M=1, I=3, R=3, I=3, A=1, M=1. IRIS requires 13 taps: I=3, R=3, I=3, S=4. EMMA requires 5 taps: E=2, M=1, M=1, A=1. INA requires 6 taps: I=3, N=2, A=1. So INA is the correct name.&nbsp;</p>'),
(94, 93, 37, 1, '<p>Seorang gadis kecil berang-berang memasangkan cincin di atas satu sama lain dengan urutan sebagai berikut:<br>1. Merah<br>2. Hijau<br>3. Kuning<br>Dia mengulangi urutannya sampai cincin terakhir dengan warna yang benar telah dipasang<br><br>Berapa banyak cincin yang dimiliki menara tersebut?</p><p><br></p><p>----------------</p><p><br></p><p>A little beaver girl puts rings on top of each other in this sequence:<br>1. Red<br>2. Green<br>3. Yellow<br>She repeats the sequence until the last correctly coloured ring has been placed<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:247911,&quot;height&quot;:401,&quot;href&quot;:&quot;http://comfypace.com/uploads/1dfigy0gVaV6ZylBjnGIhFFFENnpIibMmYu9Upr1.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/1dfigy0gVaV6ZylBjnGIhFFFENnpIibMmYu9Upr1.png&quot;,&quot;width&quot;:585}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/1dfigy0gVaV6ZylBjnGIhFFFENnpIibMmYu9Upr1.png\"><img src=\"http://comfypace.com/uploads/1dfigy0gVaV6ZylBjnGIhFFFENnpIibMmYu9Upr1.png\" width=\"585\" height=\"401\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">242.1 KB</span></figcaption></a></figure><br>How many rings will the tower have?</p>', 5, '2023-10-15 06:33:29', '2023-10-15 06:33:29', '<p>Mari kita hitung berapa jumlah paket ring dengan urutan merah-hijau-kuning yang bisa dibuat. Jangan lupa menghitung semua ring yang ada di tongkat dan di luar tongkat. Total paket ring yang bisa dibuat adalah 4 paket, yang artinya total ada 12 ring.</p><p><br></p><p>----------------------</p><p><br></p><p>Let\'s calculate how many ring packets in the order red-green-yellow can be made. Don\'t forget to count all the rings on the stick and outside the stick. The total number of ring packages that can be made is 4 packages, which means there are a total of 12 rings.</p>'),
(95, 94, 50, 1, '<p>Joji sedang menyusun kayu balok untuk sebuah pondok menggunakan aturan-aturan berikut:</p><ol><li>Aksi pertama: jika kayu balok lebih pendek dari yang berada di sebelah kanannya, maka akan digunakan untuk lantai;</li><li>Aksi kedua: jika lebih panjang, maka akan digunakan untuk atap.<br>Joji mengambil kayu balok secara berurutan dan mengulangi aksi 1 dan 2.</li></ol><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:167482,&quot;height&quot;:469,&quot;href&quot;:&quot;http://comfypace.com/uploads/FWgJDKeBJEKln3OdHb6KESCpybl2DWkwd28blnfg.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/FWgJDKeBJEKln3OdHb6KESCpybl2DWkwd28blnfg.png&quot;,&quot;width&quot;:881}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/FWgJDKeBJEKln3OdHb6KESCpybl2DWkwd28blnfg.png\"><img src=\"http://comfypace.com/uploads/FWgJDKeBJEKln3OdHb6KESCpybl2DWkwd28blnfg.png\" width=\"881\" height=\"469\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">163.56 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Kayu balok mana yang digunakan untuk atap?</p><p><strong>------------------<br>English Version</strong></p><p>Programmer beaver is sorting out logs for a hut using<br>these rules:</p><ol><li>1st action: if log is shorter than the one to the right of it it will be used for flooring;</li><li>2nd action: if longer, then it will be used for the roof.Joji is taking logs in order and repeating actions 1 and 2.</li></ol><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:167482,&quot;height&quot;:469,&quot;href&quot;:&quot;http://comfypac