(98, 97, 51, 1, '<p>David ingin berenang menyeberang semua sungai, tetapi dia hanya diizinkan untuk berenang sepanjang setiap sungai sekali.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:249662,&quot;height&quot;:646,&quot;href&quot;:&quot;http://comfypace.com/uploads/Mg9DxnIMq43rFIfXATCWriu9dMc7O7mG70ZL5vEz.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Mg9DxnIMq43rFIfXATCWriu9dMc7O7mG70ZL5vEz.png&quot;,&quot;width&quot;:889}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Mg9DxnIMq43rFIfXATCWriu9dMc7O7mG70ZL5vEz.png\"><img src=\"http://comfypace.com/uploads/Mg9DxnIMq43rFIfXATCWriu9dMc7O7mG70ZL5vEz.png\" width=\"889\" height=\"646\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">243.81 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Apa jalur yang harus ditempuh oleh David untuk berenang?</p><p><strong>-------------</strong></p><p><strong>English Version</strong></p><p>David wants to swim across all rivers but he is only<br>allowed to swim along each river once.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:249662,&quot;height&quot;:646,&quot;href&quot;:&quot;http://comfypace.com/uploads/Mg9DxnIMq43rFIfXATCWriu9dMc7O7mG70ZL5vEz.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Mg9DxnIMq43rFIfXATCWriu9dMc7O7mG70ZL5vEz.png&quot;,&quot;width&quot;:889}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Mg9DxnIMq43rFIfXATCWriu9dMc7O7mG70ZL5v