n class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">226.42 KB</span></figcaption></a></figure><strong>Question</strong><br><br>Unfortunately, four numbers are missing. What are the<br>missing numbers?</p>', 5, '2023-10-16 12:42:52', '2023-10-20 17:13:32', '<p>Jawabannya adalah 10,11, 18, 19 karena ketika dicek yang ada hanya 1, 2, 3, 4, 5, 6, 7, 8, 9, 12, 13, 14, 15, 16, 17, 20.<br><strong>----------------<br>English Version</strong></p><p>The answer is 10, 11, 18, 19 because when checked, the only numbers present are 1, 2, 3, 4, 5, 6, 7, 8, 9, 12, 13, 14, 15, 16, 17, 20.</p>'),
(100, 99, 52, 1, '<p>Seorang anak kecil bernama Lina menggunakan metode yang menarik untuk membuat gambar. Dia memotong stencil dari istana pada panel karton. Kemudian dia menempatkan bata-bata berwarna di dalamnya.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:45748,&quot;height&quot;:213,&quot;href&quot;:&quot;https://comfypace.com/uploads/hXzAzbAXfZvw7Myu1mjllF5mcRynTukFjJkJKgtF.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/hXzAzbAXfZvw7Myu1mjllF5mcRynTukFjJkJKgtF.png&quot;,&quot;width&quot;:570}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/hXzAzbAXfZvw7Myu1mjllF5mcRynTukFjJkJKgtF.png\"><img src=\"https://comfypace.com/uploads/hXzAzbAXfZvw7Myu1mjllF5mcRynTukFjJkJKgtF.png\" width=\"570\" height=\"213\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">44.68 KB</span></figcaption></a></figure></p><p>Lina menciptakan gambar ini:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:30495,&quot;height&quot;:298,&quot;href&quot;:&quot;https://comfypace.com/uploads/uZKpKfLCjcSDl00HGZ9XjtxkrqBXI8slzbPKPY65.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/uZKpKfLCjcSDl00HGZ9XjtxkrqBXI8slzbPKPY65.png&quot;,&quot;width&quot;:297}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/uZKpKfLCjcSDl00HGZ9XjtxkrqBXI8slzbPKPY65.png\"><img src=\"https://comfypace.com/uploads/uZKpKfLCjcSDl00HGZ9XjtxkrqBXI8slzbPKPY65.png\" width=\"297\" height=\"298\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">29.78 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Dalam berapa cara yang berbeda mungkin untuk membuat gambar ini?<br><strong>------------------<br>English Version</strong></p><p>A little kid, Lina uses an exciting method to create pictures. She cuts out a stencil of the castle in a<br>cardboard panel. Then she places colourful bricks in it.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:45748,&quot;height&quot;:213,&quot;href&quot;:&quot;https://comfypace.com/uploads/ers4NT1imtHXvYT5bUX51fhRisk3aiGOEbY17hG5.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/ers4NT1imtHXvYT5bUX51fhRisk3aiGOEbY17hG5.png&quot;,&quot;width&quot;:570}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/ers4NT1imtHXvYT5bUX51fhRisk3aiGOEbY17hG5.png\"><img src=\"https://comfypace.com/uploads/ers4NT1imtHXvYT5bUX51fhRisk3aiGOEbY17hG5.png\" width=\"570\" height=\"213\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">44.68 KB</span></figcaption></a></figure><br><br>Lina created this picture:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:30495,&quot;height&quot;:298,&quot;href&quot;:&quot;https://comfypace.com/uploads/hVNOqKQXIKYc579ETTGFTnODp6XftVSh93JahKH8.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/hVNOqKQXIKYc579ETTGFTnODp6XftVSh93JahKH8.png&quot;,&quot;width&quot;:297}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/hVNOqKQXIKYc579ETTGFTnODp6XftVSh93JahKH8.png\"><img src=\"https://comfypace.com/uploads/hVNOqKQXIKYc579ETTGFTnODp6XftVSh93JahKH8.png\" width=\"297\" height=\"298\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">29.78 KB</span></figcaption></a></figure><br><br><strong><br><br>Question</strong></p><p>In how many different ways is it possible to create this<br>picture?</p>', 5, '2023-10-16 12:49:23', '2023-10-25 04:46:51', '<p>Jawabannya adalah 3, yang pertama dengan menukar posisi kotak sebelah kiri dengan persegi panjang yang di kanan lalu yang kedua dengan memindah kotak yang di tengah ke samping dang yang persegi panjang dirotasi menjadi vertikal, yang ketiga dengan mengubah persegi panjang dengan 2 kotak.</p><p><strong>-----------------<br>English Version</strong></p><p>The answer is 3, the first one by swapping the positions of the square on the left with the rectangle on the right, the second one by moving the square in the middle to the side, and the rotated rectangle becomes vertical, the third one by replacing the rectangle with 2 squares.</p>'),
(101, 100, 53, 1, '<p>Hans menciptakan robot kumbang yang dapat bergerak dari satu kotak ke kotak lainnya dengan mengikuti arah panah. Robot kumbang dimulai dari salah satu pintu masuk di sebelah kiri. Robot bergerak sesuai arah yang ditunjukkan oleh panah selama jumlah kotak yang ada sama dengan jumlah panah (misalnya satu kotak jika ada satu panah, dua kotak jika ada dua panah, dan seterusnya). Ketika robot bergerak, ia mengabaikan panah di kotak-kotak tersebut.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:64650,&quot;height&quot;:382,&quot;href&quot;:&quot;https://comfypace.com/uploads/NxE79yH28FGB5KDnGfAJV2sriYZDKMTgKIJpkw8B.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/NxE79yH28FGB5KDnGfAJV2sriYZDKMTgKIJpkw8B.png&quot;,&quot;width&quot;:620}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/NxE79yH28FGB5KDnGfAJV2sriYZDKMTgKIJpkw8B.png\"><img src=\"https://comfypace.com/uploads/NxE79yH28FGB5KDnGfAJV2sriYZDKMTgKIJpkw8B.png\" width=\"620\" height=\"382\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">63.13 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Pintu masuk awal mana yang memungkinkan robot mencapai akhir?</p><p><strong>------------------<br>English Version</strong></p><p>Hans created a beetle robot, which can move from one square to another one following the arrows. The beetle robot starts at one of the entrances on the left. The robot moves in the direction indicated by the arrows for as many squares as there are arrows (e.g. one square if there is one arrow, two squares if there are two arrows etc.). When the robot is moving, he ignores the arrows on the squares.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:64650,&quot;height&quot;:382,&quot;href&quot;:&quot;https://comfypace.com/uploads/VY3dYHzgNiujXcCraKjhP9Gf5Jw1bqvsCoCgutrW.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/VY3dYHzgNiujXcCraKjhP9Gf5Jw1bqvsCoCgutrW.png&quot;,&quot;width&quot;:620}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/VY3dYHzgNiujXcCraKjhP9Gf5Jw1bqvsCoCgutrW.png\"><img src=\"https://comfypace.com/uploads/VY3dYHzgNiujXcCraKjhP9Gf5Jw1bqvsCoCgutrW.png\" width=\"620\" height=\"382\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">63.13 KB</span></figcaption></a></figure></p><p><br><strong>Question</strong><br>Which starting entrances allow the robot to reach the finish?</p>', 5, '2023-10-16 12:54:16', '2023-10-25 04:47:22', '<p>Jawabannya adalah 4 karena ketika masuk dia akan disuruh maju ke kanan sekali lalu naik sebanyak 3 kali dan terkena 2 panah ke kanan 2 kali ada lalu kena panah 2 kali ke bawah yang mana membuatnya di panah ke kiri sekali tetapi ia juga mendapatkan panah ke bawah 1 kali yang mana berisi 2 panah ke kanan yang akhirnya membawa robot Hans mencapai garis finish.<br><strong>------------<br>English Version</strong></p><p>The answer is 4 because upon entering, it will be instructed to move to the right once, then go up 3 times, and encounter 2 rightward arrows twice. Later, it will be hit by 2 downward arrows, causing it to turn to the left once. However, it will also receive 1 downward arrow containing 2 rightward arrows, ultimately leading the robot Hans to reach the finish line.</p>'),
(102, 101, 54, 1, '<p>Ada sebuah robot kucing yang memiliki perintah:<br>1. Jika ada tikus di kotak itu dia akan memakannya dan melompat secara diagonal ke kiri</p><p>2. Jika tidak ada tikus di kotak itu dia akan melompat secara diagonal ke kanan</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:95774,&quot;height&quot;:590,&quot;href&quot;:&quot;http://comfypace.com/uploads/qPzkETZmQk9W6hr0iTCbtJHXfgU6NThY5DRNXxz9.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/qPzkETZmQk9W6hr0iTCbtJHXfgU6NThY5DRNXxz9.png&quot;,&quot;width&quot;:767}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/qPzkETZmQk9W6hr0iTCbtJHXfgU6NThY5DRNXxz9.png\"><img src=\"http://comfypace.com/uploads/qPzkETZmQk9W6hr0iTCbtJHXfgU6NThY5DRNXxz9.png\" width=\"767\" height=\"590\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">93.53 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Berdasar gambar di atas berapa tikus yang sudah dimakan oleh sang robot kucing?</p><p><strong>--------------</strong></p><p><strong>English Version</strong></p><p>There is a cat robot with the following commands:</p><ol><li>If there is a mouse in the square, it will eat it and jump diagonally to the left.</li><li>If there is no mouse in the square, it will jump diagonally to the right.</li></ol><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:95774,&quot;height&quot;:590,&quot;href&quot;:&quot;http://comfypace.com/uploads/qPzkETZmQk9W6hr0iTCbtJHXfgU6NThY5DRNXxz9.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/qPzkETZmQk9W6hr0iTCbtJHXfgU6NThY5DRNXxz9.png&quot;,&quot;width&quot;:767}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/qPzkETZmQk9W6hr0iTCbtJHXfgU6NThY5DRNXxz9.png\"><img src=\"http://comfypace.com/uploads/qPzkETZmQk9W6hr0iTCbtJHXfgU6NThY5DRNXxz9.png\" width=\"767\" height=\"590\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">93.53 KB</span></figcaption></a></figure></p><p><strong>Question</strong></p><p>Based on the image above, how many mice have been eaten by the cat robot?</p>', 5, '2023-10-17 15:24:12', '2023-10-17 15:24:12', '<p>Jawabannya adalah 2 karena ketika kucing itu menemui tikus di kotak itu baru dia akan loncat ke kiri tetapi ketika dia tidak menemukan tikus di dalam kotak yang dia loncati dia akan selalu loncat ke arah kanan dan pada gambar ini dia hanya melompat ke kiri dua kali dari kotak yang ada yang mengartikan dia sudah memakan tikus sebanyak 2 ekor. Urutan gerakan dalam soal ini adalah loncat -&gt; cek ada tikus atau tidak -&gt;loncat jadi walaupun yang di loncatan terakhir ia ke kiri, itu masih valid bila dikatakan dia memakan tikus karena dia perlu memakan tikusnya baru loncat ke kiri.</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>The answer is 2 because when the cat robot encounters a mouse in the box, it will jump to the left. However, if it doesn\'t find a mouse in the box it jumps to, it will always jump to the right. In this image, it only jumps to the left twice from the boxes, which means it has eaten 2 mice. The sequence of movements in this problem is jump -&gt; check for the presence of a mouse -&gt; jump. So, even though its last jump is to the left, it\'s still valid to say that it has eaten 2 mice because it needs to eat the mice before jumping to the left.</p>'),
(103, 102, 54, 1, '<p>Budi mengenakan kaos dengan logonya sendiri yang membawa bendera Prancis. Dia mau agar setiap kaos yang dipakai memiliki warna yang berbeda-beda dan setiap kaos harus memiliki warna berdasar dari bendera Prancis. Dia bisa mengenakan kaos pertama berwarna biru lalu selanjutnya adalah putih dan akhirnya adalah merah. Kalau sekarang adalah kaos pertama yang dikenakan Budi:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:151449,&quot;height&quot;:565,&quot;href&quot;:&quot;http://comfypace.com/uploads/EdiJO4eBIOHN12vV7T3RliCFpSiew9s7WyHt3gEr.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/EdiJO4eBIOHN12vV7T3RliCFpSiew9s7WyHt3gEr.png&quot;,&quot;width&quot;:727}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/EdiJO4eBIOHN12vV7T3RliCFpSiew9s7WyHt3gEr.png\"><img src=\"http://comfypace.com/uploads/EdiJO4eBIOHN12vV7T3RliCFpSiew9s7WyHt3gEr.png\" width=\"727\" height=\"565\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">147.9 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Warna apa yang akan dikenakan Budi di kaos ke-10 nya?</p><p><strong>--------------</strong></p><p><strong>English Version</strong></p><p>Budi is wearing a t-shirt with a logo of himself on it. He would like different colours on every t-shirt he wears,<br>each t-shirt should be a colour from the French flag. He would wear a blue colour t-shirt, next would be white,<br>then  red. If this is the first t-shirt he wears:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:151449,&quot;height&quot;:565,&quot;href&quot;:&quot;http://comfypace.com/uploads/EdiJO4eBIOHN12vV7T3RliCFpSiew9s7WyHt3gEr.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/EdiJO4eBIOHN12vV7T3RliCFpSiew9s7WyHt3gEr.png&quot;,&quot;width&quot;:727}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/EdiJO4eBIOHN12vV7T3RliCFpSiew9s7WyHt3gEr.png\"><img src=\"http://comfypace.com/uploads/EdiJO4eBIOHN12vV7T3RliCFpSiew9s7WyHt3gEr.png\" width=\"727\" height=\"565\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">147.9 KB</span></figcaption></a></figure><strong>Question</strong></p><p>Which colour will the 10th t-shirt be?</p>', 5, '2023-10-17 15:33:44', '2023-10-17 15:33:44', '<p>Jawabannya adalah biru karena urutan warna nya adalah biru-&gt;putih-&gt;merah&nbsp; dan baju pertamanya berwarna biru maka bila kita urutkan biru-&gt;putih-&gt;merah-&gt;biru-&gt;putih-&gt;merah-&gt;biru-&gt;putih-&gt;merah-&gt;biru.</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>The answer is blue because the color sequence is blue -&gt; white -&gt; red, and the first shirt is blue. So, if we continue the sequence, it will be blue -&gt; white -&gt; red -&gt; blue -&gt; white -&gt; red -&gt; blue -&gt; white -&gt; red -&gt; blue.</p>'),
(104, 103, 55, 1, '<p>Lunar rover yang dikendalikan oleh Bobi sedang bergerak dari satu titik ke titik lain menggunakan peta di bawah ini. Jalur lunar rover adalah sebagai berikut:<br>(1, 1) (1, 3) (4, 3) (4, 6) (6,5)<br>Angka pertama adalah baris, yang kedua adalah nomor kolom.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:123694,&quot;height&quot;:564,&quot;href&quot;:&quot;http://comfypace.com/uploads/98sRVSDDTp5azIQV0Tv0r3jZoJtP9xHzJW1t9iHw.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/98sRVSDDTp5azIQV0Tv0r3jZoJtP9xHzJW1t9iHw.png&quot;,&quot;width&quot;:570}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/98sRVSDDTp5azIQV0Tv0r3jZoJtP9xHzJW1t9iHw.png\"><img src=\"http://comfypace.com/uploads/98sRVSDDTp5azIQV0Tv0r3jZoJtP9xHzJW1t9iHw.png\" width=\"570\" height=\"564\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">120.79 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Objek mana di antara bukit, kawah, atau batu yang akan dijumpai oleh lunar rover?</p><p><strong>--------------</strong></p><p><strong>English Version</strong></p><p>Bobi controlled lunar rover is moving from one point to another using the map below. Lunar rovers path is:<br>(1, 1) (1, 3) (4, 3) (4, 6) (6,5)<br>The first number is the row, the second  is the column number.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:123694,&quot;height&quot;:564,&quot;href&quot;:&quot;http://comfypace.com/uploads/98sRVSDDTp5azIQV0Tv0r3jZoJtP9xHzJW1t9iHw.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/98sRVSDDTp5azIQV0Tv0r3jZoJtP9xHzJW1t9iHw.png&quot;,&quot;width&quot;:570}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/98sRVSDDTp5azIQV0Tv0r3jZoJtP9xHzJW1t9iHw.png\"><img src=\"http://comfypace.com/uploads/98sRVSDDTp5azIQV0Tv0r3jZoJtP9xHzJW1t9iHw.png\" width=\"570\" height=\"564\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">120.79 KB</span></figcaption></a></figure><strong>Question</strong><br>Which one of these objects will be encountered by the lunar rover: hill, crater or rocks?</p>', 5, '2023-10-17 16:09:18', '2024-10-01 00:48:53', '<p>Jawabannya adalah kawah karena yang akan dilalui adalah (4,3) atau kawah cara membacanya map ini adalah yang pertama yaitu baris itu untuk vertikal dan yang kedua sebagai kolom yang artinya horizontal dan dia akan melalui kawah yang berada di (4,3) sementara batu yang di (5,5) tidak di lalui dan bukit di (6,4) pun tidak.</p><p><strong>--------------</strong></p><p><strong>English Version</strong></p><p>The answer is a crater because what will be passed is (4, 3), which corresponds to a crater. The way to read this map is that the first number represents the row, which is vertical, and the second number represents the column, which is horizontal. It will pass through the crater at (4, 3), while it won\'t pass through the rocks at (5, 5) or the hill at (6, 4).</p>'),
(105, 104, 55, 1, '<p>Robot mengumpulkan batu-batu menarik dengan mengulangi perintah-perintah berikut:</p><p>JIKA ada satu batu di dalam kotak, maka pindah ke kotak berikutnya,<br>JIKA TIDAK ADA - ambil satu batu dan pindah ke depan sebanyak jumlah kotak yang tersisa di dalam kotak.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:215989,&quot;height&quot;:551,&quot;href&quot;:&quot;http://comfypace.com/uploads/3GcOEXD9jm6mtvKMo2szQy27pp1RqJRuCMj2fRQa.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/3GcOEXD9jm6mtvKMo2szQy27pp1RqJRuCMj2fRQa.png&quot;,&quot;width&quot;:814}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/3GcOEXD9jm6mtvKMo2szQy27pp1RqJRuCMj2fRQa.png\"><img src=\"http://comfypace.com/uploads/3GcOEXD9jm6mtvKMo2szQy27pp1RqJRuCMj2fRQa.png\" width=\"814\" height=\"551\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">210.93 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Berapa banyak batu yang akan dikumpulkan oleh robot?<br><br><strong>---------------<br>English Version</strong></p><p>Robot is collecting interesting stones by repeating these commands:<br>IF there is one stone in the square, then move to the next square,<br>IF NOT  take one stone and move forward the same number of squares as there are stones left on the square.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:215989,&quot;height&quot;:551,&quot;href&quot;:&quot;http://comfypace.com/uploads/RXBxQI3GzQJXqs5NrI45tLr9oeXzLTG11tLKlqit.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/RXBxQI3GzQJXqs5NrI45tLr9oeXzLTG11tLKlqit.png&quot;,&quot;width&quot;:814}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/RXBxQI3GzQJXqs5NrI45tLr9oeXzLTG11tLKlqit.png\"><img src=\"http://comfypace.com/uploads/RXBxQI3GzQJXqs5NrI45tLr9oeXzLTG11tLKlqit.png\" width=\"814\" height=\"551\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">210.93 KB</span></figcaption></a></figure><br><strong>Question</strong><br>How many stones will be gathered by the robot?</p>', 5, '2023-10-18 14:32:26', '2023-10-24 16:06:35', '<p>Jawabannya adalah 5 karena ia hanya mengambil batu ketika di kotak itu tidak hanya ada satu batu lalu ketika sudah mengambil batu, batu yang sisa itu jadi jumlah robot itu untuk berjalan sehigga ia akan mengambil 1 dan loncat 2 kali lalu mengambil lagi 1 lagi tetapi loncat 3 kali dan akhirnya karena 1 batu dia hanya loncat-loncat saja dan akhirnya ada kotak yang ada 2 batu akhirnya dia mengambil 1 dan loncat 1 kali dan dia mengambil 1 batu lagi dan loncat 3 kali lalu loncat hingga ke batu yang isinya 3 dan mengambil 1 lalu loncat 2 kali dan akhirnya dia loncat lagi dan selesai akhirnya robot itu berhasil mengambil total 5 batu.</p><p><strong>-------------<br>English Version</strong></p><p>The answer is 5 because the robot only takes a stone when there is more than one stone in the square. When it takes a stone, the number of stones left on the square determines how many squares it moves forward. So, it will take 1 and move 2 squares, then take 1 more and move 3 squares, and so on. Eventually, it reaches a square with 2 stones, takes 1 and moves 1 square, then takes 1 more and moves 3 squares, and finally, it takes 1 more, jumping 2 squares, and finishes. In the end, the robot successfully gathers a total of 5 stones.</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(106, 105, 56, 1, '<p>Kursi-kursi di bioskop diberi nomor dan pelanggan seharusnya duduk di kursi yang sudah diwarnai biru. Semua pelanggan duduk di kursi-kursi ini:<br>[1, 1]; [1, 3]; [1, 6]; [2, 2]; [2, 5]; [2, 6]; [3, 2]; [4, 3]; [4, 1];<br>[4, 2]; [4, 5]; [4, 7].</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:394702,&quot;height&quot;:656,&quot;href&quot;:&quot;http://comfypace.com/uploads/adabQMA94iBZNmXfzI8E8Mt01pc0E8NwVLiGt1AV.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/adabQMA94iBZNmXfzI8E8Mt01pc0E8NwVLiGt1AV.png&quot;,&quot;width&quot;:872}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/adabQMA94iBZNmXfzI8E8Mt01pc0E8NwVLiGt1AV.png\"><img src=\"http://comfypace.com/uploads/adabQMA94iBZNmXfzI8E8Mt01pc0E8NwVLiGt1AV.png\" width=\"872\" height=\"656\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">385.45 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Pelanggan mana saja yang salah tempat duduknya?</p><p><strong>----------------<br>English Version</strong></p><p>Chairs in a cinema are marked by numbers and the customers must sit on the blue colored chairs.<br>All customers are sitting in these chairs:<br>[1, 1]; [1, 3]; [1, 6]; [2, 2]; [2, 5]; [2, 6]; [3, 2]; [4, 3]; [4, 1];<br>[4, 2]; [4, 5]; [4, 7].<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:394702,&quot;height&quot;:656,&quot;href&quot;:&quot;http://comfypace.com/uploads/adabQMA94iBZNmXfzI8E8Mt01pc0E8NwVLiGt1AV.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/adabQMA94iBZNmXfzI8E8Mt01pc0E8NwVLiGt1AV.png&quot;,&quot;width&quot;:872}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/adabQMA94iBZNmXfzI8E8Mt01pc0E8NwVLiGt1AV.png\"><img src=\"http://comfypace.com/uploads/adabQMA94iBZNmXfzI8E8Mt01pc0E8NwVLiGt1AV.png\" width=\"872\" height=\"656\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">385.45 KB</span></figcaption></a></figure><br><strong>Question</strong></p><p>Which customers that sit on the wrong chairs?</p>', 5, '2023-10-18 14:39:16', '2023-10-18 14:39:16', '<p>Jawabannya adalah [1,1],[1,3],[2,5],[4,1],[4,7] karena mereka tidak di kursi berwarna biru.<br><strong>---------------<br>English Version</strong></p><p>The answer is [1, 1], [1, 3], [2, 5], [4, 1], [4, 7] because they are not in blue-colored seats.</p>'),
(107, 106, 56, 1, '<p>Robot beaver sedang berjalan di atas ubin dan menghiasnya dengan ornamen. Dia tahu perintah-perintah berikut:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:10527,&quot;height&quot;:124,&quot;href&quot;:&quot;https://comfypace.com/uploads/9hGEz0QhSPVDYFMr6F10m0P6ueZ9EDa5MFcORUF7.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/9hGEz0QhSPVDYFMr6F10m0P6ueZ9EDa5MFcORUF7.png&quot;,&quot;width&quot;:110}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/9hGEz0QhSPVDYFMr6F10m0P6ueZ9EDa5MFcORUF7.png\"><img src=\"https://comfypace.com/uploads/9hGEz0QhSPVDYFMr6F10m0P6ueZ9EDa5MFcORUF7.png\" width=\"110\" height=\"124\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">10.28 KB</span></figcaption></a></figure></p><p>Maju ke ubin selanjutnya</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:5543,&quot;height&quot;:107,&quot;href&quot;:&quot;https://comfypace.com/uploads/hC74olxV9jXIXLgcHPIAqjacdleIfDpuc3fvnIwT.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/hC74olxV9jXIXLgcHPIAqjacdleIfDpuc3fvnIwT.png&quot;,&quot;width&quot;:113}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/hC74olxV9jXIXLgcHPIAqjacdleIfDpuc3fvnIwT.png\"><img src=\"https://comfypace.com/uploads/hC74olxV9jXIXLgcHPIAqjacdleIfDpuc3fvnIwT.png\" width=\"113\" height=\"107\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">5.41 KB</span></figcaption></a></figure></p><p>Buat gambar bunga</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9787,&quot;height&quot;:119,&quot;href&quot;:&quot;https://comfypace.com/uploads/VHE20aAB7HmzZyCGm2dxiR5Tnl1QC6KjrCJgOZp8.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/VHE20aAB7HmzZyCGm2dxiR5Tnl1QC6KjrCJgOZp8.png&quot;,&quot;width&quot;:196}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/VHE20aAB7HmzZyCGm2dxiR5Tnl1QC6KjrCJgOZp8.png\"><img src=\"https://comfypace.com/uploads/VHE20aAB7HmzZyCGm2dxiR5Tnl1QC6KjrCJgOZp8.png\" width=\"196\" height=\"119\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9.56 KB</span></figcaption></a></figure></p><p>Ulangi sebanyak 3 kali dalam contoh ini buat 3 kali gambar bunga</p><p>Beberapa bunga yang diletakkan di ubin yang sama diletakkan berdampingan.</p><div class=\"attachment-gallery attachment-gallery--2\"><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:64971,&quot;height&quot;:111,&quot;href&quot;:&quot;https://comfypace.com/uploads/hqoBHy8gXrV646Q54VXpOLKCyfrylBVbza0vUYnG.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/hqoBHy8gXrV646Q54VXpOLKCyfrylBVbza0vUYnG.png&quot;,&quot;width&quot;:863}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/hqoBHy8gXrV646Q54VXpOLKCyfrylBVbza0vUYnG.png\"><img src=\"https://comfypace.com/uploads/hqoBHy8gXrV646Q54VXpOLKCyfrylBVbza0vUYnG.png\" width=\"863\" height=\"111\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">63.45 KB</span></figcaption></a></figure><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:42333,&quot;height&quot;:115,&quot;href&quot;:&quot;https://comfypace.com/uploads/uOcz0qWzMfqRKP8uqzWUqYrD3wmkfUKNxvXVY5Q7.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/uOcz0qWzMfqRKP8uqzWUqYrD3wmkfUKNxvXVY5Q7.png&quot;,&quot;width&quot;:483}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/uOcz0qWzMfqRKP8uqzWUqYrD3wmkfUKNxvXVY5Q7.png\"><img src=\"https://comfypace.com/uploads/uOcz0qWzMfqRKP8uqzWUqYrD3wmkfUKNxvXVY5Q7.png\" width=\"483\" height=\"115\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">41.34 KB</span></figcaption></a></figure></div><p><strong>Pertanyaan</strong></p><p>Berapa jumlah maksimum bunga yang akan digambar di ubin tunggal oleh robot beaver setelah perintah-perintah ini?</p><p><strong>--------------<br>English Version</strong></p><p>Robot-beaver is walking on tiles and decorating them with ornaments. He knows these commands:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:87692,&quot;height&quot;:373,&quot;href&quot;:&quot;http://comfypace.com/uploads/WvJ2v107JX4dZbqINJkOjdzEuxLeqNeJqkd6KDeI.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/WvJ2v107JX4dZbqINJkOjdzEuxLeqNeJqkd6KDeI.png&quot;,&quot;width&quot;:838}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/WvJ2v107JX4dZbqINJkOjdzEuxLeqNeJqkd6KDeI.png\"><img src=\"http://comfypace.com/uploads/WvJ2v107JX4dZbqINJkOjdzEuxLeqNeJqkd6KDeI.png\" width=\"838\" height=\"373\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">85.64 KB</span></figcaption></a></figure><br>Several flowers on the same tile are drawn next to each other.</p><div class=\"attachment-gallery attachment-gallery--2\"><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:64971,&quot;height&quot;:111,&quot;href&quot;:&quot;https://comfypace.com/uploads/hqoBHy8gXrV646Q54VXpOLKCyfrylBVbza0vUYnG.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/hqoBHy8gXrV646Q54VXpOLKCyfrylBVbza0vUYnG.png&quot;,&quot;width&quot;:863}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/hqoBHy8gXrV646Q54VXpOLKCyfrylBVbza0vUYnG.png\"><img src=\"https://comfypace.com/uploads/hqoBHy8gXrV646Q54VXpOLKCyfrylBVbza0vUYnG.png\" width=\"863\" height=\"111\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">63.45 KB</span></figcaption></a></figure><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:42333,&quot;height&quot;:115,&quot;href&quot;:&quot;https://comfypace.com/uploads/uOcz0qWzMfqRKP8uqzWUqYrD3wmkfUKNxvXVY5Q7.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/uOcz0qWzMfqRKP8uqzWUqYrD3wmkfUKNxvXVY5Q7.png&quot;,&quot;width&quot;:483}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/uOcz0qWzMfqRKP8uqzWUqYrD3wmkfUKNxvXVY5Q7.png\"><img src=\"https://comfypace.com/uploads/uOcz0qWzMfqRKP8uqzWUqYrD3wmkfUKNxvXVY5Q7.png\" width=\"483\" height=\"115\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">41.34 KB</span></figcaption></a></figure></div><p><strong>Question</strong><br>What is the largest number of flowers drawn on a single<br>tile by robot-beaver, after these commands?</p>', 5, '2023-10-18 14:47:53', '2023-10-28 03:03:33', '<p>Jawabannya adalah 5 karena pertanyaannya adalah jumlah maksimal bunga yang digambar dalam satu ubin.&nbsp;</p><p><strong>--------------<br>English Version</strong></p><p><br>The answer is 5 because the question is about the maximum number of flowers drawn on a single tile.</p>'),
(108, 107, 57, 1, '<p>Pada peta Hadi, lokasi objek ditunjukkan dengan dua angka dalam tanda kurung. Angka baris terlebih dahulu, kemudian angka kolom.</p><p>Danau (1, 1)<br>Jembatan (5, 6)</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:207980,&quot;height&quot;:581,&quot;href&quot;:&quot;http://comfypace.com/uploads/6COnkQSdKaNtTPR4yOKhNWpKqvKDwc6qs9d0tcPd.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/6COnkQSdKaNtTPR4yOKhNWpKqvKDwc6qs9d0tcPd.png&quot;,&quot;width&quot;:754}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/6COnkQSdKaNtTPR4yOKhNWpKqvKDwc6qs9d0tcPd.png\"><img src=\"http://comfypace.com/uploads/6COnkQSdKaNtTPR4yOKhNWpKqvKDwc6qs9d0tcPd.png\" width=\"754\" height=\"581\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">203.11 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Gubuk Hadi terletak empat titik di bawah jembatan dan dua titik ke kanan dari jembatan.<br>Di mana letak gubuk beaver?<br><strong>----------------<br>English Version</strong></p><p>On Hadi\'s map the location of objects are indicated by two numbers in brackets. Row number first, then  column number.</p><p>Lake (1, 1)<br>Bridge (5, 6)</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:207980,&quot;height&quot;:581,&quot;href&quot;:&quot;http://comfypace.com/uploads/mI6kQUh81tBsGfaSPmlPcVvxE9QHeIhcWIzvfaWi.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/mI6kQUh81tBsGfaSPmlPcVvxE9QHeIhcWIzvfaWi.png&quot;,&quot;width&quot;:754}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/mI6kQUh81tBsGfaSPmlPcVvxE9QHeIhcWIzvfaWi.png\"><img src=\"http://comfypace.com/uploads/mI6kQUh81tBsGfaSPmlPcVvxE9QHeIhcWIzvfaWi.png\" width=\"754\" height=\"581\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">203.11 KB</span></figcaption></a></figure><br><strong>Question</strong><br>Hadi\'s hut is located four points below bridge and<br>two points to the right of the bridge.<br>What is the location of the Beaver hut?</p>', 5, '2023-10-18 14:56:11', '2023-10-24 16:05:54', '<p>Jawabannya adalah pinggir sungai karena titik nya adalah (9,8) tepat dipinggir sungai. Dalam perhitungan&nbsp; (5 + 4 , 6+8) sehingga hasilnya (9,8).</p><p><strong>---------------</strong><br><strong>English Version</strong></p><p>The answer is the riverbank because its coordinates are (9, 8), right on the riverbank. In the calculation (5 + 4, 6 + 8), the result is (9, 8).</p>'),
(109, 108, 58, 1, '<p>Di sebuah kampung, muncul tulisan aneh. Setelah diteliti, ternyata tulisan itu terdiri dari 3 (tiga) lambang<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25045,&quot;height&quot;:80,&quot;href&quot;:&quot;http://comfypace.com/uploads/qbSIRvImS1ddYi0R9Y6URd7JmA8f4qowaNJVHV6q.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/qbSIRvImS1ddYi0R9Y6URd7JmA8f4qowaNJVHV6q.png&quot;,&quot;width&quot;:227}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/qbSIRvImS1ddYi0R9Y6URd7JmA8f4qowaNJVHV6q.png\"><img src=\"http://comfypace.com/uploads/qbSIRvImS1ddYi0R9Y6URd7JmA8f4qowaNJVHV6q.png\" width=\"227\" height=\"80\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.46 KB</span></figcaption></a></figure>Selain itu ternyata tulisan selalu mengikuti dua aturan sebagai berikut:</p><ul><li>Mula-mula, sebuah lambang dipilih dan dituliskan satu atau dua kali.</li><li>Kemudian, aturan berikut diulang beberapa kali (atau tidak pernah ditulis) : pilih sebuah simbol, dan tulis di ujung kiri dan kanan dari yang sudah ada.</li></ul><p>Berikut ini lima contoh tulisan aneh tersebut:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:93436,&quot;height&quot;:229,&quot;href&quot;:&quot;http://comfypace.com/uploads/cwdZh8FgfpvrVF5SkrEZzePIcr39nYOKccPjuEgO.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/cwdZh8FgfpvrVF5SkrEZzePIcr39nYOKccPjuEgO.png&quot;,&quot;width&quot;:699}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/cwdZh8FgfpvrVF5SkrEZzePIcr39nYOKccPjuEgO.png\"><img src=\"http://comfypace.com/uploads/cwdZh8FgfpvrVF5SkrEZzePIcr39nYOKccPjuEgO.png\" width=\"699\" height=\"229\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">91.25 KB</span></figcaption></a></figure><strong>Tantangan:<br></strong>Dari tulisan berikut ini, mana yang tidak mengikuti aturan yang diberikan di atas ?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>In a village, strange writings appeared. Upon examination, it was found that the writings consisted of three symbols, which are</p><p>&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25045,&quot;height&quot;:80,&quot;href&quot;:&quot;http://comfypace.com/uploads/qbSIRvImS1ddYi0R9Y6URd7JmA8f4qowaNJVHV6q.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/qbSIRvImS1ddYi0R9Y6URd7JmA8f4qowaNJVHV6q.png&quot;,&quot;width&quot;:227}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/qbSIRvImS1ddYi0R9Y6URd7JmA8f4qowaNJVHV6q.png\"><img src=\"http://comfypace.com/uploads/qbSIRvImS1ddYi0R9Y6URd7JmA8f4qowaNJVHV6q.png\" width=\"227\" height=\"80\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.46 KB</span></figcaption></a></figure> Furthermore, it was discovered that the writings always followed two rules as follows:<br> Initially, a symbol is selected and written once or twice.<br> Then, the following rule is repeated several times (or not written at all): choose a symbol and write it at the left and right ends of what is already there.&nbsp;</p><p>Here are five examples of such strange writings:&nbsp;</p><p>&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:93436,&quot;height&quot;:229,&quot;href&quot;:&quot;http://comfypace.com/uploads/cwdZh8FgfpvrVF5SkrEZzePIcr39nYOKccPjuEgO.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/cwdZh8FgfpvrVF5SkrEZzePIcr39nYOKccPjuEgO.png&quot;,&quot;width&quot;:699}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/cwdZh8FgfpvrVF5SkrEZzePIcr39nYOKccPjuEgO.png\"><img src=\"http://comfypace.com/uploads/cwdZh8FgfpvrVF5SkrEZzePIcr39nYOKccPjuEgO.png\" width=\"699\" height=\"229\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">91.25 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>From the following writings, which one does not follow the rules given above?&nbsp;</p>', 5, '2023-10-18 15:24:52', '2023-10-18 15:24:52', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:262998,&quot;height&quot;:252,&quot;href&quot;:&quot;http://comfypace.com/uploads/rdwcMm3KRTOXP1pjabX7itp0fSWZNdulbCmyza7z.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/rdwcMm3KRTOXP1pjabX7itp0fSWZNdulbCmyza7z.png&quot;,&quot;width&quot;:1172}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/rdwcMm3KRTOXP1pjabX7itp0fSWZNdulbCmyza7z.png\"><img src=\"http://comfypace.com/uploads/rdwcMm3KRTOXP1pjabX7itp0fSWZNdulbCmyza7z.png\" width=\"1172\" height=\"252\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">256.83 KB</span></figcaption></a></figure></p>'),
(110, 109, 58, 1, '<p>Sebuah boneka bersarang adalah sekumpulan boneka kayu, dimana satu boneka dapat dimasukkan ke dalam boneka lainnya. Setiap boneka dapat dibuka tutupnya, untuk melihat boneka lebih kecil (ukuran tinggi dan lebarnya) yang ada di dalamnya.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:210221,&quot;height&quot;:378,&quot;href&quot;:&quot;http://comfypace.com/uploads/g87tAHXCcODCFS4R2Keildy2xRHpKs56Qq3ER5S5.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/g87tAHXCcODCFS4R2Keildy2xRHpKs56Qq3ER5S5.png&quot;,&quot;width&quot;:675}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/g87tAHXCcODCFS4R2Keildy2xRHpKs56Qq3ER5S5.png\"><img src=\"http://comfypace.com/uploads/g87tAHXCcODCFS4R2Keildy2xRHpKs56Qq3ER5S5.png\" width=\"675\" height=\"378\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">205.29 KB</span></figcaption></a></figure>Berikut ini adalah semua boneka yang dipunyai Emili. Dia ingin menyusun boneka-boneka sehingga dapat<br>dimasukkan menjadi satu, sebanyak-banyaknya.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:113585,&quot;height&quot;:195,&quot;href&quot;:&quot;http://comfypace.com/uploads/XV5qFufjOlzI1x411pqkELX4VSX7vEffKautwW5e.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/XV5qFufjOlzI1x411pqkELX4VSX7vEffKautwW5e.png&quot;,&quot;width&quot;:673}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/XV5qFufjOlzI1x411pqkELX4VSX7vEffKautwW5e.png\"><img src=\"http://comfypace.com/uploads/XV5qFufjOlzI1x411pqkELX4VSX7vEffKautwW5e.png\" width=\"673\" height=\"195\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">110.92 KB</span></figcaption></a></figure><strong>Pertanyaan:<br></strong>Berapa buah boneka dapat disusun oleh Emili?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>A nested doll is a set of wooden dolls, where one doll can be placed inside another. Each doll can be opened to reveal smaller dolls (in terms of height and width) inside it.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:210221,&quot;height&quot;:378,&quot;href&quot;:&quot;http://comfypace.com/uploads/g87tAHXCcODCFS4R2Keildy2xRHpKs56Qq3ER5S5.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/g87tAHXCcODCFS4R2Keildy2xRHpKs56Qq3ER5S5.png&quot;,&quot;width&quot;:675}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/g87tAHXCcODCFS4R2Keildy2xRHpKs56Qq3ER5S5.png\"><img src=\"http://comfypace.com/uploads/g87tAHXCcODCFS4R2Keildy2xRHpKs56Qq3ER5S5.png\" width=\"675\" height=\"378\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">205.29 KB</span></figcaption></a></figure>Here are all the dolls that Emily has. She wants to arrange the dolls so that they can be nested as much as possible.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:113585,&quot;height&quot;:195,&quot;href&quot;:&quot;http://comfypace.com/uploads/XV5qFufjOlzI1x411pqkELX4VSX7vEffKautwW5e.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/XV5qFufjOlzI1x411pqkELX4VSX7vEffKautwW5e.png&quot;,&quot;width&quot;:673}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/XV5qFufjOlzI1x411pqkELX4VSX7vEffKautwW5e.png\"><img src=\"http://comfypace.com/uploads/XV5qFufjOlzI1x411pqkELX4VSX7vEffKautwW5e.png\" width=\"673\" height=\"195\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">110.92 KB</span></figcaption></a></figure><strong> Question:<br></strong>How many dolls can Emily arrange?</p>', 5, '2023-10-18 15:29:05', '2023-10-18 15:29:05', '<p>Menurut pertanyaan ini, setiap boneka dalam jawaban harus memiliki lebar dan tinggi yang lebih kecil<br>dari yang lainnya. Jika kita pertama-tama menyortir boneka berdasarkan lebarnya dalam urutan besar ke<br>kecil, maka kita dapat memastikan boneka yang dapat dimasukkan secara bersarang.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:106058,&quot;height&quot;:210,&quot;href&quot;:&quot;http://comfypace.com/uploads/JOZkOz7ql6Xf37vEHhwrz9eERbcilv8JzkpSJRbR.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/JOZkOz7ql6Xf37vEHhwrz9eERbcilv8JzkpSJRbR.png&quot;,&quot;width&quot;:795}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/JOZkOz7ql6Xf37vEHhwrz9eERbcilv8JzkpSJRbR.png\"><img src=\"http://comfypace.com/uploads/JOZkOz7ql6Xf37vEHhwrz9eERbcilv8JzkpSJRbR.png\" width=\"795\" height=\"210\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">103.57 KB</span></figcaption></a></figure>Berikutnya, kita harus memilih sebanyak mungkin boneka, dari boneka yang sudah terurut lebarnya dan<br>dijejer pula terurut tingginya. Ingatlah bahwa boneka yang dipilih harus memiliki urutan dari yang paling<br>tinggi ke yang paling pendek.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:76993,&quot;height&quot;:210,&quot;href&quot;:&quot;http://comfypace.com/uploads/4FgUPNghAlfMUmpjzkO1Tp1XB5HqqX8pr6XA5vwI.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/4FgUPNghAlfMUmpjzkO1Tp1XB5HqqX8pr6XA5vwI.png&quot;,&quot;width&quot;:566}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/4FgUPNghAlfMUmpjzkO1Tp1XB5HqqX8pr6XA5vwI.png\"><img src=\"http://comfypace.com/uploads/4FgUPNghAlfMUmpjzkO1Tp1XB5HqqX8pr6XA5vwI.png\" width=\"566\" height=\"210\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">75.19 KB</span></figcaption></a></figure>Pada kasus ini, jika anda memilih boneka yang terbesar dulu, maka anda hanya bisa mendapatkan boneka<br>bersarang dengan tiga lapisan. Namun, jika anda tidak menggunakan boneka terbesar, anda bisa<br>mendapatkan boneka bersarang dengan empat lapisan.<br>Tentu saja, Anda bisa mulai dengan menyortir boneka berdasarkan tingginya, lalu mencoba memilih<br>boneka sebanyak mungkin berdasarkan lebar mereka.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>According to this question, each doll in the answer should have both a smaller width and height than the one it\'s nested in. If we first sort the dolls by their width in descending order, we can ensure nested dolls.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:106058,&quot;height&quot;:210,&quot;href&quot;:&quot;http://comfypace.com/uploads/JOZkOz7ql6Xf37vEHhwrz9eERbcilv8JzkpSJRbR.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/JOZkOz7ql6Xf37vEHhwrz9eERbcilv8JzkpSJRbR.png&quot;,&quot;width&quot;:795}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/JOZkOz7ql6Xf37vEHhwrz9eERbcilv8JzkpSJRbR.png\"><img src=\"http://comfypace.com/uploads/JOZkOz7ql6Xf37vEHhwrz9eERbcilv8JzkpSJRbR.png\" width=\"795\" height=\"210\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">103.57 KB</span></figcaption></a></figure>Next, we need to select as many dolls as possible from the dolls already sorted by width and also sorted by height. Remember that the chosen dolls must have a sequence from the tallest to the shortest.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:76993,&quot;height&quot;:210,&quot;href&quot;:&quot;http://comfypace.com/uploads/4FgUPNghAlfMUmpjzkO1Tp1XB5HqqX8pr6XA5vwI.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/4FgUPNghAlfMUmpjzkO1Tp1XB5HqqX8pr6XA5vwI.png&quot;,&quot;width&quot;:566}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/4FgUPNghAlfMUmpjzkO1Tp1XB5HqqX8pr6XA5vwI.png\"><img src=\"http://comfypace.com/uploads/4FgUPNghAlfMUmpjzkO1Tp1XB5HqqX8pr6XA5vwI.png\" width=\"566\" height=\"210\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">75.19 KB</span></figcaption></a></figure> In this case, if you start by choosing the largest doll, you can only get a nested doll with three layers. However, if you don\'t use the largest doll, you can get a nested doll with four layers.</p><p>Of course, you can also start by sorting the dolls by their height and try to select as many as possible based on their width.&nbsp;</p>'),
(111, 110, 59, 1, '<p>Simon berkata: Jika tombol ditekan, warna akan berpindah seperti ditunjukkan pada gambar berikut:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:120599,&quot;height&quot;:434,&quot;href&quot;:&quot;http://comfypace.com/uploads/qD39OHYoUIrgFTqewt99ysaHGici4ChJzA6jxfiD.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/qD39OHYoUIrgFTqewt99ysaHGici4ChJzA6jxfiD.png&quot;,&quot;width&quot;:872}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/qD39OHYoUIrgFTqewt99ysaHGici4ChJzA6jxfiD.png\"><img src=\"http://comfypace.com/uploads/qD39OHYoUIrgFTqewt99ysaHGici4ChJzA6jxfiD.png\" width=\"872\" height=\"434\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">117.77 KB</span></figcaption></a></figure><strong>Pertanyaan:<br></strong>Jika kita tekan tombolnya sekali lagi, dimana letak biru, hijau dan kuning?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Simon said, \"If the button is pressed, the colors will shift as shown in the following picture:\"<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:33793,&quot;height&quot;:266,&quot;href&quot;:&quot;http://comfypace.com/uploads/OAe1lnVLZ3W0cxUz5qTDlBES7bSrUKsI9yoq96KT.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/OAe1lnVLZ3W0cxUz5qTDlBES7bSrUKsI9yoq96KT.png&quot;,&quot;width&quot;:537}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/OAe1lnVLZ3W0cxUz5qTDlBES7bSrUKsI9yoq96KT.png\"><img src=\"http://comfypace.com/uploads/OAe1lnVLZ3W0cxUz5qTDlBES7bSrUKsI9yoq96KT.png\" width=\"537\" height=\"266\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">33 KB</span></figcaption></a></figure><strong>Question:<br></strong>If we press the button one more time, where will the blue, green, and yellow be located?&nbsp;</p>', 5, '2023-10-18 15:43:33', '2023-10-18 15:43:33', NULL),
(112, 111, 59, 1, '<p>Santi si ular berdansa:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:131206,&quot;height&quot;:311,&quot;href&quot;:&quot;http://comfypace.com/uploads/ZskOuBr5zRsGuvAH67Q7darrzUTk4vw8c6htUZ4L.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/ZskOuBr5zRsGuvAH67Q7darrzUTk4vw8c6htUZ4L.png&quot;,&quot;width&quot;:950}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/ZskOuBr5zRsGuvAH67Q7darrzUTk4vw8c6htUZ4L.png\"><img src=\"http://comfypace.com/uploads/ZskOuBr5zRsGuvAH67Q7darrzUTk4vw8c6htUZ4L.png\" width=\"950\" height=\"311\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">128.13 KB</span></figcaption></a></figure><strong>Tantangan:<br></strong>Dengan memperhatikan pola gerakan si Santi, gambar yang mana yang cocok untuk gerakan ke lima?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Santi the snake is dancing:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:176441,&quot;height&quot;:356,&quot;href&quot;:&quot;http://comfypace.com/uploads/bACfkP9WN9NzaLKVC6jCvJP7DUzH7WvXGbML7NOB.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/bACfkP9WN9NzaLKVC6jCvJP7DUzH7WvXGbML7NOB.png&quot;,&quot;width&quot;:1151}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/bACfkP9WN9NzaLKVC6jCvJP7DUzH7WvXGbML7NOB.png\"><img src=\"http://comfypace.com/uploads/bACfkP9WN9NzaLKVC6jCvJP7DUzH7WvXGbML7NOB.png\" width=\"1151\" height=\"356\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">172.31 KB</span></figcaption></a></figure><strong>Question:</strong><br>Based on Santi\'s movement pattern, which picture is suitable for the fifth move?&nbsp;</p>', 5, '2023-10-18 15:48:26', '2023-10-18 15:48:26', '<p>A, B &amp; D tidak mungkin benar karena tidak mengikuti pola:</p><ul><li>Dalam gambar, ekor ular berubah posisi di setiap langkah tarian, dia akan lurus atau bengkok setelah yang lain.</li><li>Garis hitam kecil berputar di atas atau di bawah garis hitam lebar.</li><li>Pada setiap langkah berikutnya, ular berputar (90 derajat) searah jarum jam.</li></ul><p>Di langkah tarian berikutnya, kepala ular melihat ke arah baru (ke bawah), tapi ekornya tetap tidak bergerak (lurus), dan garis kecil hitam bergerak di atas garis hitam lebar.<br>Satu-satunya jawaban yang benar adalah C karena mengikuti aturan yang sama.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>A, B, and D are not possible because they do not follow the pattern:</p><ul><li>In the image, the snake\'s tail changes position with each dance step, either straight or curved after each other.</li><li>The small black line rotates above or below the wide black line.</li><li>In each subsequent step, the snake rotates (90 degrees) clockwise.</li></ul><p>In the next dance step, the snake\'s head is looking in a new direction (down), but its tail remains stationary (straight), and the small black line moves above the wide black line.<br>The only correct answer is C because it follows the same rules.</p><p>&nbsp;</p>'),
(113, 112, 60, 1, '<p>Klara menyukai bunga. Ia ingin membeli sebuah karangan bunga di sebuah toko bunga. Toko itu hanya<br>mempunyai 4 jenis bunga<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:89417,&quot;height&quot;:264,&quot;href&quot;:&quot;http://comfypace.com/uploads/1Tgg93b0wV1eOTMWkCpCGYdpDEhQsvsOKhbO7wcl.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/1Tgg93b0wV1eOTMWkCpCGYdpDEhQsvsOKhbO7wcl.png&quot;,&quot;width&quot;:1049}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/1Tgg93b0wV1eOTMWkCpCGYdpDEhQsvsOKhbO7wcl.png\"><img src=\"http://comfypace.com/uploads/1Tgg93b0wV1eOTMWkCpCGYdpDEhQsvsOKhbO7wcl.png\" width=\"1049\" height=\"264\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">87.32 KB</span></figcaption></a></figure>Untuk setiap jenis bunga hanya tersedia 3 macam warna:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:4653,&quot;height&quot;:50,&quot;href&quot;:&quot;http://comfypace.com/uploads/GPbpVUoXqVSkv411lDCMik9IBkjs4GoaBMyiPvir.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/GPbpVUoXqVSkv411lDCMik9IBkjs4GoaBMyiPvir.png&quot;,&quot;width&quot;:285}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/GPbpVUoXqVSkv411lDCMik9IBkjs4GoaBMyiPvir.png\"><img src=\"http://comfypace.com/uploads/GPbpVUoXqVSkv411lDCMik9IBkjs4GoaBMyiPvir.png\" width=\"285\" height=\"50\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">4.54 KB</span></figcaption></a></figure>Klara ingin sebuah karangan bunga yang memenuhi syarat sebagai berikut.</p><ol><li>Setiap warna muncul dua kali.</li><li>Jenis bunga yang sama harus berbeda warnanya.</li><li>Paling banyak ada dua bunga untuk setiap jenis bunga.</li></ol><p><strong>Tantangan:<br></strong>Karangan bunga mana yang memenuhi syarat 1), 2) dan 3)?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Klara likes flowers and wants to buy a bouquet from a flower shop. The shop has only 4 types of flowers.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:84980,&quot;height&quot;:276,&quot;href&quot;:&quot;http://comfypace.com/uploads/JrPVaEhNCbcwgX4CzHDXBLa6zU6Pdu1dwwjiNj7G.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/JrPVaEhNCbcwgX4CzHDXBLa6zU6Pdu1dwwjiNj7G.png&quot;,&quot;width&quot;:1028}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/JrPVaEhNCbcwgX4CzHDXBLa6zU6Pdu1dwwjiNj7G.png\"><img src=\"http://comfypace.com/uploads/JrPVaEhNCbcwgX4CzHDXBLa6zU6Pdu1dwwjiNj7G.png\" width=\"1028\" height=\"276\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">82.99 KB</span></figcaption></a></figure>For each type of flower, there are only 3 different colors available.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8982,&quot;height&quot;:147,&quot;href&quot;:&quot;http://comfypace.com/uploads/GC48itxWG1rU37P4McaUc1qobaELn0xnopq3ZGnJ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/GC48itxWG1rU37P4McaUc1qobaELn0xnopq3ZGnJ.png&quot;,&quot;width&quot;:704}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/GC48itxWG1rU37P4McaUc1qobaELn0xnopq3ZGnJ.png\"><img src=\"http://comfypace.com/uploads/GC48itxWG1rU37P4McaUc1qobaELn0xnopq3ZGnJ.png\" width=\"704\" height=\"147\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.77 KB</span></figcaption></a></figure>Klara wants a bouquet of flowers that meets the following criteria:</p><ol><li>Each color appears twice.</li><li>The same type of flower should have different colors.</li><li>There can be a maximum of two flowers for each type of flower.</li></ol><p>Challenge:<br>Which bouquet of flowers meets criteria 1), 2), and 3)?&nbsp;</p>', 5, '2023-10-18 15:57:30', '2023-10-18 15:57:30', '<p>Di buket A) ada 3 bunga berwarna putih, B) tiga mawar, di buket C) dua bunga dari jenis yang sama yaitu<br>bunga terompet memiliki warna yang sama.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>In bouquet A), there are 3 white flowers. In bouquet B), there are three roses. In bouquet C), there are two flowers of the same type, which are trumpet flowers and have the same color.&nbsp;</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(114, 113, 60, 1, '<p>Si Doni mempunyai sebuah mesin sakti yang dapat membuat balok kayu dengan bentuk<br>tertentu. Cara bekerjanya adalah sebagai berikut: sebuah balok dimasukkan ke lubang input 1 atau 2 atau<br>3. Balok akan lewat sebuah mesin yang digambarkan sebagai (_) dan mengalir melalui lorong (bisa melalui<br>mesin berikutnya jika pada lorong ada lebih dari dua mesin), sampai jatuh ke bawah.</p><div class=\"attachment-gallery attachment-gallery--2\"><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:137166,&quot;height&quot;:573,&quot;href&quot;:&quot;http://comfypace.com/uploads/86bVoYXadu6HlqfA0FcEVPP2UJBlepfcXkpJHyzA.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/86bVoYXadu6HlqfA0FcEVPP2UJBlepfcXkpJHyzA.png&quot;,&quot;width&quot;:653}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/86bVoYXadu6HlqfA0FcEVPP2UJBlepfcXkpJHyzA.png\"><img src=\"http://comfypace.com/uploads/86bVoYXadu6HlqfA0FcEVPP2UJBlepfcXkpJHyzA.png\" width=\"653\" height=\"573\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">133.95 KB</span></figcaption></a></figure><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:11709,&quot;height&quot;:70,&quot;href&quot;:&quot;http://comfypace.com/uploads/vSbik4hHzpHNQmB5IAee6quWkimQgaIUY89kaB4Z.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/vSbik4hHzpHNQmB5IAee6quWkimQgaIUY89kaB4Z.png&quot;,&quot;width&quot;:124}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/vSbik4hHzpHNQmB5IAee6quWkimQgaIUY89kaB4Z.png\"><img src=\"http://comfypace.com/uploads/vSbik4hHzpHNQmB5IAee6quWkimQgaIUY89kaB4Z.png\" width=\"124\" height=\"70\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">11.43 KB</span></figcaption></a></figure></div><p>Gambar diatas artinya jika sebuah balok berbentuk segitiga datang, setelah lewat jalan akan menjadi balok</p><p>bentuk bulat. Jika balok yang lewat adalah persegi atau bulat, tidak akan terjadi perubahan.</p><p><br><strong>Tantangan:</strong><br>Bentuk balok apa yang harus dimasukkan dan harus dimasukkan ke input nomor berapa supaya doni mendapatkan sebuah balok persegi ?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:804,&quot;height&quot;:57,&quot;href&quot;:&quot;http://comfypace.com/uploads/HH2J05m8HROxz3wiOJBTEvDJqgw7AKr8ZEMaeJJU.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/HH2J05m8HROxz3wiOJBTEvDJqgw7AKr8ZEMaeJJU.png&quot;,&quot;width&quot;:73}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/HH2J05m8HROxz3wiOJBTEvDJqgw7AKr8ZEMaeJJU.png\"><img src=\"http://comfypace.com/uploads/HH2J05m8HROxz3wiOJBTEvDJqgw7AKr8ZEMaeJJU.png\" width=\"73\" height=\"57\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">804 Bytes</span></figcaption></a></figure> -----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Doni has a magical machine that can transform wooden blocks into specific shapes. The way it works is as follows: a block is inserted into input hole 1, 2, or 3. The block will pass through a machine represented by (_) and travel through a passage (it can pass through the next machine if there are more than two machines in the passage) until it falls down.</p><p>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:137166,&quot;height&quot;:573,&quot;href&quot;:&quot;http://comfypace.com/uploads/86bVoYXadu6HlqfA0FcEVPP2UJBlepfcXkpJHyzA.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/86bVoYXadu6HlqfA0FcEVPP2UJBlepfcXkpJHyzA.png&quot;,&quot;width&quot;:653}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/86bVoYXadu6HlqfA0FcEVPP2UJBlepfcXkpJHyzA.png\"><img src=\"http://comfypace.com/uploads/86bVoYXadu6HlqfA0FcEVPP2UJBlepfcXkpJHyzA.png\" width=\"653\" height=\"573\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">133.95 KB</span></figcaption></a></figure>&nbsp; <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:11709,&quot;height&quot;:70,&quot;href&quot;:&quot;http://comfypace.com/uploads/vSbik4hHzpHNQmB5IAee6quWkimQgaIUY89kaB4Z.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/vSbik4hHzpHNQmB5IAee6quWkimQgaIUY89kaB4Z.png&quot;,&quot;width&quot;:124}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/vSbik4hHzpHNQmB5IAee6quWkimQgaIUY89kaB4Z.png\"><img src=\"http://comfypace.com/uploads/vSbik4hHzpHNQmB5IAee6quWkimQgaIUY89kaB4Z.png\" width=\"124\" height=\"70\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">11.43 KB</span></figcaption></a></figure>The image above indicate that if a triangular block enters, it will become a round block after passing through the passage. If a square or round block passes through, there will be no change.</p><p><strong>Challenge:</strong><br>What shape of block should be inserted, and in which input hole, so that Doni obtains a square block?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:804,&quot;height&quot;:57,&quot;href&quot;:&quot;http://comfypace.com/uploads/HH2J05m8HROxz3wiOJBTEvDJqgw7AKr8ZEMaeJJU.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/HH2J05m8HROxz3wiOJBTEvDJqgw7AKr8ZEMaeJJU.png&quot;,&quot;width&quot;:73}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/HH2J05m8HROxz3wiOJBTEvDJqgw7AKr8ZEMaeJJU.png\"><img src=\"http://comfypace.com/uploads/HH2J05m8HROxz3wiOJBTEvDJqgw7AKr8ZEMaeJJU.png\" width=\"73\" height=\"57\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">804 Bytes</span></figcaption></a></figure>&nbsp;</p>', 5, '2023-10-18 15:59:30', '2023-10-18 15:59:47', '<p>Jawaban yang tepat adalah B. Taruh sebuah lingkaran ( ) ke input nomor 2.&nbsp;</p><p>Mari kita tinjau hasil dari masing-masing jawaban:</p><ul><li>A. Lingkaran hanya akan diubah menjadi segitiga pada perubahan terakhir. Hasilnya akan berupa sebuah segitiga.</li><li>B. Lingkaran akan dibentuk menjadi persegi, kemudian persegi menjadi segitiga, dan segitiga menjadi persegi</li><li>C. Segitiga akan dibentuk menjadi lingkaran, kemudian lingkaran menjadi segitiga lagi. Outputnya sebuah segitiga</li><li>D. Segitiga akan dibentuk menjdai lingkaran, kemudian lingkaran menjadi segitiga lagi. Outputnya adalah sebuah segitiga.</li></ul><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The correct answer is indeed B. Place a circle ( ) in input slot number 2.</p><p>Let\'s examine the results of each option:</p><ul><li>A. The circle will only be transformed into a triangle in the final change. The result will be a triangle.</li><li>B. The circle will be transformed into a square, then the square into a triangle, and the triangle into a square. The final output is a square.</li><li>C. The triangle will be transformed into a circle, and then the circle will be turned back into a triangle. The output is a triangle.</li><li>D. The triangle will be transformed into a circle, and then the circle will be turned back into a triangle. The output is a triangle.</li></ul><p>&nbsp;</p>'),
(115, 114, 61, 1, '<p>Berang-berang hidup dalam sebuah lembah yang dikelilingi gunung. Dalam lembah, ada danau. Danau<br>dikelilingi lapangan yang berisi pohon atau batu-batuan.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:442836,&quot;height&quot;:498,&quot;href&quot;:&quot;http://comfypace.com/uploads/GU9PUOgOwwrRx0iijA9KmzJuKs6Rxq2kVpBumz8T.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/GU9PUOgOwwrRx0iijA9KmzJuKs6Rxq2kVpBumz8T.png&quot;,&quot;width&quot;:1090}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/GU9PUOgOwwrRx0iijA9KmzJuKs6Rxq2kVpBumz8T.png\"><img src=\"http://comfypace.com/uploads/GU9PUOgOwwrRx0iijA9KmzJuKs6Rxq2kVpBumz8T.png\" width=\"1090\" height=\"498\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">432.46 KB</span></figcaption></a></figure>Setiap hari, para berang-berang akan mengalirkan air ke lapangan yang ada pohonnya yang bersebelahan<br>dengan danau, atau yang bersebelahan yang sudah dialiri air. Misalnya, pada hari pertama, 3 lapangan<br>sebagai berikut dialiri:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:352326,&quot;height&quot;:484,&quot;href&quot;:&quot;http://comfypace.com/uploads/UrkPAiF7dXp7Vpzkl1niKlBrcFLZO3MXVqWxZe1R.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/UrkPAiF7dXp7Vpzkl1niKlBrcFLZO3MXVqWxZe1R.png&quot;,&quot;width&quot;:965}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/UrkPAiF7dXp7Vpzkl1niKlBrcFLZO3MXVqWxZe1R.png\"><img src=\"http://comfypace.com/uploads/UrkPAiF7dXp7Vpzkl1niKlBrcFLZO3MXVqWxZe1R.png\" width=\"965\" height=\"484\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">344.07 KB</span></figcaption></a></figure><strong>Tantangan:</strong></p><p>Setelah berapa hari semua area yang berpohon diisi air?&nbsp;</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The beavers live in a valley surrounded by mountains. Within the valley, there is a lake, and the lake is surrounded by fields that contain trees or rocks.</p><p>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:442836,&quot;height&quot;:498,&quot;href&quot;:&quot;http://comfypace.com/uploads/GU9PUOgOwwrRx0iijA9KmzJuKs6Rxq2kVpBumz8T.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/GU9PUOgOwwrRx0iijA9KmzJuKs6Rxq2kVpBumz8T.png&quot;,&quot;width&quot;:1090}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/GU9PUOgOwwrRx0iijA9KmzJuKs6Rxq2kVpBumz8T.png\"><img src=\"http://comfypace.com/uploads/GU9PUOgOwwrRx0iijA9KmzJuKs6Rxq2kVpBumz8T.png\" width=\"1090\" height=\"498\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">432.46 KB</span></figcaption></a></figure>Every day, the beavers will flow water to fields that are adjacent to the lake or those already watered. For example, on the first day, 3 fields as follows are watered:</p><p>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:352326,&quot;height&quot;:484,&quot;href&quot;:&quot;http://comfypace.com/uploads/UrkPAiF7dXp7Vpzkl1niKlBrcFLZO3MXVqWxZe1R.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/UrkPAiF7dXp7Vpzkl1niKlBrcFLZO3MXVqWxZe1R.png&quot;,&quot;width&quot;:965}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/UrkPAiF7dXp7Vpzkl1niKlBrcFLZO3MXVqWxZe1R.png\"><img src=\"http://comfypace.com/uploads/UrkPAiF7dXp7Vpzkl1niKlBrcFLZO3MXVqWxZe1R.png\" width=\"965\" height=\"484\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">344.07 KB</span></figcaption></a></figure>&nbsp;<strong>Challenge:</strong></p><p>After how many days will all the areas with trees be filled with water?&nbsp;</p>', 5, '2023-10-18 16:01:02', '2023-10-18 16:01:02', '<p>Angka-angka pada gambar di bawah ini menunjukkan lapangan yang dibanjiri sesuai dengan jumlah hari.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:355589,&quot;height&quot;:441,&quot;href&quot;:&quot;http://comfypace.com/uploads/reughR5wslphRhrvQaNttuOARopiNcreF3FxFJuA.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/reughR5wslphRhrvQaNttuOARopiNcreF3FxFJuA.png&quot;,&quot;width&quot;:1063}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/reughR5wslphRhrvQaNttuOARopiNcreF3FxFJuA.png\"><img src=\"http://comfypace.com/uploads/reughR5wslphRhrvQaNttuOARopiNcreF3FxFJuA.png\" width=\"1063\" height=\"441\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">347.25 KB</span></figcaption></a></figure>Lapangan yang persis di sebelah danau dinomori dengan angka 1. Kemudian, semua lapangan yang ada pohonnya di sebelah lapangan nomer 1 ditandai dengan 2. Proses ini dilanjutkan sampai semua lapangan yang ada pohonnya dinomori. Seperti yang bisa kita lihat di atas, lapangan terakhir yang ada pohonnya akan terisi air setelah 6 hari.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;<br>&nbsp;</p><p>The numbers in the image below represent the fields flooded according to the number of days.</p><p>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:355589,&quot;height&quot;:441,&quot;href&quot;:&quot;http://comfypace.com/uploads/reughR5wslphRhrvQaNttuOARopiNcreF3FxFJuA.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/reughR5wslphRhrvQaNttuOARopiNcreF3FxFJuA.png&quot;,&quot;width&quot;:1063}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/reughR5wslphRhrvQaNttuOARopiNcreF3FxFJuA.png\"><img src=\"http://comfypace.com/uploads/reughR5wslphRhrvQaNttuOARopiNcreF3FxFJuA.png\" width=\"1063\" height=\"441\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">347.25 KB</span></figcaption></a></figure>The field right next to the lake is numbered 1. Then, all fields with trees next to field number 1 are marked with 2. This process continues until all fields with trees are numbered. As we can see in the image, the last field with trees will be filled with water after 6 days. &nbsp;</p>'),
(116, 115, 61, 1, '<p>Ada 3 robot yaitu Lea, Moe dan Bob.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:155641,&quot;height&quot;:277,&quot;href&quot;:&quot;http://comfypace.com/uploads/WUqZ38wJKN7ZW3Ax09vOhF454sv38O2UNmvXMxPZ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/WUqZ38wJKN7ZW3Ax09vOhF454sv38O2UNmvXMxPZ.png&quot;,&quot;width&quot;:549}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/WUqZ38wJKN7ZW3Ax09vOhF454sv38O2UNmvXMxPZ.png\"><img src=\"http://comfypace.com/uploads/WUqZ38wJKN7ZW3Ax09vOhF454sv38O2UNmvXMxPZ.png\" width=\"549\" height=\"277\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">151.99 KB</span></figcaption></a></figure>Lima pernyataan berikut mendeskripsikan ketiga robot tersebut:</p><ol><li>Bob dan Moe tersenyum.</li><li>Bob, Moe dan Lea masing-masing mempunyai dua kaki.</li><li>Moe mempunyai kepala bulat dan Lea mempunyai dua kaki.</li><li>Masing-masing robot mempunyai 5 jari tangan.</li><li>Lea atau Bob (salah satu dari mereka) mengangkat tangan.</li></ol><p><strong>Tantangan:</strong>&nbsp;</p><p>Pernyataan mana yang benar?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>There are 3 robots, they are Lea, Moe and Bob.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:155641,&quot;height&quot;:277,&quot;href&quot;:&quot;http://comfypace.com/uploads/WUqZ38wJKN7ZW3Ax09vOhF454sv38O2UNmvXMxPZ.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/WUqZ38wJKN7ZW3Ax09vOhF454sv38O2UNmvXMxPZ.png&quot;,&quot;width&quot;:549}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/WUqZ38wJKN7ZW3Ax09vOhF454sv38O2UNmvXMxPZ.png\"><img src=\"http://comfypace.com/uploads/WUqZ38wJKN7ZW3Ax09vOhF454sv38O2UNmvXMxPZ.png\" width=\"549\" height=\"277\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">151.99 KB</span></figcaption></a></figure>Lima pernyataan berikut mendeskripsikan ketiga robot tersebut:&nbsp;</p><p>Five statements below describes the 3 robots above:</p><ol><li>Bob and Moe are smiling.</li><li>Bob, Moe, and Lea each have two legs.</li><li>Moe has a round head, and Lea has two legs.</li><li>Each robot has 5 fingers on their hand.</li><li>Lea or Bob (one of them) raises their hand.</li></ol><p><strong>Challenge:</strong>&nbsp;</p><p>Which statement is true ?&nbsp;</p>', 5, '2023-10-18 16:01:46', '2023-10-18 16:01:46', '<p>Langkah untuk menjawab tantangan ini adalah:</p><ol><li>Evaluasi semua pernyataan dan putuskan apakah itu benar atau salah, dengan mencermati dan mempertimbangkan arti kata-kata dan dan atau.</li><li>Temukan jawaban yang benar.</li></ol><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The steps to answer this challenge are as follows:</p><ol><li>Evaluate all statements and decide whether they are true or false, considering the meanings of the words \"and\" and \"or.\"</li><li>Find the correct answer.</li></ol><p>&nbsp;</p>'),
(117, 116, 62, 1, '<p>Lina menanam bunga dalam 3 barisan, di setiap barisan ada 4 bunga.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:263319,&quot;height&quot;:493,&quot;href&quot;:&quot;http://comfypace.com/uploads/qE1WtqDI9Ee90LXH6848jWyu9zKkKrp9djPtKumg.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/qE1WtqDI9Ee90LXH6848jWyu9zKkKrp9djPtKumg.png&quot;,&quot;width&quot;:927}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/qE1WtqDI9Ee90LXH6848jWyu9zKkKrp9djPtKumg.png\"><img src=\"http://comfypace.com/uploads/qE1WtqDI9Ee90LXH6848jWyu9zKkKrp9djPtKumg.png\" width=\"927\" height=\"493\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">257.15 KB</span></figcaption></a></figure>Bunda Lina ingin agar bunga putih lebih dekat ke pagar daripada bunga biru.<br><br></p><p><strong>Tantangan:<br></strong>Baris mana yang memenuhi keinginan bunda Lina?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong> &nbsp;</p><p>Lina plants flowers in 3 rows, with 4 flowers in each row.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:263319,&quot;height&quot;:493,&quot;href&quot;:&quot;http://comfypace.com/uploads/r8pf4EpZmsLfC90koph5EeFTG4LzE5ofNg32H8K9.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/r8pf4EpZmsLfC90koph5EeFTG4LzE5ofNg32H8K9.png&quot;,&quot;width&quot;:927}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/r8pf4EpZmsLfC90koph5EeFTG4LzE5ofNg32H8K9.png\"><img src=\"http://comfypace.com/uploads/r8pf4EpZmsLfC90koph5EeFTG4LzE5ofNg32H8K9.png\" width=\"927\" height=\"493\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">257.15 KB</span></figcaption></a></figure>Lina\'s mom wants the white flowers to be closer to the fence than the blue flowers.</p><p><strong>Challenge:<br></strong>Which row fulfills Lina\'s mom\'s wish?&nbsp;</p>', 5, '2023-10-18 16:02:38', '2023-10-18 16:02:38', '<p>Jika kita perhatikan barisan bunga satu per satu, kita dapat melihat bahwa pada baris 1 dan 3 bunga putih<br>terletak lebih dekat ke pagar daripada bunga biru. Pada baris ke-2, bunga biru lebih dekat ke pagar<br>daripada putih.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>If we observe the rows of flowers one by one, we can see that in rows 1 and 3, the white flowers are closer to the fence than the blue flowers. In row 2, the blue flowers are closer to the fence than the white flowers.&nbsp;</p>'),
(118, 117, 62, 1, '<p>Sebuah alien mempunyai sebuah Kepala (H), sebuah Badan (B), dua Lengan (A), dan dua Kaki (L). Tubuh<br>alien dapat ditransformasi dengan mengikuti perintah mutasi sebagai berikut. Sebuah bagian alien<br>dapat ditransformasi lebih dari satu kali.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:187152,&quot;height&quot;:464,&quot;href&quot;:&quot;http://comfypace.com/uploads/tGl7pWqTkHNYotld5pNNWaj9lWNftqtiugcT4XE4.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/tGl7pWqTkHNYotld5pNNWaj9lWNftqtiugcT4XE4.png&quot;,&quot;width&quot;:1275}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/tGl7pWqTkHNYotld5pNNWaj9lWNftqtiugcT4XE4.png\"><img src=\"http://comfypace.com/uploads/tGl7pWqTkHNYotld5pNNWaj9lWNftqtiugcT4XE4.png\" width=\"1275\" height=\"464\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">182.77 KB</span></figcaption></a></figure>Contoh transformasi untuk H(S), B(S), A(-), L(-):<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:91512,&quot;height&quot;:236,&quot;href&quot;:&quot;http://comfypace.com/uploads/Qid2MToTdm2c10uVvC9Uv3cPul7PcFIcBsVanOSV.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Qid2MToTdm2c10uVvC9Uv3cPul7PcFIcBsVanOSV.png&quot;,&quot;width&quot;:458}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Qid2MToTdm2c10uVvC9Uv3cPul7PcFIcBsVanOSV.png\"><img src=\"http://comfypace.com/uploads/Qid2MToTdm2c10uVvC9Uv3cPul7PcFIcBsVanOSV.png\" width=\"458\" height=\"236\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">89.37 KB</span></figcaption></a></figure><strong>Tantangan:<br></strong>Dengan mengikuti perintah mutasi secara berurutan berikut ini, bentuk tubuh alien apa yang akan terjadi?<br>H(T), L(+), B(T), A(+), H(C), A(-), B(C)</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>An alien has a Head (H), a Body (B), two Arms (A), and two Legs (L). The alien\'s body can be transformed by following mutation commands as follows. Each part of the alien can be transformed multiple times.&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:136746,&quot;height&quot;:419,&quot;href&quot;:&quot;http://comfypace.com/uploads/lDmxzOpCOULWOj2TfaGZ8vkz6hmJVZ00Q7BtaABh.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/lDmxzOpCOULWOj2TfaGZ8vkz6hmJVZ00Q7BtaABh.png&quot;,&quot;width&quot;:1149}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/lDmxzOpCOULWOj2TfaGZ8vkz6hmJVZ00Q7BtaABh.png\"><img src=\"http://comfypace.com/uploads/lDmxzOpCOULWOj2TfaGZ8vkz6hmJVZ00Q7BtaABh.png\" width=\"1149\" height=\"419\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">133.54 KB</span></figcaption></a></figure>Example transformations for H(S), B(S), A(-), L(-):<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:91512,&quot;height&quot;:236,&quot;href&quot;:&quot;http://comfypace.com/uploads/Qid2MToTdm2c10uVvC9Uv3cPul7PcFIcBsVanOSV.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Qid2MToTdm2c10uVvC9Uv3cPul7PcFIcBsVanOSV.png&quot;,&quot;width&quot;:458}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Qid2MToTdm2c10uVvC9Uv3cPul7PcFIcBsVanOSV.png\"><img src=\"http://comfypace.com/uploads/Qid2MToTdm2c10uVvC9Uv3cPul7PcFIcBsVanOSV.png\" width=\"458\" height=\"236\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">89.37 KB</span></figcaption></a></figure><strong>Challenge:<br></strong>By following the mutation commands sequentially as follows, what will be the resulting shape of the alien\'s body?<br>H(T), L(+), B(T), A(+), H(C), A(-), B(C) &nbsp;</p>', 5, '2023-10-18 16:04:42', '2023-10-18 16:04:42', '<p>Untuk setiap bagian dari alien, perintah mutasi yang terakhir akan menimpa hasil dari perintah sama yang<br>sebelumnya. Karena itu, hasil akhirnya adalah kepala dengan bentuk lingkaran, tubuh dengan bentuk<br>lingkaran, lengan pendek, dan kaki panjang. Maka, jawabannya adalah D.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>For each part of the alien, the last mutation command will override the results of previous identical commands. Therefore, the final result is a head in the shape of a circle, a body in the shape of a circle, short arms, and long legs. So, the answer is D.&nbsp;</p>'),
(119, 118, 63, 1, '<p>Mama harus menumpuk perlengkapan berpakaian anaknya di atas meja. Bunda menaruh perlengkapan tersebut agar dapat dipakai sesuai dengan urutan, mulai dari yang paling atas. Bunda tidak mau anaknya memakai sabuk sebelum kemejanya.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:132061,&quot;height&quot;:86,&quot;href&quot;:&quot;http://comfypace.com/uploads/Kw3M22Y0fmbBEIGUnOYGHCGKfxN5vPpKDQLCtXnV.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Kw3M22Y0fmbBEIGUnOYGHCGKfxN5vPpKDQLCtXnV.png&quot;,&quot;width&quot;:922}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Kw3M22Y0fmbBEIGUnOYGHCGKfxN5vPpKDQLCtXnV.png\"><img src=\"http://comfypace.com/uploads/Kw3M22Y0fmbBEIGUnOYGHCGKfxN5vPpKDQLCtXnV.png\" width=\"922\" height=\"86\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">128.97 KB</span></figcaption></a></figure><strong>Tantangan:<br></strong>Tumpukan mana saja yang harus dipilih anaknya? Jawaban bisa lebih dari 1 pilihan.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Mommy needs to stack her child\'s clothing on the table. She arranges the clothing so that they can be worn in order, starting with the top item. She doesn\'t want her child to wear a belt before the shirt.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:132061,&quot;height&quot;:86,&quot;href&quot;:&quot;http://comfypace.com/uploads/Kw3M22Y0fmbBEIGUnOYGHCGKfxN5vPpKDQLCtXnV.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/Kw3M22Y0fmbBEIGUnOYGHCGKfxN5vPpKDQLCtXnV.png&quot;,&quot;width&quot;:922}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/Kw3M22Y0fmbBEIGUnOYGHCGKfxN5vPpKDQLCtXnV.png\"><img src=\"http://comfypace.com/uploads/Kw3M22Y0fmbBEIGUnOYGHCGKfxN5vPpKDQLCtXnV.png\" width=\"922\" height=\"86\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">128.97 KB</span></figcaption></a></figure><strong>Challenge:<br></strong>Which stacks can her child choose from? The answer can be more than one option. &nbsp;</p>', 5, '2023-10-18 16:09:33', '2023-10-18 16:09:33', '<p>Untuk menemukan solusinya, kita harus mengamati tumpukan mulai dari item paling atas dan memastikan bahwa urutannya benar sesuai dengan kendala (kemeja sebelum sabuk).&nbsp;</p><p>Jawaban a) dan c) adalah salah karena sabuknya akan dipakai sebelum kemeja.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>To find the solution, we need to observe the stack starting from the top item and make sure the sequence is correct according to the constraint (belt before the shirt).</p><p>Answers a) and c) are incorrect because the belt will be worn before the shirt.&nbsp;</p>'),
(120, 119, 63, 1, '<p>Penghuni planet B mengembangkan kota dengan cara yang spesial:</p><ul><li>mereka mulai dengan satu rumah.</li></ul><p>kemudian mengganti rumah dengan salah satu aturan sebagai berikut:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:21343,&quot;height&quot;:175,&quot;href&quot;:&quot;http://comfypace.com/uploads/hZZJkmB9UfnpHH9uFgz17pWuR88F1g8vH2AJZsi8.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/hZZJkmB9UfnpHH9uFgz17pWuR88F1g8vH2AJZsi8.png&quot;,&quot;width&quot;:254}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/hZZJkmB9UfnpHH9uFgz17pWuR88F1g8vH2AJZsi8.png\"><img src=\"http://comfypace.com/uploads/hZZJkmB9UfnpHH9uFgz17pWuR88F1g8vH2AJZsi8.png\" width=\"254\" height=\"175\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">20.84 KB</span></figcaption></a></figure>Misalnya jika memakai aturan-1), kemudian aturan-2), kemudian aturan-3) sebanyak dua kali, maka<br>diperoleh:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:36192,&quot;height&quot;:97,&quot;href&quot;:&quot;http://comfypace.com/uploads/MJyPmWKJxYfzmDKYEXPIr0FPcFh2GV3ThXgBGkTc.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/MJyPmWKJxYfzmDKYEXPIr0FPcFh2GV3ThXgBGkTc.png&quot;,&quot;width&quot;:877}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/MJyPmWKJxYfzmDKYEXPIr0FPcFh2GV3ThXgBGkTc.png\"><img src=\"http://comfypace.com/uploads/MJyPmWKJxYfzmDKYEXPIr0FPcFh2GV3ThXgBGkTc.png\" width=\"877\" height=\"97\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">35.34 KB</span></figcaption></a></figure><strong>Tantangan:<br></strong>kota mana yang BUKAN kota di planet B?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The residents of planet B develop their cities in a special way:</p><ul><li>They start with one house.</li></ul><p>Then, they replace houses with one of the following rules:<br>&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:21343,&quot;height&quot;:175,&quot;href&quot;:&quot;http://comfypace.com/uploads/hZZJkmB9UfnpHH9uFgz17pWuR88F1g8vH2AJZsi8.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/hZZJkmB9UfnpHH9uFgz17pWuR88F1g8vH2AJZsi8.png&quot;,&quot;width&quot;:254}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/hZZJkmB9UfnpHH9uFgz17pWuR88F1g8vH2AJZsi8.png\"><img src=\"http://comfypace.com/uploads/hZZJkmB9UfnpHH9uFgz17pWuR88F1g8vH2AJZsi8.png\" width=\"254\" height=\"175\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">20.84 KB</span></figcaption></a></figure> For example, if they use rule 1), then rule 2), then rule 3) twice, they get the following result.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:36192,&quot;height&quot;:97,&quot;href&quot;:&quot;http://comfypace.com/uploads/MJyPmWKJxYfzmDKYEXPIr0FPcFh2GV3ThXgBGkTc.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/MJyPmWKJxYfzmDKYEXPIr0FPcFh2GV3ThXgBGkTc.png&quot;,&quot;width&quot;:877}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/MJyPmWKJxYfzmDKYEXPIr0FPcFh2GV3ThXgBGkTc.png\"><img src=\"http://comfypace.com/uploads/MJyPmWKJxYfzmDKYEXPIr0FPcFh2GV3ThXgBGkTc.png\" width=\"877\" height=\"97\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">35.34 KB</span></figcaption></a></figure> <strong>Challenge:<br></strong>Which city is NOT a city on planet B? &nbsp;</p>', 5, '2023-10-18 16:11:13', '2023-10-18 16:11:13', '<p>B adalah jawaban yang benar. Aturan ke-2 mengatakan bahwa setiap pohon akan memiliki blok di sebelah<br>kanan. Tetapi di kota B, tidak ada blok di sebelah kanan pohon yang paling kanan. Dan tidak ada aturan<br>yang bisa membuat blok menghilang.</p><ul><li>Kota A dapat dikembangkan dengan menerapkan aturan 1, 2, 3 dan sekali lagi 3, persis dalam urutan ini.</li><li>Kota C dapat dikembangkan dengan menerapkan aturan 1 tiga kali.</li><li>Kota D dapat dikembangkan dengan menerapkan aturan 1, lalu aturan 2 untuk setiap rumah, dan kemudian aturan 3 untuk setiap blok.</li></ul><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Option B is the correct answer. Rule #2 states that every tree will have a block to its right. However, in city B, there is no block to the right of the rightmost tree. And there are no rules that would make a block disappear.</p><ul><li>City A can be expanded by applying rules 1, 2, 3, and once more 3, exactly in this order.</li><li>City C can be expanded by applying rule 1 three times.</li><li>City D can be expanded by applying rule 1, then rule 2 for each house, and then rule 3 for each block</li></ul>'),
(121, 120, 64, 1, '<p>Bella dari planet Belena mempunyai banyak balon. Ia selalu menaruh balonnya dalam posisi sebuah<br>barisan sehingga urutan warnanya sama jika dilihat dari ujung kiri ke kanan, maupun dari ujung kanan ke<br>kiri. Sayangnya, ia hanya bisa melihat 4 warna berbeda yaitu hijau (G), kuning (Y), merah (R) and biru (B).<br>Bagi Bella, ungu (P) tampak sama dengan kuning (Y).</p><p>Contoh: Bella akan melihat setiap barisan balon sebagai berikut sama jika dirunut dari yang paling kiri ke<br>kanan maupun dari yang paling kanan ke kiri.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:59142,&quot;height&quot;:110,&quot;href&quot;:&quot;http://comfypace.com/uploads/AQDB2h6c7yvtRmcje1l8F6z24zr4TYJoYTbP3ESt.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AQDB2h6c7yvtRmcje1l8F6z24zr4TYJoYTbP3ESt.png&quot;,&quot;width&quot;:465}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AQDB2h6c7yvtRmcje1l8F6z24zr4TYJoYTbP3ESt.png\"><img src=\"http://comfypace.com/uploads/AQDB2h6c7yvtRmcje1l8F6z24zr4TYJoYTbP3ESt.png\" width=\"465\" height=\"110\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">57.76 KB</span></figcaption></a></figure><strong>Tantangan:<br></strong>Barisan balon mana yang bagi Bella akan terlihat sama urutan warnanya?</p><p><br>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Bella from the planet Belena has many balloons. She always arranges her balloons in a row so that the order of colors is the same when viewed from both the left and the right. Unfortunately, she can only see 4 different colors, which are green (G), yellow (Y), red (R), and blue (B). For Bella, purple (P) looks the same as yellow (Y).</p><p>Example: Bella will see each row of balloons as follows, the same if viewed from the far left to the far right as well as from the far right to the far left.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:59142,&quot;height&quot;:110,&quot;href&quot;:&quot;http://comfypace.com/uploads/AQDB2h6c7yvtRmcje1l8F6z24zr4TYJoYTbP3ESt.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/AQDB2h6c7yvtRmcje1l8F6z24zr4TYJoYTbP3ESt.png&quot;,&quot;width&quot;:465}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/AQDB2h6c7yvtRmcje1l8F6z24zr4TYJoYTbP3ESt.png\"><img src=\"http://comfypace.com/uploads/AQDB2h6c7yvtRmcje1l8F6z24zr4TYJoYTbP3ESt.png\" width=\"465\" height=\"110\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">57.76 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>Which row of balloons will appear the same in terms of the order of colors for Bella?&nbsp;</p>', 5, '2023-10-18 16:18:51', '2023-10-18 16:18:51', '<p>These are all the order for each answers, as we can see only a and b is the only correct answer :</p><p>ini adalah urutan pada balon untuk setiap jawaban, karena itu hanya balon a dan b yang benar:</p><div class=\"attachment-gallery attachment-gallery--2\"><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:132779,&quot;height&quot;:276,&quot;href&quot;:&quot;http://comfypace.com/uploads/nBgAkZL3EOzcVP4gUrickeLP3anWlAHvt9VhuPe8.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/nBgAkZL3EOzcVP4gUrickeLP3anWlAHvt9VhuPe8.png&quot;,&quot;width&quot;:345}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/nBgAkZL3EOzcVP4gUrickeLP3anWlAHvt9VhuPe8.png\"><img src=\"http://comfypace.com/uploads/nBgAkZL3EOzcVP4gUrickeLP3anWlAHvt9VhuPe8.png\" width=\"345\" height=\"276\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">129.67 KB</span></figcaption></a></figure><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:96743,&quot;height&quot;:195,&quot;href&quot;:&quot;http://comfypace.com/uploads/0srMvTTd9kEoSaO9knW4RIAaKpZ4u1akibmh1mNf.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/0srMvTTd9kEoSaO9knW4RIAaKpZ4u1akibmh1mNf.png&quot;,&quot;width&quot;:335}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/0srMvTTd9kEoSaO9knW4RIAaKpZ4u1akibmh1mNf.png\"><img src=\"http://comfypace.com/uploads/0srMvTTd9kEoSaO9knW4RIAaKpZ4u1akibmh1mNf.png\" width=\"335\" height=\"195\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">94.48 KB</span></figcaption></a></figure></div>'),
(122, 121, 64, 1, '<p>Landak Etna (di pojok kiri bawah) ingin pergi ke bukit semut. Untuk pergi ke sana, ia harus mengumpulkan semut merah (yang pada gambar lebih besar). Bantulah Etna untuk menentukan jalannya dengan menyebutkan arahnya: Kanan (untuk ke kanan), Kiri (untuk ke kiri), Naik (untuk ke atas), Turun (untuk ke bawah).<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:283110,&quot;height&quot;:452,&quot;href&quot;:&quot;http://comfypace.com/uploads/uuHp6TDHSnVoLJsnmxslUtry12y7ZSxyep9WlkRn.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/uuHp6TDHSnVoLJsnmxslUtry12y7ZSxyep9WlkRn.png&quot;,&quot;width&quot;:922}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/uuHp6TDHSnVoLJsnmxslUtry12y7ZSxyep9WlkRn.png\"><img src=\"http://comfypace.com/uploads/uuHp6TDHSnVoLJsnmxslUtry12y7ZSxyep9WlkRn.png\" width=\"922\" height=\"452\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">276.47 KB</span></figcaption></a></figure><strong>Tantangan:<br></strong>Perintah mana yang harus diberikan kepada Bebras tersebut?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Hedgehog Etna (in the bottom left corner) wants to go to the anthill. To get there, she needs to collect the red ants (the larger ones in the picture). Help Etna determine her path by specifying the directions: Right (for right), Left (for left), Up (for upward), Down (for downward).</p><p>&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:283110,&quot;height&quot;:452,&quot;href&quot;:&quot;http://comfypace.com/uploads/uuHp6TDHSnVoLJsnmxslUtry12y7ZSxyep9WlkRn.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/uuHp6TDHSnVoLJsnmxslUtry12y7ZSxyep9WlkRn.png&quot;,&quot;width&quot;:922}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/uuHp6TDHSnVoLJsnmxslUtry12y7ZSxyep9WlkRn.png\"><img src=\"http://comfypace.com/uploads/uuHp6TDHSnVoLJsnmxslUtry12y7ZSxyep9WlkRn.png\" width=\"922\" height=\"452\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">276.47 KB</span></figcaption></a></figure> <strong>Question:</strong></p><p>What command should be given to Etna?&nbsp;</p>', 5, '2023-10-18 16:22:47', '2023-10-18 16:22:47', '<p>Jawaban yang tepat adalah B. Kanan, Naik, Kanan, Turun, Kanan, Naik, Kanan</p><ul><li>A. tidak mungkin benar karena melalui jalur ini tidak bisa mengumpulkan semua semut merah.</li><li>B. Edna berjalan langsung dari titik awal. Ketika jalan lurus berakhir, dia berjalan, dan berjalan sepanjang jalan ke atas sebelum ke kanan. Ketika dia menangkap semut merah berikutnya, dia turun lagi sampai garis berakhir. Selanjutnya dia harus ke kanan, lalu ke atas, dan ketika dia mencapai semut merah dia harus berjalan ke kanan lagi.</li><li>C. dan D. tidak mungkin benar karena jalur yang dijelaskan tidak mengikuti garis semut dan aturan yang ditentukan.</li></ul><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong></p><p>The correct answer is B. Right, Up, Right, Down, Right, Up, Right.</p><ul><li>A. is not possible because this path does not allow Edna to collect all the red ants.</li><li>B. Edna walks directly from the starting point. When the straight path ends, she walks, and continues upward before going to the right. When she catches the next red ant, she goes down again until the line ends. Next, she has to go right, then up, and when she reaches the next red ant, she has to walk to the right again.&nbsp;</li><li>C and D. are not possible because the described paths do not follow the line of ants and the given rules.&nbsp;</li></ul>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(123, 122, 65, 1, '<p>Joni harus memasang tali pada sekumpulan pohon, sehingga tali mengenai batang bagian luar pohon sebanyak-banyaknya. Sebagai contoh, jika ada 6 pohon pada posisi seperti gambar berikut, maka Joni hanya dapat memasang tali pada 5 pohon.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:49813,&quot;height&quot;:228,&quot;href&quot;:&quot;http://comfypace.com/uploads/og3KVxzj11Slwe1OiY5fxN0U8i9IyRCISt3DxGLk.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/og3KVxzj11Slwe1OiY5fxN0U8i9IyRCISt3DxGLk.png&quot;,&quot;width&quot;:334}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/og3KVxzj11Slwe1OiY5fxN0U8i9IyRCISt3DxGLk.png\"><img src=\"http://comfypace.com/uploads/og3KVxzj11Slwe1OiY5fxN0U8i9IyRCISt3DxGLk.png\" width=\"334\" height=\"228\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">48.65 KB</span></figcaption></a></figure><strong>Tantangan:<br></strong>Jika sekumpulan pohon yang ada adalah sebagai berikut, berapa pohon yang dapat dikenai tali dengan<br>cara tersebut?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:80162,&quot;height&quot;:274,&quot;href&quot;:&quot;http://comfypace.com/uploads/bePw9TAu1GK0Kd8gGVd2glDZbXCGKx7RrazTC2jP.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/bePw9TAu1GK0Kd8gGVd2glDZbXCGKx7RrazTC2jP.png&quot;,&quot;width&quot;:402}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/bePw9TAu1GK0Kd8gGVd2glDZbXCGKx7RrazTC2jP.png\"><img src=\"http://comfypace.com/uploads/bePw9TAu1GK0Kd8gGVd2glDZbXCGKx7RrazTC2jP.png\" width=\"402\" height=\"274\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">78.28 KB</span></figcaption></a></figure> -----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Joni has to string a rope around a group of trees so that the rope touches the outer part of the trees as much as possible. For example, if there are 6 trees in a position like the picture below, Joni can only string the rope around 5 trees.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:49813,&quot;height&quot;:228,&quot;href&quot;:&quot;http://comfypace.com/uploads/og3KVxzj11Slwe1OiY5fxN0U8i9IyRCISt3DxGLk.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/og3KVxzj11Slwe1OiY5fxN0U8i9IyRCISt3DxGLk.png&quot;,&quot;width&quot;:334}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/og3KVxzj11Slwe1OiY5fxN0U8i9IyRCISt3DxGLk.png\"><img src=\"http://comfypace.com/uploads/og3KVxzj11Slwe1OiY5fxN0U8i9IyRCISt3DxGLk.png\" width=\"334\" height=\"228\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">48.65 KB</span></figcaption></a></figure><strong>Question:</strong><br>If a group of trees is as follows, how many trees can be touched by the rope in this way? <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:80162,&quot;height&quot;:274,&quot;href&quot;:&quot;http://comfypace.com/uploads/bePw9TAu1GK0Kd8gGVd2glDZbXCGKx7RrazTC2jP.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/bePw9TAu1GK0Kd8gGVd2glDZbXCGKx7RrazTC2jP.png&quot;,&quot;width&quot;:402}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/bePw9TAu1GK0Kd8gGVd2glDZbXCGKx7RrazTC2jP.png\"><img src=\"http://comfypace.com/uploads/bePw9TAu1GK0Kd8gGVd2glDZbXCGKx7RrazTC2jP.png\" width=\"402\" height=\"274\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">78.28 KB</span></figcaption></a></figure>&nbsp;</p>', 5, '2023-10-18 16:24:50', '2023-10-18 16:25:12', NULL),
(124, 123, 65, 1, '<p>Bermain lempar bantal adalah salah satu permainan favorit anak-anak. Pada permainan ini, setiap peserta membawa bantal yang ada gambarnya. 3 anak yang sama gambar bantalnya membentuk satu tim. Jika ada lebih dari 3 berang-berang dengan gambar bantal yang sama, dipilih hanya untuk 3 anak dengan cara diundi. anak yang tidak terpilih tidak mendapat giliran bermain hari itu.<br>Berikut ini adalah bantal-bantal yang dibawa anak-anak tersebut.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:215689,&quot;height&quot;:316,&quot;href&quot;:&quot;http://comfypace.com/uploads/CXDfHZotLsxvbXn3ATkOj29pmZTqe3cq2WTNRjdl.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/CXDfHZotLsxvbXn3ATkOj29pmZTqe3cq2WTNRjdl.png&quot;,&quot;width&quot;:489}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/CXDfHZotLsxvbXn3ATkOj29pmZTqe3cq2WTNRjdl.png\"><img src=\"http://comfypace.com/uploads/CXDfHZotLsxvbXn3ATkOj29pmZTqe3cq2WTNRjdl.png\" width=\"489\" height=\"316\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">210.63 KB</span></figcaption></a></figure><strong>Tantangan:<br></strong>Hari ini ada berapa tim yang dapat bermain dan berapa anak-anak yang tak dapat giliran bermain?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Playing pillow toss is one of the favorite games of young kids. In this game, each participant brings a pillow with a picture on it. 3 kids with the same picture on their pillows form one team. If there are more than 3 kids with the same picture on their pillows, only 3 of them are selected through a random draw. Kids who are not selected do not get a turn to play that day.</p><p>Here are the pillows brought by the young kids.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:215689,&quot;height&quot;:316,&quot;href&quot;:&quot;http://comfypace.com/uploads/5em6tYNaHKl6XLCPWTSuuEWcomlxDoZwRmbmG8rz.png&quot;,&quot;url&quot;:&quot;http://comfypace.com/uploads/5em6tYNaHKl6XLCPWTSuuEWcomlxDoZwRmbmG8rz.png&quot;,&quot;width&quot;:489}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://comfypace.com/uploads/5em6tYNaHKl6XLCPWTSuuEWcomlxDoZwRmbmG8rz.png\"><img src=\"http://comfypace.com/uploads/5em6tYNaHKl6XLCPWTSuuEWcomlxDoZwRmbmG8rz.png\" width=\"489\" height=\"316\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">210.63 KB</span></figcaption></a></figure><strong>Question:</strong><br>How many teams can play today, and how many kids cannot take a turn to play?</p>', 5, '2023-10-18 16:30:47', '2023-10-18 16:31:00', '<p>4 tim:<br>Ada 6 gambar berbeda pada sekumpulan bantal tersebut, yaitu: matahari di 5 bantal, pohon di 4 bantal,<br>daun di 4 bantal, bunga biru di 3 bantal, ranting di 2 bantal dan bunga merah di 1 bantal. Perlu memiliki<br>setidaknya 3 bantal yang sama untuk membentuk tim. Ranting dan bunga merah tidak cukup untuk<br>membentuk sebuah tim.</p><p><br>7 anak-anak:<br>Total ada 19&nbsp; anak-anak . Jika dibagi menjadi 4 tim akan membutuhkan 4 x 3 = 12&nbsp; anak-anak .<br>Sisanya adalah 7 anak-anak yang akan berhenti hari ini.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong> &nbsp;</p><p>4 teams:<br>There are 6 different pictures on the set of pillows, namely: a sun on 5 pillows, a tree on 4 pillows, a leaf on 4 pillows, a blue flower on 3 pillows, a branch on 2 pillows, and a red flower on 1 pillow. It is necessary to have at least 3 pillows with the same picture to form a team. Branches and red flowers are not sufficient to form a team.</p><p>7 kids:<br>There are a total of 19 kids. Dividing them into 4 teams would require 4 x 3 = 12 kids. The remaining 7 kids will not get a turn today.&nbsp;</p>'),
(125, 124, 53, 1, '<p>Arah panah lalu lintas kereta mengendalikan pergerakan kereta di setiap persimpangan.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:98997,&quot;height&quot;:347,&quot;href&quot;:&quot;https://comfypace.com/uploads/EEM1ZRjKMhAtU24wA1qoIdB4O9y7JoNHh399bHBk.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/EEM1ZRjKMhAtU24wA1qoIdB4O9y7JoNHh399bHBk.png&quot;,&quot;width&quot;:710}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/EEM1ZRjKMhAtU24wA1qoIdB4O9y7JoNHh399bHBk.png\"><img src=\"https://comfypace.com/uploads/EEM1ZRjKMhAtU24wA1qoIdB4O9y7JoNHh399bHBk.png\" width=\"710\" height=\"347\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">96.68 KB</span></figcaption></a></figure><strong>Pertanyaan</strong></p><p>Instruksi pasangan mana yang akan membuat kereta tiba di London?</p><p><strong>-----------------<br>English Version</strong></p><p>Train traffic arrows control train movements at each crossing.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:98997,&quot;height&quot;:347,&quot;href&quot;:&quot;https://comfypace.com/uploads/oUBwKkEvE0eJxlaoff5tgjpc5EJQ0DPwrIxHP7WV.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/oUBwKkEvE0eJxlaoff5tgjpc5EJQ0DPwrIxHP7WV.png&quot;,&quot;width&quot;:710}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/oUBwKkEvE0eJxlaoff5tgjpc5EJQ0DPwrIxHP7WV.png\"><img src=\"https://comfypace.com/uploads/oUBwKkEvE0eJxlaoff5tgjpc5EJQ0DPwrIxHP7WV.png\" width=\"710\" height=\"347\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">96.68 KB</span></figcaption></a></figure><strong>Question</strong><br><br>Which pair of instructions will result in then train arriving in London?</p>', 5, '2023-10-24 15:46:37', '2023-10-25 04:48:15', '<p>Jawabannya adalah 1b &amp; 2a karena kereta pertama kali perlu melakukan belok kiri untuk ke arah london dan dijalan ia menemukan cabang ia harus belok ke kanan untuk sampai ke london.</p><p><strong>---------------<br>English Version</strong></p><p>The answer is 1b &amp; 2a because the train first needs to make a left turn towards London, and on its way, when it encounters a junction, it must turn right to reach London.</p>'),
(126, 125, 66, 1, '<p>Yose menciptakan robot kucing yang bergerak sesuai dengan aturan berikut:</p><ol><li>Maju ke depan</li><li>Berbelok pada setiap belokan yang lain<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:76565,&quot;height&quot;:559,&quot;href&quot;:&quot;https://comfypace.com/uploads/v0qguEmSzxnaZMFkEwYBR8LKwIlaO9LF1yNU6tqf.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/v0qguEmSzxnaZMFkEwYBR8LKwIlaO9LF1yNU6tqf.png&quot;,&quot;width&quot;:759}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/v0qguEmSzxnaZMFkEwYBR8LKwIlaO9LF1yNU6tqf.png\"><img src=\"https://comfypace.com/uploads/v0qguEmSzxnaZMFkEwYBR8LKwIlaO9LF1yNU6tqf.png\" width=\"759\" height=\"559\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">74.77 KB</span></figcaption></a></figure></li></ol><p><strong>Pertanyaan</strong></p><p>Di mana kucing akan keluar?</p><p><strong>---------------<br>English Version</strong></p><p>Yose created a robot cat, which moves according to the following rules:<br>1) Move forward<br>2) Turn at every other turn</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:76565,&quot;height&quot;:559,&quot;href&quot;:&quot;https://comfypace.com/uploads/c2OJonDnAtKpgCSk4TR2HFVRNrpr2iHbGfeMLn4I.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/c2OJonDnAtKpgCSk4TR2HFVRNrpr2iHbGfeMLn4I.png&quot;,&quot;width&quot;:759}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/c2OJonDnAtKpgCSk4TR2HFVRNrpr2iHbGfeMLn4I.png\"><img src=\"https://comfypace.com/uploads/c2OJonDnAtKpgCSk4TR2HFVRNrpr2iHbGfeMLn4I.png\" width=\"759\" height=\"559\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">74.77 KB</span></figcaption></a></figure><br><strong>Question</strong><br>Where will cat exit?</p>', 5, '2023-10-24 15:52:11', '2023-10-25 04:49:11', '<p>Jawabannya adalah A karena kucingnya akan selalu berbelok ketika ada belokan sehingga ketika ia baru berjalan bentar dia akan langsung berbelok ke kanan lalu berjalan lurus sehingga keluar lewat A.<br><strong>---------------<br>English Version</strong></p><p>The answer is A because the cat will always turn when there is a turn, so when it initially starts moving, it will immediately turn to the right and then move straight, ultimately exiting through A.</p>'),
(127, 126, 66, 1, '<p>Wisnu kecil menciptakan robot yang berenang sesuai dengan perintah berikut:</p><ol><li>Berenang ke depan;</li><li>Ketika memungkinkan, belok kiri.</li></ol><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:114306,&quot;height&quot;:497,&quot;href&quot;:&quot;https://comfypace.com/uploads/eGDG9JwECg0P2TNH4GWSK4AX4bO60apaA83J3D6k.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/eGDG9JwECg0P2TNH4GWSK4AX4bO60apaA83J3D6k.png&quot;,&quot;width&quot;:641}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/eGDG9JwECg0P2TNH4GWSK4AX4bO60apaA83J3D6k.png\"><img src=\"https://comfypace.com/uploads/eGDG9JwECg0P2TNH4GWSK4AX4bO60apaA83J3D6k.png\" width=\"641\" height=\"497\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">111.63 KB</span></figcaption></a></figure></p><p>Wisnu kecil meluncurkan robotnya di rumah - di kolam A.</p><p><strong>Pertanyaan</strong><br>Di kolam mana robot akan menyelesaikan perjalanannya?<br><strong>--------------<br>English Version</strong></p><p>Little Wisnu created a robot which swims according to the following commands:<br>1) Swim forward;<br>2) When it is possible, turn left.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:114306,&quot;height&quot;:497,&quot;href&quot;:&quot;https://comfypace.com/uploads/pB9VXLDzGtnaotf6AoC0qD3xR6n8w2PAtEGdD6zg.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/pB9VXLDzGtnaotf6AoC0qD3xR6n8w2PAtEGdD6zg.png&quot;,&quot;width&quot;:641}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/pB9VXLDzGtnaotf6AoC0qD3xR6n8w2PAtEGdD6zg.png\"><img src=\"https://comfypace.com/uploads/pB9VXLDzGtnaotf6AoC0qD3xR6n8w2PAtEGdD6zg.png\" width=\"641\" height=\"497\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">111.63 KB</span></figcaption></a></figure><br>Little Wisnu launched his robot at home  in pond A.</p><p><br><strong>Question</strong></p><p>In which pond will the robot will finish his journey?</p><p><br><br></p>', 5, '2023-10-24 15:57:53', '2023-10-25 04:49:42', '<p>Jawabannya adalah A karena ia akan selalu berbelok kiri ketika ia bisa dan pilihan lainnya adalah jalan lurus yang mana ketika ia baru keluar ia akan langsung berenangke arah D dan di perempatan C dia akan belok kiri ke arah F dan di perempatan F dia aka belok kiri dan berenang ke arah I di perempatan I dia belok ke kiri berenang ke L dan di perempatan L ia akan belok kiri dan bergerak lurus ke arah D tetapi di perempatan B dia berbelok dan masuk ke kolam A lagi.<br><strong>-------------<br>English Version</strong></p><p>The answer is A because it will always turn left when possible. The other options are straight paths. When it initially exits, it will immediately swim towards D, and at intersection C, it will turn left towards F. At intersection F, it will turn left and swim towards I, and at intersection I, it will turn left and swim to L. At intersection L, it will turn left and move straight towards D, but at intersection B, it will turn and re-enter pond A.</p>'),
(128, 127, 57, 1, '<p>Jarjit membangun pengering pakaian. Mereka ingin memperkuat tiangnya untuk melindungi pengering dari berang-berang. Sayangnya, mereka hanya mampu memperkuat satu tiang. Di tiang mana sebaiknya mereka menginvestasikan perbaikan?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:200978,&quot;height&quot;:589,&quot;href&quot;:&quot;https://comfypace.com/uploads/UZ33LeOpzPK8eRTlHDYUOJ0OHangRjosnvGxOkmi.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/UZ33LeOpzPK8eRTlHDYUOJ0OHangRjosnvGxOkmi.png&quot;,&quot;width&quot;:695}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/UZ33LeOpzPK8eRTlHDYUOJ0OHangRjosnvGxOkmi.png\"><img src=\"https://comfypace.com/uploads/UZ33LeOpzPK8eRTlHDYUOJ0OHangRjosnvGxOkmi.png\" width=\"695\" height=\"589\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">196.27 KB</span></figcaption></a></figure></p><p><br><strong>------------<br>English Version</strong></p><p>Jarjit built a clothes dryer. They want to strengthen the poles to save the dryer from beavers. Unfortunately, they can only afford to strengthen one pole. In which pole should they invest?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:200978,&quot;height&quot;:589,&quot;href&quot;:&quot;https://comfypace.com/uploads/0fqA0EMsQrQI4hPqOYwro7HXhdIZa7qVCutG54vz.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/0fqA0EMsQrQI4hPqOYwro7HXhdIZa7qVCutG54vz.png&quot;,&quot;width&quot;:695}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/0fqA0EMsQrQI4hPqOYwro7HXhdIZa7qVCutG54vz.png\"><img src=\"https://comfypace.com/uploads/0fqA0EMsQrQI4hPqOYwro7HXhdIZa7qVCutG54vz.png\" width=\"695\" height=\"589\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">196.27 KB</span></figcaption></a></figure></p>', 5, '2023-10-24 16:12:32', '2023-10-25 04:53:06', '<p>Jawabannya adalah E karena tiang E memiliki total 10 pakaian yang terikat kepada tiang tersebut sementara tiang yang lain di bawah 10 pakaian, tiang yang mendekati jumlah pakaian yang dipegang tiang E hanya tiang B dan C dengan total 8 pakaian baik tiang B maupun C sehingga untuk mengurangi jumlah kerugian ketika tiang di robohkan maka kita harus memperkuat tiang E.</p><p><strong>----------------<br>English Version</strong></p><p>The answer is E because pole E has a total of 10 pieces of clothing tied to it, while the other poles have fewer than 10 pieces. The poles that come closest to the number of clothes held by pole E are poles B and C, both with a total of 8 pieces of clothing. Therefore, to minimize the potential loss if a pole is knocked down, we should reinforce pole E.</p>'),
(129, 128, 67, 1, '<p>Kartu-kartu berang-berang dan kanguru diatur dalam urutan tertentu:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:93007,&quot;height&quot;:230,&quot;href&quot;:&quot;https://comfypace.com/uploads/yTM4LVWkGMAdSvL59QDyDYQ2m9wKEGc3EsfaCG9O.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/yTM4LVWkGMAdSvL59QDyDYQ2m9wKEGc3EsfaCG9O.png&quot;,&quot;width&quot;:701}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/yTM4LVWkGMAdSvL59QDyDYQ2m9wKEGc3EsfaCG9O.png\"><img src=\"https://comfypace.com/uploads/yTM4LVWkGMAdSvL59QDyDYQ2m9wKEGc3EsfaCG9O.png\" width=\"701\" height=\"230\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">90.83 KB</span></figcaption></a></figure></p><p>Anda dapat menukar dua kartu yang berdampingan.<br>Berapa banyak pertukaran yang diperlukan untuk menukar kartu-kartu sehingga semua berang-berang berada di awal baris dan kanguru di akhir? Gunakan jumlah pertukaran minimum.<br><br><strong>--------------<br>English Version</strong></p><p>Beavers and kangaroos cards are in an order:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:93007,&quot;height&quot;:230,&quot;href&quot;:&quot;https://comfypace.com/uploads/cZzxqsDNiKEzQn4gpUoidgTTUUoWTNDcQkaUl7eE.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/cZzxqsDNiKEzQn4gpUoidgTTUUoWTNDcQkaUl7eE.png&quot;,&quot;width&quot;:701}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/cZzxqsDNiKEzQn4gpUoidgTTUUoWTNDcQkaUl7eE.png\"><img src=\"https://comfypace.com/uploads/cZzxqsDNiKEzQn4gpUoidgTTUUoWTNDcQkaUl7eE.png\" width=\"701\" height=\"230\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">90.83 KB</span></figcaption></a></figure><br><br>You can swap two cards next to each other. How many swaps are needed to swap cards to get all beavers at the beginning of the row and kangaroos at the end? Use the minimum number of swaps.<br><br><br></p>', 5, '2023-10-24 16:17:11', '2023-10-25 04:53:56', '<p>Jawabannya adalah 3 yaitu menukar satu kartu berang-berang di tengah ke kangguru di kiri dan akhirnya memindahkan berang-berang di kanan ke tengah dengan menukar 2 kali dengan kangguru di sebelah kirinya.</p><p><strong>----------------<br>English Version\'</strong></p><p>The answer is 3, which means swapping one card with a beaver in the middle to the kangaroo on the left, and finally moving the beaver on the right to the middle by swapping it twice with the kangaroo on its left.</p>'),
(130, 129, 67, 1, '<p>Robot katak bisa menangkap satu serangga dengan melompat sekali dari satu daun ke daun lainnya.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:150522,&quot;height&quot;:427,&quot;href&quot;:&quot;https://comfypace.com/uploads/VT4jRn06mvy2rIafg1gU0k5xT6WZ0A4PsedF6ni5.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/VT4jRn06mvy2rIafg1gU0k5xT6WZ0A4PsedF6ni5.png&quot;,&quot;width&quot;:693}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/VT4jRn06mvy2rIafg1gU0k5xT6WZ0A4PsedF6ni5.png\"><img src=\"https://comfypace.com/uploads/VT4jRn06mvy2rIafg1gU0k5xT6WZ0A4PsedF6ni5.png\" width=\"693\" height=\"427\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">146.99 KB</span></figcaption></a></figure></p><p>Berapa banyak lompatan yang harus dilakukan robot katak untuk menangkap semua serangga?</p><p><strong>----------------<br>English Version</strong></p><p>Robot frog can grab one insect by jumping once fromone leaf to another one.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:150522,&quot;height&quot;:427,&quot;href&quot;:&quot;https://comfypace.com/uploads/QIWJW4XxyQPTixplnAtgLUJWTJfZm6rIn037l8Wo.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/QIWJW4XxyQPTixplnAtgLUJWTJfZm6rIn037l8Wo.png&quot;,&quot;width&quot;:693}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/QIWJW4XxyQPTixplnAtgLUJWTJfZm6rIn037l8Wo.png\"><img src=\"https://comfypace.com/uploads/QIWJW4XxyQPTixplnAtgLUJWTJfZm6rIn037l8Wo.png\" width=\"693\" height=\"427\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">146.99 KB</span></figcaption></a></figure><br><br>How many jumps does robot frog have to make in order to to grab all the insects?</p>', 5, '2023-10-24 16:24:58', '2023-10-25 04:54:35', '<p>Jawabannya adalah 8 dengan urutan loncat ke tengah loncat ke kanan atas loncat ke bawah loncat ke tengah lalu loncat ke kiri bawah ke kiri atas ke tengah lalu akhirnya ke kiri bawah dan semuanya sudah termakan.</p><p><strong>-------------<br>English Version</strong></p><p>The answer is 8, with the sequence of jumping to the center, then jumping to the upper right, jumping down, jumping to the center, then jumping to the lower left, to the upper left, to the center, and finally to the lower left, and all the insects are eaten.</p><p><br><br><br><br></p><p><br><br></p>'),
(131, 130, 68, 1, '<p>Seseorang memiliki laundry dengan dua mesin terpisah untuk mencuci dan mengeringkan pakaian. Kedua mesin tersebut memiliki siklus operasi setengah jam, sehingga setiap pelanggan memerlukan waktu 60 menit.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:83445,&quot;height&quot;:475,&quot;href&quot;:&quot;https://comfypace.com/uploads/VC9Sait1Hk9Vgd1o5jBnUX9N0Q1ULNN7tCQpcIPP.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/VC9Sait1Hk9Vgd1o5jBnUX9N0Q1ULNN7tCQpcIPP.png&quot;,&quot;width&quot;:440}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/VC9Sait1Hk9Vgd1o5jBnUX9N0Q1ULNN7tCQpcIPP.png\"><img src=\"https://comfypace.com/uploads/VC9Sait1Hk9Vgd1o5jBnUX9N0Q1ULNN7tCQpcIPP.png\" width=\"440\" height=\"475\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">81.49 KB</span></figcaption></a></figure></p><p>Dua orang datang dengan buru-buru. Mereka perlu mencuci dan mengeringkan pakaian mereka secepat mungkin.<br>Berapa menit waktu yang dibutuhkan untuk mencuci dan mengeringkan pakaian untuk dua berang-berang?</p><p><strong>-----------------<br>English Version</strong></p><p>Someone has a laundry with two separate machines for washing and drying. Both machines have an half hour operating cycle, so each customer needs 60 minutes.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:83445,&quot;height&quot;:475,&quot;href&quot;:&quot;https://comfypace.com/uploads/AXdHrfcHnwaTDQqdSHdfaUtcQ0Eec2EfKU3rRF1k.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/AXdHrfcHnwaTDQqdSHdfaUtcQ0Eec2EfKU3rRF1k.png&quot;,&quot;width&quot;:440}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/AXdHrfcHnwaTDQqdSHdfaUtcQ0Eec2EfKU3rRF1k.png\"><img src=\"https://comfypace.com/uploads/AXdHrfcHnwaTDQqdSHdfaUtcQ0Eec2EfKU3rRF1k.png\" width=\"440\" height=\"475\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">81.49 KB</span></figcaption></a></figure><br><br>Two people arrive in a hurry. They need to wash and dry their clothes as quickly as possible.<br>How many minutes it is going to take to wash and dry clothes for two beavers?</p>', 5, '2023-10-24 16:31:12', '2023-10-25 04:55:12', '<p>Jawabannya 90 karena ketika orang pertama selesai mencuci dengan mesin orang kedua akan mencuci bajunya dan orang kedua mengeringkan bajunya ketika baju orang pertama selesai orang kedua mengeringkan bajunya dan waktunya sekarang 60 menit , selanjutnya menunggu 30 menit lagi dan orang kedua bajunya juga sudah kering maka total waktunya 90 menit.</p><p><strong>---------------<br>English Version</strong></p><p>The answer is 90 because when the first person finishes washing with the machine, the second person starts washing their clothes, and the second person dries their clothes when the first person\'s clothes are done. The time is now 60 minutes, and then they wait for another 30 minutes for the second person\'s clothes to dry. So, the total time is 90 minutes.</p>'),
(132, 131, 68, 1, '<p>Sebuah robot diprogram untuk membawa paket ke lantai ketiga. Jika berat paket kurang dari 10 kilogram, robot dapat naik satu lantai per menit. Jika beratnya lebih dari itu, dibutuhkan waktu 2 menit per lantai. Robot menunda 1 menit untuk persiapan sebelum setiap kali naik tangga.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:76955,&quot;height&quot;:406,&quot;href&quot;:&quot;https://comfypace.com/uploads/XblW3u17OKr8BigxtK4csfVa598srdoCHFNEyQOD.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/XblW3u17OKr8BigxtK4csfVa598srdoCHFNEyQOD.png&quot;,&quot;width&quot;:712}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/XblW3u17OKr8BigxtK4csfVa598srdoCHFNEyQOD.png\"><img src=\"https://comfypace.com/uploads/XblW3u17OKr8BigxtK4csfVa598srdoCHFNEyQOD.png\" width=\"712\" height=\"406\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">75.15 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Berapa menit yang diperlukan Robot untuk membawa paket seberat 13 kilogram ke lantai 3?<br><strong>----------------<br>English Version</strong></p><p>A Robot is programmed to carry parcels to the third floor. If a parcel weighs up to 10 kilo, robot can move one floor per minute. If it is heavier 2 minutes per floor. Robot delays 1 minute preparing to move<br>before each flight of stairs.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:76955,&quot;height&quot;:406,&quot;href&quot;:&quot;https://comfypace.com/uploads/prRC9ffYXeJcZiQO7okZ9S4BSZBUArgA1Ah5RgDN.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/prRC9ffYXeJcZiQO7okZ9S4BSZBUArgA1Ah5RgDN.png&quot;,&quot;width&quot;:712}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/prRC9ffYXeJcZiQO7okZ9S4BSZBUArgA1Ah5RgDN.png\"><img src=\"https://comfypace.com/uploads/prRC9ffYXeJcZiQO7okZ9S4BSZBUArgA1Ah5RgDN.png\" width=\"712\" height=\"406\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">75.15 KB</span></figcaption></a></figure><br><strong>Question</strong><br>How many minutes will it take Robot to carry a 13 kilo parcel to the 3rd floor?</p>', 5, '2023-10-24 16:43:52', '2023-10-25 04:55:35', '<p>Jawabannya adalah 9 karena sebelum dia naik ke lantai 1 ia perlu berhenti 1 menit untuk persiapan dan proses naik perlantai itu 2 menit mengingat beratnya lebih dari 10 kilogram dan ini dia lakukan 3 kali karena perlu ke lantai 3 maka waktu yang dibutuhkan adalah 9 menit.</p><p><strong>------------------<br>English Version</strong></p><p>The answer is 9 because before it goes up to the first floor, it needs to stop for 1 minute for preparation, and the process of going up to each floor takes 2 minutes due to the weight being over 10 kilograms, and this is done 3 times because it needs to reach the 3rd floor, so the total time required is 9 minutes.</p>'),
(133, 132, 69, 1, '<p>Roda diprogram untuk berhenti sesuai dengan aturan berikut:</p><ol><li>Kali pertama - melompati satu kotak,&nbsp;</li><li>Kali kedua - melompati dua kotak,</li><li>Kali ketiga - melompati tiga kotak, dan seterusnya.<br>Huruf pertama dari kata tersebut adalah \"P\".</li></ol><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:273545,&quot;height&quot;:453,&quot;href&quot;:&quot;https://comfypace.com/uploads/iVMroE8s9Wzck2R0028tU8D8COW6HUYAH8zzBfpM.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/iVMroE8s9Wzck2R0028tU8D8COW6HUYAH8zzBfpM.png&quot;,&quot;width&quot;:585}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/iVMroE8s9Wzck2R0028tU8D8COW6HUYAH8zzBfpM.png\"><img src=\"https://comfypace.com/uploads/iVMroE8s9Wzck2R0028tU8D8COW6HUYAH8zzBfpM.png\" width=\"585\" height=\"453\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">267.13 KB</span></figcaption></a></figure></p><p>Apa kata tersebut?<br><strong>----------------<br>English Version</strong></p><p>A wheel is programmed to stop according to the following rules:<br>1st time  skip one square,<br>2nd time  skip two squares,<br>3rd time  skip three squares etc.<br>The first letter of the word is P.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:273545,&quot;height&quot;:453,&quot;href&quot;:&quot;https://comfypace.com/uploads/tfLwg2GLPGvn6dEgkSEjYqWndNhjp51miPYIsoJI.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/tfLwg2GLPGvn6dEgkSEjYqWndNhjp51miPYIsoJI.png&quot;,&quot;width&quot;:585}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/tfLwg2GLPGvn6dEgkSEjYqWndNhjp51miPYIsoJI.png\"><img src=\"https://comfypace.com/uploads/tfLwg2GLPGvn6dEgkSEjYqWndNhjp51miPYIsoJI.png\" width=\"585\" height=\"453\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">267.13 KB</span></figcaption></a></figure><br><br>What is the word?</p>', 5, '2023-10-24 16:56:07', '2023-10-25 04:56:24', '<p>Jawabannya adalah PROGRAM karena dia akan melompati kotak sebelahnya baru masuk ke kotak berikutnya jadi seperti P ketika loncat sekali dia akan loncat ke R dia berputar melawan arah jam untuk kotaknya karena dia berputar searah jarum jam.</p><p><strong>----------------<br>English Version</strong></p><p>The answer is PROGRAM because it will skip the adjacent square and then enter the next square, similar to how \"P\" looks when you skip one square. It rotates counterclockwise in its square because it moves against the clockwise direction of the hands of a clock.</p>'),
(134, 133, 69, 1, '<p>Willy Kecil ingin memberikan kalung kepada pacarnya. Dia tahu bahwa dia menginginkan kalung tertentu:</p><ol><li>Buah beri merah harus berada di antara jarum-jarum pinus, dan</li><li>Jumlah biji apel harus sama dengan jumlah jarum-jarum pinus.</li></ol><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:161319,&quot;height&quot;:521,&quot;href&quot;:&quot;https://comfypace.com/uploads/e3eGOjq6Q4OYyEenZEpkq1EfOCuOEom1Zeil3pm8.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/e3eGOjq6Q4OYyEenZEpkq1EfOCuOEom1Zeil3pm8.png&quot;,&quot;width&quot;:609}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/e3eGOjq6Q4OYyEenZEpkq1EfOCuOEom1Zeil3pm8.png\"><img src=\"https://comfypace.com/uploads/e3eGOjq6Q4OYyEenZEpkq1EfOCuOEom1Zeil3pm8.png\" width=\"609\" height=\"521\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">157.54 KB</span></figcaption></a></figure></p><p>Kalung mana yang akan disukai oleh gadis berang-berang kecil?</p><p><strong>--------------<br>English Version</strong></p><p>Little Willy wants to give a necklace to his girlfriend. He knows she wants a specific one:<br>1) Red berries have to be between pine needles and<br>2) The number of apple pips has to be equal to the number of pine needles.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:161319,&quot;height&quot;:521,&quot;href&quot;:&quot;https://comfypace.com/uploads/LfFmgBAlORmDhmQf3xuznLZDJqYhy36ogdq5mIaK.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/LfFmgBAlORmDhmQf3xuznLZDJqYhy36ogdq5mIaK.png&quot;,&quot;width&quot;:609}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/LfFmgBAlORmDhmQf3xuznLZDJqYhy36ogdq5mIaK.png\"><img src=\"https://comfypace.com/uploads/LfFmgBAlORmDhmQf3xuznLZDJqYhy36ogdq5mIaK.png\" width=\"609\" height=\"521\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">157.54 KB</span></figcaption></a></figure><br>Which necklace will little beaver girl like?<br><br><br></p>', 5, '2023-10-24 17:00:18', '2023-10-25 04:56:46', '<p>Jawabannya A karena buah beri merah selalu ditengah jarum-jarum pinus dan jumlah biji apel sesuai dengan jumlah jarum-jarum pinus tersebut.</p><p><strong>----------------<br>English Version</strong></p><p>The answer is A because the red berries are always between the pine needles, and the number of apple pips matches the number of pine needles.</p>'),
(135, 134, 70, 1, '<p>Programmer menghias Pohon Natal yang luar biasa, terutama untuk merayakan Malam Tahun Baru. Lampu yang menyala menunjukkan angka 1 dan yang mati menunjukkan angka 0.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:180890,&quot;height&quot;:559,&quot;href&quot;:&quot;https://comfypace.com/uploads/Jyz7mKJwEt07tz02sQfb47lMSJ1H6HAhA7QnLXeV.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Jyz7mKJwEt07tz02sQfb47lMSJ1H6HAhA7QnLXeV.png&quot;,&quot;width&quot;:722}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Jyz7mKJwEt07tz02sQfb47lMSJ1H6HAhA7QnLXeV.png\"><img src=\"https://comfypace.com/uploads/Jyz7mKJwEt07tz02sQfb47lMSJ1H6HAhA7QnLXeV.png\" width=\"722\" height=\"559\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">176.65 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Tahun Baru Malam apa yang sedang dirayakan?</p><p><strong>-------------<br>English Version</strong></p><p>Programmer decorated an extraordinary Christmas Tree especially for a New Years Eve. A lit light bulb means 1 and unlit means 0.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:180890,&quot;height&quot;:559,&quot;href&quot;:&quot;https://comfypace.com/uploads/uTYy3ofdAnFtRs4HOkmCyye3ihuYzvGa6gHh1dnu.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/uTYy3ofdAnFtRs4HOkmCyye3ihuYzvGa6gHh1dnu.png&quot;,&quot;width&quot;:722}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/uTYy3ofdAnFtRs4HOkmCyye3ihuYzvGa6gHh1dnu.png\"><img src=\"https://comfypace.com/uploads/uTYy3ofdAnFtRs4HOkmCyye3ihuYzvGa6gHh1dnu.png\" width=\"722\" height=\"559\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">176.65 KB</span></figcaption></a></figure><br><strong>Question</strong><br>Which New Year Eve is being celebrated?</p>', 5, '2023-10-24 17:29:24', '2023-10-25 04:57:34', '<p>Jawabannya adalah 2017 karena 0010 itu 2 0000 itu 0&nbsp; 0001 itu 1 dan 0111 adalah 7 sehingga menjadi 2017.</p><p><strong>--------------<br>English Version</strong></p><p><br>The answer is 2017 because 0010 is 2, 0000 is 0, 0001 is 1, and 0111 is 7, which makes it 2017.</p>'),
(136, 135, 70, 1, '<p>Jendela-jendela di rumah Judi ditandai dengan nomor baris dan kolom, misalnya, jendela di sebelah kanan pintu: [1, 3] dan [2, 3]. Judi mengganti jendela-jendela berikut tahun lalu: [1, 2]; [1, 6]; [2, 2]; [2, 5].</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:118008,&quot;height&quot;:389,&quot;href&quot;:&quot;https://comfypace.com/uploads/yP31vtJOV5LViCj2bdqX6ovm6SHVLiHCqCtectwc.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/yP31vtJOV5LViCj2bdqX6ovm6SHVLiHCqCtectwc.png&quot;,&quot;width&quot;:714}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/yP31vtJOV5LViCj2bdqX6ovm6SHVLiHCqCtectwc.png\"><img src=\"https://comfypace.com/uploads/yP31vtJOV5LViCj2bdqX6ovm6SHVLiHCqCtectwc.png\" width=\"714\" height=\"389\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">115.24 KB</span></figcaption></a></figure></p><p>Tahun ini, ia ingin mengganti jendela-jendela lain, tetapi hanya yang memiliki 4 \"tetangga\": di sebelah kiri, kanan, di atas, dan di bawah.</p><p><strong>Pertanyaan</strong><br>Berapa banyak jendela yang akan diganti oleh Beaver tahun ini?</p><p><strong>--------------<br>English Version</strong></p><p>Judi house windows are marked by row &amp; column numbers, e.g. windows on the doors right: [1, 3] and [2,3].<br>Judi replaced windows: [1, 2]; [1, 6]; [2, 2]; [2, 5] last year.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:118008,&quot;height&quot;:389,&quot;href&quot;:&quot;https://comfypace.com/uploads/XUejajrPcDLqJPleTQ26ZML0zdPuntyN13CTnKLS.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/XUejajrPcDLqJPleTQ26ZML0zdPuntyN13CTnKLS.png&quot;,&quot;width&quot;:714}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/XUejajrPcDLqJPleTQ26ZML0zdPuntyN13CTnKLS.png\"><img src=\"https://comfypace.com/uploads/XUejajrPcDLqJPleTQ26ZML0zdPuntyN13CTnKLS.png\" width=\"714\" height=\"389\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">115.24 KB</span></figcaption></a></figure><br><br>This year he wants to replace other windows, but only those, which have 4 neighbours: to the left, right, above &amp; below.</p><p><strong>Question</strong><br>How many windows Beaver is going to replace this year?</p>', 5, '2023-10-24 17:46:21', '2023-10-25 04:58:05', '<p>Jawabannya adalah 2 karena [2,4] dan [2,5] yang memiliki tetangga atas,kiri,kanan, dan bawah.</p><p><strong>--------------<br>English Version</strong></p><p>The answer is 2 because [2,4] and [2,5] are the ones that have neighbors on the top, left, right, and bottom.</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(137, 136, 71, 1, '<p>Josh yang bersiul dapat berkomunikasi satu sama lain dari jarak jauh menggunakan bahasa bersiul. Setiap huruf dibentuk oleh kombinasi bersiul panjang dan pendek. Ada jeda antara huruf-huruf.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:1076,&quot;height&quot;:39,&quot;href&quot;:&quot;https://comfypace.com/uploads/PInYxVrZAAO6MAWcPEv0CdpMpV0Yh3KxdkowRruy.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/PInYxVrZAAO6MAWcPEv0CdpMpV0Yh3KxdkowRruy.png&quot;,&quot;width&quot;:55}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/PInYxVrZAAO6MAWcPEv0CdpMpV0Yh3KxdkowRruy.png\"><img src=\"https://comfypace.com/uploads/PInYxVrZAAO6MAWcPEv0CdpMpV0Yh3KxdkowRruy.png\" width=\"55\" height=\"39\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">1.05 KB</span></figcaption></a></figure>Siul Panjang</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:928,&quot;height&quot;:24,&quot;href&quot;:&quot;https://comfypace.com/uploads/9iflVR44tUb2FqvPJEPS7UBiRR4fvMozo31NSWv9.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/9iflVR44tUb2FqvPJEPS7UBiRR4fvMozo31NSWv9.png&quot;,&quot;width&quot;:23}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/9iflVR44tUb2FqvPJEPS7UBiRR4fvMozo31NSWv9.png\"><img src=\"https://comfypace.com/uploads/9iflVR44tUb2FqvPJEPS7UBiRR4fvMozo31NSWv9.png\" width=\"23\" height=\"24\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">928 Bytes</span></figcaption></a></figure>Siul Pendek</p><p>Suara untuk huruf-huruf berikut adalah:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15213,&quot;height&quot;:183,&quot;href&quot;:&quot;https://comfypace.com/uploads/Fz8mKcHrkK1Bqqhnm2kkcae1milSllMd8U7cw6vq.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Fz8mKcHrkK1Bqqhnm2kkcae1milSllMd8U7cw6vq.png&quot;,&quot;width&quot;:322}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Fz8mKcHrkK1Bqqhnm2kkcae1milSllMd8U7cw6vq.png\"><img src=\"https://comfypace.com/uploads/Fz8mKcHrkK1Bqqhnm2kkcae1milSllMd8U7cw6vq.png\" width=\"322\" height=\"183\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.86 KB</span></figcaption></a></figure></p><p><strong>Pertanyaan</strong></p><p>Manakah urutan bersiul yang membentuk kata NEST?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:57391,&quot;height&quot;:384,&quot;href&quot;:&quot;https://comfypace.com/uploads/SxGEqtw8s3ndTF5aNDIdV9ByHFGZeY2OX91OidEL.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/SxGEqtw8s3ndTF5aNDIdV9ByHFGZeY2OX91OidEL.png&quot;,&quot;width&quot;:494}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/SxGEqtw8s3ndTF5aNDIdV9ByHFGZeY2OX91OidEL.png\"><img src=\"https://comfypace.com/uploads/SxGEqtw8s3ndTF5aNDIdV9ByHFGZeY2OX91OidEL.png\" width=\"494\" height=\"384\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">56.05 KB</span></figcaption></a></figure></p><p><strong>---------------<br>English Version</strong></p><p>Whistling beavers can talk with each other from a long distance using whistle language. Every letter is made up of a combination of long and short whistles. There is a pause between letters.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:9274,&quot;height&quot;:70,&quot;href&quot;:&quot;https://comfypace.com/uploads/fi2Vr2PzOuKdG4qbpkk3SHdsmu3ShhIwfr2a6jVb.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/fi2Vr2PzOuKdG4qbpkk3SHdsmu3ShhIwfr2a6jVb.png&quot;,&quot;width&quot;:499}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/fi2Vr2PzOuKdG4qbpkk3SHdsmu3ShhIwfr2a6jVb.png\"><img src=\"https://comfypace.com/uploads/fi2Vr2PzOuKdG4qbpkk3SHdsmu3ShhIwfr2a6jVb.png\" width=\"499\" height=\"70\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">9.06 KB</span></figcaption></a></figure><br><br>Sounds for the following letters are:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:15213,&quot;height&quot;:183,&quot;href&quot;:&quot;https://comfypace.com/uploads/GIlixxnhwbX0TM7gTLKu5FSZnHx6B5ZpsRYS69AH.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/GIlixxnhwbX0TM7gTLKu5FSZnHx6B5ZpsRYS69AH.png&quot;,&quot;width&quot;:322}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/GIlixxnhwbX0TM7gTLKu5FSZnHx6B5ZpsRYS69AH.png\"><img src=\"https://comfypace.com/uploads/GIlixxnhwbX0TM7gTLKu5FSZnHx6B5ZpsRYS69AH.png\" width=\"322\" height=\"183\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.86 KB</span></figcaption></a></figure></p><p><strong>Question</strong><br><br>Which whistle sequence makes the word NEST?</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:57391,&quot;height&quot;:384,&quot;href&quot;:&quot;https://comfypace.com/uploads/64qbwMb9nW3AjFr79ImH49dg94joGj0rIMMjdi9z.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/64qbwMb9nW3AjFr79ImH49dg94joGj0rIMMjdi9z.png&quot;,&quot;width&quot;:494}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/64qbwMb9nW3AjFr79ImH49dg94joGj0rIMMjdi9z.png\"><img src=\"https://comfypace.com/uploads/64qbwMb9nW3AjFr79ImH49dg94joGj0rIMMjdi9z.png\" width=\"494\" height=\"384\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">56.05 KB</span></figcaption></a></figure></p>', 5, '2023-10-24 18:08:58', '2023-10-25 05:07:34', '<p>Jawabannya adalah B karena dia mempunyai jawaban yang tepat.</p><p><strong>---------------<br>English Version</strong></p><p>The answer is D because it has the correct response.</p>'),
(138, 137, 71, 1, '<p>Sebuah roda diprogram untuk berhenti sesuai dengan aturan berikut:</p><ol><li>Kali pertama - melompati satu kotak,</li><li>Kali kedua - melompati dua kotak,</li><li>Kali ketiga - melompati tiga kotak, dan seterusnya.<br>Huruf pertama dari kata tersebut adalah \"P\".</li></ol><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:282490,&quot;height&quot;:441,&quot;href&quot;:&quot;https://comfypace.com/uploads/wTHtL6yMvgRLeKmNg7EcAYV2TqX1xLHTFouBJDGO.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/wTHtL6yMvgRLeKmNg7EcAYV2TqX1xLHTFouBJDGO.png&quot;,&quot;width&quot;:553}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/wTHtL6yMvgRLeKmNg7EcAYV2TqX1xLHTFouBJDGO.png\"><img src=\"https://comfypace.com/uploads/wTHtL6yMvgRLeKmNg7EcAYV2TqX1xLHTFouBJDGO.png\" width=\"553\" height=\"441\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">275.87 KB</span></figcaption></a></figure></p><p>Gojo membaca sebuah kata dan menemukan sebuah kesalahan. Apa kesalahannya?</p><p><strong>--------------<br>English Version</strong></p><p>A wheel is programmed to stop according to the following rules:<br>1st time  skip one square,<br>2nd time  skip two squares,<br>3rd time  skip three squares etc.<br>The first letter of the word is P.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:282490,&quot;height&quot;:441,&quot;href&quot;:&quot;https://comfypace.com/uploads/TgYyEQjcPH2S9I8At7M2WCUgmQaflznxjCU721nL.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/TgYyEQjcPH2S9I8At7M2WCUgmQaflznxjCU721nL.png&quot;,&quot;width&quot;:553}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/TgYyEQjcPH2S9I8At7M2WCUgmQaflznxjCU721nL.png\"><img src=\"https://comfypace.com/uploads/TgYyEQjcPH2S9I8At7M2WCUgmQaflznxjCU721nL.png\" width=\"553\" height=\"441\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">275.87 KB</span></figcaption></a></figure><br>Gojo read a word and found a mistake. What is the mistake?</p>', 5, '2023-10-24 18:14:53', '2023-10-25 05:07:58', '<p>Jawabannya adalah I karena teksnya seharusnya PROGRAMMI_G.</p><p><strong>--------------<br>English Version</strong></p><p>The answer is I because the text should be PROGRAMMI_G.</p>'),
(139, 138, 72, 1, '<p>Dua robot: kucing dan tikus. Keduanya dapat berpindah dari satu kotak ke kotak lainnya mengikuti arah panah. Kucing ingin memburu tikus.</p><p> Kucing mulai duluan.<br> Gerakan dilakukan secara bergantian (kucing, tikus, kucing, tikus, dst.).<br> Para robot bergerak sesuai arah yang ditunjukkan oleh panah sejauh kotak yang ada panah (misalnya satu kotak jika ada satu panah, dua kotak jika ada dua panah, dan seterusnya).<br> Ketika robot bergerak, ia mengabaikan panah di kotak-kotak yang dilaluinya.<br> Tikus dimakan ketika kucing berada di kotak yang sama dengan tikus.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:34295,&quot;height&quot;:388,&quot;href&quot;:&quot;https://comfypace.com/uploads/XdfXKnf9lyxsRFEnxNsIdlZrudovfqIxRuvKp44I.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/XdfXKnf9lyxsRFEnxNsIdlZrudovfqIxRuvKp44I.png&quot;,&quot;width&quot;:347}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/XdfXKnf9lyxsRFEnxNsIdlZrudovfqIxRuvKp44I.png\"><img src=\"https://comfypace.com/uploads/XdfXKnf9lyxsRFEnxNsIdlZrudovfqIxRuvKp44I.png\" width=\"347\" height=\"388\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">33.49 KB</span></figcaption></a></figure></p><p>Dapatkah tikus menghindari kucing?<br><strong>-------------<br>English Version</strong></p><p>Two robots: cat and mouse. Both of them can move from one square to another following the arrows. Cat wants to hunt the mouse.<br> Cat starts first.<br> Moves are made alternately (cat, mouse, cat, mouse, etc.)<br> The robots move in the direction indicated by the arrows as many squares as there are arrows (E.G. one square if there is one arrow, two squares if two arrows and etc.).<br> When a robot is moving, it ignores the arrows on the squares it moves over.<br> Mouse is eaten, when the cat is on the same square as the mouse.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:34295,&quot;height&quot;:388,&quot;href&quot;:&quot;https://comfypace.com/uploads/7HkzhI7f6pQAYpWgREqZuFfGFWaGg3eefqum11aP.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/7HkzhI7f6pQAYpWgREqZuFfGFWaGg3eefqum11aP.png&quot;,&quot;width&quot;:347}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/7HkzhI7f6pQAYpWgREqZuFfGFWaGg3eefqum11aP.png\"><img src=\"https://comfypace.com/uploads/7HkzhI7f6pQAYpWgREqZuFfGFWaGg3eefqum11aP.png\" width=\"347\" height=\"388\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">33.49 KB</span></figcaption></a></figure><br><br>Can the mouse avoid the cat?</p>', 5, '2023-10-24 18:21:28', '2023-10-25 05:08:37', '<p>Ya karena tikus dan kucing tidak akan pernah bertemu atau terjadi infinite looping.</p><p><strong>--------------<br>English Version</strong></p><p>Yes, because the mouse and the cat will never meet, or an infinite loop occurs.</p>'),
(140, 139, 72, 1, '<p>Kenta mengirim pesan yang dienkripsi dengan sandi tertentu: setiap huruf abjad digeser dua huruf.<br>Contohnya, A-&gt;C, B-&gt;D..., Y-&gt;A, Z-&gt;B.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:105396,&quot;height&quot;:416,&quot;href&quot;:&quot;https://comfypace.com/uploads/Dvl9Qb9pNCCHjh8xovXDEgX4DgTYWoeYBkq988sd.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Dvl9Qb9pNCCHjh8xovXDEgX4DgTYWoeYBkq988sd.png&quot;,&quot;width&quot;:703}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Dvl9Qb9pNCCHjh8xovXDEgX4DgTYWoeYBkq988sd.png\"><img src=\"https://comfypace.com/uploads/Dvl9Qb9pNCCHjh8xovXDEgX4DgTYWoeYBkq988sd.png\" width=\"703\" height=\"416\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">102.93 KB</span></figcaption></a></figure></p><p>Pesan yang diterima: JGNNQ VJGTG<br>Apa yang ditulis oleh Kenta?</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>Kenta send messages encoded with a specific cipher: every alphabet letter is shifted by two letters.<br>E.g. A-&gt;C, B-&gt;D..., Y-&gt;A, Z-&gt;B.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:105396,&quot;height&quot;:416,&quot;href&quot;:&quot;https://comfypace.com/uploads/Dvl9Qb9pNCCHjh8xovXDEgX4DgTYWoeYBkq988sd.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Dvl9Qb9pNCCHjh8xovXDEgX4DgTYWoeYBkq988sd.png&quot;,&quot;width&quot;:703}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Dvl9Qb9pNCCHjh8xovXDEgX4DgTYWoeYBkq988sd.png\"><img src=\"https://comfypace.com/uploads/Dvl9Qb9pNCCHjh8xovXDEgX4DgTYWoeYBkq988sd.png\" width=\"703\" height=\"416\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">102.93 KB</span></figcaption></a></figure><br><br>Message received: JGNNQ VJGTG<br>What was written by the Kenta?</p>', 5, '2023-10-24 18:25:45', '2023-10-27 13:20:37', '<p>Jawabannya adalah HELLO THERE karena menggeser 2 huruf ke kiri untuk mendeskripsikan pesan yang dienkripsi. J -&gt; H, G-&gt;E, N-&gt;L, Q-&gt;O , V-&gt;T, T-&gt;R.&nbsp;</p><p><strong>----------------</strong></p><p><strong>English Version</strong></p><p>The answer is HELLO THERE because it shifts 2 letters to the left to decrypt the encrypted message. J -&gt; H, G -&gt; E, N -&gt; L, Q -&gt; O, V -&gt; T, T -&gt; R.</p>'),
(142, 140, 74, 1, '<p>Ada dua penjual es krim.<br>Mereka menggunakan empat rasa yang sama:<br>Penjual pertama menggunakan petunjuk berikut untuk membuat es krim:<br>1. Mulailah dengan kerucut yang kosong.<br>2. Pilih rasa secara acak, dan tambahkan dua sendok rasa tersebut.<br>3. Tambahkan satu sendok rasa berbeda.<br>4. Jika ketinggian yang diminta tercapai, berhenti, jika tidak lanjutkan ke Langkah 2.<br>Penjual es krim kedua tidak mengikuti instruksi apapun.</p><p>Anda hanya dapat melihat beberapa sendok pertama kerucut es krim. Yang mana yang pasti dari penjual kedua?</p><p><br></p><p>----------------------------------------</p><p>There are two ice cream sellers. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:21959,&quot;height&quot;:77,&quot;href&quot;:&quot;https://comfypace.com/uploads/J09ehRkhpYkwG54sQ7x5ZuWXbtSOa5XmuoXUGjac.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/J09ehRkhpYkwG54sQ7x5ZuWXbtSOa5XmuoXUGjac.png&quot;,&quot;width&quot;:319}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/J09ehRkhpYkwG54sQ7x5ZuWXbtSOa5XmuoXUGjac.png\"><img src=\"https://comfypace.com/uploads/J09ehRkhpYkwG54sQ7x5ZuWXbtSOa5XmuoXUGjac.png\" width=\"319\" height=\"77\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">21.44 KB</span></figcaption></a></figure>They use the same four flavours:<br>The first seller uses the following instructions to make ice cream:<br>1. Start with an empty cone.<br>2. Pick a flavour at random, and add two scoops of that flavour.<br>3. Add one scoop of any different flavour.<br>4. If the requested height is reached, stop, otherwise go to Step 2.<br>The second ice cream seller does not follow any instructions.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:53164,&quot;height&quot;:201,&quot;href&quot;:&quot;https://comfypace.com/uploads/RWnxoqNm1Bck0O2JRfkdzko58HDyq9SduGpNBVQb.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/RWnxoqNm1Bck0O2JRfkdzko58HDyq9SduGpNBVQb.png&quot;,&quot;width&quot;:347}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/RWnxoqNm1Bck0O2JRfkdzko58HDyq9SduGpNBVQb.png\"><img src=\"https://comfypace.com/uploads/RWnxoqNm1Bck0O2JRfkdzko58HDyq9SduGpNBVQb.png\" width=\"347\" height=\"201\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">51.92 KB</span></figcaption></a></figure>You can only see the<br>first few scoops of the<br>ice cream cones.<br>Which one is certainly<br>from the second seller?</p>', 5, '2023-10-28 04:16:14', '2023-10-28 04:16:14', '<p>Hanya ada satu kerucut yang jelas-jelas tidak mengikuti<br>instruksi saat rasa sendok ketiga diulang dua kali<br>sebanyak tiga kali atau satu kali, yang akan memenuhi persyaratan.</p><p><br></p><p>-----------------------------------------</p><p><br></p><p>There is only one cone that clearly does not follow the<br>instructions as the third scoop flavour repeats twice, instead<br>of three times or once, which would meet the requirements.</p>'),
(143, 141, 74, 1, '<p>Banyak berang-berang yang perlu menggunakan dua lift.<br>Setiap lift hanya mampu membawa beban maksimal 30kg.<br><br></p><p>Berapa jumlah berang-berang terbanyak yang dapat dibawa oleh kedua lift ini sekaligus?</p><p><br></p><p>-------------------------------------------</p><p><br></p><p>A lot of beavers need to use two lifts. Each lift can only take a maximum of 30kg.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:46865,&quot;height&quot;:305,&quot;href&quot;:&quot;https://comfypace.com/uploads/m6s4J1SbVCGyD5GjHZbFGSsc1P50oEI8zBrSarxw.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/m6s4J1SbVCGyD5GjHZbFGSsc1P50oEI8zBrSarxw.png&quot;,&quot;width&quot;:528}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/m6s4J1SbVCGyD5GjHZbFGSsc1P50oEI8zBrSarxw.png\"><img src=\"https://comfypace.com/uploads/m6s4J1SbVCGyD5GjHZbFGSsc1P50oEI8zBrSarxw.png\" width=\"528\" height=\"305\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">45.77 KB</span></figcaption></a></figure>What is the largest number of beavers these two lifts can take at once?</p><p><br></p>', 5, '2023-10-28 04:21:07', '2023-10-28 04:21:07', '<p>Salah satu lift dapat membawa berang-berang dengan berat: 2kg, 3kg, 5kg, 8kg dan 12kg.<br>Lift lainnya dapat membawa berang-berang dengan berat: 12kg, 9kg dan 9kg.</p><p><br></p><p>--------------------------------------</p><p><br></p><p>One of the lifts can take the beavers that weigh: 2kg, 3kg, 5kg, 8kg and 12kg. The other lift can take the beavers that weigh: 12kg, 9kg and 9kg.</p>'),
(144, 142, 75, 1, '<p>Ini adalah peta sebuah taman:<br><br>Lingkaran hijau dengan huruf melambangkan pepohonan dan garis coklat melambangkan jalan setapak. Perhatikan bahwa beberapa huruf digunakan untuk memberi label pada lebih dari satu pohon. Berjalan dari pohon F ke pohon B dapat digambarkan sebagai F D E C A B.<br><br>Minggu lalu dua keluarga berjalan-jalan di taman.<br><br>Jalan keluarga Wilde adalah B A A A C E D E E D A. Jalan keluarga Gilde adalah F D C D A E A D E D A.<br><br>Kedua keluarga memulai perjalanan mereka pada waktu yang bersamaan. Berjalan dari satu pohon ke pohon lainnya, menyusuri satu jalur membutuhkan waktu yang sama.</p><p>Berapa kali kedua keluarga bertemu di pohon?</p><p>----------------------------------------</p><p><br></p><p>This is the map of a park:</p><p>The green circles with letters represent the trees and the brown lines are paths. Note that some letters are used to label more than one tree. Walking from tree F to tree B can be described as F D E C A B.</p><p>Last Sunday two families walked in the park.</p><p>The Wilde familys walk was B A A A C E D E E D A. The Gilde familys walk was F D C D A E A D E D A.</p><p>Both families started their walks at the same time. Walking from one tree to another tree, down one path takes the same amount of time.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:33930,&quot;height&quot;:282,&quot;href&quot;:&quot;https://comfypace.com/uploads/timAMaZZs4N1vFJ3iEhvRf0lFep4B94WRevxmetp.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/timAMaZZs4N1vFJ3iEhvRf0lFep4B94WRevxmetp.png&quot;,&quot;width&quot;:402}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/timAMaZZs4N1vFJ3iEhvRf0lFep4B94WRevxmetp.png\"><img src=\"https://comfypace.com/uploads/timAMaZZs4N1vFJ3iEhvRf0lFep4B94WRevxmetp.png\" width=\"402\" height=\"282\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">33.13 KB</span></figcaption></a></figure>How many times did the two families meet at a tree?<br><br></p>', 5, '2023-10-28 04:28:23', '2023-10-28 04:28:23', '<p>Saat Anda menandai perjalanan keluarga Wilde (dimulai dari B dengan warna biru) dan keluarga Gilde (dimulai dari F dengan warna merah), Anda dapat memberi nomor pada pohon sesuai urutan waktu kunjungannya. Saat Anda melakukan ini, Anda dapat melihat bahwa kedua keluarga tidak pernah berada di pohon yang sama pada waktu yang bersamaan.</p><p><br></p><p>----------------------------------------------</p><p><br></p><p>When you mark out the walk of the Wilde family (starting at B with a blue colour) and the Gilde family (starting at F with a red colour) you can number the trees in the time order they were visited. When you do this, you can see that both families were never at the same tree at the same time.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:53833,&quot;height&quot;:358,&quot;href&quot;:&quot;https://comfypace.com/uploads/H7lvjwhF3jVIfqUChAze1RhXYUQiXb7YFHnsus0M.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/H7lvjwhF3jVIfqUChAze1RhXYUQiXb7YFHnsus0M.png&quot;,&quot;width&quot;:531}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/H7lvjwhF3jVIfqUChAze1RhXYUQiXb7YFHnsus0M.png\"><img src=\"https://comfypace.com/uploads/H7lvjwhF3jVIfqUChAze1RhXYUQiXb7YFHnsus0M.png\" width=\"531\" height=\"358\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">52.57 KB</span></figcaption></a></figure></p>'),
(145, 143, 75, 1, '<p>Para anggota Klub Komputer Perempuan sedang merencanakan perjalanan akhir pekan.<br>Mereka akan menginap di hostel dengan kamar besar, yang masing-masing bisa menampung maksimal enam tamu. Tapi siapa yang akan berbagi kamar satu sama lain?<br><br>Setiap gadis mengirimkan keinginan berbagi kamarnya pada sebuah kartu yang bertuliskan:<br><br>dengan gadis mana dia benar-benar ingin berbagi kamar (+)<br>gadis lain mana yang pastinya tidak dia inginkan sekamar dengannya ()<br>Presiden klub ingin membuat semua anggota bahagia. Jadi dia harus menugaskan gadis-gadis itu ke kamar dan memenuhi semua keinginan berbagi kamar mereka.<br>&nbsp;<br>&nbsp;Bantu presiden klub menugaskan gadis-gadis ke kamar mereka dengan mengelompokkan gadis-gadis ke dalam tiga kamar.</p><p><br></p><p>------------------------------------------------</p><p><br></p><p>The members of the Girls Computer Club are planning a weekend trip.<br>They will stay in a hostel with large rooms, that can take a maximum of six guests each. But who will share rooms with each other?</p><p>Each girl submits her room sharing wishes on a card saying:</p><ul><li>which other girls she absolutely wants to share a room with (+)</li><li>which other girls she definitely does not want share a room with ()</li><li>The club president wants to keep all members happy. So she must assign the girls to rooms and fulfil all their room sharing wishes.</li></ul><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:22703,&quot;height&quot;:194,&quot;href&quot;:&quot;https://comfypace.com/uploads/cQFoYi3y0tN9snXzAHiljDCWGNPAAdvTTvZXOrxW.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/cQFoYi3y0tN9snXzAHiljDCWGNPAAdvTTvZXOrxW.png&quot;,&quot;width&quot;:410}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/cQFoYi3y0tN9snXzAHiljDCWGNPAAdvTTvZXOrxW.png\"><img src=\"https://comfypace.com/uploads/cQFoYi3y0tN9snXzAHiljDCWGNPAAdvTTvZXOrxW.png\" width=\"410\" height=\"194\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">22.17 KB</span></figcaption></a></figure>Help the club president assign the girls to their rooms by grouping the girls into three rooms.</p>', 5, '2023-10-28 04:34:46', '2023-10-28 04:34:55', '<p>Alina memilih Lilli, dan Lilli tidak memilih teman sekamar, tapi mengecualikan Lara. Jadi Lilli dan Alina punya kamar bersama.<br>Mia memilih Emma dan Zoe, dan agar mereka bertiga berada di kamar bersama, Alina tidak bisa sekamar dengan mereka, jadi mereka punya kamar kedua bersama.<br>Lara hanya mengecualikan Emma, jadi tidak bisa berada di kamar mereka, dan Lilli mengecualikan Lara, jadi Lara punya ruang untuk dirinya sendiri.</p><p><br></p><p>--------------------------------------------</p><p><br></p><p>Alina picked Lilli, and Lilli did not choose a roommate, but did exclude Lara. So Lilli and Alina have a room together.</p><p>Mia picked Emma and Zoe, and for the three of them to be in a room together, Alina cannot be in a room with them, so they have a second room together.</p><p>Lara only excluded Emma, so cannot be in their room, and Lilli excluded Lara, so Lara has room to herself.</p>'),
(146, 144, 76, 1, '<p>Sebuah toko perhiasan memproduksi gelang.&nbsp;<br><br>Mereka menggunakan ornamen berbentuk braket yang berpasangan. Untuk membuat gelang Anda mulai dengan salah satu dari pasangan berikut:<br><br>Pasangan braket tambahan disisipkan berulang kali di mana saja pada gelang, seperti yang Anda lihat pada tiga contoh di bawah ini:&nbsp;<br><br>&nbsp;Manakah gelang berikut yang dibuat dengan metode yang dijelaskan?</p><p><br></p><p>-------------------------------------------</p><p><br></p><p>A jewellery shop produces bracelets.&nbsp;</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:19467,&quot;height&quot;:173,&quot;href&quot;:&quot;https://comfypace.com/uploads/9lqVXYQZMzFSRMIBERCanxcXinGkgManW7AD8XWg.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/9lqVXYQZMzFSRMIBERCanxcXinGkgManW7AD8XWg.png&quot;,&quot;width&quot;:351}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/9lqVXYQZMzFSRMIBERCanxcXinGkgManW7AD8XWg.png\"><img src=\"https://comfypace.com/uploads/9lqVXYQZMzFSRMIBERCanxcXinGkgManW7AD8XWg.png\" width=\"351\" height=\"173\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">19.01 KB</span></figcaption></a></figure>They use bracket-shaped ornaments that come in pairs. To make a bracelet you start with one of these pairs:</p><p>Additional bracket pairs are inserted repeatedly at any place in the bracelet, as you can see in the three examples below:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:24632,&quot;height&quot;:133,&quot;href&quot;:&quot;https://comfypace.com/uploads/tlRuVGwGR2ExyhT4iTiESuU7pP2k1wuohxYFRFgu.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/tlRuVGwGR2ExyhT4iTiESuU7pP2k1wuohxYFRFgu.png&quot;,&quot;width&quot;:580}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/tlRuVGwGR2ExyhT4iTiESuU7pP2k1wuohxYFRFgu.png\"><img src=\"https://comfypace.com/uploads/tlRuVGwGR2ExyhT4iTiESuU7pP2k1wuohxYFRFgu.png\" width=\"580\" height=\"133\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.05 KB</span></figcaption></a></figure>Which of the following bracelets is made with the method described?</p>', 5, '2023-10-28 04:46:39', '2023-10-28 04:47:51', '<p>Semua gelang lainnya tidak dibuat sesuai dengan metode yang dijelaskan:<br><br>A. sisi Posisi 3 salah: mereka menempatkan kanan ornamen 2 sebelum sisi kanan ornamen 1;<br>B. Posisi 1 salah: Anda memulai dengan ornamen sisi kanan dan bukan sisi kiri, yang tidak benar; C. Posisi 2 salah: terlihat 3 sisi kiri ornamen yang satu dan kemudian 3 sisi kanan ornamen lainnya, sehingga tidak ada pasangan yang digunakan.</p><p><br></p><p>-----------------------------------------------------</p><p><br></p><p>All other bracelets were not made according to the method described:</p><p>A. Position 3 is wrong: they placed the right side of ornament 2 before the right side of ornament 1;<br>B. Position 1 is wrong: you start off with a right side of ornament instead of a left side, which is not correct; C. Position 2 is wrong: you see 3 left sides of one ornament and then 3 right sides of another ornament, so there arent any pairs used.</p>'),
(147, 145, 76, 1, '<p>Bebras Fitness Gym memiliki lapangan voli, lapangan basket, lapangan tenis, dan lapangan sepak bola.<br><br>Anna, Bruno, Chris dan Diana datang ke Bebras Fitness untuk berolahraga.<br><br>Gunakan informasi berikut untuk mencocokkan pemain dengan olahraganya:<br><br>Anna dan Chris tidak menggunakan raket<br>Pemain bola voli, pesepakbola, dan Diana semuanya berlatih di hari yang sama<br>Pesepakbola menonton Chris bermain<br>Bruno dan pesepakbola berlari bersama di pagi hari<br>Diana tinggal bersama pemain tenis itu</p><p><br></p><p>-------------------------------------------</p><p><br></p><p>Bebras Fitness Gym has a volleyball court, a basketball court, a tennis court and a football field.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:27289,&quot;height&quot;:260,&quot;href&quot;:&quot;https://comfypace.com/uploads/Om8aYisxpZiMHKPZyS9uCH6ErLWDB8scloQIDTkD.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Om8aYisxpZiMHKPZyS9uCH6ErLWDB8scloQIDTkD.png&quot;,&quot;width&quot;:308}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Om8aYisxpZiMHKPZyS9uCH6ErLWDB8scloQIDTkD.png\"><img src=\"https://comfypace.com/uploads/Om8aYisxpZiMHKPZyS9uCH6ErLWDB8scloQIDTkD.png\" width=\"308\" height=\"260\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">26.65 KB</span></figcaption></a></figure>Anna, Bruno, Chris and Diana come to Bebras Fitness to play sports.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:52124,&quot;height&quot;:217,&quot;href&quot;:&quot;https://comfypace.com/uploads/OpFy3QvigX7ySAq38bxcMw3xMmxdFTZdfzKAikje.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/OpFy3QvigX7ySAq38bxcMw3xMmxdFTZdfzKAikje.png&quot;,&quot;width&quot;:616}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/OpFy3QvigX7ySAq38bxcMw3xMmxdFTZdfzKAikje.png\"><img src=\"https://comfypace.com/uploads/OpFy3QvigX7ySAq38bxcMw3xMmxdFTZdfzKAikje.png\" width=\"616\" height=\"217\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">50.9 KB</span></figcaption></a></figure>Use the following information to match the player to the sport:</p><ul><li>Anna and Chris dont use rackets</li><li>The volleyballer, footballer and Diana all have their training on the same day</li><li>The footballer watches Chris play</li><li>Bruno and the footballer run together in the morning</li><li>Diana lives with the tennis player</li></ul>', 5, '2023-10-28 04:53:42', '2023-10-28 04:53:42', '<p>Menyelesaikan tabel pemeriksaan seiring berjalannya waktu membantu Anda memecahkan masalah. Dari sini, Anda dapat menugaskan Bola Basket ke Diana, dan kemudian Bola Voli ke Chris. Kemudian melalui proses eliminasi, kekosongan tersebut diisi.</p><p><br></p><p>--------------------------------------------------</p><p><br></p><p>Completing a check table as you go helps you solve the problem. From this, you can assign Basketball to Diana, and then Volleyball to Chris. Then through a process of elimination, the gaps are filled.</p>'),
(148, 146, 77, 1, '<p>Bola bernomor menggelinding ke bawah.<br>Urutan bola berubah saat jatuh ke dalam lubang. Ketika sebuah bola memasuki sebuah lubang, jika ada ruang yang cukup, bola tersebut jatuh ke dalam, jika tidak, bola akan menggelinding melewati lubang tersebut. Sebuah pin di bagian bawah setiap lubang dapat ditarik untuk mengeluarkan bola.<br><br>Contoh:</p><p>Sepuluh bola menggelinding menuruni jalan yang ditunjukkan di bawah ini. Tiga lubang A, B dan C memiliki ruang untuk 3, 2 dan 1 bola seperti yang ditunjukkan.</p><p>Pin ditarik dengan urutan A, B, C, tetapi setiap kali hanya setelah semua bola berhenti menggelinding. Apa hasil akhirnya?</p><p>----------------------------------------</p><p><br></p><p>Numbered balls roll down ramps.<br>The order of the balls changes as they fall into holes. When a ball comes to a hole, if there is enough space, the ball falls in, otherwise, the ball rolls past the hole. A pin at the bottom of each hole can be pulled which ejects the balls.</p><p>Example:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:36255,&quot;height&quot;:232,&quot;href&quot;:&quot;https://comfypace.com/uploads/uTNra9gHgfKzFautxMXqN9rapxC8CFZ3LVvz1qzf.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/uTNra9gHgfKzFautxMXqN9rapxC8CFZ3LVvz1qzf.png&quot;,&quot;width&quot;:760}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/uTNra9gHgfKzFautxMXqN9rapxC8CFZ3LVvz1qzf.png\"><img src=\"https://comfypace.com/uploads/uTNra9gHgfKzFautxMXqN9rapxC8CFZ3LVvz1qzf.png\" width=\"760\" height=\"232\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">35.41 KB</span></figcaption></a></figure>Ten balls roll down the ramp shown below. Three holes A, B and C have space for<br>3, 2 and 1 balls as shown.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25190,&quot;height&quot;:301,&quot;href&quot;:&quot;https://comfypace.com/uploads/XD5PziiMkj85D0eip4qjNfaN7bmsjiwPmWSfyr45.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/XD5PziiMkj85D0eip4qjNfaN7bmsjiwPmWSfyr45.png&quot;,&quot;width&quot;:390}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/XD5PziiMkj85D0eip4qjNfaN7bmsjiwPmWSfyr45.png\"><img src=\"https://comfypace.com/uploads/XD5PziiMkj85D0eip4qjNfaN7bmsjiwPmWSfyr45.png\" width=\"390\" height=\"301\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">24.6 KB</span></figcaption></a></figure><br>The pins are pulled in the order A, B, C, but each time only after all the balls have stopped rolling. What is the final result?</p>', 100, '2023-10-28 05:07:43', '2023-10-28 05:07:43', '<p>Lubang A mempunyai ruang untuk tiga bola, jadi bola 4 sampai 10 menggelinding melewatinya secara berurutan. Lubang B mempunyai ruang untuk dua bola, jadi bola 6 sampai 10 menggelinding melewatinya secara berurutan. Lubang C mempunyai ruang untuk satu bola, jadi bola 7 sampai 10 menggelinding melewatinya secara berurutan. Kemudian pin di Lubang A ditarik dan bola dikeluarkan dengan urutan 3,2,1 dan menggelinding ke bawah. Pada titik ini, bola berada di bawah dengan urutan 7,8,9,10,3,2,1.<br>Kemudian pin di Lubang B ditarik dan bola dikeluarkan dengan urutan 5,4. Pada titik ini, bola berada di bawah dengan urutan 7,8,9,10,3,2,1,5,4.<br>Terakhir, pin ditarik ke dalam Lubang C dan bola 6 menggelinding ke bawah memberikan jawaban yang benar.</p><p><br></p><p>-----------------------------------------------</p><p><br></p><p>Hole A has space for three balls, so balls 4 to 10 roll past it in order. Hole B has space for two balls, so balls 6 to 10 roll past it in order. Hole C has space for one ball, so balls 7 to 10 roll past it in order. Then the pin in Hole A is pulled and balls are ejected in the order 3,2,1 and roll to the bottom. At this point, the balls are at the bottom in the order 7,8,9,10,3,2,1.</p><p>Then the pin in Hole B is pulled and balls are ejected in the order 5,4. At this point, the balls are at the bottom in the order 7,8,9,10,3,2,1,5,4.</p><p>Finally, the pin is pulled in Hole C and ball 6 rolls to the bottom giving the correct answer.</p>'),
(149, 147, 77, 1, '<p>Berang-berang senang bermain lempar, permainan populer yang mirip dengan hoki.<br><br>Setelah permainan berakhir, berang-berang di masing-masing kedua tim berbaris dan berjalan melewati tim lainnya. Saat mereka berpapasan, mereka berjabat tangan. Pada awalnya, hanya pemain pertama di setiap tim yang berjabat tangan. Selanjutnya dua pemain pertama berjabat tangan (lihat gambar di bawah).<br>Hal ini berlanjut hingga setiap pemain berjabat tangan dengan setiap pemain di tim lainnya.<br><br>Ada 15 pemain di setiap tim.<br>Jika setiap pemain membutuhkan waktu satu detik untuk berjabat tangan dan berpindah ke pemain berikutnya, berapa detik yang akan terjadi untuk berjabat tangan?</p><p><br></p><p>--------------------------------------------</p><p><br></p><p>Beavers enjoy playing hurling, a popular game similar to hockey.</p><p>After the game ends, the beavers in each of the two teams line up in a row and walk past the other team. As they pass each other, they shake hands. At the beginning, only the first player on each team shakes hands. Next, the first two players shake hands (see picture below).<br>This continues until each player has shaken hands with every player on the other team.</p><p>There are 15 players on each team.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:32051,&quot;height&quot;:132,&quot;href&quot;:&quot;https://comfypace.com/uploads/VXJRV9FM5bcVCZUtEM19ZK1k2RA4bkz7zFCpXKAL.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/VXJRV9FM5bcVCZUtEM19ZK1k2RA4bkz7zFCpXKAL.png&quot;,&quot;width&quot;:723}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/VXJRV9FM5bcVCZUtEM19ZK1k2RA4bkz7zFCpXKAL.png\"><img src=\"https://comfypace.com/uploads/VXJRV9FM5bcVCZUtEM19ZK1k2RA4bkz7zFCpXKAL.png\" width=\"723\" height=\"132\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">31.3 KB</span></figcaption></a></figure>If each player takes one second to shake hands and move to the next player, how many seconds of shaking hands will there be?</p>', 5, '2023-10-28 05:09:48', '2023-10-28 05:09:48', '<p>Besarnya jabat tangan sama persis dengan panjang satu garis ditambah panjang garis lainnya, dikurangi satu.<br>Jika setiap tim hanya memiliki satu pemain, mereka akan selesai setelah 1 detik. Jika masing-masing tim mempunyai dua pemain, pasangan pertama akan berjabat tangan (1 detik), lalu melangkah maju (detik ke-2), lalu berjabat tangan dengan pemain yang tersisa (detik ke-3). Ini sesuai dengan rumus kami tentang jumlah pemain dikurangi 1: 4 -1 =3.</p><p><br></p><p>------------------------------</p><p><br></p><p>The amount of handshaking is exactly the length of one line plus the length of the other line, minus one.</p><p>If each team only had one player, they would be complete after 1 second. If each team had two players, the first pair would shake hands (1 second), then step forward (2nd second), then shake the remaining players hand (3rd second). This fits our formula of the number of players subtract 1: 4 -1 =3.</p>'),
(150, 148, 78, 1, '<p>Betaro Beaver telah menemukan lima ramuan ajaib baru: ramuan membuat telinga lebih panjang, ramuan lain membuat gigi lebih panjang, ramuan lain membuat kumis keriting, dan ramuan lain memutihkan hidung. Yang terakhir membuat mata menjadi putih.<br><br>Betaro memasukkan setiap ramuan ajaib ke dalam gelas terpisah. Dia meletakkan<br>air murni ke dalam gelas kimia yang lain, sehingga totalnya ada enam gelas kimia. Gelas kimia tersebut diberi label A sampai F. Masalahnya, dia lupa mencatat gelas mana yang berisi ramuan ajaib apa!<br><br>Untuk mengetahui ramuan apa yang ada di setiap gelas kimia, Betaro melakukan percobaan berikut: Percobaan 1: Seekor berang-berang minum dari gelas kimia A, B dan C bersama-sama.<br>Eksperimen 2: Seekor berang-berang minum dari gelas kimia A, D, dan E secara bersamaan<br>Eksperimen 3: Seekor berang-berang minum dari gelas kimia C, D, dan F secara bersamaan</p><p>Gelas kimia manakah yang berisi air murni?</p><p><br></p><p>--------------------------------------</p><p><br></p><p>Betaro Beaver has discovered five new magic potions: one makes ears longer, another makes teeth longer, another makes whiskers curly, another turns the nose white. The last one turns eyes white.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:18946,&quot;height&quot;:131,&quot;href&quot;:&quot;https://comfypace.com/uploads/4l9vLfw2roq5R4sGRCqMefq2ioI6KOf4RRynqZOJ.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/4l9vLfw2roq5R4sGRCqMefq2ioI6KOf4RRynqZOJ.png&quot;,&quot;width&quot;:439}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/4l9vLfw2roq5R4sGRCqMefq2ioI6KOf4RRynqZOJ.png\"><img src=\"https://comfypace.com/uploads/4l9vLfw2roq5R4sGRCqMefq2ioI6KOf4RRynqZOJ.png\" width=\"439\" height=\"131\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">18.5 KB</span></figcaption></a></figure></p><p>Betaro put each magic potion into a separate beaker. He put<br>pure water into another beaker, so there are six beakers in total. The beakers are labelled A to F. The problem is, he forgot to record which beaker contains which magic potion!</p><p>To find out which potion is in each beaker, Betaro set up the following experiments: Experiment 1: A beaver drinks from beakers A, B and C together<br>Experiment 2: A beaver drinks from beakers A, D and E together<br>Experiment 3: A beaver drinks from beakers C, D and F together</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:42914,&quot;height&quot;:234,&quot;href&quot;:&quot;https://comfypace.com/uploads/atIDqed6vLB8f9YKtAbkegiia0UoMYiklKi6ivOS.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/atIDqed6vLB8f9YKtAbkegiia0UoMYiklKi6ivOS.png&quot;,&quot;width&quot;:605}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/atIDqed6vLB8f9YKtAbkegiia0UoMYiklKi6ivOS.png\"><img src=\"https://comfypace.com/uploads/atIDqed6vLB8f9YKtAbkegiia0UoMYiklKi6ivOS.png\" width=\"605\" height=\"234\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">41.91 KB</span></figcaption></a></figure>Which beaker contains pure water?</p>', 5, '2023-10-28 05:18:39', '2023-10-28 05:18:39', '<p>Eksperimen 1 memiliki tiga efek, Eksperimen 2 dan 3 keduanya memiliki dua efek. Oleh karena itu, tidak ada air murni pada Percobaan 1 dan hanya terdapat satu gelas air pada Percobaan 2<br>dan Percobaan 3. Satu-satunya gelas kimia yang umum antara percobaan 2 dan 3 adalah gelas kimia D. Jadi, D adalah air murni.</p><p><br></p><p>--------------------------</p><p><br></p><p>Experiment 1 has three effects, Experiment 2 and 3 both have two effects. Therefore, there is no pure water in Experiment 1 and there is exactly one water beaker in Experiment 2<br>and Experiment 3. The only common beaker between experiments 2 and 3 is beaker D. Thus, D is pure water.</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(151, 149, 78, 1, '<p>Beaver Bert memiliki selembar kertas berwarna panjang untuk pesta. Strip ini memiliki tiga warna berbeda (kuning, merah, biru) dengan pola yang berulang secara teratur.<br>Teman Bert, James, telah memotong sebagian kertas, seperti yang ditunjukkan pada diagram di bawah.<br><br>James mengatakan bahwa dia akan mengembalikan potongan kertas yang hilang tersebut jika Bert dapat menebak dengan benar ukuran potongan kertas tersebut.<br><br>Berapa banyak kotak berwarna yang terdapat pada selembar kertas yang hilang?</p><p><br></p><p>------------------------------------------</p><p><br></p><p>Beaver Bert has a long strip of coloured paper for a party. The strip has three different colours (yellow, red, blue) in a regularly repeating pattern.<br>Berts friend, James, has cut out a section of the paper, as shown in the diagram below.</p><p>James says that he will give back the missing piece of paper if Bert can correctly guess the size of the piece cut out.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:16615,&quot;height&quot;:106,&quot;href&quot;:&quot;https://comfypace.com/uploads/IPGtBUjPuQQWTJSq8UQTPJEPlq8RxCPfuOj7kcc7.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/IPGtBUjPuQQWTJSq8UQTPJEPlq8RxCPfuOj7kcc7.png&quot;,&quot;width&quot;:753}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/IPGtBUjPuQQWTJSq8UQTPJEPlq8RxCPfuOj7kcc7.png\"><img src=\"https://comfypace.com/uploads/IPGtBUjPuQQWTJSq8UQTPJEPlq8RxCPfuOj7kcc7.png\" width=\"753\" height=\"106\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">16.23 KB</span></figcaption></a></figure>How many coloured squares does the missing piece of paper have?</p>', 5, '2023-10-28 05:21:10', '2023-10-28 05:21:10', '<p>Kita tahu polanya diakhiri dengan YRR, artinya James telah memotong setidaknya satu B. Setelah itu, dia memotong sejumlah rangkaian 4 (yaitu YRRB). Setelah itu, di sisi kanan kertasnya harus ada YR, karena kertas kedua diawali dengan RB. Jadi, panjang kertasnya adalah<br>1 (untuk B) + 4*X (di mana X adalah jumlah pola berulang YRRB) + 2 (untuk YR). Jadi, panjang kertasnya adalah 4X+3.<br><br>Melihat kemungkinan jawabannya, kita melihat bahwa 31/4 mempunyai sisa 3: yaitu, 31 = 4*7 + 3. Jadi, persamaan kita terselesaikan jika X=7. Tidak ada jawaban lain yang dapat ditulis sebagai 4X+3.</p><p><br></p><p>-----------------------------------------------</p><p><br></p><p>We know the pattern ended with YRR, meaning that the James has cut out at least one B. After that, he cuts out some number of sequences of 4 (i.e., YRRB). After that, the right side of his piece of paper must have YR, since the second piece begins with RB. So, the length of his piece of paper is<br>1 (for B) + 4*X (where X is the number of repeated patterns YRRB) + 2 (for the YR). So, the length of her paper is 4X+3.</p><p>Looking at the possible answers, we see that 31/4 has remainder 3: that is, 31 = 4*7 + 3. So, our equation is solved when X=7. None of the other answers can be written as 4X+3.</p>'),
(152, 150, 79, 1, '<p>Dokter Hamid ingin membangun tiga rumah sakit untuk berang-berang.<br>Rumah sakit hanya dapat dibangun di tempat yang ditunjukkan oleh surat pada peta di bawah. Untuk sampai ke rumah sakit, berang-berang tidak harus berenang melalui lebih dari satu aliran sungai dari salah satu tempat tersebut.<br><br>Pilih tiga tempat terbaik untuk membangun rumah sakit</p><p><br></p><p>---------------------------------------------</p><p><br></p><p>Doctor Hamid wants to build three hospitals for the beavers.<br>The hospitals can only be built on the places shown by a letter on the map below. To get to a hospital, the beavers should not have to swim through more than one stream from any of these places.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:25956,&quot;height&quot;:226,&quot;href&quot;:&quot;https://comfypace.com/uploads/swu8duXdAiHfsBh5A8SmCCvi4QppXZqouUB2DpAz.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/swu8duXdAiHfsBh5A8SmCCvi4QppXZqouUB2DpAz.png&quot;,&quot;width&quot;:304}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/swu8duXdAiHfsBh5A8SmCCvi4QppXZqouUB2DpAz.png\"><img src=\"https://comfypace.com/uploads/swu8duXdAiHfsBh5A8SmCCvi4QppXZqouUB2DpAz.png\" width=\"304\" height=\"226\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">25.35 KB</span></figcaption></a></figure>Choose the best three places to build the hospitals</p>', 5, '2023-10-28 05:27:19', '2023-10-28 05:27:19', '<p>Ada beberapa penyelesaian yang benar antara lain E H K, A E H, C G I, C H I, C I K,<br>D F K, B I K dan C E H.<br><br>Salah satu dari opsi ini memenuhi persyaratan dokter.</p><p><br></p><p>----------------------------------------------------------</p><p><br></p><p>There are several correct solutions including E H K, A E H, C G I, C H I, C I K,<br>D F K, B I K and C E H.</p><p>Any of these options meet the doctors requirements.</p>'),
(153, 151, 79, 1, '<p>Di sebuah gudang, tiga robot selalu bekerja sebagai satu tim.<br><br>Ketika tim mendapat instruksi arah<br>(N, S, E, W), semua robot dalam grid akan bergerak satu kotak ke arah tersebut secara bersamaan.<br><br>Setelah mengikuti daftar instruksi, semua robot mengambil objek yang ditemukan di kotak terakhirnya.<br><br>Misalnya kita memberikan daftar N, N, S, S, E kepada tim, maka robot A akan mengambil kerucut, robot B akan mengambil cincin, dan robot C akan mengambil kerucut.</p><p>Daftar instruksi manakah yang dapat dikirimkan ke robot sehingga tim dapat mengambil bola, kerucut, dan cincin dengan tepat?</p><p><br></p><p>---------------------------------------------</p><p><br></p><p>In a warehouse, three robots always work as a team.</p><p>When the team gets a direction instruction<br>(N, S, E, W), all robots in the grid will move one square in that direction at the same time.</p><p>After following a list of instructions, the robots all pick up the object found in their final square.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:38372,&quot;height&quot;:525,&quot;href&quot;:&quot;https://comfypace.com/uploads/mUUGFNml2NsV1G50rWgo5Xr3nT6CU5GWm4jLPPsm.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/mUUGFNml2NsV1G50rWgo5Xr3nT6CU5GWm4jLPPsm.png&quot;,&quot;width&quot;:482}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/mUUGFNml2NsV1G50rWgo5Xr3nT6CU5GWm4jLPPsm.png\"><img src=\"https://comfypace.com/uploads/mUUGFNml2NsV1G50rWgo5Xr3nT6CU5GWm4jLPPsm.png\" width=\"482\" height=\"525\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">37.47 KB</span></figcaption></a></figure>For example, if we give the list N, N, S, S, E to the team, then robot A will pick up a cone, robot B will pick up a ring, and robot C will pick up a cone.</p><p>Which list of instructions can be sent to the robots so that the team picks up exactly a sphere, a cone, and a ring?</p>', 5, '2023-10-28 05:30:54', '2023-10-28 05:30:54', '<p>Opsi A salah karena tidak ada bola yang diambil. Opsi C salah karena tidak ada dering yang diangkat. Opsi D salah karena tidak ada bola yang diambil.</p><p><br></p><p>-----------------------------------------</p><p><br></p><p>Option A is incorrect because no sphere is picked up. Option C is incorrect because no ring is picked up. Option D is incorrect because no sphere is picked up.</p>'),
(154, 152, 80, 1, '<p>Tiga berang-berang yang sangat cepat akan bertanding dalam lari lintas alam.<br><br>Pak Brown akan menyusul seekor berang-berang saat berlari menanjak. Nyonya Pink akan menyusul seekor berang-berang saat berlari menuruni bukit. Nyonya Green akan menyusul seekor berang-berang saat berlari melintasi bebatuan.<br><br>Medannya terlihat pada gambar: menanjak, disusul beberapa bebatuan, menurun dan beberapa bebatuan lagi.<br><br>Ny. Pink dimulai di posisi pertama, disusul Mr. Brown dan Mrs. Green.<br><br>Dalam urutan apa mereka akan menyelesaikan perlombaan?</p><p><br></p><p>-------------------------------------------</p><p><br></p><p>Three very fast beavers will compete in a cross-country run.</p><p>Mr. Brown will overtake one beaver when running uphill. Mrs. Pink will overtake one beaver when running downhill. Mrs. Green will overtake one beaver when running across rocks.</p><p>The terrain is shown in the picture: uphill, followed by some rocks, downhill and then some more rocks.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:30653,&quot;height&quot;:209,&quot;href&quot;:&quot;https://comfypace.com/uploads/MCWTfaKJexpc2O0fzcLFrhaEXCK80Hnn9L48nnij.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/MCWTfaKJexpc2O0fzcLFrhaEXCK80Hnn9L48nnij.png&quot;,&quot;width&quot;:742}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/MCWTfaKJexpc2O0fzcLFrhaEXCK80Hnn9L48nnij.png\"><img src=\"https://comfypace.com/uploads/MCWTfaKJexpc2O0fzcLFrhaEXCK80Hnn9L48nnij.png\" width=\"742\" height=\"209\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">29.93 KB</span></figcaption></a></figure>Mrs. Pink starts in the first position, followed by Mr. Brown and Mrs. Green.</p><p>In what order will they finish the race?</p>', 5, '2023-10-28 05:39:39', '2023-10-28 05:39:39', '<p>Bu Pink start duluan tapi kemudian disusul Pak Brown ke atas bukit sehingga urutannya sekarang Coklat, Pink, Hijau.<br>Nyonya Green menyusul Nyonya Pink melintasi bebatuan sehingga urutannya sekarang menjadi Coklat, Hijau, Merah Muda.<br>Bu Pink menyusul Bu Hijau yang berlari menuruni bukit, jadi urutannya sekarang Coklat, Pink, Hijau.<br>Akhirnya Ny. Green menyusul Ny. Pink melintasi bebatuan sehingga urutannya sekarang menjadi Coklat, Hijau, Pink.</p><p><br></p><p>---------------------------------------------</p><p><br></p><p>Mrs. Pink starts first but is then overtaken by Mr. Brown up the hill so the order is now Brown, Pink, Green.</p><p>Mrs. Green overtakes Mrs. Pink across the rocks so the order is now Brown, Green, Pink.</p><p>Mrs. Pink overtakes Mrs. Green running down hill, so the order is now Brown, Pink, Green.</p><p>Finally, Mrs. Green overtakes Mrs. Pink across the rocks so the order is now Brown, Green, Pink.</p>'),
(155, 153, 80, 1, '<p>Beaver Alex dan Beaver Betty saling mengirim pesan menggunakan urutan transformasi berikut pada setiap kata.<br><br>Misalnya, kata BEAVER diubah menjadi WBFCSF.<br><br>Beaver Betty menerima pesan berkode PMGEP dari Beaver Alex.<br><br>Apa yang ingin dikatakan Berang-berang Alex? RIVERI, KNOCK, FLOOD atau FLODGE</p><p><br></p><p>-----------------------------------------------</p><p><br></p><p>Beaver Alex and Beaver Betty send each other messages using the following sequence of transformations on every word.</p><p>For example, the word BEAVER is transformed to WBFCSF.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:29613,&quot;height&quot;:150,&quot;href&quot;:&quot;https://comfypace.com/uploads/4ZGu19OhgJXtJCqj9DSuJolhhk5wiPQZqPNCBm0O.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/4ZGu19OhgJXtJCqj9DSuJolhhk5wiPQZqPNCBm0O.png&quot;,&quot;width&quot;:726}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/4ZGu19OhgJXtJCqj9DSuJolhhk5wiPQZqPNCBm0O.png\"><img src=\"https://comfypace.com/uploads/4ZGu19OhgJXtJCqj9DSuJolhhk5wiPQZqPNCBm0O.png\" width=\"726\" height=\"150\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">28.92 KB</span></figcaption></a></figure>Beaver Betty receives the encoded message PMGEP from Beaver Alex.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8588,&quot;height&quot;:58,&quot;href&quot;:&quot;https://comfypace.com/uploads/OsjX7AqlVIE2dJBG1bSvFGYl57czG3sAUrQneE1u.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/OsjX7AqlVIE2dJBG1bSvFGYl57czG3sAUrQneE1u.png&quot;,&quot;width&quot;:121}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/OsjX7AqlVIE2dJBG1bSvFGYl57czG3sAUrQneE1u.png\"><img src=\"https://comfypace.com/uploads/OsjX7AqlVIE2dJBG1bSvFGYl57czG3sAUrQneE1u.png\" width=\"121\" height=\"58\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.39 KB</span></figcaption></a></figure>What did Beaver Alex want to say? RIVER, KNOCK, FLOOD or LODGE</p>', 5, '2023-10-28 05:46:26', '2023-10-28 05:46:26', '<p>Langkah-langkah transformasi yang diterapkan di<br><br>urutan terbalik, adalah:<br><br>PMGEP &gt; OLFDO &gt; DOOLF &gt; FLOOD\"<br><br>Yaitu:<br><br>Ganti setiap huruf dengan huruf sebelumnya dalam alfabet;<br><br>Geser huruf sebanyak 2 ke kanan;<br><br>Kata terbalik.</p><p><br></p><p>----------------------------------------</p><p><br></p><p>The steps of the transformation, applied in the</p><p>reverse order, are:&nbsp;</p><p>PMGEP &gt; OLFDO &gt; DOOLF &gt; FLOOD\"</p><p>That is:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8319,&quot;height&quot;:44,&quot;href&quot;:&quot;https://comfypace.com/uploads/Gx2D5ediVX0ioXjFiD69770aXTYDWSDW9KVuLJk3.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Gx2D5ediVX0ioXjFiD69770aXTYDWSDW9KVuLJk3.png&quot;,&quot;width&quot;:97}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Gx2D5ediVX0ioXjFiD69770aXTYDWSDW9KVuLJk3.png\"><img src=\"https://comfypace.com/uploads/Gx2D5ediVX0ioXjFiD69770aXTYDWSDW9KVuLJk3.png\" width=\"97\" height=\"44\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.12 KB</span></figcaption></a></figure>Replace each letter with the previous in the alphabet;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8429,&quot;height&quot;:47,&quot;href&quot;:&quot;https://comfypace.com/uploads/Trj4wWEdZFATHNpZSdJevQpi0r7iRrAFWOjmfzEt.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Trj4wWEdZFATHNpZSdJevQpi0r7iRrAFWOjmfzEt.png&quot;,&quot;width&quot;:103}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Trj4wWEdZFATHNpZSdJevQpi0r7iRrAFWOjmfzEt.png\"><img src=\"https://comfypace.com/uploads/Trj4wWEdZFATHNpZSdJevQpi0r7iRrAFWOjmfzEt.png\" width=\"103\" height=\"47\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.23 KB</span></figcaption></a></figure>Shift letters by 2 to the right;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8381,&quot;height&quot;:45,&quot;href&quot;:&quot;https://comfypace.com/uploads/FeATujUzPHGfIuNssG7MPfIOq41nd0zjwUJrp3Qx.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/FeATujUzPHGfIuNssG7MPfIOq41nd0zjwUJrp3Qx.png&quot;,&quot;width&quot;:95}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/FeATujUzPHGfIuNssG7MPfIOq41nd0zjwUJrp3Qx.png\"><img src=\"https://comfypace.com/uploads/FeATujUzPHGfIuNssG7MPfIOq41nd0zjwUJrp3Qx.png\" width=\"95\" height=\"45\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.18 KB</span></figcaption></a></figure>Reverse word.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8349,&quot;height&quot;:44,&quot;href&quot;:&quot;https://comfypace.com/uploads/C8x3zHa6y2DoQaM80WrDcBNoS15qcnMLKFpHgJ4L.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/C8x3zHa6y2DoQaM80WrDcBNoS15qcnMLKFpHgJ4L.png&quot;,&quot;width&quot;:95}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/C8x3zHa6y2DoQaM80WrDcBNoS15qcnMLKFpHgJ4L.png\"><img src=\"https://comfypace.com/uploads/C8x3zHa6y2DoQaM80WrDcBNoS15qcnMLKFpHgJ4L.png\" width=\"95\" height=\"44\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.15 KB</span></figcaption></a></figure></p>'),
(156, 154, 81, 1, '<p>Sepulang sekolah, berang-berang muda sering bermain bersama.<br>Untuk menghindari pertengkaran tentang tempat bermain, mereka melempar dadu biasa bersisi enam. Keputusan diambil menurut aturan ini:<br><br>Urutan lemparan manakah yang akan mengirim berang-berang muda ke lapangan olahraga?</p><p><br></p><p>------------------------------------</p><p><br></p><p>After school the young beavers often play together.<br>To avoid quarrels about where to play, they throw a normal six-sided die. The decision is found according to this rule:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:52374,&quot;height&quot;:398,&quot;href&quot;:&quot;https://comfypace.com/uploads/qXwgCWjS4yLKF8NDj2LcBOfhZw3ltewxN6jES5cs.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/qXwgCWjS4yLKF8NDj2LcBOfhZw3ltewxN6jES5cs.png&quot;,&quot;width&quot;:730}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/qXwgCWjS4yLKF8NDj2LcBOfhZw3ltewxN6jES5cs.png\"><img src=\"https://comfypace.com/uploads/qXwgCWjS4yLKF8NDj2LcBOfhZw3ltewxN6jES5cs.png\" width=\"730\" height=\"398\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">51.15 KB</span></figcaption></a></figure>Which sequence of throws will send the young beavers to the sports field?</p>', 5, '2023-10-28 05:51:19', '2023-10-28 05:51:19', '<p>Lemparan pertama sebesar 3 tidak lebih besar dari lemparan kedua sebesar 3, sehingga cabang ELSE-IF yang memutuskan. Lemparan ketiga dari 3 kali tidak lebih besar dari 3 kali lemparan pertama sehingga peraturan mengirimkan berang-berang muda ke lapangan olah raga.</p><p><br></p><p>-----------------------------------------</p><p><br></p><p>The first throw of 3 is not greater than the second throw of 3, so the ELSE-IF branch decides. The third throw of 3 is not greater than the first 3 thrown so the rule sends the young beavers to the sporting field.</p>'),
(157, 155, 81, 1, '<p>Stella si berang-berang suka menggambar bintang. Dia telah merancang sistem untuk<br><br>memberi label bintang-bintangnya menurut bentuknya. Dia menggunakan dua angka:<br><br>Sejumlah titik pada bintang.<br>Bilangan yang menunjukkan apakah suatu garis ditarik dari suatu titik ke titik terdekat (bilangannya 1), titik terdekat kedua (bilangannya 2), dst.<br>Berikut empat contoh sistem pelabelan Stella:<br><br>Bagaimana Stella memberi label pada bintang berikut?</p><p><br></p><p>-----------------------------------------------------</p><p><br></p><p>Stella the beaver loves to draw stars. She has devised a system for</p><p>labeling her stars according to their shape. She uses two numbers:</p><ul><li>A number of points on the star.</li><li>A number indicating if a line from a point is drawn to the nearest point (the number is 1), the second closest point (the number is 2), etc.</li></ul><p>Here are four examples of Stellas labelling system:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:22325,&quot;height&quot;:127,&quot;href&quot;:&quot;https://comfypace.com/uploads/2b1xj1ezYXnE54J0mVII8KiQPj5Veu6hZob3rKKJ.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/2b1xj1ezYXnE54J0mVII8KiQPj5Veu6hZob3rKKJ.png&quot;,&quot;width&quot;:387}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/2b1xj1ezYXnE54J0mVII8KiQPj5Veu6hZob3rKKJ.png\"><img src=\"https://comfypace.com/uploads/2b1xj1ezYXnE54J0mVII8KiQPj5Veu6hZob3rKKJ.png\" width=\"387\" height=\"127\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">21.8 KB</span></figcaption></a></figure>How would Stella label the following star?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:17324,&quot;height&quot;:183,&quot;href&quot;:&quot;https://comfypace.com/uploads/lnuvsT5hl4XnBpuXCH0ya8ZsI1zODXQYnHWx3kcl.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/lnuvsT5hl4XnBpuXCH0ya8ZsI1zODXQYnHWx3kcl.png&quot;,&quot;width&quot;:184}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/lnuvsT5hl4XnBpuXCH0ya8ZsI1zODXQYnHWx3kcl.png\"><img src=\"https://comfypace.com/uploads/lnuvsT5hl4XnBpuXCH0ya8ZsI1zODXQYnHWx3kcl.png\" width=\"184\" height=\"183\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">16.92 KB</span></figcaption></a></figure></p>', 5, '2023-10-28 05:56:37', '2023-10-28 05:56:37', '<p>10:4</p><p>Bintang tersebut mempunyai 10 titik sehingga angka pertama harus 10. Titik-titik tersebut masing-masing terhubung ke titik lain yang berjarak 4 titik sehingga angka kedua harus 4.</p><p><br></p><p>-------------------------------------------------</p><p><br></p><p>10:4<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:46584,&quot;height&quot;:420,&quot;href&quot;:&quot;https://comfypace.com/uploads/T6eSBoobWHwJTLWAmK5I5Orl2mvKA1Cjgo8Q3zfe.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/T6eSBoobWHwJTLWAmK5I5Orl2mvKA1Cjgo8Q3zfe.png&quot;,&quot;width&quot;:433}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/T6eSBoobWHwJTLWAmK5I5Orl2mvKA1Cjgo8Q3zfe.png\"><img src=\"https://comfypace.com/uploads/T6eSBoobWHwJTLWAmK5I5Orl2mvKA1Cjgo8Q3zfe.png\" width=\"433\" height=\"420\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">45.49 KB</span></figcaption></a></figure>The star has 10 points so the first number must be 10. The points each connect to another point, 4 points away so the second number must be 4.</p>'),
(158, 156, 82, 1, '<p>Sebuah desa menerima jaringan nirkabel baru yang terdiri dari beberapa menara jaringan. Jaringan akan menawarkan WiFi ke semua penduduk desa.<br><br>Setiap menara jaringan memiliki area jangkauan seperti di bawah ini.<br>Bintang merah melambangkan menara jaringan. Hanya di dua belas kotak teduh yang mengelilingi menara sebuah rumah akan mendapat sinyal WiFi.<br><br>Gambar menunjukkan peta desa yang dibagi menjadi beberapa kotak. Setiap segitiga mewakili sebuah rumah.&nbsp;<br><br>&nbsp;Menara jaringan tidak dapat dibangun di dalam alun-alun, hanya di titik persimpangan alun-alun desa.&nbsp;<br><br>&nbsp;Area cakupannya mungkin tumpang tindih.<br><br>Berapa jumlah minimumnya<br>menara jaringan yang dibutuhkan untuk menyediakan jangkauan ke setiap rumah?</p><p><br></p><p>-------------------------------------------------</p><p><br></p><p>A village is receiving a new wireless network consisting of several network towers. The network will offer WiFi to all the villagers.</p><p>Every network tower has the coverage area shown below.<br>The red star represents the network tower. Only in the twelve shaded squares surrounding the tower will a house get a WiFi signal.</p><p>The picture shows a map of the village divided into squares. Every triangle represents a house.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:11049,&quot;height&quot;:236,&quot;href&quot;:&quot;https://comfypace.com/uploads/0jyfEtAH1W6teN3Cza4WDa2TFqauZ9r5EIXIfBXr.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/0jyfEtAH1W6teN3Cza4WDa2TFqauZ9r5EIXIfBXr.png&quot;,&quot;width&quot;:241}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/0jyfEtAH1W6teN3Cza4WDa2TFqauZ9r5EIXIfBXr.png\"><img src=\"https://comfypace.com/uploads/0jyfEtAH1W6teN3Cza4WDa2TFqauZ9r5EIXIfBXr.png\" width=\"241\" height=\"236\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">10.79 KB</span></figcaption></a></figure>A network tower cannot be built inside a square, only on the cross point of the village squares.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:21859,&quot;height&quot;:408,&quot;href&quot;:&quot;https://comfypace.com/uploads/vuK2r659cRU8VCXGrNEnDzjj2rg6bVWJss26yNRf.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/vuK2r659cRU8VCXGrNEnDzjj2rg6bVWJss26yNRf.png&quot;,&quot;width&quot;:410}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/vuK2r659cRU8VCXGrNEnDzjj2rg6bVWJss26yNRf.png\"><img src=\"https://comfypace.com/uploads/vuK2r659cRU8VCXGrNEnDzjj2rg6bVWJss26yNRf.png\" width=\"410\" height=\"408\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">21.35 KB</span></figcaption></a></figure>The coverage areas may overlap.</p><p>What is the minimum number<br>of network towers required to provide coverage to every house?</p>', 5, '2023-10-28 06:02:37', '2023-10-28 06:09:35', '<p>3 menara jaringan<br><br>Dua menara tidak akan menutupi seluruh area.</p><p><br></p><p>----------------------------------------------------</p><p><br></p><p>3 network towers</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:26261,&quot;height&quot;:240,&quot;href&quot;:&quot;https://comfypace.com/uploads/paP9yAdnBjXLfHHx6S2e9Xjmfq2QPr9zDO1bVTGK.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/paP9yAdnBjXLfHHx6S2e9Xjmfq2QPr9zDO1bVTGK.png&quot;,&quot;width&quot;:505}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/paP9yAdnBjXLfHHx6S2e9Xjmfq2QPr9zDO1bVTGK.png\"><img src=\"https://comfypace.com/uploads/paP9yAdnBjXLfHHx6S2e9Xjmfq2QPr9zDO1bVTGK.png\" width=\"505\" height=\"240\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">25.65 KB</span></figcaption></a></figure>Two towers would not cover the whole area.</p>'),
(159, 157, 82, 1, '<p>Menyelenggarakan Hari Raya adalah pekerjaan yang berat di Kota Bebras. Semua peristiwa harus terjadi dalam urutan tertentu.<br><br>Diagram menunjukkan semua peristiwa yang harus disertakan. Tanda panah menunjukkan bahwa suatu peristiwa harus terjadi sebelum peristiwa lainnya. Misalnya, Jeda Musik hanya dapat dilakukan setelah Drum Ruffle dan Pidato Membosankan selesai.<br><br>Apa hal pertama dan terakhir yang terjadi pada Hari Raya?</p><p><br></p><p>----------------------------------------------------------</p><p><br></p><p>Organising Festive Day is a lot of work in Bebras City. All the events must occur in a specific order.</p><p>The diagram shows all the events that must be included. The arrows indicate that an event has to occur before another event. For example, the Musical Intermission can only happen after both the Drum Ruffle and the Boring Speeches have finished.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:52393,&quot;height&quot;:302,&quot;href&quot;:&quot;https://comfypace.com/uploads/mfKUjNO0VbnrZHzInbZ00TQvhPJL6H5Qa23iuFeE.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/mfKUjNO0VbnrZHzInbZ00TQvhPJL6H5Qa23iuFeE.png&quot;,&quot;width&quot;:753}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/mfKUjNO0VbnrZHzInbZ00TQvhPJL6H5Qa23iuFeE.png\"><img src=\"https://comfypace.com/uploads/mfKUjNO0VbnrZHzInbZ00TQvhPJL6H5Qa23iuFeE.png\" width=\"753\" height=\"302\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">51.17 KB</span></figcaption></a></figure>What are the first and last things to happen at Festive Day?</p>', 5, '2023-10-28 06:09:11', '2023-10-28 06:09:11', '<p>Pertama: Paduan Suara Bernyanyi karena tidak ada anak panah yang mengarah ke sana, tidak ada yang mendahuluinya.<br><br>Terakhir: Terima kasih karena tidak ada anak panah yang keluar, artinya tidak perlu melanjutkan apa pun.</p><p><br></p><p>----------------------------------------------------</p><p><br></p><p>First: Choir Singing as it has no arrows pointing to it, nothing has to come before it.</p><p>Last: Thank you as it has no arrows coming from it, meaning it does not have to proceed anything.</p>'),
(160, 158, 83, 1, '<p>Robot diprogram untuk mengumpulkan<br>permen sebanyak mungkin. Ia melakukan ini sambil berjalan melewati sel. Setiap sel dalam kotak di bawah ini memiliki 0, 1, 2, atau 3 permen.<br><br>Robot dimulai dari kiri bawah dan berakhir di kanan atas. Robot hanya bisa bergerak ke kanan atau ke atas.<br><br>Berapa banyak permen yang akan dikumpulkan robot di kotak ini?</p><p><br></p><p>--------------------------------------</p><p><br></p><p>A robot is programmed to collect<br>as many sweets as possible. It does this while walking through cells. Each cell in the grid below has either 0, 1, 2 or 3 sweets.</p><p>The robot begins in the bottom-left and ends in the top-right. The robot can only move to the right or upwards.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:57341,&quot;height&quot;:445,&quot;href&quot;:&quot;https://comfypace.com/uploads/CaEzA5zkKe1a7uLUOjqsmvUiElLfCABUBOiPygIV.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/CaEzA5zkKe1a7uLUOjqsmvUiElLfCABUBOiPygIV.png&quot;,&quot;width&quot;:444}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/CaEzA5zkKe1a7uLUOjqsmvUiElLfCABUBOiPygIV.png\"><img src=\"https://comfypace.com/uploads/CaEzA5zkKe1a7uLUOjqsmvUiElLfCABUBOiPygIV.png\" width=\"444\" height=\"445\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">56 KB</span></figcaption></a></figure>How many sweets will the robot collect in this grid?</p>', 5, '2023-10-28 06:18:09', '2023-10-28 06:18:09', '<p>Salah satu pendekatan terhadap masalah ini adalah dengan menggunakan metode penghitungan sapuan diagonal. Anda bisa memulai dengan membuat tabel seperti di sebelah kanan yang menunjukkan berapa banyak permen di setiap kotak.<br><br>Telusuri setiap kotak di meja dan hitung jumlah maksimum permen yang dapat dikumpulkan setelah mencapai posisi ini. Caranya dengan menambahkan jumlah permen di kotak yang Anda hitung ke \'Jumlah tertinggi yang dikumpulkan (di kiri atau di bawah kotak)\'.<br><br>Dalam contoh tebal ini Anda dapat melihat bahwa kotak yang dicetak tebal di kanan atas memiliki maksimal 4 dengan menambahkan 1 manis yang sudah ada di kotak ke angka tertinggi yaitu kotak di sebelah kiri dengan 3.<br><br>Lanjutkan proses ini sampai semua kotak telah dihitung.</p><p><br></p><p>------------------------------------------------------</p><p><br></p><p>One approach to this problem is to use a diagonal sweep method of counting. You can start by creating a table like the one to the right that shows how many sweets in each square.</p><p>Move along each square in the table and calculate the maximum number of sweets that could be gathered after reaching this position. You do this by adding the number of sweets in the square you are calculating to the Highest number gathered (either left or below the square).</p><p>In this bold example you can see that the top right bolded square has a maximum of 4 by adding the 1 sweet already in the square to the highest number which is the square to the left with 3.</p><p>Continue doing this process until all squares have been tallied.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:38244,&quot;height&quot;:228,&quot;href&quot;:&quot;https://comfypace.com/uploads/J5uBVSz1bqfwoPxylq7CHHpGOIKxyxwgHPzd8XW2.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/J5uBVSz1bqfwoPxylq7CHHpGOIKxyxwgHPzd8XW2.png&quot;,&quot;width&quot;:743}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/J5uBVSz1bqfwoPxylq7CHHpGOIKxyxwgHPzd8XW2.png\"><img src=\"https://comfypace.com/uploads/J5uBVSz1bqfwoPxylq7CHHpGOIKxyxwgHPzd8XW2.png\" width=\"743\" height=\"228\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">37.35 KB</span></figcaption></a></figure></p>'),
(161, 159, 83, 1, '<p>Para guru di Funtime School suka memasukkan permainan ke dalam pelajaran mereka.<br><br>Pada suatu hari, seorang guru mengajak murid-muridnya bermain sebuah permainan. Pemenangnya harus meninggalkan sekolah sebelum yang lain dibubarkan.<br><br>Aturan mainnya:<br>Sekolah ini memiliki satu koridor dengan lima pintu berturut-turut. Para siswa membentuk antrian dan bergiliran berjalan menyusuri koridor. Ketika mereka sampai di pintu yang terbuka, mereka harus menutupnya dan pindah ke pintu berikutnya. Ketika mereka sampai di pintu yang tertutup, mereka harus membukanya, masuk ke dalam kelas, membiarkan pintu terbuka dan menunggu di sana sampai guru membubarkan mereka.<br><br>Di awal permainan semua pintu ditutup.<br><br>Jika seorang siswa menemukan semua pintu terbuka, setelah menutup masing-masing pintu, mereka dapat pulang untuk minum teh!<br><br><br><br>Jika siswanya diberi nomor 1 sampai 35, siswa manakah yang boleh meninggalkan sekolah terlebih dahulu?</p><p><br></p><p>--------------------------------</p><p><br></p><p>The teachers at Funtime School like to include games in their lessons.</p><p>At the end of one day, one teacher invites his students to play a game. The winner gets to leave school before the others are dismissed.</p><p>Rules of the game:<br>The school has one corridor with five doors in a row. The students form a queue and take turns to walk down the corridor. When they get to an open door, they must close it and move to the next door. When they get to a closed door, they must open it, go into the classroom, leave the door open and wait there until the teacher dismisses them.</p><p>At the start of the game all the doors are closed.</p><p>If a student finds all the doors are open, after shutting each of them, they can head home for their tea!</p><p><br></p><p>If the students are numbered 1 to 35, which student gets to leave school first?</p>', 5, '2023-10-28 06:23:44', '2023-10-28 06:23:44', '<p>Pertanyaan ini dapat diselesaikan dengan Penghitungan Biner, dimana 0 adalah pintu tertutup dan 1 adalah pintu terbuka.<br>Mulai: 00000 Semua pintu tertutup<br>Siswa pertama: 00001 Siswa pertama ditutup; buka dan masuk<br>Siswa ke-2: 00010 Tutup pintu pertama, pintu kedua tertutup, buka dan masuk<br>Hanya pada siswa ke 32 akan terjadi 11111.</p><p><br></p><p>-----------------------------------</p><p><br></p><p>This question can be solved with Binary Counting, where 0 is a closed door and 1 is an open door.</p><p>Start: 00000 All doors closed<br>1st student: 00001 The first is closed; open and enter</p><p>2nd student: 00010 Shut the first door, the second is closed, open and enter</p><p>Only by the 32nd student will 11111 occur.</p>'),
(162, 160, 84, 1, '<p>Taro menemukan lima jenis ramuan ajaib yang efeknya adalah<br>sebagai berikut:</p><ul><li>Ramuan pertama membuat telinga bertambah panjang</li><li>Ramuan lainnya membuat gigi bertambah panjang</li><li>Ramuan lainnya membuat kumis menjadi keriting</li><li>Ramuan lainnya membuat hidung menjadi putih</li><li>Ramuan terakhir membuat mata menjadi putih</li></ul><p>Taro menaruh setiap macam ramuan ajaib tersebut dalam sebuah gelas, dan ada sebuah gelas yang berisi air. Keenam gelas tersebut diberi label A sampai dengan F. Malangnya, ia lupa mencatat gelas mana yang mengandung ramuan ajaib apa.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:14574,&quot;height&quot;:87,&quot;href&quot;:&quot;https://comfypace.com/uploads/VBu870tyKyTA1Qbeo2hR83o3YJcH1ni5TGGClWgu.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/VBu870tyKyTA1Qbeo2hR83o3YJcH1ni5TGGClWgu.png&quot;,&quot;width&quot;:258}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/VBu870tyKyTA1Qbeo2hR83o3YJcH1ni5TGGClWgu.png\"><img src=\"https://comfypace.com/uploads/VBu870tyKyTA1Qbeo2hR83o3YJcH1ni5TGGClWgu.png\" width=\"258\" height=\"87\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.23 KB</span></figcaption></a></figure>Maka, ia mengadakan percobaan sebagai berikut untuk mengidentifikasi jenis<br>ramuan ajaib pada setiap gelas.</p><ul><li>Percobaan 1: jika ia mengambil ramuan pada gelas A,B dan C, maka efeknya adalah pada Gambar 1</li><li>Percobaan 2: jika ia mengambil ramuan pada gelas A,D dan E, maka efeknya adalah pada Gambar 2</li></ul><p>Percobaan 3: jika ia mengambil ramuan pada gelas C, D dan F, maka efeknya adalah pada Gambar 3<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:58554,&quot;height&quot;:171,&quot;href&quot;:&quot;https://comfypace.com/uploads/72NbuPWlP7DC9ET1oVcORcca2HPs1MQrDwXPUAv7.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/72NbuPWlP7DC9ET1oVcORcca2HPs1MQrDwXPUAv7.png&quot;,&quot;width&quot;:421}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/72NbuPWlP7DC9ET1oVcORcca2HPs1MQrDwXPUAv7.png\"><img src=\"https://comfypace.com/uploads/72NbuPWlP7DC9ET1oVcORcca2HPs1MQrDwXPUAv7.png\" width=\"421\" height=\"171\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">57.18 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong></p><p>Gelas mana yang berisi air?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Taro conducted experiments to identify the types of magical potions in each glass. The effects of the potions were as follows:</p><ol><li>The first potion makes ears longer.</li><li>The second potion makes teeth longer.</li><li>The third potion makes mustache curly.</li><li>The fourth potion makes the nose white.</li><li>The fifth potion makes the eyes white.</li></ol><p>He placed each type of magical potion in a glass labeled from A to F. Unfortunately, he forgot to record which glass contained which magical potion.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:14574,&quot;height&quot;:87,&quot;href&quot;:&quot;https://comfypace.com/uploads/VBu870tyKyTA1Qbeo2hR83o3YJcH1ni5TGGClWgu.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/VBu870tyKyTA1Qbeo2hR83o3YJcH1ni5TGGClWgu.png&quot;,&quot;width&quot;:258}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/VBu870tyKyTA1Qbeo2hR83o3YJcH1ni5TGGClWgu.png\"><img src=\"https://comfypace.com/uploads/VBu870tyKyTA1Qbeo2hR83o3YJcH1ni5TGGClWgu.png\" width=\"258\" height=\"87\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">14.23 KB</span></figcaption></a></figure>The experiments he conducted were as follows:</p><p>Experiment 1: When he took potions from glasses A, B, and C, the effect was as shown in Figure 1.<br>Experiment 2: When he took potions from glasses A, D, and E, the effect was as shown in Figure 2.<br>Experiment 3: When he took a potion from glasses C, D, and F, the effect was as shown in Figure 3. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:58554,&quot;height&quot;:171,&quot;href&quot;:&quot;https://comfypace.com/uploads/72NbuPWlP7DC9ET1oVcORcca2HPs1MQrDwXPUAv7.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/72NbuPWlP7DC9ET1oVcORcca2HPs1MQrDwXPUAv7.png&quot;,&quot;width&quot;:421}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/72NbuPWlP7DC9ET1oVcORcca2HPs1MQrDwXPUAv7.png\"><img src=\"https://comfypace.com/uploads/72NbuPWlP7DC9ET1oVcORcca2HPs1MQrDwXPUAv7.png\" width=\"421\" height=\"171\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">57.18 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>Which glass contains water?</p>', 5, '2023-10-28 16:15:27', '2023-10-28 16:15:27', '<p>Solusi 1<br>Pada percobaan pertama, gelas A, B dan C tidak ada yang berisi air, karena ada tiga perubahan pada Taro.<br>Pada percobaan kedua, gelas D atau E berisi air atau ramuan yang membuat hidung menjadi putih. Hal ini dikarenakan dari percobaan pertama A bukan berisi air.<br>Pada percobaan ketiga, gelas D dan F berisi air murni atau ramuan yang membuat kumis keriting. Hal ini dikarenakan dari percobaan pertama C bukan berisi air murni.<br>Oleh karena dapat disimpulkan bahwa D adalah air murni.</p><p><br>Solusi 2:<br>Percobaan 1 menyebabkan tiga perubahan, Percobaan 2 dan 3 menyebabkan dua perubahan. Oleh karena itu tidak ada air murni pada percobaan 1 dan ada satu gelas pada percobaan 2 dan 3 yang berisi air. Gelas yang sama pada percobaan 2 dan 3 adalah D, maka dengan demikian gelas D adalah air murni.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Solution 1:<br>In the first experiment, glasses A, B, and C do not contain water, as there are three effects on Taro.<br>In the second experiment, glass D or E contains water or the potion that makes the nose white. This is because in the first experiment, glass A does not contain water.<br>In the third experiment, glasses D and F contain pure water or the potion that makes mustache curly. This is because in the first experiment, glass C does not contain pure water.<br>Therefore, it can be concluded that D contains pure water.</p><p>Solution 2:<br>Experiment 1 results in three effects, while Experiments 2 and 3 result in two effects. Therefore, there is no pure water in Experiment 1, and there is one glass in Experiments 2 and 3 that contains water. The glass that is common in Experiments 2 and 3 is D, so glass D is pure water.</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(163, 161, 84, 1, '<p>Sebuah mobil robot bekerja dengan aturan yang sederhana untuk melalui suatu maze: belok kanan setiap memungkinkan untuk belok kanan. Gambar di kanan menunjukkan suatu contoh bagaimana mobil robot akan berjalan melalui suatu maze.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:28620,&quot;height&quot;:208,&quot;href&quot;:&quot;https://comfypace.com/uploads/8KpLoWYoj10AyblWp4u8Zpv33qTHCc4Fm69IgRdz.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/8KpLoWYoj10AyblWp4u8Zpv33qTHCc4Fm69IgRdz.png&quot;,&quot;width&quot;:258}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/8KpLoWYoj10AyblWp4u8Zpv33qTHCc4Fm69IgRdz.png\"><img src=\"https://comfypace.com/uploads/8KpLoWYoj10AyblWp4u8Zpv33qTHCc4Fm69IgRdz.png\" width=\"258\" height=\"208\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">27.95 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong><br>Dengan cara kerja demikian, berapa banyakkah dari empat maze berikut ini mobil robot dapat akhirnya mencapai titik merah?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:52646,&quot;height&quot;:149,&quot;href&quot;:&quot;https://comfypace.com/uploads/iULVERY8Hqy10zQpTREOnXbKQCsivNyzkg9fR5w1.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/iULVERY8Hqy10zQpTREOnXbKQCsivNyzkg9fR5w1.png&quot;,&quot;width&quot;:588}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/iULVERY8Hqy10zQpTREOnXbKQCsivNyzkg9fR5w1.png\"><img src=\"https://comfypace.com/uploads/iULVERY8Hqy10zQpTREOnXbKQCsivNyzkg9fR5w1.png\" width=\"588\" height=\"149\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">51.41 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>&nbsp;A robot car operates with a simple rule when navigating through a maze: \"turn right whenever possible.\" The image on the right shows an example of how the robot car would navigate through a maze.&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:28620,&quot;height&quot;:208,&quot;href&quot;:&quot;https://comfypace.com/uploads/GgO0fhfyGwVHtag90fPt1altlyUf6ayP4nSTaeF3.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/GgO0fhfyGwVHtag90fPt1altlyUf6ayP4nSTaeF3.png&quot;,&quot;width&quot;:258}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/GgO0fhfyGwVHtag90fPt1altlyUf6ayP4nSTaeF3.png\"><img src=\"https://comfypace.com/uploads/GgO0fhfyGwVHtag90fPt1altlyUf6ayP4nSTaeF3.png\" width=\"258\" height=\"208\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">27.95 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>With this operating method, how many out of the four mazes below can the robot car ultimately reach the red point? <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:52646,&quot;height&quot;:149,&quot;href&quot;:&quot;https://comfypace.com/uploads/YywylNfz5b3ea9WUY5Uj6rSGqt4U8Vw8FCiqVGhy.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/YywylNfz5b3ea9WUY5Uj6rSGqt4U8Vw8FCiqVGhy.png&quot;,&quot;width&quot;:588}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/YywylNfz5b3ea9WUY5Uj6rSGqt4U8Vw8FCiqVGhy.png\"><img src=\"https://comfypace.com/uploads/YywylNfz5b3ea9WUY5Uj6rSGqt4U8Vw8FCiqVGhy.png\" width=\"588\" height=\"149\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">51.41 KB</span></figcaption></a></figure></p>', 5, '2023-10-28 16:18:53', '2023-10-28 16:18:53', '<p>Pada gambar di bawah ini, garis hijau menunjukkan jalur yang dapat dilalui oleh mobil. Pada Gambar C semua bagian tengah labirin tidak dapat dilalui dan titik merah tidak dapat dicapai. Pada kasus labirin yang lain titik<br>merah dapat dicapai. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:66197,&quot;height&quot;:163,&quot;href&quot;:&quot;https://comfypace.com/uploads/AU6Z8jmKqsH0PYpSl0IHhxKGz9sHSBiEeWOUqT3S.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/AU6Z8jmKqsH0PYpSl0IHhxKGz9sHSBiEeWOUqT3S.png&quot;,&quot;width&quot;:639}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/AU6Z8jmKqsH0PYpSl0IHhxKGz9sHSBiEeWOUqT3S.png\"><img src=\"https://comfypace.com/uploads/AU6Z8jmKqsH0PYpSl0IHhxKGz9sHSBiEeWOUqT3S.png\" width=\"639\" height=\"163\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">64.65 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>In the image below, the green line represents the path that the car can navigate. In Figure C, the central part of the maze is impassable, and the red point cannot be reached. In the other maze cases, the red point can be reached.&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:66197,&quot;height&quot;:163,&quot;href&quot;:&quot;https://comfypace.com/uploads/AU6Z8jmKqsH0PYpSl0IHhxKGz9sHSBiEeWOUqT3S.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/AU6Z8jmKqsH0PYpSl0IHhxKGz9sHSBiEeWOUqT3S.png&quot;,&quot;width&quot;:639}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/AU6Z8jmKqsH0PYpSl0IHhxKGz9sHSBiEeWOUqT3S.png\"><img src=\"https://comfypace.com/uploads/AU6Z8jmKqsH0PYpSl0IHhxKGz9sHSBiEeWOUqT3S.png\" width=\"639\" height=\"163\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">64.65 KB</span></figcaption></a></figure>&nbsp;</p>'),
(164, 162, 85, 1, '<p>Jane sedang bermain suatu permainan komputer. Secara rahasia komputer memilih warna-warna untuk lima kuntum bunga. Warna pilihan yang tersedia adalah biru, oranye, dan pink. Pilihan warna-warna itu tidak berubah selama satu permainan. Jane harus menebak warna-warna itu. Lalu Jane menebaknya dan oleh komputer kuntum-kuntum yang warnanya berhasil ditebak segera ditampilkan mengembang, dan yang belum berhasil ditebak tetap ditampilkan sebagai kuntum, seperti terlihat pada gambar berikut.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:99098,&quot;height&quot;:150,&quot;href&quot;:&quot;https://comfypace.com/uploads/JaL9HmpBfECAlY5Eu6BeZaoEVMToLifeaEstGN2L.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/JaL9HmpBfECAlY5Eu6BeZaoEVMToLifeaEstGN2L.png&quot;,&quot;width&quot;:607}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/JaL9HmpBfECAlY5Eu6BeZaoEVMToLifeaEstGN2L.png\"><img src=\"https://comfypace.com/uploads/JaL9HmpBfECAlY5Eu6BeZaoEVMToLifeaEstGN2L.png\" width=\"607\" height=\"150\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">96.78 KB</span></figcaption></a></figure>Itu adalah hasil tebakan pertama. Berikutnya, Jane mendapat kesempatan untuk menebak kedua kalinya, dan hasil tebakannya ditampilkan komputer sebagai pada gambar berikut.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:105696,&quot;height&quot;:142,&quot;href&quot;:&quot;https://comfypace.com/uploads/cjMZ5lrZjqi0LLUTkBxNNNzrtqLtMZT7YMOovz8D.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/cjMZ5lrZjqi0LLUTkBxNNNzrtqLtMZT7YMOovz8D.png&quot;,&quot;width&quot;:587}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/cjMZ5lrZjqi0LLUTkBxNNNzrtqLtMZT7YMOovz8D.png\"><img src=\"https://comfypace.com/uploads/cjMZ5lrZjqi0LLUTkBxNNNzrtqLtMZT7YMOovz8D.png\" width=\"587\" height=\"142\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">103.22 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong><br>Warna-warna apakah yang telah dipilih komputer untuk kuntum-kuntum bunga tersebut?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Jane is playing a computer game. The computer secretly selects colors for five flower buds. The available color choices are blue, orange, and pink. These color choices do not change throughout the game. Jane has to guess these colors. She makes her guesses, and the computer immediately reveals the flower buds whose colors were correctly guessed, causing them to bloom, while the ones that were not correctly guessed remain displayed as buds, as seen in the picture below. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:99098,&quot;height&quot;:150,&quot;href&quot;:&quot;https://comfypace.com/uploads/JaL9HmpBfECAlY5Eu6BeZaoEVMToLifeaEstGN2L.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/JaL9HmpBfECAlY5Eu6BeZaoEVMToLifeaEstGN2L.png&quot;,&quot;width&quot;:607}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/JaL9HmpBfECAlY5Eu6BeZaoEVMToLifeaEstGN2L.png\"><img src=\"https://comfypace.com/uploads/JaL9HmpBfECAlY5Eu6BeZaoEVMToLifeaEstGN2L.png\" width=\"607\" height=\"150\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">96.78 KB</span></figcaption></a></figure> This is the result of the first guess. Next, Jane gets another chance to make a second guess, and the results of her second guess are displayed by the computer as shown in the picture below.&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:105696,&quot;height&quot;:142,&quot;href&quot;:&quot;https://comfypace.com/uploads/cjMZ5lrZjqi0LLUTkBxNNNzrtqLtMZT7YMOovz8D.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/cjMZ5lrZjqi0LLUTkBxNNNzrtqLtMZT7YMOovz8D.png&quot;,&quot;width&quot;:587}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/cjMZ5lrZjqi0LLUTkBxNNNzrtqLtMZT7YMOovz8D.png\"><img src=\"https://comfypace.com/uploads/cjMZ5lrZjqi0LLUTkBxNNNzrtqLtMZT7YMOovz8D.png\" width=\"587\" height=\"142\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">103.22 KB</span></figcaption></a></figure><strong>&nbsp;Question:</strong><br>What colors did the computer select for the flower buds?&nbsp;</p>', 5, '2023-10-28 16:23:49', '2023-10-28 16:23:49', '<p>Setelah tiga kali tebakan ada tiga warna kuntum bunga. Dengan demikian kita sudah melihat warna yang sudah dipilih oleh komputer untuk bunga yang pertama, ketiga dan kelima. Warna bunga yang pertama adalah merah muda, maka pilihan D tidak benar.<br><br></p><p>Pada tebakan yang pertama, Jane menebak bunga yang kedua pink, dan bunga tidak mengembang. Selanjutnya dia menebak oranye dan bunga juga tidak mengembang. Karena hanya ada tiga pilihan warna bunga, maka warna bunga yang kedua pasti biru. Tebakan ini menyebabkan pilihan C dan D salah.<br><br></p><p>Hal yang sama juga jika Jane menebak bunga ke empat berwarna oranye atau biru, dan bunga tetap tidak mengembang. Oleh karena itu, warna bunga ke empat pasti pink. Karena C salah, maka jawaban yang benar adalah B.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>After three guesses, there are three different flower colors. This means we have seen the colors chosen by the computer for the first, third, and fifth flowers. The color of the first flower is pink, so option D is incorrect.</p><p>In the first guess, Jane guessed the second flower to be pink, and it did not bloom. Then, she guessed orange, and the flower still did not bloom. Since there are only three color choices for the flowers, the second flower must be blue. This guess rules out options C and D.</p><p>The same logic applies if Jane guesses the fourth flower to be either orange or blue, and the flower still does not bloom. Therefore, the fourth flower must be pink. Since option C is incorrect, the correct answer is B.</p><p><br><br><br><br></p><p><br>&nbsp;</p>'),
(165, 163, 85, 1, '<p>Bola adalah mainan yang dapat dioperasikan dengan pengendali jauh (remote control), dan dapat mengenali setiap perintah untuk bergerak satu kotak ke empat arah. Perintah-perintah E ke kanan, W ke kiri, N ke belakang, dan S ke depan.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:27935,&quot;height&quot;:324,&quot;href&quot;:&quot;https://comfypace.com/uploads/rKqPxZGSBI2XMfp6TgA1JasctXyQaJFG0NRjpUdM.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/rKqPxZGSBI2XMfp6TgA1JasctXyQaJFG0NRjpUdM.png&quot;,&quot;width&quot;:128}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/rKqPxZGSBI2XMfp6TgA1JasctXyQaJFG0NRjpUdM.png\"><img src=\"https://comfypace.com/uploads/rKqPxZGSBI2XMfp6TgA1JasctXyQaJFG0NRjpUdM.png\" width=\"128\" height=\"324\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">27.28 KB</span></figcaption></a></figure>Bila Bola bergerak ke kotak putih, ia akan jatuh satu tingkat (level). Bola akan mengabaikan setiap perintah untuk berpindah ke luar batas.</p><p><strong>Pertanyaan:</strong><br>Lihat pada posisi awal Bola dalam gambar di atas. Rangkaian perintah manakah yang menyebabkan Bola mencapai posisi petak merah yang ditandai GOAL?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The ball is a remote-controlled toy that can follow commands to move one square in four directions: E for right, W for left, N for backward, and S for forward.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:27935,&quot;height&quot;:324,&quot;href&quot;:&quot;https://comfypace.com/uploads/rKqPxZGSBI2XMfp6TgA1JasctXyQaJFG0NRjpUdM.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/rKqPxZGSBI2XMfp6TgA1JasctXyQaJFG0NRjpUdM.png&quot;,&quot;width&quot;:128}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/rKqPxZGSBI2XMfp6TgA1JasctXyQaJFG0NRjpUdM.png\"><img src=\"https://comfypace.com/uploads/rKqPxZGSBI2XMfp6TgA1JasctXyQaJFG0NRjpUdM.png\" width=\"128\" height=\"324\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">27.28 KB</span></figcaption></a></figure>If the ball moves onto a white square, it will drop down one level. The ball will ignore any commands to move beyond the boundaries.</p><p><strong>Question:<br></strong>In the initial position of the ball in the image above, which sequence of commands will cause the ball to reach the red square marked as GOAL?&nbsp;</p>', 5, '2023-10-28 16:26:58', '2023-10-28 16:26:58', '<p>Pada soal semua jawaban dimulai dengan melangkah ke kanan (E). Setelah E maka ada dua kemungkinan ke belakang (N) atau ke kiri (W).</p><p>Jika memilih langkah ke Belakang (N), maka langkah selanjutnya pasti ke kiri (W). Jika memilih ke kiri (W), maka langkah selanjutnya ada dua kemungkinan yaitu ke kanan (E) atau ke belakang (N). Dengan demikian pilihan A salah.</p><p>Jika memilih langkah ke kiri (W), maka langkah selanjutnya adalah melangkah ke belakang (N). Setelah itu ada dua kemungkinan yaitu ke kiri (W) atau ke depan (S). Sampai disini jawaban B dan C adalah salah.</p><p>Jika memilih ke kiri (W) maka sudah mencapai goal. Tetapi jika memilih melangkah ke depan (S), maka langkah selanjutnya dalah melangkah ke kiri (W). maka jawaban yang benar adalah D (E, W, N, W)</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>In this question, all the answer options start with a rightward step (E). After E, there are two possibilities: moving backward (N) or to the left (W).</p><p>If you choose to move backward (N), the next step must be to the left (W). If you choose to go left (W), the next step has two possibilities: right (E) or backward (N). Therefore, option A is incorrect.</p><p>If you choose to move left (W), the next step is to move backward (N). After that, there are two possibilities: moving left (W) or forward (S). Up to this point, answers B and C are incorrect.</p><p>If you choose to move left (W), you have already reached the goal. But if you choose to move forward (S), the next step is to move left (W). Therefore, the correct answer is D (E, W, N, W).&nbsp;</p>'),
(166, 164, 86, 1, '<p>Informasi berikut di bawah ini terkait dengan hubungan persahabatan antara seekor bebras, kelinci, hedgehog, bajing and skunk dalam suatu jaringan sosial Instachat.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:155572,&quot;height&quot;:650,&quot;href&quot;:&quot;https://comfypace.com/uploads/yFE0Xe7NpGry0RFsTHqsmvvZ8ePITrJ1qVYDTjnB.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/yFE0Xe7NpGry0RFsTHqsmvvZ8ePITrJ1qVYDTjnB.png&quot;,&quot;width&quot;:425}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/yFE0Xe7NpGry0RFsTHqsmvvZ8ePITrJ1qVYDTjnB.png\"><img src=\"https://comfypace.com/uploads/yFE0Xe7NpGry0RFsTHqsmvvZ8ePITrJ1qVYDTjnB.png\" width=\"425\" height=\"650\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">151.93 KB</span></figcaption></a></figure>Dalam gambar tersebut, garis menunjukkan hubungan persahabatan ini. Tabel di sampingnya mencatat banyaknya teman yang dimiliki masing-masing binatang itu. Lima binatang berbeda itu berada dalam jaringan sosial Snapgram dan informasi yang serupa juga dicatat dengan cara yang sama.</p><p><br><strong>Pertanyaan:</strong><br>Manakah dari berikut ini yang bukan merupakan tabel pencatat banyaknya teman yang dimiliki setiap binatang di dalam Snapgram?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>&nbsp;The provided image shows the friendship connections between a bebras, a rabbit, a hedgehog, a chipmunk, and a skunk in the Instachat social network. The lines indicate these friendship connections. The table beside it records the number of friends each animal has. The five different animals are also part of the Snapgram social network, and similar information is recorded in the same way.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:149829,&quot;height&quot;:613,&quot;href&quot;:&quot;https://comfypace.com/uploads/EF0bmIPnmoUFROlcF4vNmgvaOz7p7UILim1JORRn.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/EF0bmIPnmoUFROlcF4vNmgvaOz7p7UILim1JORRn.png&quot;,&quot;width&quot;:407}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/EF0bmIPnmoUFROlcF4vNmgvaOz7p7UILim1JORRn.png\"><img src=\"https://comfypace.com/uploads/EF0bmIPnmoUFROlcF4vNmgvaOz7p7UILim1JORRn.png\" width=\"407\" height=\"613\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">146.32 KB</span></figcaption></a></figure><strong>Question:</strong></p><p>Which of the following is not a table recording the number of friends each animal has in Snapgram?</p>', 5, '2023-10-28 16:48:03', '2023-10-28 16:48:03', '<p>Dalam hubungan pertemanan jumlah banyaknya teman harus genap, karena hubungan pertemanan harus melibatkan dua objek. Jika kita tambahkan jumlah pertemanan pada kolom kedua, maka jumlahnya harus genap. Jumlah pertemanan pada tabel A, B, C, D adalah 16, 14, 10 dan 13. Maka tabel yang bukan merupakan tabel pencatat banyaknya teman yang dimiliki setiap binatang di dalam Snapgram adalah Tabel D.</p><p>Banyaknya jumlah pertemanan pada Tabel C adalah mungkin karena membentuk membentuk lingkaran di antara lima binatang.</p><p>Banyaknya jumlah pertemanan pada Tabel B dan A juga memungkinkan. Sebagai contoh: bebras&nbsp; -&gt;&nbsp; chipmunk, kelinci -&gt; kura-kura, hedgehog&nbsp; -&gt;&nbsp; groundhog, bajing&nbsp; -&gt;&nbsp; ular, skunk&nbsp; -&gt;&nbsp; serigala.</p><p>Jika groundhog dan serigala menjadi teman dan kura-kura dan ular juga menjadi teman, maka Tabel B adalah mungkin.&nbsp;</p><p>Tabel A juga memungkinkan dengan menambahkan hubungan pertemanan antara<br>serigala dan ular.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>In a friendship relationship, the number of friends must be even because a friendship involves two objects. If we add the number of friendships in the second column, the total must be even. The number of friendships in tables A, B, C, D is 16, 14, 10, and 13. Therefore, the table that does not represent the number of friends each animal has in Snapgram is Table D.</p><p>The number of friendships in Table C is possible because it forms a circle among the five animals.</p><p>The number of friendships in Tables B and A is also possible. For example: bebras-&gt; chipmunk, rabbit -&gt; turtle, hedgehog -&gt; groundhog, chipmunk-&gt; snake, skunk -&gt; wolf.</p><p>If groundhog and wolf become friends and turtle and snake also become friends, then Table B is possible.</p><p>Table A is also possible by adding a friendship between the wolf and the snake.&nbsp;</p>'),
(167, 165, 86, 1, '<p>Tiga-sebaris (Three-in-a-row) merupakan jenis permainan komputer yang sedang populer walaupun pemain hanya menukar-nukarkan posisi pasangan batu permata. Bila setelah penukaran terdapat tiga atau lebih batu permata dengan bentuk yang sama berada berturut-turut secara vertikal atau horisontal maka batu-batu itu akan menghilang. Selanjutnya, setiap batu lainnya yang berada di atasnya akan jatuh mengisi ruang yang telah ditinggalkan. Setelah jatuh, proses yang sama (menghilang dan jatuh) berlanjut bila terjadi ada tiga batu atau lebih berurutan seperti tadi.</p><p>Tujuan akhir permainan adalah menghilangkan seluruh batu permata melalui sejumlah penukaran. Berikut ini suatu contoh situasi sebuah permainan:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:38825,&quot;height&quot;:122,&quot;href&quot;:&quot;https://comfypace.com/uploads/dzU46wuTC1o8S5BcFVWiHiuQGWSlKafMor3F5KbW.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/dzU46wuTC1o8S5BcFVWiHiuQGWSlKafMor3F5KbW.png&quot;,&quot;width&quot;:433}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/dzU46wuTC1o8S5BcFVWiHiuQGWSlKafMor3F5KbW.png\"><img src=\"https://comfypace.com/uploads/dzU46wuTC1o8S5BcFVWiHiuQGWSlKafMor3F5KbW.png\" width=\"433\" height=\"122\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">37.92 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong><br>Batu-batu manakah yang harus ditukar agar seluruh batu menghilang pada situasi permainan berikut ini?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:35489,&quot;height&quot;:160,&quot;href&quot;:&quot;https://comfypace.com/uploads/GgZiqsSMPuRZsdVu3bag7EZqfDnNRnvY4CSPztsm.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/GgZiqsSMPuRZsdVu3bag7EZqfDnNRnvY4CSPztsm.png&quot;,&quot;width&quot;:140}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/GgZiqsSMPuRZsdVu3bag7EZqfDnNRnvY4CSPztsm.png\"><img src=\"https://comfypace.com/uploads/GgZiqsSMPuRZsdVu3bag7EZqfDnNRnvY4CSPztsm.png\" width=\"140\" height=\"160\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">34.66 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>Three-in-a-row is a popular computer game where players swap the positions of pairs of gemstones. When, after swapping, there are three or more gemstones of the same shape in a row either vertically or horizontally, those gemstones disappear. Subsequently, any other gemstones above them will fall to fill the empty spaces. After falling, the same process (disappearing and falling) continues if there are three or more consecutive gemstones as before.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:38825,&quot;height&quot;:122,&quot;href&quot;:&quot;https://comfypace.com/uploads/dzU46wuTC1o8S5BcFVWiHiuQGWSlKafMor3F5KbW.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/dzU46wuTC1o8S5BcFVWiHiuQGWSlKafMor3F5KbW.png&quot;,&quot;width&quot;:433}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/dzU46wuTC1o8S5BcFVWiHiuQGWSlKafMor3F5KbW.png\"><img src=\"https://comfypace.com/uploads/dzU46wuTC1o8S5BcFVWiHiuQGWSlKafMor3F5KbW.png\" width=\"433\" height=\"122\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">37.92 KB</span></figcaption></a></figure>The ultimate goal of the game is to eliminate all the gemstones through a series of exchanges. Below is an example situation in a game:</p><p><strong>Question:<br></strong>Which gemstones should be swapped to make all the gemstones disappear in the following game situation?&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:35489,&quot;height&quot;:160,&quot;href&quot;:&quot;https://comfypace.com/uploads/GgZiqsSMPuRZsdVu3bag7EZqfDnNRnvY4CSPztsm.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/GgZiqsSMPuRZsdVu3bag7EZqfDnNRnvY4CSPztsm.png&quot;,&quot;width&quot;:140}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/GgZiqsSMPuRZsdVu3bag7EZqfDnNRnvY4CSPztsm.png\"><img src=\"https://comfypace.com/uploads/GgZiqsSMPuRZsdVu3bag7EZqfDnNRnvY4CSPztsm.png\" width=\"140\" height=\"160\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">34.66 KB</span></figcaption></a></figure></p>', 5, '2023-10-28 16:55:16', '2023-10-28 16:55:16', '<p><strong>Penjelasan (batu-batu bertanda 2)</strong></p><p>Setelah menukar batu-batu yang bertanda 2 maka, batu berwarna hijau pada kolom tiga dapat dihilangkan. Langkah selanjutnya batu berwarna merah pada baris keempat dapat dihilangkan. Setelah itu batu berwarna biru pada kolom keempat dapat dihilangkan. Langkah berikutnya batu berwarna kuning pada baris kelima dapat dihilangkan. Setelah itu tidak ada lagi batu yang dapat dihilangkan.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:79692,&quot;height&quot;:169,&quot;href&quot;:&quot;https://comfypace.com/uploads/sGBXWhQYyIkjEvN0mk0rATp1LooREGl8223aIL3Q.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/sGBXWhQYyIkjEvN0mk0rATp1LooREGl8223aIL3Q.png&quot;,&quot;width&quot;:309}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/sGBXWhQYyIkjEvN0mk0rATp1LooREGl8223aIL3Q.png\"><img src=\"https://comfypace.com/uploads/sGBXWhQYyIkjEvN0mk0rATp1LooREGl8223aIL3Q.png\" width=\"309\" height=\"169\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">77.82 KB</span></figcaption></a></figure><strong>Penjelasan (batu-batu bertanda 3)</strong></p><p>Setelah menukar batu-batu bertanda 3 maka akan menghilangkan batu berwarna biru pada kolom 1. Setelah itu tidak ada lagi batu yang dapat dihilangkan.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:86720,&quot;height&quot;:136,&quot;href&quot;:&quot;https://comfypace.com/uploads/7MuYNZ9XqxEh3Zoe2XLppfLHUOTJE62J12d12EmN.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/7MuYNZ9XqxEh3Zoe2XLppfLHUOTJE62J12d12EmN.png&quot;,&quot;width&quot;:374}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/7MuYNZ9XqxEh3Zoe2XLppfLHUOTJE62J12d12EmN.png\"><img src=\"https://comfypace.com/uploads/7MuYNZ9XqxEh3Zoe2XLppfLHUOTJE62J12d12EmN.png\" width=\"374\" height=\"136\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">84.69 KB</span></figcaption></a></figure><strong>Penjelasan (batu-batu bertanda 1)</strong></p><p>Berikut ini adalah tahapan penjelasan C:</p><p>Dengan menukar batu-batu 1 maka semua batu akan menghilang. Perhatikan enam tahapan berikut ini:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:143226,&quot;height&quot;:323,&quot;href&quot;:&quot;https://comfypace.com/uploads/fihk6VMWC4TMGI0DFa2uRX4kke4aHu5KHgWBGn7C.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/fihk6VMWC4TMGI0DFa2uRX4kke4aHu5KHgWBGn7C.png&quot;,&quot;width&quot;:484}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/fihk6VMWC4TMGI0DFa2uRX4kke4aHu5KHgWBGn7C.png\"><img src=\"https://comfypace.com/uploads/fihk6VMWC4TMGI0DFa2uRX4kke4aHu5KHgWBGn7C.png\" width=\"484\" height=\"323\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">139.87 KB</span></figcaption></a></figure><strong>Penjelasan (batu-batu bertanda 4)</strong></p><p>Setelah menukar posisi 4 biru dan 4 kuning, maka segitiga kuning akan hilang. Setelah itu tidak ada yang bisa ditukar lagi posisinya.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:127511,&quot;height&quot;:167,&quot;href&quot;:&quot;https://comfypace.com/uploads/syrtNO5z2ELOadW6RMkKp6fftvBzH8CT1iBAGkoK.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/syrtNO5z2ELOadW6RMkKp6fftvBzH8CT1iBAGkoK.png&quot;,&quot;width&quot;:471}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/syrtNO5z2ELOadW6RMkKp6fftvBzH8CT1iBAGkoK.png\"><img src=\"https://comfypace.com/uploads/syrtNO5z2ELOadW6RMkKp6fftvBzH8CT1iBAGkoK.png\" width=\"471\" height=\"167\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">124.52 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p><strong>Explanation for gemstones marked 2:</strong></p><p>After exchanging the stones marked with 2, the green stone in column three can be removed. The next step is to remove the red stone in the fourth row. After that, the blue stone in the fourth column can be removed. The next step is to remove the yellow stone in the fifth row. After that, no more stones can be removed.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:79692,&quot;height&quot;:169,&quot;href&quot;:&quot;https://comfypace.com/uploads/2faHJUTkSfgwk337kzL7qqwJMcOUl9vd7E5sZ2ip.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/2faHJUTkSfgwk337kzL7qqwJMcOUl9vd7E5sZ2ip.png&quot;,&quot;width&quot;:309}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/2faHJUTkSfgwk337kzL7qqwJMcOUl9vd7E5sZ2ip.png\"><img src=\"https://comfypace.com/uploads/2faHJUTkSfgwk337kzL7qqwJMcOUl9vd7E5sZ2ip.png\" width=\"309\" height=\"169\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">77.82 KB</span></figcaption></a></figure><strong>Explanation for gemstones marked 3:</strong></p><p>After exchanging the stones marked with 3, the blue stone in column 1 will be removed. After that, no more stones can be removed.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:86720,&quot;height&quot;:136,&quot;href&quot;:&quot;https://comfypace.com/uploads/TXE6bmgVj8H2bsNI4jr9PwIob2f3nJO2bJXe8sr0.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/TXE6bmgVj8H2bsNI4jr9PwIob2f3nJO2bJXe8sr0.png&quot;,&quot;width&quot;:374}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/TXE6bmgVj8H2bsNI4jr9PwIob2f3nJO2bJXe8sr0.png\"><img src=\"https://comfypace.com/uploads/TXE6bmgVj8H2bsNI4jr9PwIob2f3nJO2bJXe8sr0.png\" width=\"374\" height=\"136\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">84.69 KB</span></figcaption></a></figure><strong>Explanation for gemstones marked 1:</strong></p><p>Here is the step-by-step explanation for C:</p><p>By exchanging the stones marked with 1, all the stones will disappear. Please note the following six steps:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:143226,&quot;height&quot;:323,&quot;href&quot;:&quot;https://comfypace.com/uploads/jRgiAoVqWYUsEV2SmJKsUeWhNah7jYAdpkTjKO0U.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/jRgiAoVqWYUsEV2SmJKsUeWhNah7jYAdpkTjKO0U.png&quot;,&quot;width&quot;:484}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/jRgiAoVqWYUsEV2SmJKsUeWhNah7jYAdpkTjKO0U.png\"><img src=\"https://comfypace.com/uploads/jRgiAoVqWYUsEV2SmJKsUeWhNah7jYAdpkTjKO0U.png\" width=\"484\" height=\"323\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">139.87 KB</span></figcaption></a></figure><strong>Explanation for gemstones marked 4:</strong></p><p>After exchanging the positions of 4 blue and 4 yellow stones, the yellow triangle will disappear. After that, there are no more stone positions that can be exchanged. <figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:127511,&quot;height&quot;:167,&quot;href&quot;:&quot;https://comfypace.com/uploads/Z1VHbWVDQA4NnpT4LSwDvfkgbJw9b31vgLUhYSlk.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Z1VHbWVDQA4NnpT4LSwDvfkgbJw9b31vgLUhYSlk.png&quot;,&quot;width&quot;:471}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Z1VHbWVDQA4NnpT4LSwDvfkgbJw9b31vgLUhYSlk.png\"><img src=\"https://comfypace.com/uploads/Z1VHbWVDQA4NnpT4LSwDvfkgbJw9b31vgLUhYSlk.png\" width=\"471\" height=\"167\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">124.52 KB</span></figcaption></a></figure></p>'),
(168, 166, 87, 1, '<p>Sejumlah karung diletakkan di koridor, di dekat suatu lift (elevator). Koridor sangat sempit sehingga karung-karung harus dibariskan satu-satu.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:110931,&quot;height&quot;:221,&quot;href&quot;:&quot;https://comfypace.com/uploads/log1PDzpfB9ymZK6hAywDUxMMzVoDD6p0Qng2AC5.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/log1PDzpfB9ymZK6hAywDUxMMzVoDD6p0Qng2AC5.png&quot;,&quot;width&quot;:796}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/log1PDzpfB9ymZK6hAywDUxMMzVoDD6p0Qng2AC5.png\"><img src=\"https://comfypace.com/uploads/log1PDzpfB9ymZK6hAywDUxMMzVoDD6p0Qng2AC5.png\" width=\"796\" height=\"221\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">108.33 KB</span></figcaption></a></figure>Dengan lift tersebut, karung-karung hendak dikirimkan ke toko di lantai dasar. Sekali angkut, Lift hanya dapat mengangkut karung-karung dengan total berat tidak kurang dari 80 kg dan tidak lebih dari 100 kg. Setelah terkirim maka lift akan kembali ke lantai tersebut.</p><p>Saat memuatkan karung-karung ke dalam lift, karung yang terdekat dengan lift yang akan diambil terlebih dulu. Seandainya penambahan suatu karung dapat menyebabkan overload (terlalu berat, karena total beratnya lebih dari 100 kg), karung itu untuk sementara tidak dimasukkan ke dalam lift tapi ditaruh di koridor pada arah berlawanan dari semula sejauh-jauhnya (jika tidak overload tentu akan dimasukkan ke dalam lift!).&nbsp;</p><p>Bila karung-karung dari barisan awal telah diambil, hal yang sama kemudian dilakukan pada barisan karung yang terbentuk pada koridor arah berlawanan dengan semula hingga seluruh karung di situ berhasil dikirim ke toko atau dipindah ke ujung koridor berlawanan dengannya. Hal itu terus-menerus dilakukan sampai semua karung berhasil dikirim ke toko.<br><br><strong>Pertanyaan:</strong><br>Sampai semua karung dikirimkan ke toko dengan prosedur tersebut di atas, Berapa kali lift turun-naik mengangkut karung-karung itu semula karung-karung ada seperti pada gambar di atas dengan berat masing-masing seperti yang tercantum pada setiap karung?</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>&nbsp;A number of bags are placed in a corridor, near an elevator. The corridor is very narrow, so the bags must be lined up one by one.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:110931,&quot;height&quot;:221,&quot;href&quot;:&quot;https://comfypace.com/uploads/R5IBMdQLzhYXCkr8W4xwKnSTTby4l9d8sqZ4sftr.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/R5IBMdQLzhYXCkr8W4xwKnSTTby4l9d8sqZ4sftr.png&quot;,&quot;width&quot;:796}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/R5IBMdQLzhYXCkr8W4xwKnSTTby4l9d8sqZ4sftr.png\"><img src=\"https://comfypace.com/uploads/R5IBMdQLzhYXCkr8W4xwKnSTTby4l9d8sqZ4sftr.png\" width=\"796\" height=\"221\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">108.33 KB</span></figcaption></a></figure>Using the elevator, the bags are to be sent to a shop on the ground floor. In one trip, the elevator can only carry bags with a total weight of not less than 80 kg and not more than 100 kg. After being delivered, the elevator will return to the same floor.</p><p>When loading the bags into the elevator, the bag closest to the elevator will be taken first. If adding a bag would cause an overload (too heavy, because the total weight is more than 100 kg), that bag will temporarily not be placed in the elevator but will be put in the corridor in the opposite direction as far as possible (if not overloaded, it will be placed in the elevator!).</p><p>Once the bags from the initial row have been taken, the same process is then done for the row of bags that forms in the corridor in the opposite direction until all the bags there have been successfully sent to the shop or moved to the end of the opposite corridor. This is done continuously until all the bags are successfully sent to the shop.</p><p><strong>Question:<br></strong>Until all the sacks are delivered to the store using the procedure described above, how many times will the elevator go up and down to transport the sacks, assuming that the sacks are initially arranged as shown in the picture with the weights as indicated on each sack?&nbsp;</p>', 5, '2023-10-28 17:00:33', '2023-10-28 17:00:33', '<p>Pada pemuatan pertama, 3 karung dengan berat 40+20+34=94 kg. Pada pemuatan kedua, karung berikutnya (55 kg) dimasukkan ke dalam lift. Karung berikutnya (50 kg) akan mengakibatkan overload, sehingga ditaruh pada ujung yang berlawanan. Karung berikutnya (23 kg) ditaruh kembali dalam lift, namun lift tak dapat pergi hanya dengan total berat 55+23= 78 kg. Karung berikutnya adalah 45 kg, yang akan membuat beban lift terlalu berat, maka karung itu dibawa ke ujung yang berlawanan. Hal yang sama terjadi untuk karung berikutnya (30 kg). Akhirnya, karung berikutnya (10 kg) dapat ditaruh dalam lift, dan berangkat dengan 55+23+10=88 kg. Ketiga karung terakhir (25+30+15 = 70kg) ditaruh dalam lift. Demikian seterusnya pemuatan karung-karung ke dalam lift dilakukan hingga semua karung terkirim.</p><p>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>During the first loading, 3 bags with a total weight of 40+20+34=94 kg were loaded. In the second loading, the next bag (55 kg) was placed in the lift. The following bag (50 kg) would cause an overload, so it was placed at the opposite end. The next bag (23 kg) was placed back in the lift, but the lift couldn\'t operate with a total weight of only 55+23=78 kg. The next bag weighed 45 kg, which would make the lift too heavy, so it was moved to the opposite end. The same happened with the next bag (30 kg). Finally, the next bag (10 kg) could be placed in the lift, and it departed with a total weight of 55+23+10=88 kg. The last three bags (25+30+15=70 kg) were placed in the lift. This process continued, loading bags into the lift, until all the bags were delivered.</p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(169, 167, 87, 1, '<p>Kombinasi kartu A dan kartu B, menghasilkan kartu C.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:20846,&quot;height&quot;:120,&quot;href&quot;:&quot;https://comfypace.com/uploads/8xTaFRzQ2RAuM9LHIdqdVekNadu5SS8IRmXoWPKe.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/8xTaFRzQ2RAuM9LHIdqdVekNadu5SS8IRmXoWPKe.png&quot;,&quot;width&quot;:477}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/8xTaFRzQ2RAuM9LHIdqdVekNadu5SS8IRmXoWPKe.png\"><img src=\"https://comfypace.com/uploads/8xTaFRzQ2RAuM9LHIdqdVekNadu5SS8IRmXoWPKe.png\" width=\"477\" height=\"120\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">20.36 KB</span></figcaption></a></figure><strong>Pertanyaan:</strong><br>Berapa banyak sel gelap dari kombinasi kartu D dan kartu E berikut? Tuliskan bilangannya sebagai jawaban.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:16064,&quot;height&quot;:133,&quot;href&quot;:&quot;https://comfypace.com/uploads/SIDg2dhJl5iE0RK5w6hrZgCnUbgS8yGpnPeFmYvK.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/SIDg2dhJl5iE0RK5w6hrZgCnUbgS8yGpnPeFmYvK.png&quot;,&quot;width&quot;:470}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/SIDg2dhJl5iE0RK5w6hrZgCnUbgS8yGpnPeFmYvK.png\"><img src=\"https://comfypace.com/uploads/SIDg2dhJl5iE0RK5w6hrZgCnUbgS8yGpnPeFmYvK.png\" width=\"470\" height=\"133\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">15.69 KB</span></figcaption></a></figure></p>', 5, '2023-10-28 17:04:47', '2023-10-28 17:04:47', '<p>Aturan untuk melakukan kombinasi kartu D dan E adalah sebagai berikut:</p><ul><li>Jika warna sel kartu yang bersesuaian sama maka warna yang dihasilkan hitam</li><li>Selainnya, warna yang dihasilkan adalah putih</li></ul><p>Berikut ini adalah hasil kombinasi kartu D dan E:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:24463,&quot;height&quot;:119,&quot;href&quot;:&quot;https://comfypace.com/uploads/laxVoKlaMOOFm274kfbQsWbuvegWLtaLITDGtQ11.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/laxVoKlaMOOFm274kfbQsWbuvegWLtaLITDGtQ11.png&quot;,&quot;width&quot;:479}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/laxVoKlaMOOFm274kfbQsWbuvegWLtaLITDGtQ11.png\"><img src=\"https://comfypace.com/uploads/laxVoKlaMOOFm274kfbQsWbuvegWLtaLITDGtQ11.png\" width=\"479\" height=\"119\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">23.89 KB</span></figcaption></a></figure>-----------------------------------------------------------------------------------------------<strong>ENGLISH VERSION</strong>&nbsp;</p><p>The rules for combining cards D and E are as follows:</p><ul><li>If the matching cell colors are the same, the resulting color is black.</li><li>Otherwise, the resulting color is white.</li></ul><p>Here are the results of combining cards D and E:&nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:24463,&quot;height&quot;:119,&quot;href&quot;:&quot;https://comfypace.com/uploads/laxVoKlaMOOFm274kfbQsWbuvegWLtaLITDGtQ11.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/laxVoKlaMOOFm274kfbQsWbuvegWLtaLITDGtQ11.png&quot;,&quot;width&quot;:479}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/laxVoKlaMOOFm274kfbQsWbuvegWLtaLITDGtQ11.png\"><img src=\"https://comfypace.com/uploads/laxVoKlaMOOFm274kfbQsWbuvegWLtaLITDGtQ11.png\" width=\"479\" height=\"119\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">23.89 KB</span></figcaption></a></figure></p>'),
(170, 168, 88, 1, '<p>Keluarga berang-berang merencanakan pergi untuk berpiknik. Sebelum berangkat,<br>ayah meminta mereka merapikan kamarnya. Sesaat kemudian, ayah sangat puas<br>karena ruangannya sangat rapi. Ayah melihat kotak berisi mainan dan berkata:<br>\"Kalian sudah mengerjakan dengan sangat baik. Semua boneka, rangkaian manik-<br>manik dan lidi-lidi sudah berada dalam kotak. Sekarang saya punya permainan tebak-tebakan. Sekarang, kalau saya berikan tiga buah lingkaran berlabel AABBCC, ABCABC, ABCCBA; di mana kalian akan menaruh mainan-mainan tadi? Saya yakin<br>kalian bisa menebak dengan baik, dan sebagai hadiah kalian akan saya belikan es<br>krim\".</p><p>contoh rangkaian<br>mainan boneka</p><p>contoh rangkaian<br>mainan manik-manik<br><br>contoh rangkaian<br>mainan lidi-lidi</p><p>Masukkan setiap mainan ke dalam lingkaran-lingkaran yang sesuai dengan label yang tertulis pada masing-masing lingkaran. Tempatkan semua mainan pada lingkaran-lingkaran berlabel AABBCC, ABCABC, ABCCBA, sesuai dengan pola susunan mainan dalam rangkaian.</p><p><br></p><p>------------------------------------------------------</p><p>The family of otters plans to go on a picnic. Before leaving,<br>Dad asked them to tidy up his room. A moment later, father was very satisfied<br>because the room is very neat. Dad looked at the box filled with toys and said:<br>\"You\'ve done very well. All the dolls, the strings of beads<br>The beads and sticks are already in the box. Now I have a guessing game. Now, if I give you three circles labeled AABBCC, ABCABC, ABCCBA; where will you put the toys? I believe<br>You can guess well, and as your reward I will buy you ice<br>cream\".<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:89922,&quot;height&quot;:314,&quot;href&quot;:&quot;https://comfypace.com/uploads/2voriaMLOgnu3N8oUByZk48vhDHF6xzYZB7ZPPgc.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/2voriaMLOgnu3N8oUByZk48vhDHF6xzYZB7ZPPgc.png&quot;,&quot;width&quot;:381}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/2voriaMLOgnu3N8oUByZk48vhDHF6xzYZB7ZPPgc.png\"><img src=\"https://comfypace.com/uploads/2voriaMLOgnu3N8oUByZk48vhDHF6xzYZB7ZPPgc.png\" width=\"381\" height=\"314\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">87.81 KB</span></figcaption></a></figure>stuffed toys order example<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:119339,&quot;height&quot;:311,&quot;href&quot;:&quot;https://comfypace.com/uploads/Gie2FrDKlTEzXjApBsXmSaDr4vpwDseEYbL70Nck.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Gie2FrDKlTEzXjApBsXmSaDr4vpwDseEYbL70Nck.png&quot;,&quot;width&quot;:416}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Gie2FrDKlTEzXjApBsXmSaDr4vpwDseEYbL70Nck.png\"><img src=\"https://comfypace.com/uploads/Gie2FrDKlTEzXjApBsXmSaDr4vpwDseEYbL70Nck.png\" width=\"416\" height=\"311\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">116.54 KB</span></figcaption></a></figure>beaded toys order example<br><br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:88934,&quot;height&quot;:275,&quot;href&quot;:&quot;https://comfypace.com/uploads/2fbZTXcMiUvJUf7YdT9WScgDoy8uyGEJcblZRpBW.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/2fbZTXcMiUvJUf7YdT9WScgDoy8uyGEJcblZRpBW.png&quot;,&quot;width&quot;:388}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/2fbZTXcMiUvJUf7YdT9WScgDoy8uyGEJcblZRpBW.png\"><img src=\"https://comfypace.com/uploads/2fbZTXcMiUvJUf7YdT9WScgDoy8uyGEJcblZRpBW.png\" width=\"388\" height=\"275\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">86.85 KB</span></figcaption></a></figure>stick toys order example<br><br>Put each toy into the circles corresponding to the labels written on each circle. Place all the toys in the circles labeled AABBCC, ABCABC, ABCCBA, according to the toy arrangement pattern in the series.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:153354,&quot;height&quot;:295,&quot;href&quot;:&quot;https://comfypace.com/uploads/J03H6muGlrCgrA4S3PPT7GK4LtV1NyYsIEBuoo1A.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/J03H6muGlrCgrA4S3PPT7GK4LtV1NyYsIEBuoo1A.png&quot;,&quot;width&quot;:682}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/J03H6muGlrCgrA4S3PPT7GK4LtV1NyYsIEBuoo1A.png\"><img src=\"https://comfypace.com/uploads/J03H6muGlrCgrA4S3PPT7GK4LtV1NyYsIEBuoo1A.png\" width=\"682\" height=\"295\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">149.76 KB</span></figcaption></a></figure></p>', 5, '2023-10-30 04:19:36', '2023-10-30 04:19:36', '<p>Masing-masing mainan tersebut masih dapat dikelompokkan kembali berdasarkan<br>polanya. Boneka menurut pola urutan pada lingkaran dalam satu arah tertentu;<br>untaian manik-manik menurut urutannya dalam rangkaian tali; dan mainan lidi-lidi<br>menurut pola kemiringan setiap lidi dalam urutannya dari kiri ke kanan.</p><p><br></p><p>-----------------------------------------------------</p><p><br></p><p>Each of these toys can still be regrouped based on<br>the \"pattern\". Puppets follow a sequence pattern on a circle in one particular direction; string of beads according to their sequence in a series of strings; and stick toys according to the slope pattern of each stick in order from left to right.</p>'),
(171, 169, 88, 1, '<p>Taro si berang-berang menemukan lima jenis ramuan ajaib yang efeknya adalah<br>sebagai berikut:<br> Ramuan pertama membuat telinga bertambah panjang<br> Ramuan lainnya membuat gigi bertambah panjang<br> Ramuan lainnya membuat kumis menjadi keriting<br> Ramuan lainnya membuat hidung menjadi putih<br> Ramuan terakhir membuat mata menjadi putih<br>Taro menaruh setiap macam ramuan ajaib tersebut dalam sebuah gelas, dan ada<br>sebuah gelas yang berisi air. Keenam gelas tersebut diberi label A sampai dengan F.<br>Malangnya, ia lupa mencatat gelas mana yang mengandung ramuan ajaib apa.<br><br>Maka, ia mengadakan percobaan sebagai berikut untuk mengidentifikasi jenis<br>ramuan ajaib pada setiap gelas.<br> Percobaan 1: jika ia mengambil ramuan pada gelas A,B dan C, maka efeknya<br>adalah pada Gambar 1<br> Percobaan 2: jika ia mengambil ramuan pada gelas A,D dan E, maka efeknya<br>adalah pada Gambar 2<br> Percobaan 3: jika ia mengambil ramuan pada gelas C, D dan F, maka efeknya<br>adalah pada Gambar 3</p><p>Gelas mana yang berisi air? Pilih salah satu:</p><p><br></p><p>---------------------------------------------------</p><p><br></p><p>Taro the otter discovered five types of magic potions whose effects are<br>as follows:<br> The first potion makes the ears grow longer<br> Other herbs make teeth longer<br> Other herbs make the mustache curly<br> Other concoctions make the nose white<br> The last concoction makes the eyes white<br>Taro put every kind of magic potion in a glass, and there it was<br>a glass filled with water. The six glasses are labeled A through F.<br>Unfortunately, he forgot to note which glass contained which magic potion.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:42779,&quot;height&quot;:149,&quot;href&quot;:&quot;https://comfypace.com/uploads/T3LAv824PM6oj5jV61mJVgnGH83BkQZR1vlfG4SM.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/T3LAv824PM6oj5jV61mJVgnGH83BkQZR1vlfG4SM.png&quot;,&quot;width&quot;:493}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/T3LAv824PM6oj5jV61mJVgnGH83BkQZR1vlfG4SM.png\"><img src=\"https://comfypace.com/uploads/T3LAv824PM6oj5jV61mJVgnGH83BkQZR1vlfG4SM.png\" width=\"493\" height=\"149\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">41.78 KB</span></figcaption></a></figure>So, he conducted the following experiment to identify the type<br>Magic potion in every glass.<br> Experiment 1: if he takes the potion in glasses A, B and C, then the effect will be<br>is in Figure 1<br> Experiment 2: if he takes the potion in glasses A, D and E, then the effect will be<br>is in Figure 2<br> Experiment 3: if he takes the potion in glasses C, D and F, then the effect will be<br>is in Figure 3</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:108958,&quot;height&quot;:232,&quot;href&quot;:&quot;https://comfypace.com/uploads/V3g1AXuNsPOWuUnsg230xth5DFFYBCE5AqmmHfUf.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/V3g1AXuNsPOWuUnsg230xth5DFFYBCE5AqmmHfUf.png&quot;,&quot;width&quot;:602}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/V3g1AXuNsPOWuUnsg230xth5DFFYBCE5AqmmHfUf.png\"><img src=\"https://comfypace.com/uploads/V3g1AXuNsPOWuUnsg230xth5DFFYBCE5AqmmHfUf.png\" width=\"602\" height=\"232\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">106.4 KB</span></figcaption></a></figure>Which glass contains water? Select one:</p>', 5, '2023-10-30 04:23:17', '2023-10-30 04:23:17', '<p>Solusi 1<br>Pada percobaan pertama, gelas A, B dan C tidak ada yang berisi air, karena<br>ada tiga perubahan pada berang-berang.<br>Pada percobaan kedua, gelas D atau E berisi air atau ramuan yang membuat<br>hidung menjadi putih. Hal ini dikarenakan dari percobaan pertama A bukan<br>berisi air.<br>Pada percobaan ketiga, gelas D dan F berisi air murni atau ramuan yang<br>membuat kumis keriting. Hal ini dikarenakan dari percobaan pertama C bukan<br>berisi air murni.<br>Oleh karena dapat disimpulkan bahwa D adalah air murni.<br>Solusi 2:<br>Percobaan 1 menyebabkan tiga perubahan, Percobaan 2 dan 3 menyebabkan<br>dua perubahan. Oleh karena itu tidak ada air murni pada percobaan 1 dan<br>ada satu gelas pada percobaan 2 dan 3 yang berisi air. Gelas yang sama pada<br>percobaan 2 dan 3 adalah D, maka dengan demikian gelas D adalah air murni.</p><p><br></p><p>------------------------------------------------------</p><p><br></p><p>Solution 1<br>In the first experiment, none of glasses A, B and C contained water, because<br>there are three changes in the beaver.<br>In the second experiment, glass D or E contained water or the potion that made it<br>nose turns white. This is because from the first try A was not<br>contains water.<br>In the third experiment, glasses D and F contained pure water or a mixture<br>make a curly mustache. This is because from the first experiment C was not<br>contains pure water.<br>Therefore it can be concluded that D is pure water.<br>Solution 2:<br>Experiment 1 caused three changes, Experiments 2 and 3 did<br>two changes. Therefore there is no pure water in experiments 1 and<br>There was one glass in experiments 2 and 3 which contained water. The same glass on<br>Experiments 2 and 3 are D, so glass D is pure water.</p>'),
(172, 170, 89, 1, '<p>Rio si berang-berang sedang membangun rakit. Untuk kontrol lalu lintas sungai,<br>semua rakit harus didaftar. Ini berarti bahwa setiap rakit harus memiliki tanda<br>berupa plat dengan teks yang unik. Teks yang terdiri dari huruf dan angka hanya bisa<br>dibangkitkan sesuai dengan diagram di bawah ini, yaitu dimulai dengan huruf B,<br>diikuti huruf/angka berikutnya sesuai arah panah, dan diakhiri dengan angka digit 0<br>atau 1.</p><p>Manakah 2 (dua) plat berikut yang tidak dapat didaftarkan?</p><p><br></p><p>------------------------------------------------------</p><p><br></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:152024,&quot;height&quot;:198,&quot;href&quot;:&quot;https://comfypace.com/uploads/odMCYZhuRFwmJrTX5Ynxt562ZfbhbnVNV0BVJyci.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/odMCYZhuRFwmJrTX5Ynxt562ZfbhbnVNV0BVJyci.png&quot;,&quot;width&quot;:586}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/odMCYZhuRFwmJrTX5Ynxt562ZfbhbnVNV0BVJyci.png\"><img src=\"https://comfypace.com/uploads/odMCYZhuRFwmJrTX5Ynxt562ZfbhbnVNV0BVJyci.png\" width=\"586\" height=\"198\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">148.46 KB</span></figcaption></a></figure>Rio the otter is building a raft. For river traffic control,<br>all rafts must be registered. This means that each raft must have markings<br>in the form of a plate with unique text. Text consisting of letters and numbers can only be generated according to the diagram below, starting with the letter B,<br>followed by the next letter/number in the direction of the arrow, and ending with the digit 0<br>or 1.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:82039,&quot;height&quot;:456,&quot;href&quot;:&quot;https://comfypace.com/uploads/ihnR4nCJNs0hbhAJoJwXhWMZ8DidA1iXku8xJIXn.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/ihnR4nCJNs0hbhAJoJwXhWMZ8DidA1iXku8xJIXn.png&quot;,&quot;width&quot;:620}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/ihnR4nCJNs0hbhAJoJwXhWMZ8DidA1iXku8xJIXn.png\"><img src=\"https://comfypace.com/uploads/ihnR4nCJNs0hbhAJoJwXhWMZ8DidA1iXku8xJIXn.png\" width=\"620\" height=\"456\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">80.12 KB</span></figcaption></a></figure>Which 2 (two) plates below cannot be registered?</p>', 5, '2023-10-30 04:26:43', '2023-10-30 04:26:43', '<p>Anda harus menelusuri diagram dan memeriksa jawaban: BBB100 salah, sebab digit<br>dimulai dengan angka 1.<br>BR00A0 salah, sebab dari 0 tak dapat ke A, karena panah hanya satu arah dari A ke 0.</p><p><br></p><p>-------------------------------------------------------</p><p><br></p><p>You should go through the diagram and check the answer: BBB100 is wrong, because of the digits starting with the number 1. Rio si berang-berang sedang membangun rakit. Untuk kontrol lalu lintas sungai,<br>semua rakit harus didaftar. Ini berarti bahwa setiap rakit harus memiliki tanda<br>berupa plat dengan teks yang unik. Teks yang terdiri dari huruf dan angka hanya bisa<br>dibangkitkan sesuai dengan diagram di bawah ini, yaitu dimulai dengan huruf B,<br>diikuti huruf/angka berikutnya sesuai arah panah, dan diakhiri dengan angka digit 0<br>atau 1. BR00A0 is wrong, because you cannot go from 0 to A, because the arrow only goes in one direction from A to 0.</p>'),
(173, 171, 89, 1, '<p>Sebuah mobil robot bekerja dengan aturan yang sederhana untuk melalui suatu<br>maze: belok kanan setiap memungkinkan untuk belok kanan. Gambar di kanan<br>menunjukkan suatu contoh bagaimana mobil robot akan berjalan melalui suatu<br>maze.</p><p>Dengan cara kerja demikian, berapa banyakkah dari empat maze berikut ini mobil<br>robot dapat akhirnya mencapai titik merah?</p><p><br></p><p>--------------------------------------------------------</p><p><br></p><p>A robot car works with simple rules to get through a<br>maze: turn right every time it is possible to turn right. Image on right<br>shows an example of how a robot car would drive through a<br>mazes.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:55866,&quot;height&quot;:299,&quot;href&quot;:&quot;https://comfypace.com/uploads/RR6FXiIvVZKc6C8zGSaiT9Wae6yWU1m5A4p1VrVM.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/RR6FXiIvVZKc6C8zGSaiT9Wae6yWU1m5A4p1VrVM.png&quot;,&quot;width&quot;:370}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/RR6FXiIvVZKc6C8zGSaiT9Wae6yWU1m5A4p1VrVM.png\"><img src=\"https://comfypace.com/uploads/RR6FXiIvVZKc6C8zGSaiT9Wae6yWU1m5A4p1VrVM.png\" width=\"370\" height=\"299\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">54.56 KB</span></figcaption></a></figure>Using this method, how many of the following four mazes are cars<br>can the robot finally reach the red point?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;Screen Shot 2023-10-30 at 11.29.55.png&quot;,&quot;filesize&quot;:164354,&quot;height&quot;:316,&quot;href&quot;:&quot;https://comfypace.com/uploads/JeOFiwdzZ9DejB67QY9r89yIB5jbkZ1XtZXXKIwS.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/JeOFiwdzZ9DejB67QY9r89yIB5jbkZ1XtZXXKIwS.png&quot;,&quot;width&quot;:1298}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/JeOFiwdzZ9DejB67QY9r89yIB5jbkZ1XtZXXKIwS.png\"><img src=\"https://comfypace.com/uploads/JeOFiwdzZ9DejB67QY9r89yIB5jbkZ1XtZXXKIwS.png\" width=\"1298\" height=\"316\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">Screen Shot 2023-10-30 at 11.29.55.png</span> <span class=\"attachment__size\">160.5 KB</span></figcaption></a></figure></p>', 5, '2023-10-30 04:31:41', '2023-10-30 04:31:54', '<p>Jawaban yang benar adalah 3. Pada gambar di bawah ini, garis hijau menunjukkan<br>jalur yang dapat dilalui oleh mobil. Pada Gambar C semua bagian tengah labirin tidak<br>dapat dilalui dan titik merah tidak dapat dicapai. Pada kasus labirin yang lain titik<br>merah dapat dicapai.</p><p><br></p><p>-------------------------------------------------</p><p><br></p><p>The correct answer is 3. In the image below, the green line shows<br>path that can be passed by cars. In Figure C all the middle parts of the maze are not<br>can be passed and the red point cannot be reached. In the case of the maze, another point<br>red can be achieved.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:120439,&quot;height&quot;:233,&quot;href&quot;:&quot;https://comfypace.com/uploads/VZb1uek0rv2CZLyUHCXi6nZEQottNErVRDpIapoT.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/VZb1uek0rv2CZLyUHCXi6nZEQottNErVRDpIapoT.png&quot;,&quot;width&quot;:955}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/VZb1uek0rv2CZLyUHCXi6nZEQottNErVRDpIapoT.png\"><img src=\"https://comfypace.com/uploads/VZb1uek0rv2CZLyUHCXi6nZEQottNErVRDpIapoT.png\" width=\"955\" height=\"233\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">117.62 KB</span></figcaption></a></figure></p>'),
(174, 172, 90, 1, '<p>Ali ingin bermain dengan John. Ali memiliki beberapa kartu berbentuk geometris dan<br>ingin bertukar beberapa kartu yang dimilikinya dengan Jon. Ali menggunakan aturan<br>pertukaran kartu mengikuti diagram berikut:<br><br>Berdasarkan aturan permainan:<br>a. kartu persegi diganti dengan 2 kartu segitiga<br>b. 1 kartu segitiga diganti dengan 1 kartu persegi, 1 kartu segitiga, dan 1 kartu<br>persegi lainnya<br>Sebagai contoh, jika Ali mulai permainan dari kartu persegi dengan menggunakan<br>aturan yang ada, setelah 3 langkah dia akan mendapatkan kartu dengan urutan<br>sebagai berikut:</p><p>Aturan mana yang akan menghasilkan urutan kartu berikut?</p><p><br></p><p>------------------------------------------------------</p><p><br></p><p>Ali wants to play with John. Ali has several geometric shaped cards and<br>wanted to exchange some of the cards he had with Jon. Ali uses rules<br>card exchange follows the following diagram:<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:40877,&quot;height&quot;:118,&quot;href&quot;:&quot;https://comfypace.com/uploads/oWq9azOEJtB28HvUT57OAqUHFyoZirIdDQI3FmmS.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/oWq9azOEJtB28HvUT57OAqUHFyoZirIdDQI3FmmS.png&quot;,&quot;width&quot;:837}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/oWq9azOEJtB28HvUT57OAqUHFyoZirIdDQI3FmmS.png\"><img src=\"https://comfypace.com/uploads/oWq9azOEJtB28HvUT57OAqUHFyoZirIdDQI3FmmS.png\" width=\"837\" height=\"118\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">39.92 KB</span></figcaption></a></figure>Based on the game rules:<br>a. Square cards are replaced with 2 triangle cards<br>b. 1 triangle card is replaced with 1 square card, 1 triangle card, and 1 card<br>another square<br>For example, if Ali starts the game from a square card using<br>existing rules, after 3 steps he will get the cards in sequence<br>as follows:</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:75612,&quot;height&quot;:162,&quot;href&quot;:&quot;https://comfypace.com/uploads/4CQrAiwJsNlNO9cgCpDOpc7IfJbTZw1nSOOqZTso.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/4CQrAiwJsNlNO9cgCpDOpc7IfJbTZw1nSOOqZTso.png&quot;,&quot;width&quot;:969}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/4CQrAiwJsNlNO9cgCpDOpc7IfJbTZw1nSOOqZTso.png\"><img src=\"https://comfypace.com/uploads/4CQrAiwJsNlNO9cgCpDOpc7IfJbTZw1nSOOqZTso.png\" width=\"969\" height=\"162\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">73.84 KB</span></figcaption></a></figure>Which rule will produce the following sequence of cards?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:26577,&quot;height&quot;:99,&quot;href&quot;:&quot;https://comfypace.com/uploads/pigF88zwegwvwSQJ1E2Rn4BBGFqsFSjTDUIaPBj7.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/pigF88zwegwvwSQJ1E2Rn4BBGFqsFSjTDUIaPBj7.png&quot;,&quot;width&quot;:789}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/pigF88zwegwvwSQJ1E2Rn4BBGFqsFSjTDUIaPBj7.png\"><img src=\"https://comfypace.com/uploads/pigF88zwegwvwSQJ1E2Rn4BBGFqsFSjTDUIaPBj7.png\" width=\"789\" height=\"99\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">25.95 KB</span></figcaption></a></figure></p>', 5, '2023-10-30 04:39:02', '2023-10-30 04:39:02', '<p>Perhatikanlah bahwa dengan menggunakan aturan-aturan yang ada pada jawaban B,<br>urutan kartu yang diminta dapat dihasilkan, seperti terlihat pada proses pergantian<br>kartu sebagai berikut:</p><p><br>Untuk mencoret 2 kemungkinan pilihan lainnya (yaitu jawaban A dan C), kita perlu<br>melakukan observasi.<br>Untuk jawaban A, jika dimulai dengan segitiga atau lingkaran, kita tak mungkin<br>memperoleh bujur sangkar. Jika dimulai dengan bujur sangkar, kita akan<br>memperoleh gambar sebagai berikut, dan langkah-langkah yang menghasilkan pola<br>yang terlalu panjang :<br><br>Untuk jawaban C, jika kita mulai dengan segitiga, kita hanya dapat memperoleh<br>sederetan segitiga.<br>Jika kita mulai dengan kartu persegi:<br><br>Empat segitiga tidak pernah akan berubah menjadi<br><br>Jika kita mulai dengan lingkaran:<br><br>Seperti sebelumnya, empat segitiga tak dapat membentuk<br>Untuk jawaban D, kita tak mungkin mendapatkan urutan kartu yang diminta.</p><p><br></p><p>------------------------------------------------------</p><p><br></p><p>Note that using the rules in answer B,<br>the requested card sequence can be generated, as seen in the replacement process<br>card as follows:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:88013,&quot;height&quot;:133,&quot;href&quot;:&quot;https://comfypace.com/uploads/y2Y0Z8Scz1KKkFAfgmz3BVAN8oRIp9TMxOLaQfI5.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/y2Y0Z8Scz1KKkFAfgmz3BVAN8oRIp9TMxOLaQfI5.png&quot;,&quot;width&quot;:1046}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/y2Y0Z8Scz1KKkFAfgmz3BVAN8oRIp9TMxOLaQfI5.png\"><img src=\"https://comfypace.com/uploads/y2Y0Z8Scz1KKkFAfgmz3BVAN8oRIp9TMxOLaQfI5.png\" width=\"1046\" height=\"133\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">85.95 KB</span></figcaption></a></figure>To cross out the other 2 possible choices (namely answers A and C), we need<br>make observations.<br>For answer A, if it starts with a triangle or circle, we can\'t do it<br>get a square. If we start with a square, we will<br>obtain the following image, and the steps that produce the pattern<br>too long:<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:146515,&quot;height&quot;:206,&quot;href&quot;:&quot;https://comfypace.com/uploads/pd9WAQYNFZGBf1pAND8N9m1ALWPSTtmyNAqXaOOA.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/pd9WAQYNFZGBf1pAND8N9m1ALWPSTtmyNAqXaOOA.png&quot;,&quot;width&quot;:1036}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/pd9WAQYNFZGBf1pAND8N9m1ALWPSTtmyNAqXaOOA.png\"><img src=\"https://comfypace.com/uploads/pd9WAQYNFZGBf1pAND8N9m1ALWPSTtmyNAqXaOOA.png\" width=\"1036\" height=\"206\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">143.08 KB</span></figcaption></a></figure>For answer C, if we start with triangles, we can only get<br>a row of triangles.<br>If we start with a square card:<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:146250,&quot;height&quot;:171,&quot;href&quot;:&quot;https://comfypace.com/uploads/FLCy5THKPRvcSk925eRRMjG0uogwbFCcMERLteSS.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/FLCy5THKPRvcSk925eRRMjG0uogwbFCcMERLteSS.png&quot;,&quot;width&quot;:1085}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/FLCy5THKPRvcSk925eRRMjG0uogwbFCcMERLteSS.png\"><img src=\"https://comfypace.com/uploads/FLCy5THKPRvcSk925eRRMjG0uogwbFCcMERLteSS.png\" width=\"1085\" height=\"171\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">142.82 KB</span></figcaption></a></figure>Four triangles will never turn out to be<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:20780,&quot;height&quot;:84,&quot;href&quot;:&quot;https://comfypace.com/uploads/EhCf7XndNF1IDBx0GJRk2I9QOZgCnGrWWpW0zig3.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/EhCf7XndNF1IDBx0GJRk2I9QOZgCnGrWWpW0zig3.png&quot;,&quot;width&quot;:235}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/EhCf7XndNF1IDBx0GJRk2I9QOZgCnGrWWpW0zig3.png\"><img src=\"https://comfypace.com/uploads/EhCf7XndNF1IDBx0GJRk2I9QOZgCnGrWWpW0zig3.png\" width=\"235\" height=\"84\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">20.29 KB</span></figcaption></a></figure>If we start with a circle:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:94814,&quot;height&quot;:104,&quot;href&quot;:&quot;https://comfypace.com/uploads/b4ZwT7tqqnFQIhHvRZe3BEpD0LcZ8VDvVedI7RCP.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/b4ZwT7tqqnFQIhHvRZe3BEpD0LcZ8VDvVedI7RCP.png&quot;,&quot;width&quot;:1053}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/b4ZwT7tqqnFQIhHvRZe3BEpD0LcZ8VDvVedI7RCP.png\"><img src=\"https://comfypace.com/uploads/b4ZwT7tqqnFQIhHvRZe3BEpD0LcZ8VDvVedI7RCP.png\" width=\"1053\" height=\"104\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">92.59 KB</span></figcaption></a></figure>As before, four triangles cannot form<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:20819,&quot;height&quot;:75,&quot;href&quot;:&quot;https://comfypace.com/uploads/wIymGQ01vAPlKoBLtLlpoffVYjIEKuxGW8K7L0dN.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/wIymGQ01vAPlKoBLtLlpoffVYjIEKuxGW8K7L0dN.png&quot;,&quot;width&quot;:243}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/wIymGQ01vAPlKoBLtLlpoffVYjIEKuxGW8K7L0dN.png\"><img src=\"https://comfypace.com/uploads/wIymGQ01vAPlKoBLtLlpoffVYjIEKuxGW8K7L0dN.png\" width=\"243\" height=\"75\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">20.33 KB</span></figcaption></a></figure>For answer D, it is impossible for us to get the requested card sequence.</p>'),
(175, 173, 90, 1, '<p>Enam anak sedang bermain di halaman.</p><p>Salah satu dari mereka melempar bola dan memecahkan kaca jendela rumah Pak<br>Beaverdam.<br>Saat Pak Beaverdam memeriksa jendela tersebut, ia sempat melihat punggung dari<br>anak pelaku pelemparan tersebut sedang berlari. Ia hanya ingat si anak<br>menggunakan atasan merah dan berambut pendek.</p><p>Siapa si pelaku pelemparan itu?<br>Pilih salah satu dari empat anak berikut : John, Tom, Jane atau Dan ?</p><p><br></p><p>-------------------------------------------------</p><p><br></p><p>Six children were playing in the yard.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:195024,&quot;height&quot;:321,&quot;href&quot;:&quot;https://comfypace.com/uploads/iSrIPJkHjdGxXJvSUYa0IUUQvqlAEz1MadCiRcip.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/iSrIPJkHjdGxXJvSUYa0IUUQvqlAEz1MadCiRcip.png&quot;,&quot;width&quot;:742}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/iSrIPJkHjdGxXJvSUYa0IUUQvqlAEz1MadCiRcip.png\"><img src=\"https://comfypace.com/uploads/iSrIPJkHjdGxXJvSUYa0IUUQvqlAEz1MadCiRcip.png\" width=\"742\" height=\"321\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">190.45 KB</span></figcaption></a></figure>One of them threw a ball and broke the window of Pak\'s house<br>Beaver Dam.When Mr. Beaverdam checked the window, he saw the back of a man<br>The child who threw it was running. He only remembered the child<br>wearing a red top and short hair.</p><p>Who was the perpetrator of the throwing?<br>Choose one of the following four children: John, Tom, Jane or Dan?</p>', 5, '2023-10-30 04:41:27', '2023-10-30 04:41:27', '<p>Hanya 3 dari anak-anak tersebut memakai atasan merah: Jane, John dan Dane. Tetapi<br>Jane mempunyai rambut pirang dan rambut Dan warnanya ungu. Jadi, si pelempar<br>pastilah John.</p><p><br></p><p>------------------------------------------------</p><p><br></p><p>Only 3 of the children wear red tops: Jane, John and Dane. But<br>Jane has blonde hair and Dan\'s hair is purple. So, the thrower<br>definitely John.</p>'),
(176, 174, 91, 1, '<p>Sejumlah karung diletakkan di koridor, di dekat suatu lift (elevator). Koridor sangat<br>sempit sehingga karung-karung harus dibariskan satu-satu.Karung-karung hendak dikirimkan ke toko di lantai dasar dengan menggunakan lift tersebut. Sekali angkut, Lift hanya dapat mengangkut karung-karung dengan total berat tidak kurang dari 80 kg dan tidak lebih dari 100 kg. Setelah terkirim maka lift akan kembali ke lantai tersebut. Saat memuatkan karung-karung ke dalam lift, karung yang terdekat dengan lift yang akan diambil terlebih dulu. Seandainya penambahan suatu karung dapat menyebabkan overload (terlalu berat, karena total beratnya lebih dari 100 kg), karung itu untuk sementara tidak dimasukkan ke dalam lift tapi ditaruh di koridor pada arah berlawanan dari semula sejauh-jauhnya (jika tidak overload tentu akan dimasukkan ke dalam lift!). Bila karung-karung dari barisan awal telah diambil, hal yang sama kemudian dilakukan pada barisan karung yang terbentuk pada koridor arah berlawanan dengan semula hingga seluruh karung di situ berhasil dikirim ke toko atau dipindah ke ujung koridor berlawanan dengannya. Hal itu terus-menerus dilakukan sampai semua karung berhasil dikirim ke toko.</p><p>Pertanyaan<br>Sampai semua karung dikirimkan ke toko dengan prosedur tersebut di atas, Berapa<br>kali lift turun-naik mengangkut karung-karung itu semula karung-karung ada seperti pada gambar di atas dengan berat masing-masing seperti yang tercantum pada setiap karung?</p><p><br></p><p>-----------------------------------------------------------</p><p><br></p><p>A number of sacks were placed in the corridor, near an elevator. Very corridor<br>It\'s narrow so the sacks have to be lined up one by one.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:76812,&quot;height&quot;:187,&quot;href&quot;:&quot;https://comfypace.com/uploads/6VNY4bdCPtiKdt4yjih7cuSdqoN1aVNt2EtuuK8b.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/6VNY4bdCPtiKdt4yjih7cuSdqoN1aVNt2EtuuK8b.png&quot;,&quot;width&quot;:669}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/6VNY4bdCPtiKdt4yjih7cuSdqoN1aVNt2EtuuK8b.png\"><img src=\"https://comfypace.com/uploads/6VNY4bdCPtiKdt4yjih7cuSdqoN1aVNt2EtuuK8b.png\" width=\"669\" height=\"187\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">75.01 KB</span></figcaption></a></figure></p><p>The sacks will be sent to the shop on the ground floor using the lift. Once transported, the elevator can only transport sacks with a total weight of no less than 80 kg and no more than 100 kg. Once sent, the elevator will return to that floor. When loading sacks into the lift, the sack closest to the lift will be taken first. If the addition of a sack can cause an overload (too heavy, because the total weight is more than 100 kg), the sack is temporarily not put into the lift but is placed in the corridor in the opposite direction from the original as far as possible (if it is not overloaded it will of course be put in elevator!). When the sacks from the initial row have been taken, the same thing is then done to the row of sacks formed in the corridor in the opposite direction until all the sacks there have been successfully sent to the shop or moved to the opposite end of the corridor. This continues until all the sacks have been sent to the shop.<br><br>Question<br>Until all the sacks are sent to the shop using the procedure above, how many times will the elevator go up and down to transport the sacks? Originally the sacks were as in the picture above with their respective weights as stated on each sack?</p>', 5, '2023-10-30 04:53:40', '2023-10-30 04:53:40', '<p>Pada pemuatan pertama, 3 karung dengan berat 40+20+34=94 kg. Pada pemuatan<br>kedua, karung berikutnya (55 kg) dimasukkan ke dalam lift. Karung berikutnya (50 kg) akan mengakibatkan overload, sehingga ditaruh pada ujung yang berlawanan. Karung berikutnya (23 kg) ditaruh kembali dalam lift, namun lift tak dapat pergi hanya dengan total berat 55+23= 78 kg. Karung berikutnya adalah 45 kg, yang akan<br>membuat beban lift terlalu berat, maka karung itu dibawa ke ujung yang berlawanan. Hal yang sama terjadi untuk karung berikutnya (30 kg). Akhirnya, karung berikutnya (10 kg) dapat ditaruh dalam lift, dan berangkat dengan 55+23+10=88 kg. Ketiga karung terakhir (25+30+15 = 70kg) ditaruh dalam lift. Demikian seterusnya pemuatan karung-karung ke dalam lift dilakukan hingga semua karung terkirim.</p><p><br></p><p>----------------------------------------</p><p><br></p><p>In the first loading, 3 sacks weighing 40+20+34=94 kg. On loading<br>secondly, the next sack (55 kg) is put into the lift. The next sack (50 kg) will cause overload, so it is placed at the opposite end. The next sack (23 kg) is put back in the lift, but the lift cannot go only with a total weight of 55+23= 78 kg. The next sack was 45 kg, which would have made the lift load too heavy, so it was carried to the opposite end. The same thing happens for the next sack (30 kg). Finally, the next sack (10 kg) can be placed in the lift, and leave with 55+23+10=88 kg. The last three sacks (25+30+15 = 70kg) are placed in the lift. And so on, loading the sacks into the elevator is carried out until all the sacks have been sent.</p><p><br></p>');
INSERT INTO `exercise_questions` (`id`, `order_number`, `exercise_id`, `exercise_type_id`, `question`, `score`, `created_at`, `updated_at`, `explanation`) VALUES
(177, 175, 91, 1, '<p>Berang-berang yang bernama Emil sedang mencoba permainan baru di<br>komputernya. Mula-mula ia harus menyusun sejumlah kelereng di dalam suatu<br>tabung. Sekurangnya harus ada tiga kelereng di dalamnya dan kelereng-kelereng itu berwarna merah atau biru.</p><p>Dengan menekan tombol GO, dua kelereng terbawah jatuh dan kemudian akan ada<br>beberapa kelereng lain yang masuk dari atas. Kelereng-kelereng apa yang akan<br>masuk adalah berdasarkan warna dari kelereng-kelereng yang jatuh. Satu dari dua<br>kemungkinan di bawah ini akan terjadi:</p><p>Selama sekurangnya ada tiga kelereng dalam tabung, Emil masih dapat meng-klik<br>tombol GO lagi. Permainan hanya akan berhenti jika tersisa kurang dari tiga kelereng dalam tabung.</p><p>Misalnya, jika Emil awalnya mengatur kelereng dalam tabung sebagai pada gambar di samping kanan ini, pada akhirnya hanya dua kelereng biru yang tersisa, sehingga<br>permainan berhenti.</p><p>Pertanyaan<br>Emil akan memulai permainan dengan memasukkan tiga kelereng. Tolong usulkan<br>warna-warna apa untuk kelereng-kelereng itu sehingga Emil dapat bermain terus<br>menerus tanpa henti? Warna merah dituliskan dengan huruf M dan warna biru<br>dengan huruf B. Keduanya huruf besar. Urutan kelereng dari atas ke bawah dituliskan dari kiri ke kanan sebagai huruf-huruf (tanpa terpisahkan apapun seperti<br>spasi/koma/dll).</p><p><br></p><p>------------------------------------------------------------</p><p><br></p><p>An otter named Emil is trying out a new game at<br>his computer. First he has to arrange a number of marbles in a circle tube. There must be at least three marbles in it and they must be red or blue.<br><br></p><p>If the bottom one is colored<br>red, one new colored marble blue will enter the tube.<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:36713,&quot;height&quot;:256,&quot;href&quot;:&quot;https://comfypace.com/uploads/McgUflc6WSKfZTQdjgOYGIKx3qLWKSAcSjjD5RNn.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/McgUflc6WSKfZTQdjgOYGIKx3qLWKSAcSjjD5RNn.png&quot;,&quot;width&quot;:269}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/McgUflc6WSKfZTQdjgOYGIKx3qLWKSAcSjjD5RNn.png\"><img src=\"https://comfypace.com/uploads/McgUflc6WSKfZTQdjgOYGIKx3qLWKSAcSjjD5RNn.png\" width=\"269\" height=\"256\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">35.85 KB</span></figcaption></a></figure><br>If the bottom marble is colored<br>blue, three new marbles will go into in tubes in order: one red, one blue, and one red.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:36841,&quot;height&quot;:241,&quot;href&quot;:&quot;https://comfypace.com/uploads/85UahjuJhpgWE96N6y4visFpWIiI6btR0ELjKCxK.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/85UahjuJhpgWE96N6y4visFpWIiI6btR0ELjKCxK.png&quot;,&quot;width&quot;:241}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/85UahjuJhpgWE96N6y4visFpWIiI6btR0ELjKCxK.png\"><img src=\"https://comfypace.com/uploads/85UahjuJhpgWE96N6y4visFpWIiI6btR0ELjKCxK.png\" width=\"241\" height=\"241\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">35.98 KB</span></figcaption></a></figure></p><p>By pressing the GO button, the bottom two marbles fall and then there will be<br>several other marbles coming in from above. What marbles will<br>Entry is based on the color of the marbles that fall. One of two<br>the following possibilities will occur:<br><br>As long as there are at least three marbles in the tube, Emil can still click<br>GO button again. The game will only stop if there are less than three marbles left in the tube.<br><br>For example, if Emil initially arranges the marbles in the tube as in the image on the right, in the end only two blue marbles remain, so<br>the game stops.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:38084,&quot;height&quot;:302,&quot;href&quot;:&quot;https://comfypace.com/uploads/OLYXXhjqoYjuqfA5US4Ki82yD3ssTSfsL6k9J7wW.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/OLYXXhjqoYjuqfA5US4Ki82yD3ssTSfsL6k9J7wW.png&quot;,&quot;width&quot;:272}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/OLYXXhjqoYjuqfA5US4Ki82yD3ssTSfsL6k9J7wW.png\"><img src=\"https://comfypace.com/uploads/OLYXXhjqoYjuqfA5US4Ki82yD3ssTSfsL6k9J7wW.png\" width=\"272\" height=\"302\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">37.19 KB</span></figcaption></a></figure><br><br>Question<br>Emil will start the game by putting in three marbles. Please suggest what colors for the marbles so Emil can continue playing continuously without stopping? The color red is written with the letter M and the color blue with the letter B. Both are uppercase. The order of marbles from top to bottom is written from left to right as letters (without any separation like space/comma/etc).</p>', 5, '2023-10-30 05:03:28', '2023-10-30 05:03:28', '<p>Permainan tak akan berakhir jika Emil mulai dengan 3 kelereng dan ada satu kelereng<br>biru pada posisi paling bawah.<br>Harap dicatat, saat stack awal terdiri dari 3 kelereng dan yang paling bawah adalah<br>merah, satu klik akan mengakhiri permainan. Tetapi jika mulai dengan sebuah stack<br>yang terdiri dari 3 kelereng dan yang paling bawah adalah biru, setelah paling tidak 5 klik silinder akan berisi RBRRBR (lihat gambar di bawah). Sebenarnya, dengan<br>menuliskan warna kelereng dari yang paling atas ke paling bawah, kita akan<br>mendapatkan:<br><br>BBB  RBRB  RBRRB  RBRRBR;<br>BRB  RBRB  RBRRB  RBRRBR;<br>RBB  RBRR  BRB  RBRB  RBRRB  RBRRBR;<br>RRB  RBRR  BRB  RBRB  RBRRB  RBRRBR.<br><br>Maka, permainan akan menjadi 4 siklus (sebab setelah 4 klik, akan didapat<br>konfigurasi yang sama yaitu RBRRBR akan berulang):<br>RBRRBR  BRBRR  BBRB  RBRBB  RBRRBR.</p><p><br></p><p>---------------------------------------------</p><p><br></p><p>The game will not end if Emil starts with 3 marbles and is left with one marble<br>blue in the lowest position.<br>Please note, the initial stack consists of 3 marbles and the bottom one is<br>red, one click will end the game. But if you start with a stack<br>which consists of 3 marbles and the bottom one is blue, after at least 5 clicks the cylinder will contain RBRRBR (see image below). Actually, with<br>write the color of the marbles from top to bottom, we will<br>get:<br><br>BBB  RBRB  RBRRB  RBRRBR;<br>BRB  RBRB  RBRRB  RBRRBR;<br>RBB  RBRR  BRB  RBRB  RBRRB  RBRRBR;<br>RRB  RBRR  BRB  RBRB  RBRRB  RBRRBR.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:313031,&quot;height&quot;:457,&quot;href&quot;:&quot;https://comfypace.com/uploads/pKcsZ3RQoAXEYfXWN5KVwfJRQmWzPtvS8D7CPorI.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/pKcsZ3RQoAXEYfXWN5KVwfJRQmWzPtvS8D7CPorI.png&quot;,&quot;width&quot;:650}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/pKcsZ3RQoAXEYfXWN5KVwfJRQmWzPtvS8D7CPorI.png\"><img src=\"https://comfypace.com/uploads/pKcsZ3RQoAXEYfXWN5KVwfJRQmWzPtvS8D7CPorI.png\" width=\"650\" height=\"457\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">305.69 KB</span></figcaption></a></figure><br>So, the game will be 4 cycles (because after 4 clicks, you will get<br>the same configuration i.e. RBRRBR will repeat):<br>RBRRBR  BRBRR  BBRB  RBRBB  RBRRBR.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:44519,&quot;height&quot;:353,&quot;href&quot;:&quot;https://comfypace.com/uploads/yYwr6oxTIlzaI5B60ePu1bYgZuOJiwWFNcka3jnY.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/yYwr6oxTIlzaI5B60ePu1bYgZuOJiwWFNcka3jnY.png&quot;,&quot;width&quot;:261}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/yYwr6oxTIlzaI5B60ePu1bYgZuOJiwWFNcka3jnY.png\"><img src=\"https://comfypace.com/uploads/yYwr6oxTIlzaI5B60ePu1bYgZuOJiwWFNcka3jnY.png\" width=\"261\" height=\"353\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">43.48 KB</span></figcaption></a></figure></p>'),
(178, 176, 92, 1, '<p>Kantor Pos Bebras memiliki kode-kode pos yang berisi 36 karakter alfanumeris<br>(\'A\'..\'Z\' dan \'0\'..\'9\'). Agar kode-kode pos dapat dibaca oleh mesin pembaca, mereka<br>mengubah kode-kode pos itu menjadi kode-kode Kix.</p><p>Setiap karakter dikodekan ke dalam 2 bagian pengkodean: bagian atas dan bagian<br>bawah.<br>Masing-masing bagian terdiri atas 4 garis vertikal. Kedua bagian digabungkan<br>sedemikian rupa dengan menyusun bagian atas bertumpukan separuhnya pada<br>bagian bawah sebagai berikut. Setiap garis di bagian atas bertumpukan separuhnya<br>dengan separuh garis di bagian bawah seperti pada gambar berikut ini: bagian atas<br>mengambil bagian tengah (middle) dan atas (top) dari setiap garis, sementara bagian<br>bawah megambil bagian tengah (middle) dan bagian bawah (bottom).<br>Misalnya kode Kix untuk G7Y0 adalah</p><p>Jika Kode Kix -nya adalah sebagai berikut, berapa kode hurufnya?</p><p><br></p><p>-------------------------------------------------</p><p><br></p><p>Bebras Post Office has postal codes containing 36 alphanumeric characters<br>(\'A\'..\'Z\' and \'0\'..\'9\'). So that postal codes can be read by machine readers, they<br>change those zip codes to Kix codes.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:45728,&quot;height&quot;:310,&quot;href&quot;:&quot;https://comfypace.com/uploads/Yos3dIitT6zvQ6IMXqyjcHmJxudlyIJ15EJdTwP5.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Yos3dIitT6zvQ6IMXqyjcHmJxudlyIJ15EJdTwP5.png&quot;,&quot;width&quot;:321}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Yos3dIitT6zvQ6IMXqyjcHmJxudlyIJ15EJdTwP5.png\"><img src=\"https://comfypace.com/uploads/Yos3dIitT6zvQ6IMXqyjcHmJxudlyIJ15EJdTwP5.png\" width=\"321\" height=\"310\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">44.66 KB</span></figcaption></a></figure><br><br>Each character is encoded into 2 coding parts: top and bottom<br>lower.<br>Each part consists of 4 vertical lines. Both parts are combined<br>in such a way as to arrange the top part with half of it on top<br>bottom as follows. Each line at the top overlaps half<br>with half a line at the bottom as in the following image: top<br>take the middle (middle) and top (top) of each line, while part<br>The bottom takes the middle and bottom.<br>For example, the Kix code for G7Y0 is<br><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:29318,&quot;height&quot;:105,&quot;href&quot;:&quot;https://comfypace.com/uploads/L6m5yyIOAChDda4rKslDRV5JNGyDIpTgcZVvEvAf.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/L6m5yyIOAChDda4rKslDRV5JNGyDIpTgcZVvEvAf.png&quot;,&quot;width&quot;:250}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/L6m5yyIOAChDda4rKslDRV5JNGyDIpTgcZVvEvAf.png\"><img src=\"https://comfypace.com/uploads/L6m5yyIOAChDda4rKslDRV5JNGyDIpTgcZVvEvAf.png\" width=\"250\" height=\"105\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">28.63 KB</span></figcaption></a></figure><br>If the Kix code is as follows, what is the letter code?<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:26702,&quot;height&quot;:93,&quot;href&quot;:&quot;https://comfypace.com/uploads/fn5CXgNY7PlMwbHK4Mpc3G2530GqldpYCgIUqL96.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/fn5CXgNY7PlMwbHK4Mpc3G2530GqldpYCgIUqL96.png&quot;,&quot;width&quot;:248}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/fn5CXgNY7PlMwbHK4Mpc3G2530GqldpYCgIUqL96.png\"><img src=\"https://comfypace.com/uploads/fn5CXgNY7PlMwbHK4Mpc3G2530GqldpYCgIUqL96.png\" width=\"248\" height=\"93\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">26.08 KB</span></figcaption></a></figure></p>', 5, '2023-10-30 05:07:46', '2023-10-30 05:07:46', '<p>Jawaban dapat diperoleh dengan mengamati tabel dan mengkonversi kode Kix<br>menjadi huruf yang terkait. Karakter yang dipakai dalam Kode Kix diberi tanda pada<br>tabel berikut:</p><p><br></p><p>------------------------------------------------</p><p><br></p><p>The answer can be obtained by observing the table and converting the Kix code<br>be the corresponding letters. The characters used in the Kix Code are marked on<br>following table:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:77432,&quot;height&quot;:364,&quot;href&quot;:&quot;https://comfypace.com/uploads/HDEAgdP9RAX9sLZ7SXTCr93q4rhqUfVE5pD0ze2s.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/HDEAgdP9RAX9sLZ7SXTCr93q4rhqUfVE5pD0ze2s.png&quot;,&quot;width&quot;:379}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/HDEAgdP9RAX9sLZ7SXTCr93q4rhqUfVE5pD0ze2s.png\"><img src=\"https://comfypace.com/uploads/HDEAgdP9RAX9sLZ7SXTCr93q4rhqUfVE5pD0ze2s.png\" width=\"379\" height=\"364\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">75.62 KB</span></figcaption></a></figure></p>'),
(179, 177, 92, 1, '<p>Dua mesin pemindai (scanner) mengkodekan citra digital (gambar digital) melalui<br>pengubahan harga-harga piksel citra (baris per baris dari kiri ke kanan), ke kode-kode<br>tertentu. Pengkodeannya adalah dengan menuliskannya sebagai bilangan-bilangan<br>yang masing-masing menyatakan banyaknya piksel dalam suatu deretan yang<br>berwarna sama. Hanya ada dua harga: putih dan hitam. Bilangan bilangan<br>pengkodean menyatakan deretan-deretan piksel yang dimulai dari deretan pertama<br>di pojok kiri atas ke arah kanannya, kemudian bilangan berikutnya untuk deretan dari<br>warna lainnya, secara bergantian.hingga pojok kanan bawah.<br>Kedua mesin menggunakan cara berbeda untuk menangani ujung baris:<br> Scanner-A memproses piksel baris-demi baris hingga ujung baris, dan memulai<br>lagi untuk setiap baris berikutnya sebagai deretan yang berbeda (walaupun<br>warna sama).<br> Scanner-B memproses piksel demi piksel dan, saat di ujung baris, meneruskan ke<br>baris berikutnya sebagai satu deretan (tanpa memulai lagi) ketika warna<br>berlanjut sama.<br>Misalnya, citra di sebelah kanan akan dikodekan sebagai berikut:<br><br> Scanner A: 3,1,1,1,2,4 (3 putih, 1 hitam, 1 hitam, 1 putih, 2 hitam, 4 hitam)<br> Scanner B: 3,2,1,6. (3 putih, 2 hitam, 1 putih, 6 hitam)<br><br>Pertanyaan<br>Citra manakah dari berikut ini yang akan menghasilkan pengkodean yang persis sama<br>oleh kedua mesin pemindai tersebut?<br>Pilih salah satu:</p><p><br></p><p>-----------------------------------------------------</p><p><br></p><p>Two scanning machines (scanners) encode digital images (digital images) through<br>changing image pixel values (line by line from left to right), into codes<br>certain. The coding is to write them as numbers each of which states the number of pixels in a row<br>the same color. There are only two prices: white and black. Numerical numbers coding represents rows of pixels starting from the first row in the top left corner to the right, then the next number for the series of other colors, alternately. to the bottom right corner. The two machines use different ways to handle line endings:<br> Scanner-A processes pixels row-by-row until the end of the row, and starts<br>again for each subsequent row as a different row (although same color).<br> Scanner-B processes pixel by pixel and, when at the end of the line, forwards to<br>next row as a row (without starting over) when color<br>continues the same.<br>For example, the image on the right would be encoded as follows:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:8792,&quot;height&quot;:121,&quot;href&quot;:&quot;https://comfypace.com/uploads/3hmMgOQ8q3Tc2gksHuwKGg9jJQRqZmAwWbqNRODe.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/3hmMgOQ8q3Tc2gksHuwKGg9jJQRqZmAwWbqNRODe.png&quot;,&quot;width&quot;:169}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/3hmMgOQ8q3Tc2gksHuwKGg9jJQRqZmAwWbqNRODe.png\"><img src=\"https://comfypace.com/uploads/3hmMgOQ8q3Tc2gksHuwKGg9jJQRqZmAwWbqNRODe.png\" width=\"169\" height=\"121\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">8.59 KB</span></figcaption></a></figure><br> Scanner A: 3,1,1,1,2,4 (3 white, 1 black, 1 black, 1 white, 2 black, 4 black)<br> Scanner B: 3,2,1,6. (3 white, 2 black, 1 white, 6 black)<br><br>Question<br>Which of the following images will produce exactly the same encoding<br>by both scanning machines?<br>Select one:</p>', 5, '2023-10-30 05:14:50', '2023-10-30 05:14:50', '<p>Perbedaan kedua metoda adalah apakah piksel terakhir dari sebuah baris dan piksel<br>pertama dari baris berikutnya adalah kombinasi atau bukan. Pemindai A tidak<br>mengkombinasikan, sedangkan B mengkombinasikan hanya jika piksel berwarna<br>sama.<br>Jika piksel itu tak sama warnanya, kode dari kedua pemindai akan sama. Maka, kita<br>harus menemukan sebuah citra di mana piksel terakhir dari sebuah baris berbeda<br>dengan piksel pertama dari baris berikutnya , untuk seluruh baris:<br><br>Kita hanya perlu membandingkan 4 baris terakhir yang membentuk piksel dan 4 baris<br>pertama piksel untuk tahu dengan pasti bahwa piksel-piksel tersebut warnanya<br>berlawanan.</p><p><br></p><p>----------------------------------------------------</p><p><br></p><p>The difference between the two methods is whether the last pixel of a row is the pixel<br>first of the next row is a combination or not. Scanner A does not<br>combines, while B combines only if the pixels are colored the same.<br>If the pixels are not the same color, the codes from both scanners will be the same. So, we<br>must find an image where the last pixel of a row is different<br>with the first pixel of the next row, for the entire row:<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:42743,&quot;height&quot;:128,&quot;href&quot;:&quot;https://comfypace.com/uploads/JXqii6FJ7mQmRmrC7tly5RVj5SrtvrTvrrYApJOb.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/JXqii6FJ7mQmRmrC7tly5RVj5SrtvrTvrrYApJOb.png&quot;,&quot;width&quot;:600}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/JXqii6FJ7mQmRmrC7tly5RVj5SrtvrTvrrYApJOb.png\"><img src=\"https://comfypace.com/uploads/JXqii6FJ7mQmRmrC7tly5RVj5SrtvrTvrrYApJOb.png\" width=\"600\" height=\"128\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">41.74 KB</span></figcaption></a></figure><br><br>We only need to compare the last 4 rows that make up the pixel and the 4 rows<br>first the pixels to know for sure that the pixels are the color<br>opposite.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:31943,&quot;height&quot;:141,&quot;href&quot;:&quot;https://comfypace.com/uploads/zhIDQVGb7ZAj56ly7SyX7XqlZCvXt4IvN7QCIeNv.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/zhIDQVGb7ZAj56ly7SyX7XqlZCvXt4IvN7QCIeNv.png&quot;,&quot;width&quot;:600}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/zhIDQVGb7ZAj56ly7SyX7XqlZCvXt4IvN7QCIeNv.png\"><img src=\"https://comfypace.com/uploads/zhIDQVGb7ZAj56ly7SyX7XqlZCvXt4IvN7QCIeNv.png\" width=\"600\" height=\"141\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">31.19 KB</span></figcaption></a></figure></p>'),
(180, 178, 93, 1, '<p>Berlian berwarna biru yang terkenal telah dicuri dari museum hari ini. Si pencuri<br>berhasil menukar berlian tersebut dengan perhiasan imitasi murah berwarna hijau.<br><br>Pada acara pameran berlian hari ini dihadiri oleh 2000 orang pengunjung. Para<br>pengunjung tersebut memasuki ruangan pameran satu per satu. Inspektur Bebro<br>harus dapat menangkap si pencuri dengan menginterogasi beberapa orang dari<br>pengunjung tersebut. Inspektur Bebro telah memiliki daftar nama dari 2000 orang<br>pengunjung yang memasuki ruang pameran hari ini. Inspektur Bebro akan menanyai<br>setiap orang dengan dengan pertanyaan yang sama :<br>Apakah warna berlian tersebut hijau atau biru pada saat anda melihatnya ?<br>Setiap pengunjung akan menjawab dengan jujur; kecuali si pencuri, yang akan<br>menjawab warna berlian tersebut adalah hijau.<br>Inspektur Bebro sangat pintar dan akan menggunakan strategi dimana jumlah orang<br>yang akan ditanyai akan seminimal mungkin. Manakah dari pernyataan berikut yang<br>dapat disampaikan Inspektur Bebro tanpa berbohong ?<br>Pilih salah satu:<br> Tugas ini adalah tugas yang sulit; Saya perlu menanyai sekurang-kurangnya 200<br>orang, tetapi kemungkinan terbanyaknya adalah 1999 orang.<br> Saya tidak dapat menjanjikan apapun. Jika saya tidak beruntung, maka saya akan<br>menanyai setiap pengunjung.<br> Tidak cukup dengan hanya menanyai 20 orang (kecuali saya sedang beruntung)<br>tetapi saya yakin dapat menyelesaikan tugas saya dengan menanyai kurang dari<br>200 orang.<br> Saya dapat menjamin bahwa saya dapat menemukan si pencuri dengan cukup<br>menanyai kurang dari 20 orang.</p><p><br></p><p>-----------------------------------------------</p><p><br></p><p>The famous blue diamond was stolen from a museum today. The thief<br>managed to exchange the diamond for cheap green imitation jewelry.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:57372,&quot;height&quot;:151,&quot;href&quot;:&quot;https://comfypace.com/uploads/8oQnE5luqjqY3yg9ciA6u6HMPdXPetutwD2hCi5b.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/8oQnE5luqjqY3yg9ciA6u6HMPdXPetutwD2hCi5b.png&quot;,&quot;width&quot;:495}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/8oQnE5luqjqY3yg9ciA6u6HMPdXPetutwD2hCi5b.png\"><img src=\"https://comfypace.com/uploads/8oQnE5luqjqY3yg9ciA6u6HMPdXPetutwD2hCi5b.png\" width=\"495\" height=\"151\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">56.03 KB</span></figcaption></a></figure><br><br>Today\'s diamond exhibition was attended by 2000 visitors. Para<br>The visitors entered the exhibition room one by one. Inspector Bebro<br>must be able to catch the thief by interrogating several people from<br>the visitor. Inspector Bebro has a list of names of 2000 people<br>visitors entering the exhibition hall today. Inspector Bebro will question you<br>everyone with the same question:<br>Was the diamond green or blue when you looked at it?<br>Every visitor will answer honestly; except the thief, who will<br>answered that the color of the diamond is green.<br>Inspector Bebro is very smart and will use strategies where there are many people<br>who will be asked will be as minimal as possible. Which of the following statements is<br>Can Inspector Bebro convey this without lying?<br>Select one:<br> This task is a difficult task; I need to ask at least 200<br>people, but the largest number is probably 1999 people.<br> I can\'t promise anything. If I\'m unlucky, then I will be<br>ask every visitor.<br> It\'s not enough to just ask 20 people (unless I\'m lucky)<br>but I am sure I can complete my task by asking less than<br>200 people.<br> I can guarantee that I can find the thief fairly well<br>asked less than 20 people.</p>', 5, '2023-10-30 05:19:31', '2023-10-30 05:19:31', '<p>Sangat mencengangkan bahwa Inspektur Bebro hanya perlu menginterogasi sebagian<br>kecil pengunjung, dengan mengulangi setengah dari daftar dengan cara ini :<br>Pengunjung diberi nomor 1 s.d 2000 terurut dengan saat memasuki ruangan.<br>Inspektur menginterogasi pengunjung nomor 1000 dan menanyakan warna berlian<br>yang dilihatnya<br> jika dia menjawab biru, maka si pencuri datang setelah pengunjung nomor 1000<br>dan nomornya adalah antara nomor 1001 sampai 2000;<br> jika dia menjawab hijau, maka si pencuri bernomor antara 1 sampai 1000 (catat<br>juga bahwa si pencuri mungkin bernomor 1000).<br>Pada kedua kasus, jumlah pengunjung yang mungkin sebagai si pencuri, berkurang<br>dari 2000 menjadi 1000 (setengahnya).<br>Berikutnya, sang Inspektur menanyakan ke orang dengan nomor \"tengah\" sisanya<br>(yaitu nomor 1500 pada kasus pertama, atau nomor 500 pada kasus kedua). Dengan<br>demikian, Inspektur membagi dua jumlah pengunjung (menjadi setengahnya) setiap<br>kali satu pengunjung diinterogasi.<br>Mengulangi cara yang sama, ia dapat mengurangi jumlah yang dicurigai menjadi 500,<br>250, 125, 63,32, 16, 8, 4 dan kemudian 2. Saat tinggal 2 tersangka, ia akan<br>menanyakan kepada yang pertama. Jika ia menjawab hijau, ia adalah si pencuri; jika<br>tidak maka yang lainnya adalah pencuri. Inspektur Bebro dapat menemukan sang<br>pencuri hanya dengan menginterogasi 11 orang.</p><p><br></p><p>-------------------------------------------------------</p><p><br></p><p>It is astonishing that Inspector Bebro only had to interrogate part of it<br>small number of visitors, by iterating over half of the list this way :<br>Visitors are given numbers 1 to 2000 in order of when they enter the room.<br>Inspector interrogates visitor number 1000 and asks about the color of the diamond<br>what he saw<br> If he answers blue, then the thief comes after visitor number 1000<br>and the number is between number 1001 to 2000;<br> If he answers green, then the thief has a number between 1 and 1000 (note<br>also that the thief may be number 1000).<br>In both cases, the number of visitors who could be thieves is reduced<br>from 2000 to 1000 (half).<br>Next, the Inspector asks the person with the remaining \"middle\" number<br>(i.e. number 1500 in the first case, or number 500 in the second case). With<br>Thus, the Inspector halves the number of visitors (in half) each<br>one time a visitor was questioned.<br>Repeating the same method, he can reduce the number of suspects to 500,<br>250, 125, 63.32, 16, 8, 4 and then 2. When there are only 2 suspects left, he will<br>ask the first one. If he answers green, he is the thief; If<br>no then the others are thieves. Inspector Bebro was able to find the<br>thieves only by interrogating 11 people.</p>'),
(181, 179, 93, 1, '<p>Dokter berang-berang ingin mendirikan tiga rumah sakit untuk merawat pasien<br>berang-berang.<br><br>Dokter mempunyai syarat bahwa rumah sakit tersebut harus berada di tempat yang<br>sedemikian sehingga berang-berang cukup berenang melalui maksimal satu saluran<br>air (kanal) saja untuk dapat menjangkau rumah sakit dari tempat di manapun dia<br>berada.<br><br>Tentukan tiga lokasi yang cocok untuk dipilih sebagai tempat didirikannya rumah<br>sakit sesuai dengan persyaratan di atas. Jawaban ditulis secara terurut abjad dengan<br>karakter huruf besar (urut dari A sampai Z) tanpa dipisahkan spasi. Misalnya jawaban<br><br>yang benar adalah ADE, maka tidak boleh dituliskan sebagai DAE atau AED. Jawaban<br>manapun yang benar akan diperbolehkan.</p><p><br></p><p>----------------------------------------------------------------</p><p><br></p><p>Doctor Beaver wants to establish three hospitals to treat patients<br>Beaver.<br><br>Doctors have a condition that the hospital must be in a certain place<br>such that the beaver can simply swim through a maximum of one channel just water (canal) to be able to reach the hospital from wherever he is at.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:136617,&quot;height&quot;:194,&quot;href&quot;:&quot;https://comfypace.com/uploads/kBOwEoIGbjYtgvWN11soEwmzsB4gS06Ek2TYDWaH.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/kBOwEoIGbjYtgvWN11soEwmzsB4gS06Ek2TYDWaH.png&quot;,&quot;width&quot;:528}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/kBOwEoIGbjYtgvWN11soEwmzsB4gS06Ek2TYDWaH.png\"><img src=\"https://comfypace.com/uploads/kBOwEoIGbjYtgvWN11soEwmzsB4gS06Ek2TYDWaH.png\" width=\"528\" height=\"194\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">133.42 KB</span></figcaption></a></figure><br>Determine three suitable locations to choose as a place to build a house<br>sick in accordance with the above requirements. Answers are written in alphabetical order with<br>uppercase characters (in order from A to Z) without spaces separated. For example answers<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:34294,&quot;height&quot;:276,&quot;href&quot;:&quot;https://comfypace.com/uploads/Kqn0R9ETS7q53FwCREbxUxZKff4M6F9B63LyccEq.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/Kqn0R9ETS7q53FwCREbxUxZKff4M6F9B63LyccEq.png&quot;,&quot;width&quot;:334}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/Kqn0R9ETS7q53FwCREbxUxZKff4M6F9B63LyccEq.png\"><img src=\"https://comfypace.com/uploads/Kqn0R9ETS7q53FwCREbxUxZKff4M6F9B63LyccEq.png\" width=\"334\" height=\"276\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">33.49 KB</span></figcaption></a></figure><br>the correct one is ADE, so it should not be written as DAE or AED. Answer<br>Whichever is correct will be allowed.</p>', 5, '2023-10-30 05:23:03', '2023-10-30 05:23:03', '<p>Ada banyak solusi benar; salah satu di antaranya adalah EHK, yaitu menggunakan E,<br>H dan K:<br> dari lokasi D, E dan I , berang-berang dapat berenang ke E.<br> dari lokasi B, C, F, G dan H, berang-berang dapat berenang ke H.<br> dari lokasi A, C, G dan K, berang-berang dapat berenang ke K.<br>Solusi lainnya: A E H, C G I, C H I, C I K, D F K.<br><br>Solusi dapat diketemukan dengan menempatkan sebuah lokasi secara random,<br>menandai semua lokasi yang dapat dicapai dalam satu langkah.<br>Kemudian Anda melakukan untuk lokasi berikutnya. Setelah 3 lokasi diipilih, ada dua<br>kemungkinan: apakah itu sebuah solusi, atau ada satu atau lebih lokasi yang tak<br>ditandai. Jika bukan solusi, kita dapat menghapus lokasi terakhir dan menggantinya<br>dengan sebuah lokasi lain, kemudian memeriksa ulang. Jika kita masih tak dapat<br>menemukan solusi dengan 3 lokasi, kita dapat kembali dan menempatkan lokasi<br>terakhir ke tempat lain. Dengan melakukan hal ini secara sistematis, kita dapat<br>menemukan semua solusi.</p><p><br></p><p>----------------------------------------------------------------------</p><p><br></p><p>There are many correct solutions; one of them is EHK, which uses E,<br>H and K:<br> from locations D, E and I, the beaver can swim to E.<br> from locations B, C, F, G and H, the beaver can swim to H.<br> from locations A, C, G and K, the beaver can swim to K.<br>Other solutions: A E H, C G I, C H I, C I K, D F K.<br><br>Solutions can be found by placing a location randomly,<br>marking all locations that can be reached in one step.<br>Then you move on to the next location. After 3 locations were selected, there were two<br>possibilities: is it a solution, or is there one or more locations where it is not<br>be marked. If it is not a solution, we can delete the last location and replace it<br>with another location, then double check. If we still can\'t<br>found a solution with 3 locations, we can go back and place the locations<br>finally to another place. By doing this systematically, we can<br>found all the solutions.</p>'),
(182, 180, 94, 1, '<p>Apa nama ibu kota Indonesia?</p>', 10, '2023-11-02 05:33:42', '2023-11-02 05:33:42', '<p>Ibu kota Indonesia adalah DKI Jakarta</p>');
