(15, 'Computational Thinking - Advanced C', 'level-images/6mYeCZtPdup4a19cqebKsQBh0d2Dbs-metaU2NyZWVuc2hvdCAyMDIzLTEwLTEyIGF0IDE1LjIzLjQ1LnBuZw==-.png', '<p>Pada <strong>level Advanced-C ini terdiri atas 3 modul</strong> yang berisi banyak sekali unit yang menampilkan teka-teki yang harus kamu pecahkan jawabannya. Nah coba selesaikan setiap teka-teki yang ada dengan usaha mandiri ya. Kamu mendapatkan satu kali kesempatan untuk mengerjakan setiap soal.</p><p>Modul dan unit di dalam modul pada <strong>awalnya akan ditutup aksesnya</strong>. Setelah kamu <strong>menyelesaikan</strong> sebuah unit, maka unit atau modul berikutnya akan <strong>otomatis terbuka </strong>aksesnya. Jadi kamu bisa fokus belajar langkah demi langkah.</p><p><strong>Tips untuk hasil yang efektif:</strong> kerjakan latihan CT ini <strong>SETIAP HARI</strong>, tapi cukup kerjakan<strong> 1-2 unit saja</strong> setiap hari. Pastikan kamu benar-benar memahami setiap teka-teki yang kamu kerjakan.</p><p>Salam CT dan selamat mengerjakan !</p><p>&nbsp;</p><p>-----------</p><p>&nbsp;</p><p>The <strong>Advanced-C level consists of</strong> <strong>3 modules</strong> which contain lots of units that display puzzles that you have to solve. So, try to solve every existing puzzle with your own efforts. You get one chance to do each question.<br><br>Modules and units within modules<strong> are initially inaccessible</strong>. Once you complete a unit, access to the next unit or module will automatically open. So you can focus on learning step by step.<br><br><strong>Tips for effective results:</strong> do this CT exercise <strong>EVERY DAY</strong>, but <strong>only do 1-2 units</strong> every day. Make sure you really understand each puzzle you work on.<br><br>Have fun and good luck !</p>', 1, 12, '2023-10-15 03:39:38', '2023-10-15 03:39:38'),
