(18, 'Webdev 2023-1', 'level-images/f2jwDsZgSYfDBMgd7a7YdbagHm34k9-metaR3JlZW4gYW5kIEJsdWUgSWxsdXN0cmF0aXZlIFRlY2hub2xvZ3kgU2FsZXMgUHJlc2VudGF0aW9uICgxKS5qcGc=-.jpg', '<h2>RPS<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image (1).png&quot;,&quot;filesize&quot;:171340,&quot;height&quot;:443,&quot;href&quot;:&quot;https://comfypace.com/uploads/cLcov5JBC8hToF7nL7LHjBFzsDrjwJtuXmkZjOEb.png&quot;,&quot;url&quot;:&quot;https://comfypace.com/uploads/cLcov5JBC8hToF7nL7LHjBFzsDrjwJtuXmkZjOEb.png&quot;,&quot;width&quot;:831}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://comfypace.com/uploads/cLcov5JBC8hToF7nL7LHjBFzsDrjwJtuXmkZjOEb.png\"><img src=\"https://comfypace.com/uploads/cLcov5JBC8hToF7nL7LHjBFzsDrjwJtuXmkZjOEb.png\" width=\"831\" height=\"443\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image (1).png</span> <span class=\"attachment__size\">167.32 KB</span></figcaption></a></figure><strong>Class Rules</strong></h2><p><strong>Attendance</strong></p><ul><li>Make sure to attend every scheduled meeting</li><li>Students are required to <strong>dress neatly/appropriately </strong>during class meetings</li><li>If you are not present, you must be responsible for <strong>studying the material</strong> that has been submitted. The material will not be repeated.</li><li>If you are not present, you still have to <strong>submit assignments </strong>with the applicable deadlines to get <strong>grades</strong></li><li>If you do not attend class, you will remain <strong>not present</strong>, regardless of assignment collection or prior notification, unless there is a doctor\'s letter</li><li>Terms to join <strong>UAS </strong>is mandatory <strong>attend 75% </strong>of the total number of meetings</li></ul><p><strong>MATERIALS AND TASKS</strong></p><ul><li><strong>Learning materials </strong>learning will be provided through the platform eLearn</li><li>Relevant information <strong>assignments </strong>will be provided in eLearn and explained during class meetings</li><li><strong>Collection assignments </strong>is done through eLearn, both group and individual assignments</li></ul><p><strong>Pre-CLASS ACTIVITY</strong></p><ul><li>Pre-class activity materials will be given<strong> before class </strong>starts</li><li>Students <strong>must do</strong> Pre-Class Activity before the class schedule starts. Activities can include watching videos, reading articles, taking quizzes, or making reports. Therefore, it is recommended to do a minimal pre-class activity the day before class starts.</li><li>Each Pre-Class Activity has an assignment that must be <strong>collected </strong>before deadline</li></ul>', 2, 14, '2023-11-02 07:09:15', '2023-11-02 07:09:15'),
(19, 'CT - Combined', 'level-images/lKWgCTw71vgEGRObvyMvkg7vezmKCq-metaV2hhdHNBcHAgSW1hZ2UgMjAyMy0xMC0wNiBhdCAxMS4zOC4yNC5qcGVn-.jpg', '<p>CT Center All Level Combined</p>', 1, 15, '2023-11-02 23:39:54', '2023-11-02 23:39:54'),
(22, 'Techno Code', 'level-images/01JZ0916WCKGV07X32NBVTFS68.webp', '<p>TC-0</p>', 1, 17, '2025-06-30 11:19:51', '2025-06-30 11:19:51'),
(23, '[HP] Fun Coding Camp', 'level-images/01JZ2K3AFFZGC0V7D4FVP9EPV7.png', '<p>HP-FCC-23</p>', 1, 18, '2025-07-01 08:54:15', '2025-07-01 08:54:44'),
(24, '[EC] Digital Technology Literacy 01', 'level-images/01JZ2P58D6B3XRDZBVHEVTJGC3.jpg', '<p>EC-DTL-01</p>', 1, 19, '2025-07-01 09:47:44', '2025-07-01 09:47:44'),
(40, 'Basic Animation', 'level-images/01K03A7D8ZXX000H4P08SPZPFK.jpg', '<p>-</p>', 1, 20, '2025-07-14 01:54:08', '2025-07-14 01:54:08'),
(41, 'Basic Game Coding - Scratch | IND', 'level-images/01K0NE53HH3QG6KGTR9PMHPM5H.png', '<p>Belajar dasar pemrograman sambil membuat game seru dengan Scratch. Kamu akan mengenal logika coding, elemen game (karakter, skor, tantangan), dan melatih kreativitas serta problem solving sejak dini.</p>', 1, 21, '2025-07-21 02:49:07', '2025-07-21 03:18:42'),
(42, 'Basic Animation - Scratch | IND', 'level-images/01K0NF04MNFAWZV2S8RWV0VKM1.png', '<p>Di kelas ini, kamu akan belajar membuat animasi seru dengan Scratch. Kamu akan mengenal cara menggerakkan karakter, mengganti kostum, mengatur panggung, dan menceritakan kisah lewat animasi buatanmu sendiri.</p>', 1, 22, '2025-07-21 03:03:53', '2025-07-21 03:23:17');
