(2, 'Unit 1', '<p>Kemampuan apa saja yang akan dipelajari di Computational Thinking ?</p><p>Nah berikut adalah 4 hal yang akan kamu pelajari pada Computational Thinking:</p><ol><li><strong>Decomposition</strong>: Memecah data, proses, atau masalah menjadi bagian-bagian kecil untuk mempermudah analisis.</li><li><strong>Pattern Recognition</strong>: Menentukan pola, tren, persamaan, and perbedaan dari banyak data.</li><li><strong>Abstraction</strong>: Mengidentifikasi kesimpulan, prinsip umum atau rumus yang menghasilkan pola.</li><li><strong>Algorithm Design</strong>: Mengembangkan panduan langkah demi langkah untuk memecahkan permasalahan.</li></ol><p>-------------------------------------------------------------------------------------------------------</p><p><strong>English Version</strong></p><p>What skills are going to be learned in Computational Thinking?</p><p>Here are the four things you will learn in Computational Thinking:</p><ol><li><strong>Decomposition</strong>: Breaking down data, processes, or problems into smaller parts to facilitate analysis.</li><li><strong>Pattern</strong> <strong>Recognition</strong>: Identifying patterns, trends, similarities, and differences in large sets of data.</li><li><strong>Abstraction</strong>: Identifying conclusions, general principles, or formulas that yield patterns.</li><li><strong>Algorithm</strong> <strong>Design</strong>: Developing step-by-step guidelines to solve problems.</li></ol>', '#', 0, 2, 2, '2023-10-10 07:58:07', '2023-10-13 14:21:37'),
