(855, 'Challenge 1', '<p>Make the starting screen like in the game preview. There is some skin that you can choose and define the price. Have at least 5 skins and (left and right for each).</p>', '#', 300, 855, 102, '2025-07-01 10:37:18', '2025-07-01 10:37:18'),
(856, 'Challenge 2', '<p>In the starting screen player can also choose backdrop. How to make:\r\n1. Make a button to choose a stage in the starting screen\r\n2. When the button is clicked, display all the backgrounds that the player can choose (not only brick)\r\n3. When the player chooses a background, the game will be using it.\r\n4. Add a back button to go back to the starting screen.</p>', '#', 300, 856, 102, '2025-07-01 10:37:18', '2025-07-01 10:37:18'),
(857, 'Challenge 3', '<p>Make a particle appear when the player is jumping on a platform</p>', '#', 300, 857, 102, '2025-07-01 10:37:18', '2025-07-01 10:37:18'),
(858, 'Challenge 4', '<p>Add enemies that is going left and right to make the game harder and the player can shoot the enemy.</p>', '#', 300, 858, 102, '2025-07-01 10:37:18', '2025-07-01 10:37:18'),
